INSERT INTO `gx_video` VALUES (7627, 4, '梦想的声音第二季', '', '', '#FF0000', '', '', '<p>《梦想的声音第二季》是浙江卫视推出的一档大型励志音乐竞技真人秀，由华少主持，采用4+X导师阵容，由林俊杰、林忆莲、羽泉、张靓颖担任四大常驻导师。 节目除了四大常驻导师，每期还会邀请一位神秘的导师助阵，4+X的模式不仅让音乐盛宴升级，也给素人歌手有更多的选择。 节目于2017年10月27日起每周五晚21:10在浙江卫视播出。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fl1eganwhij20j60i9q4s.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]梦想的声音20181109.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6490/[阳光电影-www.ygdy8.com]梦想的声音20181116.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]梦想的声音20181109.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6490/[阳光电影-www.ygdy8.com]梦想的声音20181116.mkv', 'admin', '', 'M', 10.0, 1, 0);
