INSERT INTO `gx_video` VALUES (7630, 4, '口红王子', '', '', '#FF0000', '', '', '<p>《口红王子》是由腾讯视频、腾讯时尚联合出品的中国首档"偶像剧式"美妆综艺秀。由何炅带领MIKE、费启鸣、秦奋、戴景耀担任主持。 该节目打破传统美妆节目的固定模式，推出全新的"沉浸式体验"概念。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fuzs1200g8j207i07i75h.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6482/[阳光电影-www.ygdy8.com]口红王子20181106.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6482/[阳光电影-www.ygdy8.com]口红王子20181106.mp4', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7631, 4, '拜托冰箱', '', '', '#FF0000', '', '', '<p>《拜托冰箱》是韩国JTBC电视台的一档新艺能节目。由嘉宾带着家里的冰箱一起到节目现场，利用冰箱里的原材料来制作美食。以往的美食节目都是用平时很难采购到的食材进行烹饪，而该节目将用最常见的食材做出美食。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fu12p056udj20qo06yq4j.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6480/[阳光电影-www.ygdy8.com]拜托了冰箱20181105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]拜托了冰箱20181112.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6494/[阳光电影-www.ygdy8.com]拜托了冰箱20181119.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6480/[阳光电影-www.ygdy8.com]拜托了冰箱20181105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]拜托了冰箱20181112.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6494/[阳光电影-www.ygdy8.com]拜托了冰箱20181119.mkv', 'admin', '', 'B', 10.0, 1, 0);
