INSERT INTO `gx_video` VALUES (7633, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6479/[阳光电影-www.ygdy8.com]综艺大集合20181104.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]综艺大集合20181111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]综艺大集合20181118.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6479/[阳光电影-www.ygdy8.com]综艺大集合20181104.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]综艺大集合20181111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]综艺大集合20181118.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7634, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6478/[阳光电影-www.ygdy8.com]两天一夜20181104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]两天一夜20181111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]两天一夜20181118.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6478/[阳光电影-www.ygdy8.com]两天一夜20181104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]两天一夜20181111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]两天一夜20181118.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7635, 4, '我家的熊孩子', '', '', '#FF0000', '', '', '<p>《我家的熊孩子》是一档韩国脱口秀节目。节目主要关注家长与孩子之间的问题。你对孩子了解多少？今天孩子和谁见面了，又发生了什么样的故事？孩子今天怎么满面愁容，又为什么食欲突然增加？通过这个节目家长对这些问题会有更深的思考。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1ftzupnmfy5j20pk0df0xo.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6478/[阳光电影-www.ygdy8.com]我家的熊孩子20181104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]我家的熊孩子20181111.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6493/[阳光电影-www.ygdy8.com]我家的熊孩子20181118.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6478/[阳光电影-www.ygdy8.com]我家的熊孩子20181104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]我家的熊孩子20181111.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6493/[阳光电影-www.ygdy8.com]我家的熊孩子20181118.mkv', 'admin', '', 'W', 10.0, 1, 0);
