INSERT INTO `gx_video` VALUES (7640, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6478/[阳光电影-www.ygdy8.com]天天向上20181104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]天天向上20181111.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]天天向上20181118.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6478/[阳光电影-www.ygdy8.com]天天向上20181104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]天天向上20181111.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]天天向上20181118.mkv', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7641, 4, '我就是演员', '', '', '#FF0000', '', '', '<p>《我就是演员》是一方综艺人和影视人充分碰撞火花的舞台。专业性影视人士除了提供点评和指导，还在幕后为表演剧本的创作付诸心力。表演环节在继续致敬经典作品的同时，格外增大了原创比重，尤其是现实主义题材的数量。<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fv4e3v20xsj207i0603za.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6478/[阳光电影-www.ygdy8.com]我就是演员20181103.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6491/[阳光电影-www.ygdy8.com]我就是演员20181117.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6478/[阳光电影-www.ygdy8.com]我就是演员20181103.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6491/[阳光电影-www.ygdy8.com]我就是演员20181117.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7642, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6478/[阳光电影-www.ygdy8.com]非诚勿扰20181103.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]非诚勿扰20181110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6491/[阳光电影-www.ygdy8.com]非诚勿扰20181117.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6478/[阳光电影-www.ygdy8.com]非诚勿扰20181103.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]非诚勿扰20181110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6491/[阳光电影-www.ygdy8.com]非诚勿扰20181117.mkv', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7643, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]快乐大本营20181103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6491/[阳光电影-www.ygdy8.com]快乐大本营20181117.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]快乐大本营20181103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6491/[阳光电影-www.ygdy8.com]快乐大本营20181117.mp4', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7644, 4, '认识的哥哥', '', '', '#FF0000', '', '', '<p>《认识的哥哥》节目是根据主题不同，以存在于人生中，虽不是很重大，却会让人好奇不已，不得到答案就浑身不自在的问题为主题，通过各种方式为其寻求解答的综艺节目。<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fdljka0l66j20rs09x14w.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]认识的哥哥20181103.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]认识的哥哥20181110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6491/[阳光电影-www.ygdy8.com]认识的哥哥20181117.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]认识的哥哥20181103.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]认识的哥哥20181110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6491/[阳光电影-www.ygdy8.com]认识的哥哥20181117.mkv', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7645, 4, '综艺3国智', '', '', '#FF0000', '', '', '<p>《综艺3国智》，官方英文名3 Kingdoms，是台湾电视公司监制及首播的实境外景节目，主持人为李李仁、纳豆、王少伟、黄路梓茵、明杰、风田、Evan、Teddy、 张立东、玛丽，台视主频于2016年11月12日首播。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fh5wyh40i8j20p00eqtau.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]综艺3国智20181103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]综艺3国智20181110.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]综艺3国智20181103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]综艺3国智20181110.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7646, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]综艺玩很大20181103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]综艺玩很大20181110.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]综艺玩很大20181117.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]综艺玩很大20181103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]综艺玩很大20181110.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]综艺玩很大20181117.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7647, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]天才冲冲冲20181103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]天才冲冲冲20181110.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]天才冲冲冲20181117.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]天才冲冲冲20181103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]天才冲冲冲20181110.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]天才冲冲冲20181117.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7648, 4, '明星大侦探', '', '', '#FF0000', '', '', '<p>《明星大侦探》第四季全线升级！推理剧情无限烧脑，节目录制全程爆笑，互动玩法深入首创！新老玩家再度聚集。10月26日起每周五中午12点，真相即将大白！<img alt="" src="http://ww1.sinaimg.cn/mw690/444476dfgw1fbpxayvqeej208c0ciq4r.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]明星大侦探20181102-1.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]明星大侦探20181102-2.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6483/[阳光电影-www.ygdy8.com]明星大侦探20181109-上.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6483/[阳光电影-www.ygdy8.com]明星大侦探20181109-下.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6490/[阳光电影-www.ygdy8.com]明星大侦探20181116-1.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6490/[阳光电影-www.ygdy8.com]明星大侦探20181116-2.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]明星大侦探20181102-1.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]明星大侦探20181102-2.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6483/[阳光电影-www.ygdy8.com]明星大侦探20181109-上.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6483/[阳光电影-www.ygdy8.com]明星大侦探20181109-下.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6490/[阳光电影-www.ygdy8.com]明星大侦探20181116-1.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6490/[阳光电影-www.ygdy8.com]明星大侦探20181116-2.mp4', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7649, 4, '野生厨房', '', '', '#FF0000', '', '', '<p>《野生厨房》是由湖南快乐阳光互动娱乐传媒有限公司、原子娱乐传媒有限公司联合出品并制作的一档美食探寻节目。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fwwah67palj21kw11xx01.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]野生厨房20181103.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]野生厨房20181103.mp4', 'admin', '', 'Y', 10.0, 1, 0);
