INSERT INTO `gx_video` VALUES (7651, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>“我用声音追着光”。由特仑苏有机奶冠名的首档原创励志声乐竞演节目《声入人心》即将于11月2日，本周五晚20：00燃情上映，登录湖南卫视每周五晚黄金档播出。作为湖南卫视四季度的“秘密武器”，《声入人心》用年轻时尚的演唱方式，颠覆大众对高雅音乐的固有印象，引领观众感知声乐艺术独特的魅力。<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fwwaaxk0twj20dw07uaaa.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]声入人心-先导篇.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]声入人心20181109.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6491/[阳光电影-www.ygdy8.com]声入人心20181116.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]声入人心-先导篇.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]声入人心20181109.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6491/[阳光电影-www.ygdy8.com]声入人心20181116.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7652, 4, '人生酒馆', '', '', '#FF0000', '', '', '<p>《人生酒馆》是韩国有线电视台tvN的一档明星访谈综艺节目，节目每期会邀请一位明星嘉宾，邀请到节目预备的一间实体酒馆餐厅内与主持人一同饮酒畅谈，明星们将会在节目中坦承自己的内心，让观众看到一个真实的、与屏幕前不一样的明星。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1ftzumqusdej20xc0dlgnq.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6476/[阳光电影-www.ygdy8.com]人生酒馆20181101.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6482/[阳光电影-www.ygdy8.com]人生酒馆20181108.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6490/[阳光电影-www.ygdy8.com]人生酒馆20181115.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6476/[阳光电影-www.ygdy8.com]人生酒馆20181101.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6482/[阳光电影-www.ygdy8.com]人生酒馆20181108.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6490/[阳光电影-www.ygdy8.com]人生酒馆20181115.mkv', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7653, 4, '我独自生活', '', '', '#FF0000', '', '', '<p>《我独自生活》是由MBC电视台新年播放的特辑《男人的独居时代》改名进行播出的，由大雁爸爸李成宰，金泰元和因为妻子是运动选手而不得不分开居住的韩尚进，还有单身的金光奎，Defconn和徐仁国等向观众公开独自在家生活的面貌。特别是和形象不符的干净利落的Defconn的家和脏乱的徐仁国的家成为强烈对比，还 有公开大雁爸爸的日常的李成宰和金泰沅等的故事希望能得到观众的共感。<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fu1jq997iqj20he082wn3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6476/[阳光电影-www.ygdy8.com]我独自生活20181102.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6483/[阳光电影-www.ygdy8.com]我独自生活20181109.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6490/[阳光电影-www.ygdy8.com]我独自生活20181116.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6476/[阳光电影-www.ygdy8.com]我独自生活20181102.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6483/[阳光电影-www.ygdy8.com]我独自生活20181109.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6490/[阳光电影-www.ygdy8.com]我独自生活20181116.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7654, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>《亲爱的·客栈第二季》是湖南卫视推出的经营体验类观察真人秀节目《亲爱的·客栈》的续集，由刘涛、王珂、王鹤棣、武艺、马思超担任固定经营者。 <img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fkbwphja6gj20u00gvmye.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6476/[阳光电影-www.ygdy8.com]亲爱的客栈20181102.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]亲爱的客栈20181109.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6491/[阳光电影-www.ygdy8.com]亲爱的客栈20181116.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6476/[阳光电影-www.ygdy8.com]亲爱的客栈20181102.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6486/[阳光电影-www.ygdy8.com]亲爱的客栈20181109.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6491/[阳光电影-www.ygdy8.com]亲爱的客栈20181116.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7655, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>《火星情报局》是一档科普喜剧类节目，前三季一直致力于以综艺手法检验全民新奇发现。这一季，我们用火星的视角来看待地球，把人类看成一个命运共同体。地球有太多无法解决的烦恼，我们要做地球人的哆啦A梦。本季节目跳出火星4的既定思维，从科幻和科学的维度去解读社会的洞察，为地球人的普通烦恼提供非地球的解决方案，治疗地球人的小确丧，增加生活的幸福感。\n<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fw7ofhq6kaj20rs076752.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6476/[阳光电影-www.ygdy8.com]火星情报局20181102.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6482/[阳光电影-www.ygdy8.com]火星情报局20181109.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6476/[阳光电影-www.ygdy8.com]火星情报局20181102.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6482/[阳光电影-www.ygdy8.com]火星情报局20181109.mp4', 'admin', '', 'Z', 10.0, 1, 0);
