INSERT INTO `gx_video` VALUES (7658, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6475/[阳光电影-www.ygdy8.com]娱乐百分百20181101.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6476/[阳光电影-www.ygdy8.com]娱乐百分百20181102.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6477/[阳光电影-www.ygdy8.com]娱乐百分百20181103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6479/[阳光电影-www.ygdy8.com]娱乐百分百20181105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6480/[阳光电影-www.ygdy8.com]娱乐百分百20181106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6481/[阳光电影-www.ygdy8.com]娱乐百分百20181107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6482/[阳光电影-www.ygdy8.com]娱乐百分百20181108.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6483/[阳光电影-www.ygdy8.com]娱乐百分百20181109.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]娱乐百分百20181110.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6485/[阳光电影-www.ygdy8.com]娱乐百分百20181112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6487/[阳光电影-www.ygdy8.com]娱乐百分百20181113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6487/[阳光电影-www.ygdy8.com]娱乐百分百20181114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6488/[阳光电影-www.ygdy8.com]娱乐百分百20181115.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]娱乐百分百20181116.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]娱乐百分百20181117.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6493/[阳光电影-www.ygdy8.com]娱乐百分百20181119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6494/[阳光电影-www.ygdy8.com]娱乐百分百20181120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6495/[阳光电影-www.ygdy8.com]娱乐百分百20181121.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6475/[阳光电影-www.ygdy8.com]娱乐百分百20181101.mp4 \nft