INSERT INTO `gx_video` VALUES (7659, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>女人我最大----献给让自己美丽的女人们\u3000●原本是台湾一个女性类的电视娱乐节目，讨论各种女性感兴趣的话题——从头到脚，从里到外，从身体到心灵。本书根据中国大陆的流行趋势，对这个节目进行了深度挖掘和梳理，并有针对性地推荐了很多产品，是一本适合所有爱美女性的时尚读物。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bixok74zj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6475/[阳光电影-www.ygdy8.com]女人我最大20181101.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6479/[阳光电影-www.ygdy8.com]女人我最大20181105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6480/[阳光电影-www.ygdy8.com]女人我最大20181106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6481/[阳光电影-www.ygdy8.com]女人我最大20181107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6482/[阳光电影-www.ygdy8.com]女人我最大20181108.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]女人我最大20181109.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6485/[阳光电影-www.ygdy8.com]女人我最大20181112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6487/[阳光电影-www.ygdy8.com]女人我最大20181113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6487/[阳光电影-www.ygdy8.com]女人我最大20181114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6488/[阳光电影-www.ygdy8.com]女人我最大20181115.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6492/[阳光电影-www.ygdy8.com]女人我最大20181116.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6493/[阳光电影-www.ygdy8.com]女人我最大20181119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6494/[阳光电影-www.ygdy8.com]女人我最大20181120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6495/[阳光电影-www.ygdy8.com]女人我最大20181121.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6496/[阳光电影-www.ygdy8.com]女人我最大20181122.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6475/[阳光电影-www.ygdy8.com]女人我最大20181101.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6479/[阳光电影-www.ygdy8.com]女人我最大20181105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6480/[阳光电影-www.ygdy8.com]女人我最大20181106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6481/[阳光电影-www.ygdy8.com]女人我最大20181107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6482/[阳光电影-www.ygdy8.com]女人我最大20181108.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6484/[阳光电影-www.ygdy8.com]女人我最大2