INSERT INTO `gx_video` VALUES (7662, 4, 'Hi室友', '', '', '#FF0000', '', '', '<p>《Hi室友》是一档全新纪实观察类生活慢综艺，节目由7位合宿室友和1位房东构成，在一栋名为“Happy house”的房子中共同生活20天。24小时全方位实拍，节目全程无干预，无剧本，让室友们真实生活自然相处，让真实世界的活动在构建的情境中自然发生，编排感更少，更注重观察，看都市男女的相处之道，看空巢老人的陪伴与相处，看传统文化与潮流文化的融合，将现实生活中的正能量完整体现。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fwsifjb04kj207i0b9tb2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6474/[阳光电影-www.ygdy8.com]Hi室友20181003.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6474/[阳光电影-www.ygdy8.com]Hi室友20181010.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6474/[阳光电影-www.ygdy8.com]HI室友20181017.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6474/[阳光电影-www.ygdy8.com]HI室友20181031.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6474/[阳光电影-www.ygdy8.com]Hi室友20181003.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6474/[阳光电影-www.ygdy8.com]Hi室友20181010.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6474/[阳光电影-www.ygdy8.com]HI室友20181017.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6474/[阳光电影-www.ygdy8.com]HI室友20181031.mp4', 'admin', '', 'HI', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7663, 4, '拜托冰箱', '', '', '#FF0000', '', '', '<p>《拜托冰箱》是韩国JTBC电视台的一档新艺能节目。由嘉宾带着家里的冰箱一起到节目现场，利用冰箱里的原材料来制作美食。以往的美食节目都是用平时很难采购到的食材进行烹饪，而该节目将用最常见的食材做出美食。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fu12p056udj20qo06yq4j.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6472/[阳光电影-www.ygdy8.com]拜托了冰箱20181029.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6472/[阳光电影-www.ygdy8.com]拜托了冰箱20181029.mkv', 'admin', '', 'B', 10.0, 1, 0);
