INSERT INTO `gx_video` VALUES (7667, 4, '我家的熊孩子', '', '', '#FF0000', '', '', '<p>《我家的熊孩子》是一档韩国脱口秀节目。节目主要关注家长与孩子之间的问题。你对孩子了解多少？今天孩子和谁见面了，又发生了什么样的故事？孩子今天怎么满面愁容，又为什么食欲突然增加？通过这个节目家长对这些问题会有更深的思考。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1ftzupnmfy5j20pk0df0xo.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6455/[阳光电影-www.ygdy8.com]我家的熊孩子20181014.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6463/[阳光电影-www.ygdy8.com]我家的熊孩子20181021.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6469/[阳光电影-www.ygdy8.com]我家的熊孩子20181028.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6455/[阳光电影-www.ygdy8.com]我家的熊孩子20181014.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6463/[阳光电影-www.ygdy8.com]我家的熊孩子20181021.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6469/[阳光电影-www.ygdy8.com]我家的熊孩子20181028.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7668, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>《亲爱的·客栈第二季》是湖南卫视推出的经营体验类观察真人秀节目《亲爱的·客栈》的续集，由刘涛、王珂、王鹤棣、武艺、马思超担任固定经营者。 <img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fkbwphja6gj20u00gvmye.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]亲爱的客栈第二季20181012.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]亲爱的客栈第二季20181019.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6469/[阳光电影-www.ygdy8.com]亲爱的客栈第二季20181026.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]亲爱的客栈第二季20181012.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]亲爱的客栈第二季20181019.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6469/[阳光电影-www.ygdy8.com]亲爱的客栈第二季20181026.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7669, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>《火星情报局》是一档科普喜剧类节目，前三季一直致力于以综艺手法检验全民新奇发现。这一季，我们用火星的视角来看待地球，把人类看成一个命运共同体。地球有太多无法解决的烦恼，我们要做地球人的哆啦A梦。本季节目跳出火星4的既定思维，从科幻和科学的维度去解读社会的洞察，为地球人的普通烦恼提供非地球的解决方案，治疗地球人的小确丧，增加生活的幸福感。\n<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fw7ofhq6kaj20rs076752.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]火星情报局20181012.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]火星情报局20181026.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]火星情报局20181012.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]火星情报局20181026.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7670, 4, '口红王子', '', '', '#FF0000', '', '', '<p>《口红王子》是由腾讯视频、腾讯时尚联合出品的中国首档"偶像剧式"美妆综艺秀。由何炅带领MIKE、费启鸣、秦奋、戴景耀担任主持。 该节目打破传统美妆节目的固定模式，推出全新的"沉浸式体验"概念。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fuzs1200g8j207i07i75h.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6452/[阳光电影-www.ygdy8.com]口红王子20181009.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6457/[阳光电影-www.ygdy8.com]口红王子20181016.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6464/[阳光电影-www.ygdy8.com]口红王子20181023.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6472/[阳光电影-www.ygdy8.com]口红王子20181030.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6452/[阳光电影-www.ygdy8.com]口红王子20181009.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6457/[阳光电影-www.ygdy8.com]口红王子20181016.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6464/[阳光电影-www.ygdy8.com]口红王子20181023.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6472/[阳光电影-www.ygdy8.com]口红王子20181030.mp4', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7671, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6450/[阳光电影-www.ygdy8.com]两天一夜20181007.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6455/[阳光电影-www.ygdy8.com]两天一夜20181014.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6463/[阳光电影-www.ygdy8.com]两天一夜20181021.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6470/[阳光电影-www.ygdy8.com]两天一夜20181028.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6450/[阳光电影-www.ygdy8.com]两天一夜20181007.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6455/[阳光电影-www.ygdy8.com]两天一夜20181014.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6463/[阳光电影-www.ygdy8.com]两天一夜20181021.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6470/[阳光电影-www.ygdy8.com]两天一夜20181028.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7672, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6450/[阳光电影-www.ygdy8.com]天天向上20181007.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6455/[阳光电影-www.ygdy8.com]天天向上20181014.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6462/[阳光电影-www.ygdy8.com]天天向上20181021.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6470/[阳光电影-www.ygdy8.com]天天向上20181028.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6450/[阳光电影-www.ygdy8.com]天天向上20181007.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6455/[阳光电影-www.ygdy8.com]天天向上20181014.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6462/[阳光电影-www.ygdy8.com]天天向上20181021.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6470/[阳光电影-www.ygdy8.com]天天向上20181028.mkv', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7673, 4, '人气歌谣', '', '', '#FF0000', '', '', '<p>《人气歌谣》每周日播出，主要是一个歌手的新歌和新专集得以COME BACK回归的第一平台，因此参加演出的歌手以最近一段时间的人气歌曲为主。基本形式是每周选出TAKE7进行打榜，最终选出一名周冠军，其中也穿插很多明星的COME BACK舞台。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfgw1eacv7d4jhcj20cq09a74t.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6450/[阳光电影-www.ygdy8.com]人气歌谣20181007.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6456/[阳光电影-www.ygdy8.com]人气歌谣20181014.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6462/[阳光电影-www.ygdy8.com]人气歌谣20181021.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6470/[阳光电影-www.ygdy8.com]人气歌谣20181028.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6450/[阳光电影-www.ygdy8.com]人气歌谣20181007.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6456/[阳光电影-www.ygdy8.com]人气歌谣20181014.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6462/[阳光电影-www.ygdy8.com]人气歌谣20181021.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6470/[阳光电影-www.ygdy8.com]人气歌谣20181028.mp4', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7674, 4, '超人回来了', '', '', '#FF0000', '', '', '<p>《超人回来了》是KBS打造的一档亲子节目，节目讲述在没有爸爸或是妈妈陪同的情况下，大人与孩子在48小时内发生的有趣的事情。<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fdljlrbnvoj20cg0ioadf.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]超人回来了20181007.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6455/[阳光电影-www.ygdy8.com]超人回来了20181014.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6462/[阳光电影-www.ygdy8.com]超人回来了20181021.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6469/[阳光电影-www.ygdy8.com]超人回来了20181028.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]超人回来了20181007.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6455/[阳光电影-www.ygdy8.com]超人回来了20181014.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6462/[阳光电影-www.ygdy8.com]超人回来了20181021.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6469/[阳光电影-www.ygdy8.com]超人回来了20181028.mkv', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7675, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]RunningMan20181007.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6455/[阳光电影-www.ygdy8.com]RunningMan20181014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6462/[阳光电影-www.ygdy8.com]RunningMan20181021.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]RunningMan20181007.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6455/[阳光电影-www.ygdy8.com]RunningMan20181014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6462/[阳光电影-www.ygdy8.com]RunningMan20181021.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7676, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]综艺大集合20181007.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6455/[阳光电影-www.ygdy8.com]综艺大集合20181014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6463/[阳光电影-www.ygdy8.com]综艺大集合20181021.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6469/[阳光电影-www.ygdy8.com]综艺大集合20181028.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]综艺大集合20181007.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6455/[阳光电影-www.ygdy8.com]综艺大集合20181014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6463/[阳光电影-www.ygdy8.com]综艺大集合20181021.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6469/[阳光电影-www.ygdy8.com]综艺大集合20181028.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7677, 4, '认识的哥哥', '', '', '#FF0000', '', '', '<p>《认识的哥哥》节目是根据主题不同，以存在于人生中，虽不是很重大，却会让人好奇不已，不得到答案就浑身不自在的问题为主题，通过各种方式为其寻求解答的综艺节目。<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fdljka0l66j20rs09x14w.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]认识的哥哥20181006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]认识的哥哥20181013.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]认识的哥哥20181020.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]认识的哥哥20181027.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]认识的哥哥20181006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]认识的哥哥20181013.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]认识的哥哥20181020.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]认识的哥哥20181027.mkv', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7678, 4, '我就是演员', '', '', '#FF0000', '', '', '<p>《我就是演员》是一方综艺人和影视人充分碰撞火花的舞台。专业性影视人士除了提供点评和指导，还在幕后为表演剧本的创作付诸心力。表演环节在继续致敬经典作品的同时，格外增大了原创比重，尤其是现实主义题材的数量。<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fv4e3v20xsj207i0603za.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]我就是演员20181006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]我就是演员20181013.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]我就是演员20181020.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]我就是演员20181027.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]我就是演员20181006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]我就是演员20181013.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]我就是演员20181020.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]我就是演员20181027.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7679, 4, '相声有新人', '', '', '#FF0000', '', '', '<p>《相声有新人》2018年8月11日起每周六晚播出，是全国首档垂直相声竞演类节目，邀请郭德纲和张国立为“召唤师”，从全国各地寻找到的身怀绝技的相声演员中，用淘汰晋级的方式，评选出最有传承感和时代感的相声新星。力求用中国式幽默，表达传统艺人对当下生活的思考和感悟，让相声这门中国传统的幽默艺术，在传承中焕发出全新的活力。节目开发了多种创新赛制，比如一对一对战，即兴表演大逃杀等等，希望用最残酷的赛制激发选手的创作潜能，将选手之间的竞争矛盾最大化，带领观众跟随选手体验喜怒哀乐，给观众一场身临其境式的欢乐盛宴。《相声有新人》不仅追求内容方面的极致创新，在舞美方面也要求最大程度的更新更美。全球首个相声小镇诞生，融合最有海派建筑特色的石库门元素等，从视觉上给观众冲击力。百组相声高手们在相声小镇集合，华山论剑，最终十名高手突出重围进入剧场表演，象征着相声艺术缘起街头，梦回舞台的特色，给人深刻的记忆。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fu6qia8sb8j20ds07sglz.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]相声有新人20181006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]相声有新人20181013.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]相声有新人20101027.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]相声有新人20181006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]相声有新人20181013.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]相声有新人20101027.mkv', 'admin', '', 'X', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7680, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]非诚勿扰20181006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]非诚勿扰20181013.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]非诚勿扰20181020.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6469/[阳光电影-www.ygdy8.com]非诚勿扰20181027.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]非诚勿扰20181006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]非诚勿扰20181013.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]非诚勿扰20181020.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6469/[阳光电影-www.ygdy8.com]非诚勿扰20181027.mkv', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7681, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]快乐大本营20181006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]快乐大本营20181013.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]快乐大本营20181020.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]快乐大本营20181027.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6449/[阳光电影-www.ygdy8.com]快乐大本营20181006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]快乐大本营20181013.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]快乐大本营20181020.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]快乐大本营20181027.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7682, 4, '超级夜总会', '', '', '#FF0000', '', '', '<p>《超级夜总会》是三立电视台独立制作的一档综艺娱乐节目，以歌曲演唱、幽默情景剧、户外与观众近距离互动为主要元素，是台湾第一个电视台出动大型舞台车至各县市镇、乡、村的著名观光景点、夜市、庙宇录制的节目。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3hdcxn0doj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6448/[阳光电影-www.ygdy8.com]超级夜总会20181006.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]超级夜总会20181013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]超级夜总会20181020.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]超级夜总会20181027.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6448/[阳光电影-www.ygdy8.com]超级夜总会20181006.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]超级夜总会20181013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]超级夜总会20181020.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]超级夜总会20181027.mp4', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7683, 4, '综艺3国智', '', '', '#FF0000', '', '', '<p>《综艺3国智》，官方英文名3 Kingdoms，是台湾电视公司监制及首播的实境外景节目，主持人为李李仁、纳豆、王少伟、黄路梓茵、明杰、风田、Evan、Teddy、 张立东、玛丽，台视主频于2016年11月12日首播。<img alt="" src="" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6448/[阳光电影-www.ygdy8.com]综艺3国智20181006.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]综艺3国智20181013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]综艺3国智20181020.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]综艺3国智20181027.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6448/[阳光电影-www.ygdy8.com]综艺3国智20181006.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]综艺3国智20181013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]综艺3国智20181020.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]综艺3国智20181027.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7684, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6448/[阳光电影-www.ygdy8.com]综艺玩很大20181006.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]综艺玩很大20181013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]综艺玩很大20181020.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]综艺玩很大20181027.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6448/[阳光电影-www.ygdy8.com]综艺玩很大20181006.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]综艺玩很大20181013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]综艺玩很大20181020.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]综艺玩很大20181027.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7685, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6448/[阳光电影-www.ygdy8.com]天才冲冲冲20181006.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]天才冲冲冲20181013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]天才冲冲冲20181020.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]天才冲冲冲20181027.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6448/[阳光电影-www.ygdy8.com]天才冲冲冲20181006.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]天才冲冲冲20181013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]天才冲冲冲20181020.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]天才冲冲冲20181027.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7686, 4, '幻乐之城', '', '', '#FF0000', '', '', '<p>《幻乐之城》是湖南卫视和酷博特文化联合打造的全新原创综艺。 \u3000\u3000<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1ftqlac9gi1j207i0b90v0.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6447/[阳光电影-www.ygdy8.com]幻乐之城20181005.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]幻乐之城20181019.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6447/[阳光电影-www.ygdy8.com]幻乐之城20181005.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]幻乐之城20181019.mkv', 'admin', '', 'H', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7687, 4, '我独自生活', '', '', '#FF0000', '', '', '<p>《我独自生活》是由MBC电视台新年播放的特辑《男人的独居时代》改名进行播出的，由大雁爸爸李成宰，金泰元和因为妻子是运动选手而不得不分开居住的韩尚进，还有单身的金光奎，Defconn和徐仁国等向观众公开独自在家生活的面貌。特别是和形象不符的干净利落的Defconn的家和脏乱的徐仁国的家成为强烈对比，还 有公开大雁爸爸的日常的李成宰和金泰沅等的故事希望能得到观众的共感。<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fu1jq997iqj20he082wn3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6446/[阳光电影-www.ygdy8.com]我独自生活20181005.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]我独自生活20181012.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]我独自生活20181026.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6446/[阳光电影-www.ygdy8.com]我独自生活20181005.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]我独自生活20181012.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]我独自生活20181026.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7688, 4, '金炳万的丛林法则', '', '', '#FF0000', '', '', '<p>《金炳万的丛林法则》是一档户外真人秀冒险节目，由金秉万带领小伙伴们去到各种地方冒险，完全依靠自己的生存能力，显现出不同强度的生存挑战！<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fp1vdqr7qaj20pk0dfgq3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6446/[阳光电影-www.ygdy8.com]金炳万的丛林法则20181005.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]金炳万的丛林法则20181012.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]丛林法则20181019.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]金炳万的丛林法则20181026.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6446/[阳光电影-www.ygdy8.com]金炳万的丛林法则20181005.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]金炳万的丛林法则20181012.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]丛林法则20181019.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6468/[阳光电影-www.ygdy8.com]金炳万的丛林法则20181026.mkv', 'admin', '', 'J', 10.0, 1, 0);
