INSERT INTO `gx_video` VALUES (7693, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]娱乐百分百20181001.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6445/[阳光电影-www.ygdy8.com]娱乐百分百20181003.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6446/[阳光电影-www.ygdy8.com]娱乐百分百20181004.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6448/[阳光电影-www.ygdy8.com]娱乐百分百20181006.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6450/[阳光电影-www.ygdy8.com]娱乐百分百20181008.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6451/[阳光电影-www.ygdy8.com]娱乐百分百20181009.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6452/[阳光电影-www.ygdy8.com]娱乐百分百20181010.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6452/[阳光电影-www.ygdy8.com]娱乐百分百20181011.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]娱乐百分百20181012.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6454/[阳光电影-www.ygdy8.com]娱乐百分百20181013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6456/[阳光电影-www.ygdy8.com]娱乐百分百20181015.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6457/[阳光电影-www.ygdy8.com]娱乐百分百20181016.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6458/[阳光电影-www.ygdy8.com]娱乐百分百20181017.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6459/[阳光电影-www.ygdy8.com]娱乐百分百20181018.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6460/[阳光电影-www.ygdy8.com]娱乐百分百20181019.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6461/[阳光电影-www.ygdy8.com]娱乐百分百20181020.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6463/[阳光电影-www.ygdy8.com]娱乐百分百20181022.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6464/[阳光电影-www.ygdy8.com]娱乐百分百20181023.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6465/[阳光电影-www.ygdy8.com]娱乐百分百20181024.mp4\nftp://