INSERT INTO `gx_video` VALUES (7698, 4, '这！就是歌唱·对唱季', '', '', '#FF0000', '', '', '<p>《这！就是歌唱·对唱季》是一档大型音乐对唱剧情式真人秀，由岑俊义担任总导演、欣喜文化制作。节目由乐坛三位明星发起人鹿晗、罗志祥、李荣浩＋男女对唱搭档的阵容组成。90名颜艺俱佳且有个性的年轻男女选手在节目中组成音乐搭档，通过三个阶段的层层关卡突出重围，最终将有一对音乐搭档获得总冠军并获得顶级资源支持！节目使用“剧情式”制作手法，从“遇见心跳的TA”到“携手厮杀团魂激荡”再到“只为我与你而战”，突如其来意想不到的残酷赛制、音乐搭档间的分分合合、默契与情感火花将成为节目除选手音乐实力以外的突破和看点！这个夏天，我们一起对上心跳，唱出味道！<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1fvqc6b3y4tj207i0b9myk.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6441/[阳光电影-www.ygdy8.com]这就是歌唱20180928.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6441/[阳光电影-www.ygdy8.com]这就是歌唱20180928.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7699, 4, 'Hi室友', '', '', '#FF0000', '', '', '<p>《Hi室友》是由灵梦传媒出品的都市年轻人合宿生活观察类真人秀。<img alt="" src="https://wx3.sinaimg.cn/mw690/006LlD6Hgy1fvo1n76cboj30m80m8whb.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6440/[阳光电影-www.ygdy8.com]Hi室友01.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6440/[阳光电影-www.ygdy8.com]Hi室友01.mp4 ', 'admin', '', 'HI', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7700, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2018湖南卫视中秋之夜颠覆式创新，今年晚会打破了传统晚会的演播厅录制形态，首次走进长沙铜官窑古镇户外实景录制，致力于打造富有新意与诚意的创新型户外实景沉浸式中秋晚会，在中秋节的晚上为观众呈现出一台极具文化底蕴的视听盛宴。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1fvna4yp8lij20ds09kgm7.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6438/[阳光电影-www.ygdy8.com]2018湖南卫视中秋之夜.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6438/[阳光电影-www.ygdy8.com]2018湖南卫视中秋之夜.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7701, 4, '明日之子', '', '', '#FF0000', '', '', '<p>《明日之子》第二季是腾讯视频独播的一档原创高品质音乐类节目。 第二季节目以“带领 冲撞 正流行”为核心，选出最受年轻人喜爱的音乐新人。选手通过盛世美颜、盛世独秀、盛世魔音三大赛道进入比拼称为“九大厂牌”，最终选出能够带领正流行的“最强厂牌”。由李宇春、吴青峰、华晨宇任赛道星推官，何炅出任“现场总导演”，杨幂担任“厂牌星推官”。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1ftbq946jodj207i0b9gmy.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6423/[阳光电影-www.ygdy8.com]明日之子20180907.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]明日之子第二季20180914.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6423/[阳光电影-www.ygdy8.com]明日之子20180907.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]明日之子第二季20180914.mp4', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7702, 4, '鲁豫有约', '', '', '#FF0000', '', '', '<p>《鲁豫有约》为香港凤凰卫视的电视谈话性节目，凤凰卫视于1998年开播，后进入中国大陆电视，在各个地方电视台播出，2008年湖南卫视购买中国大陆区独播版权并与4月14日开始播出。2010年1月4日，《鲁豫有约》登陆安徽卫视，每周一到周五的晚间21：27分播出。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e6c74wy6s8j20fd08lwf1.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]鲁豫有约20180906.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6433/[阳光电影-www.ygdy8.com]鲁豫有约20180911.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6433/[阳光电影-www.ygdy8.com]鲁豫有约20180912.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6433/[阳光电影-www.ygdy8.com]鲁豫有约20180918.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6433/[阳光电影-www.ygdy8.com]鲁豫有约20180919.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6440/[阳光电影-www.ygdy8.com]鲁豫有约20180925.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6440/[阳光电影-www.ygdy8.com]鲁豫有约20180926.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]鲁豫有约20180906.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6433/[阳光电影-www.ygdy8.com]鲁豫有约20180911.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6433/[阳光电影-www.ygdy8.com]鲁豫有约20180912.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6433/[阳光电影-www.ygdy8.com]鲁豫有约20180918.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6433/[阳光电影-www.ygdy8.com]鲁豫有约20180919.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6440/[阳光电影-www.ygdy8.com]鲁豫有约20180925.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6440/[阳光电影-www.ygdy8.com]鲁豫有约20180926.mp4', 'admin', '', 'L', 10.0, 1, 0);
