INSERT INTO `gx_video` VALUES (7704, 4, '相声有新人', '', '', '#FF0000', '', '', '<p>《相声有新人》2018年8月11日起每周六晚播出，是全国首档垂直相声竞演类节目，邀请郭德纲和张国立为“召唤师”，从全国各地寻找到的身怀绝技的相声演员中，用淘汰晋级的方式，评选出最有传承感和时代感的相声新星。力求用中国式幽默，表达传统艺人对当下生活的思考和感悟，让相声这门中国传统的幽默艺术，在传承中焕发出全新的活力。节目开发了多种创新赛制，比如一对一对战，即兴表演大逃杀等等，希望用最残酷的赛制激发选手的创作潜能，将选手之间的竞争矛盾最大化，带领观众跟随选手体验喜怒哀乐，给观众一场身临其境式的欢乐盛宴。《相声有新人》不仅追求内容方面的极致创新，在舞美方面也要求最大程度的更新更美。全球首个相声小镇诞生，融合最有海派建筑特色的石库门元素等，从视觉上给观众冲击力。百组相声高手们在相声小镇集合，华山论剑，最终十名高手突出重围进入剧场表演，象征着相声艺术缘起街头，梦回舞台的特色，给人深刻的记忆。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fu6qia8sb8j20ds07sglz.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]相声有新人20180908.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]相声有新人20180915.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]相声有新人20180922.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6442/[阳光电影-www.ygdy8.com]相声有新人20180929.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]相声有新人20180908.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]相声有新人20180915.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]相声有新人20180922.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6442/[阳光电影-www.ygdy8.com]相声有新人20180929.mkv', 'admin', '', 'X', 10.0, 1, 0);
