INSERT INTO `gx_video` VALUES (7712, 4, '口红王子', '', '', '#FF0000', '', '', '<p>《口红王子》是由腾讯视频、腾讯时尚联合出品的中国首档"偶像剧式"美妆综艺秀。由何炅带领MIKE、费启鸣、秦奋、戴景耀担任主持。 该节目打破传统美妆节目的固定模式，推出全新的"沉浸式体验"概念。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fuzs1200g8j207i07i75h.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6418/[阳光电影-www.ygdy8.com]口红王子20180904先导片.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6418/[阳光电影-www.ygdy8.com]口红王子20180904.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6427/[阳光电影-www.ygdy8.com]口红王子20180911.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]口红王子20180918.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6441/[阳光电影-www.ygdy8.com]口红王子20180925.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6418/[阳光电影-www.ygdy8.com]口红王子20180904先导片.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6418/[阳光电影-www.ygdy8.com]口红王子20180904.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6427/[阳光电影-www.ygdy8.com]口红王子20180911.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]口红王子20180918.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6441/[阳光电影-www.ygdy8.com]口红王子20180925.mp4', 'admin', '', 'K', 10.0, 1, 0);
