INSERT INTO `gx_video` VALUES (7720, 4, '我家的熊孩子', '', '', '#FF0000', '', '', '<p>《我家的熊孩子》是一档韩国脱口秀节目。节目主要关注家长与孩子之间的问题。你对孩子了解多少？今天孩子和谁见面了，又发生了什么样的故事？孩子今天怎么满面愁容，又为什么食欲突然增加？通过这个节目家长对这些问题会有更深的思考。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1ftzupnmfy5j20pk0df0xo.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]我家的熊孩子20180902.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]我家的熊孩子20180909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6429/[阳光电影-www.ygdy8.com]我家的熊孩子20180916.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]我家的熊孩子20180923.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]我家的熊孩子20180930.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]我家的熊孩子20180902.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]我家的熊孩子20180909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6429/[阳光电影-www.ygdy8.com]我家的熊孩子20180916.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]我家的熊孩子20180923.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]我家的熊孩子20180930.mkv', 'admin', '', 'W', 10.0, 1, 0);
