INSERT INTO `gx_video` VALUES (7722, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]RunningMan20180902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]RunningMan20180909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6429/[阳光电影-www.ygdy8.com]RunningMan20180916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]RunningMan20180923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]RunningMan20180930.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]RunningMan20180902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]RunningMan20180909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6429/[阳光电影-www.ygdy8.com]RunningMan20180916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]RunningMan20180923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]RunningMan20180930.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7723, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]两天一夜20180902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]两天一夜20180909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6429/[阳光电影-www.ygdy8.com]两天一夜20180916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]两天一夜20180923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]两天一夜20180930.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]两天一夜20180902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]两天一夜20180909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6429/[阳光电影-www.ygdy8.com]两天一夜20180916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]两天一夜20180923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]两天一夜20180930.mp4', 'admin', '', 'Z', 10.0, 1, 0);
