INSERT INTO `gx_video` VALUES (7725, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]综艺大集合20180902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]综艺大集合20180909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6429/[阳光电影-www.ygdy8.com]综艺大集合20180916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]综艺大集合20180923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]综艺大集合20180930.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]综艺大集合20180902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]综艺大集合20180909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6429/[阳光电影-www.ygdy8.com]综艺大集合20180916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]综艺大集合20180923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]综艺大集合20180930.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7726, 4, '超级夜总会', '', '', '#FF0000', '', '', '<p>《超级夜总会》是三立电视台独立制作的一档综艺娱乐节目，以歌曲演唱、幽默情景剧、户外与观众近距离互动为主要元素，是台湾第一个电视台出动大型舞台车至各县市镇、乡、村的著名观光景点、夜市、庙宇录制的节目。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3hdcxn0doj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]超级夜总会20180901.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6421/[阳光电影-www.ygdy8.com]超级夜总会20180908.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]超级夜总会20180915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]超级夜总会20180922.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6442/[阳光电影-www.ygdy8.com]超级夜总会20180929.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]超级夜总会20180901.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6421/[阳光电影-www.ygdy8.com]超级夜总会20180908.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]超级夜总会20180915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]超级夜总会20180922.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6442/[阳光电影-www.ygdy8.com]超级夜总会20180929.mp4', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7727, 4, '坦白吧！花花世界', '', '', '#FF0000', '', '', '<p>《坦白吧！花花世界》主持人徐熙娣、蔡康永分享乐趣，康熙再度合体，感动！小s跟蔡康永为马云定制的购物节目。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fscvnv54zhj20f00qo7g5.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]真相吧花花万物20180903.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6420/[阳光电影-www.ygdy8.com]真相吧花花万物20180907.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]真相吧花花万物20180914.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]真相吧花花万物20180917.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6434/[阳光电影-www.ygdy8.com]真相吧花花万物20180921.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6441/[阳光电影-www.ygdy8.com]真相吧花花万物20180928.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]真相吧花花万物20180903.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6420/[阳光电影-www.ygdy8.com]真相吧花花万物20180907.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]真相吧花花万物20180914.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]真相吧花花万物20180917.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6434/[阳光电影-www.ygdy8.com]真相吧花花万物20180921.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6441/[阳光电影-www.ygdy8.com]真相吧花花万物20180928.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7728, 4, '新舞林大会', '', '', '#FF0000', '', '', '<p>《新舞林大会》是东方卫视推出的原创明星舞蹈真人秀，由徐向东担任总导演，曲清担任联合总导演 。 节目邀请了张靓颖、迪丽热巴、薛之谦、王子异等艺人加盟 。 节目于2018年7月22日起每周日21:00在东方卫视播出 。 由东方卫视和灿星制作联合打造的原创明星舞蹈真人秀《新舞林大会》，将在东方卫视登陆。第一批明星阵容，张靓颖、薛之谦、迪丽热巴、王子异等均已确认加盟。《新舞林大会》首次尝试“去评委化”，现场全由观众打分，以决定明星去留；其次，《新舞林大会》告别了单调常规的赛制，采用全新原创的“连续剧剧情式”赛制，致力于给观众呈现一场更有悬念的视觉盛宴；再次，《新舞林大会》将对舞者全面开放所有舞种，明星可以任选街舞、国标舞、现代舞、当代舞、民族舞、组合舞等多种表现形式，观众将有机会看到明星尝试百变舞风。<img alt="" src="" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]新舞林大会20180902.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]新舞林大会20180909.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]新舞林大会20180916.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]新舞林大会20180923.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]新舞林大会20180930.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]新舞林大会20180902.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]新舞林大会20180909.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]新舞林大会20180916.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]新舞林大会20180923.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]新舞林大会20180930.mkv', 'admin', '', 'X', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7729, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]天天向上2080902.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]天天向上2080909.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]天天向上2080916.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]天天向上20180923.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]天天向上2080902.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]天天向上2080909.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]天天向上2080916.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6436/[阳光电影-www.ygdy8.com]天天向上20180923.mkv', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7730, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]非诚勿扰20180901.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]非诚勿扰20180908.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]非诚勿扰20180915.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]非诚勿扰20180922.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6442/[阳光电影-www.ygdy8.com]非诚勿扰20180929.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6415/[阳光电影-www.ygdy8.com]非诚勿扰20180901.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]非诚勿扰20180908.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]非诚勿扰20180915.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]非诚勿扰20180922.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6442/[阳光电影-www.ygdy8.com]非诚勿扰20180929.mkv', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7731, 4, '认识的哥哥', '', '', '#FF0000', '', '', '<p>《认识的哥哥》节目是根据主题不同，以存在于人生中，虽不是很重大，却会让人好奇不已，不得到答案就浑身不自在的问题为主题，通过各种方式为其寻求解答的综艺节目。<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fdljka0l66j20rs09x14w.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]认识的哥哥20180901.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6421/[阳光电影-www.ygdy8.com]认识的哥哥20180908.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]认识的哥哥20180915.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]认识的哥哥20180922.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]认识的哥哥20180929.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]认识的哥哥20180901.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6421/[阳光电影-www.ygdy8.com]认识的哥哥20180908.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]认识的哥哥20180915.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]认识的哥哥20180922.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6443/[阳光电影-www.ygdy8.com]认识的哥哥20180929.mkv', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7732, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>这是一档结合音乐+美食+答题的新综艺。由申东烨、SHINee Key，李惠利、朴娜莱文世允、韩海担任固定成员。节目设定是一群人在市场听歌，音乐打断后猜下一句歌词，答对获得美食。\n<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fu28p11uv8j20e00fegxe.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]惊人的星期六20180901.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]惊人的星期六20180901.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7733, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]快乐大本营20180901.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]快乐大本营20180908.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]快乐大本营20180915.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]快乐大本营20180922.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]快乐大本营20180901.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6422/[阳光电影-www.ygdy8.com]快乐大本营20180908.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]快乐大本营20180915.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]快乐大本营20180922.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7734, 4, '综艺3国智', '', '', '#FF0000', '', '', '<p>《综艺3国智》，官方英文名3 Kingdoms，是台湾电视公司监制及首播的实境外景节目，主持人为李李仁、纳豆、王少伟、黄路梓茵、明杰、风田、Evan、Teddy、 张立东、玛丽，台视主频于2016年11月12日首播。<img alt="" src="" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]综艺3国智20180901.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6421/[阳光电影-www.ygdy8.com]综艺3国智20180908.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]综艺3国智20180915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]综艺3国智20180922.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6442/[阳光电影-www.ygdy8.com]综艺3国智20180929.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]综艺3国智20180901.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6421/[阳光电影-www.ygdy8.com]综艺3国智20180908.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]综艺3国智20180915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]综艺3国智20180922.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6442/[阳光电影-www.ygdy8.com]综艺3国智20180929.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7735, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]综艺玩很大20180901.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6421/[阳光电影-www.ygdy8.com]综艺玩很大20180908.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]综艺玩很大20180915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]综艺玩很大20180922.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6442/[阳光电影-www.ygdy8.com]综艺玩很大20180929.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]综艺玩很大20180901.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6421/[阳光电影-www.ygdy8.com]综艺玩很大20180908.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]综艺玩很大20180915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]综艺玩很大20180922.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6442/[阳光电影-www.ygdy8.com]综艺玩很大20180929.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7736, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]娱乐百分百20180901.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6416/[阳光电影-www.ygdy8.com]娱乐百分百20180903.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6417/[阳光电影-www.ygdy8.com]娱乐百分百20180904.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6418/[阳光电影-www.ygdy8.com]娱乐百分百20180905.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6419/[阳光电影-www.ygdy8.com]娱乐百分百20180906.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6420/[阳光电影-www.ygdy8.com]娱乐百分百20180907.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6421/[阳光电影-www.ygdy8.com]娱乐百分百20180908.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6423/[阳光电影-www.ygdy8.com]娱乐百分百20180910.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6424/[阳光电影-www.ygdy8.com]娱乐百分百20180911.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6425/[阳光电影-www.ygdy8.com]娱乐百分百20180912.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6426/[阳光电影-www.ygdy8.com]娱乐百分百20180913.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]娱乐百分百20180914.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6430/[阳光电影-www.ygdy8.com]娱乐百分百20180917.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6431/[阳光电影-www.ygdy8.com]娱乐百分百20180918.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6433/[阳光电影-www.ygdy8.com]娱乐百分百20180919.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6433/[阳光电影-www.ygdy8.com]娱乐百分百20180920.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6434/[阳光电影-www.ygdy8.com]娱乐百分百20180921.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]娱乐百分百20180922.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6437/[阳光电影-www.ygdy8.com]娱乐百分百20180924.mp4\nftp://