INSERT INTO `gx_video` VALUES (7737, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]天才冲冲冲20180901.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6421/[阳光电影-www.ygdy8.com]天才冲冲冲20180908.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]天才冲冲冲20180915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]天才冲冲冲20180922.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6442/[阳光电影-www.ygdy8.com]天才冲冲冲20180929.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6414/[阳光电影-www.ygdy8.com]天才冲冲冲20180901.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6421/[阳光电影-www.ygdy8.com]天才冲冲冲20180908.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6428/[阳光电影-www.ygdy8.com]天才冲冲冲20180915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6435/[阳光电影-www.ygdy8.com]天才冲冲冲20180922.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6442/[阳光电影-www.ygdy8.com]天才冲冲冲20180929.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7738, 4, '这就是灌篮', '', '', '#FF0000', '', '', '<p>《这就是灌篮》是一档由优酷&amp;浙江卫视联合播出的中国首档大型青春篮球竞技原创节目。周杰伦&amp;林书豪、李易峰&amp;郭艾伦分别担任两大篮球阵营领队，集结热爱篮球的年轻人，引领全民篮球狂潮。四位领队，两支战队，上演最燃3V3篮球对战。用最真实的逐梦之路，唤醒青春热血。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fumv703to5j20m80e9q60.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6407/[阳光电影-www.ygdy8.com]这就是灌篮20180825.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6407/[阳光电影-www.ygdy8.com]这就是灌篮20180825.mp4', 'admin', '', 'Z', 10.0, 1, 0);
