INSERT INTO `gx_video` VALUES (7740, 4, '超级夜总会', '', '', '#FF0000', '', '', '<p>《超级夜总会》是三立电视台独立制作的一档综艺娱乐节目，以歌曲演唱、幽默情景剧、户外与观众近距离互动为主要元素，是台湾第一个电视台出动大型舞台车至各县市镇、乡、村的著名观光景点、夜市、庙宇录制的节目。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3hdcxn0doj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6393/[阳光电影-www.ygdy8.com]超级夜总会20180811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]超级夜总会20180818.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6393/[阳光电影-www.ygdy8.com]超级夜总会20180811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]超级夜总会20180818.mp4', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7741, 4, '相声有新人', '', '', '#FF0000', '', '', '<p>《相声有新人》2018年8月11日起每周六晚播出，是全国首档垂直相声竞演类节目，邀请郭德纲和张国立为“召唤师”，从全国各地寻找到的身怀绝技的相声演员中，用淘汰晋级的方式，评选出最有传承感和时代感的相声新星。力求用中国式幽默，表达传统艺人对当下生活的思考和感悟，让相声这门中国传统的幽默艺术，在传承中焕发出全新的活力。节目开发了多种创新赛制，比如一对一对战，即兴表演大逃杀等等，希望用最残酷的赛制激发选手的创作潜能，将选手之间的竞争矛盾最大化，带领观众跟随选手体验喜怒哀乐，给观众一场身临其境式的欢乐盛宴。《相声有新人》不仅追求内容方面的极致创新，在舞美方面也要求最大程度的更新更美。全球首个相声小镇诞生，融合最有海派建筑特色的石库门元素等，从视觉上给观众冲击力。百组相声高手们在相声小镇集合，华山论剑，最终十名高手突出重围进入剧场表演，象征着相声艺术缘起街头，梦回舞台的特色，给人深刻的记忆。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fu6qia8sb8j20ds07sglz.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6392/[阳光电影-www.ygdy8.com]相声有新人20180811.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]相声有新人20180818.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6407/[阳光电影-www.ygdy8.com]相声有新人20180825.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6392/[阳光电影-www.ygdy8.com]相声有新人20180811.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]相声有新人20180818.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6407/[阳光电影-www.ygdy8.com]相声有新人20180825.mkv', 'admin', '', 'X', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7742, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>这是一档结合音乐+美食+答题的新综艺。由申东烨、SHINee Key，李惠利、朴娜莱文世允、韩海担任固定成员。节目设定是一群人在市场听歌，音乐打断后猜下一句歌词，答对获得美食。\n<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fu28p11uv8j20e00fegxe.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6388/[阳光电影-www.ygdy8.com]惊人的星期六20180807.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6396/[阳光电影-www.ygdy8.com]惊人的星期六20180811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6401/[阳光电影-www.ygdy8.com]惊人的星期六20180818.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6407/[阳光电影-www.ygdy8.com]惊人的星期六20180825.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6388/[阳光电影-www.ygdy8.com]惊人的星期六20180807.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6396/[阳光电影-www.ygdy8.com]惊人的星期六20180811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6401/[阳光电影-www.ygdy8.com]惊人的星期六20180818.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6407/[阳光电影-www.ygdy8.com]惊人的星期六20180825.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7743, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Idol Room， 由韩国资深娱乐节目主持人郑亨敦与嘻哈歌手Defconn双人组合，每周采访一个或多个idol组合的室内综艺。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fu28olj86xj20f10cjn63.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6388/[阳光电影-www.ygdy8.com]Idol Room20180807.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6391/[阳光电影-www.ygdy8.com]Idol Room20180810.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6388/[阳光电影-www.ygdy8.com]Idol Room20180807.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6391/[阳光电影-www.ygdy8.com]Idol Room20180810.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7744, 4, '我独自生活', '', '', '#FF0000', '', '', '<p>《我独自生活》是由MBC电视台新年播放的特辑《男人的独居时代》改名进行播出的，由大雁爸爸李成宰，金泰元和因为妻子是运动选手而不得不分开居住的韩尚进，还有单身的金光奎，Defconn和徐仁国等向观众公开独自在家生活的面貌。特别是和形象不符的干净利落的Defconn的家和脏乱的徐仁国的家成为强烈对比，还 有公开大雁爸爸的日常的李成宰和金泰沅等的故事希望能得到观众的共感。<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fu1jq997iqj20he082wn3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6388/[阳光电影-www.ygdy8.com]我独自生活20180803.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6391/[阳光电影-www.ygdy8.com]我独自生活20180810.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6400/[阳光电影-www.ygdy8.com]我独自生活20180817.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6406/[阳光电影-www.ygdy8.com]我独自生活20180824.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6413/[阳光电影-www.ygdy8.com]我独自生活20180831.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6388/[阳光电影-www.ygdy8.com]我独自生活20180803.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6391/[阳光电影-www.ygdy8.com]我独自生活20180810.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6400/[阳光电影-www.ygdy8.com]我独自生活20180817.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6406/[阳光电影-www.ygdy8.com]我独自生活20180824.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6413/[阳光电影-www.ygdy8.com]我独自生活20180831.mkv', 'admin', '', 'W', 10.0, 1, 0);
