INSERT INTO `gx_video` VALUES (7747, 4, '放开我北鼻', '', '', '#FF0000', '', '', '<p>《放开我北鼻》是一档由上海东方娱乐传媒集团有限公司和腾讯视频共同推出的纯网综艺，由李文妤担纲制作人。节目记录几位性格迥异、颜值极高的素人小孩与明星嘉宾相处的过程。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fsf8w88y8vj20le0u00v9.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6387/[阳光电影-www.ygdy8.com]放开我北鼻20180805.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6396/[阳光电影-www.ygdy8.com]放开我北鼻第三季20180812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]放开我北鼻第三季20180819.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6387/[阳光电影-www.ygdy8.com]放开我北鼻20180805.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6396/[阳光电影-www.ygdy8.com]放开我北鼻第三季20180812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]放开我北鼻第三季20180819.mp4', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7748, 4, '新舞林大会', '', '', '#FF0000', '', '', '<p>《新舞林大会》是东方卫视推出的原创明星舞蹈真人秀，由徐向东担任总导演，曲清担任联合总导演 。 节目邀请了张靓颖、迪丽热巴、薛之谦、王子异等艺人加盟 。 节目于2018年7月22日起每周日21:00在东方卫视播出 。 由东方卫视和灿星制作联合打造的原创明星舞蹈真人秀《新舞林大会》，将在东方卫视登陆。第一批明星阵容，张靓颖、薛之谦、迪丽热巴、王子异等均已确认加盟。《新舞林大会》首次尝试“去评委化”，现场全由观众打分，以决定明星去留；其次，《新舞林大会》告别了单调常规的赛制，采用全新原创的“连续剧剧情式”赛制，致力于给观众呈现一场更有悬念的视觉盛宴；再次，《新舞林大会》将对舞者全面开放所有舞种，明星可以任选街舞、国标舞、现代舞、当代舞、民族舞、组合舞等多种表现形式，观众将有机会看到明星尝试百变舞风。<img alt="" src="" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6387/[阳光电影-www.ygdy8.com]新舞林大会20180805.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6393/[阳光电影-www.ygdy8.com]新舞林大会20180812.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]新舞林大会20180819.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6408/[阳光电影-www.ygdy8.com]新舞林大会20180826.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6387/[阳光电影-www.ygdy8.com]新舞林大会20180805.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6393/[阳光电影-www.ygdy8.com]新舞林大会20180812.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]新舞林大会20180819.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6408/[阳光电影-www.ygdy8.com]新舞林大会20180826.mkv', 'admin', '', 'X', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7749, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6387/[阳光电影-www.ygdy8.com]天天向上2080805.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]天天向上2080819.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6408/[阳光电影-www.ygdy8.com]天天向上2080826.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6387/[阳光电影-www.ygdy8.com]天天向上2080805.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]天天向上2080819.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6408/[阳光电影-www.ygdy8.com]天天向上2080826.mkv ', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7750, 4, '我家的熊孩子', '', '', '#FF0000', '', '', '<p>《我家的熊孩子》是一档韩国脱口秀节目。节目主要关注家长与孩子之间的问题。你对孩子了解多少？今天孩子和谁见面了，又发生了什么样的故事？孩子今天怎么满面愁容，又为什么食欲突然增加？通过这个节目家长对这些问题会有更深的思考。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1ftzupnmfy5j20pk0df0xo.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6386/[阳光电影-www.ygdy8.com]我家的熊孩子20180805.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6393/[阳光电影-www.ygdy8.com]我家的熊孩子2080812.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6401/[阳光电影-www.ygdy8.com]我家的熊孩子20180819.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6386/[阳光电影-www.ygdy8.com]我家的熊孩子20180805.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6393/[阳光电影-www.ygdy8.com]我家的熊孩子2080812.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6401/[阳光电影-www.ygdy8.com]我家的熊孩子20180819.mkv', 'admin', '', 'W', 10.0, 1, 0);
