INSERT INTO `gx_video` VALUES (7757, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6386/[阳光电影-www.ygdy8.com]综艺大集合20180805.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6395/[阳光电影-www.ygdy8.com]综艺大集合20180812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]综艺大集合20180819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6408/[阳光电影-www.ygdy8.com]综艺大集合20180826.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6386/[阳光电影-www.ygdy8.com]综艺大集合20180805.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6395/[阳光电影-www.ygdy8.com]综艺大集合20180812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]综艺大集合20180819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6408/[阳光电影-www.ygdy8.com]综艺大集合20180826.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7758, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2018跨界歌王，跨界歌手有吴秀波 、徐静蕾、刘恺威、陈学冬、卢靖姗、李菲儿、韩东君。点评嘉宾有薛之谦 、谭维维 、S子佼。还有更多神秘大咖，敬请期待。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fr3ucbd0ivj20f50k677w.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6386/[阳光电影-www.ygdy8.com]跨界歌王第三季20180804.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6386/[阳光电影-www.ygdy8.com]跨界歌王第三季20180804.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7759, 4, '明日之子', '', '', '#FF0000', '', '', '<p>《明日之子》第二季是腾讯视频独播的一档原创高品质音乐类节目。 第二季节目以“带领 冲撞 正流行”为核心，选出最受年轻人喜爱的音乐新人。选手通过盛世美颜、盛世独秀、盛世魔音三大赛道进入比拼称为“九大厂牌”，最终选出能够带领正流行的“最强厂牌”。由李宇春、吴青峰、华晨宇任赛道星推官，何炅出任“现场总导演”，杨幂担任“厂牌星推官”。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1ftbq946jodj207i0b9gmy.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6386/[阳光电影-www.ygdy8.com]明日之子第二季20180803.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6392/[阳光电影-www.ygdy8.com]明日之子20180810.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6400/[阳光电影-www.ygdy8.com]明日之子20180817.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6408/[阳光电影-www.ygdy8.com]明日之子20180824.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6386/[阳光电影-www.ygdy8.com]明日之子第二季20180803.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6392/[阳光电影-www.ygdy8.com]明日之子20180810.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6400/[阳光电影-www.ygdy8.com]明日之子20180817.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6408/[阳光电影-www.ygdy8.com]明日之子20180824.mp4', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7760, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6385/[阳光电影-www.ygdy8.com]非诚勿扰20180804.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6392/[阳光电影-www.ygdy8.com]非诚勿扰20180811.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6401/[阳光电影-www.ygdy8.com]非诚勿扰20180818.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6407/[阳光电影-www.ygdy8.com]非诚勿扰20180825.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6385/[阳光电影-www.ygdy8.com]非诚勿扰20180804.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6392/[阳光电影-www.ygdy8.com]非诚勿扰20180811.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6401/[阳光电影-www.ygdy8.com]非诚勿扰20180818.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6407/[阳光电影-www.ygdy8.com]非诚勿扰20180825.mkv', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7761, 4, '青春同学会', '', '', '#FF0000', '', '', '<p>《青春同学会》是东方卫视与欢乐传媒联袂打造的综艺节目。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1fri29fry7xj20fe0b4abr.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6385/[阳光电影-www.ygdy8.com]青春同学会20180804.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6385/[阳光电影-www.ygdy8.com]青春同学会20180804.mkv', 'admin', '', 'Q', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7762, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6385/[阳光电影-www.ygdy8.com]快乐大本营20180804.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6392/[阳光电影-www.ygdy8.com]快乐大本营20180811.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6400/[阳光电影-www.ygdy8.com]快乐大本营20180818.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6407/[阳光电影-www.ygdy8.com]快乐大本营20180825.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6385/[阳光电影-www.ygdy8.com]快乐大本营20180804.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6392/[阳光电影-www.ygdy8.com]快乐大本营20180811.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6400/[阳光电影-www.ygdy8.com]快乐大本营20180818.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6407/[阳光电影-www.ygdy8.com]快乐大本营20180825.mkv', 'admin', '', 'K', 10.0, 1, 0);
