INSERT INTO `gx_video` VALUES (7765, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6385/[阳光电影-www.ygdy8.com]综艺玩很大20180804.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6393/[阳光电影-www.ygdy8.com]综艺玩很大20180811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]综艺玩很大20180819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6408/[阳光电影-www.ygdy8.com]综艺玩很大20180825.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6385/[阳光电影-www.ygdy8.com]综艺玩很大20180804.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6393/[阳光电影-www.ygdy8.com]综艺玩很大20180811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]综艺玩很大20180819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6408/[阳光电影-www.ygdy8.com]综艺玩很大20180825.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7766, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6385/[阳光电影-www.ygdy8.com]天才冲冲冲20180804.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6393/[阳光电影-www.ygdy8.com]天才冲冲冲20180811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]天才冲冲冲20180818.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6408/[阳光电影-www.ygdy8.com]天才冲冲冲20180825.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6385/[阳光电影-www.ygdy8.com]天才冲冲冲20180804.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6393/[阳光电影-www.ygdy8.com]天才冲冲冲20180811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]天才冲冲冲20180818.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6408/[阳光电影-www.ygdy8.com]天才冲冲冲20180825.mp4', 'admin', '', 'T', 10.0, 1, 0);
