INSERT INTO `gx_video` VALUES (7774, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment  News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。  <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6382/[阳光电影-www.ygdy8.com]娱乐百分百20180801.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6383/[阳光电影-www.ygdy8.com]娱乐百分百20180802.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6385/[阳光电影-www.ygdy8.com]娱乐百分百20180803.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6385/[阳光电影-www.ygdy8.com]娱乐百分百20180804.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6388/[阳光电影-www.ygdy8.com]娱乐百分百20180806.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6388/[阳光电影-www.ygdy8.com]娱乐百分百20180807.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6389/[阳光电影-www.ygdy8.com]娱乐百分百20180808.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6391/[阳光电影-www.ygdy8.com]娱乐百分百20180809.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6391/[阳光电影-www.ygdy8.com]娱乐百分百20180810.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6393/[阳光电影-www.ygdy8.com]娱乐百分百20180811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6396/[阳光电影-www.ygdy8.com]娱乐百分百20180813.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6397/[阳光电影-www.ygdy8.com]娱乐百分百20180814.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6397/[阳光电影-www.ygdy8.com]娱乐百分百20180815.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6400/[阳光电影-www.ygdy8.com]娱乐百分百20180816.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]娱乐百分百20180818.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6402/[阳光电影-www.ygdy8.com]娱乐百分百20180820.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6403/[阳光电影-www.ygdy8.com]娱乐百分百20180821.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6404/[阳光电影-www.ygdy8.com]娱乐百分百20180822.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6405/[阳光电影-www.ygdy8.com]娱乐百分百20180823.mp4\nftp: