INSERT INTO `gx_video` VALUES (7778, 4, '幻乐之城', '', '', '#FF0000', '', '', '<p>《幻乐之城》是湖南卫视和酷博特文化联合打造的全新原创综艺。 \u3000\u3000<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1ftqlac9gi1j207i0b90v0.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6378/[阳光电影-www.ygdy8.com]幻乐之城20180720.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6378/[阳光电影-www.ygdy8.com]幻乐之城20180727.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6378/[阳光电影-www.ygdy8.com]幻乐之城20180720.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6378/[阳光电影-www.ygdy8.com]幻乐之城20180727.mkv', 'admin', '', 'H', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7779, 4, '新舞林大会', '', '', '#FF0000', '', '', '<p>《新舞林大会》是东方卫视推出的原创明星舞蹈真人秀，由徐向东担任总导演，曲清担任联合总导演 。 节目邀请了张靓颖、迪丽热巴、薛之谦、王子异等艺人加盟 。 节目于2018年7月22日起每周日21:00在东方卫视播出 。 由东方卫视和灿星制作联合打造的原创明星舞蹈真人秀《新舞林大会》，将在东方卫视登陆。第一批明星阵容，张靓颖、薛之谦、迪丽热巴、王子异等均已确认加盟。《新舞林大会》首次尝试“去评委化”，现场全由观众打分，以决定明星去留；其次，《新舞林大会》告别了单调常规的赛制，采用全新原创的“连续剧剧情式”赛制，致力于给观众呈现一场更有悬念的视觉盛宴；再次，《新舞林大会》将对舞者全面开放所有舞种，明星可以任选街舞、国标舞、现代舞、当代舞、民族舞、组合舞等多种表现形式，观众将有机会看到明星尝试百变舞风。<img alt="" src="" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]新舞林大会20180722.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]新舞林大会20180729.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]新舞林大会20180722.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]新舞林大会20180729.mkv', 'admin', '', 'X', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7780, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6371/[阳光电影-www.ygdy8.com]天才冲冲冲20180721.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]天才冲冲冲20180728.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6371/[阳光电影-www.ygdy8.com]天才冲冲冲20180721.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]天才冲冲冲20180728.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7781, 4, '中国新说唱', '', '', '#FF0000', '', '', '<p>《中国新说唱》是2018年爱奇艺举全平台之力打造的S+级自制超级网综。它是中国第一个以“剧集式”叙事 理念制作的真人秀节目，也是第一档华语青年说唱音乐真人秀。在兼具“燃、酷、潮“三大基因的同时，中国元素与说唱音乐的华丽碰撞，以及新时代新青年的自信表达，无疑将推动《中国新说唱》更好地回归音乐本身，打造一场华语青年说唱音乐盛会。由陈伟担任总制片人，车澈担任总导演，刘洲担任音乐总监。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1ftd64ij598j20hs0a074s.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6366/[阳光电影-www.ygdy8.com]中国新说唱20180714.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6366/[阳光电影-www.ygdy8.com]中国新说唱20180714.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7782, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]天天向上20180715.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]天天向上20180722.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6380/[阳光电影-www.ygdy8.com]天天向上2080729.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]天天向上20180715.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]天天向上20180722.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6380/[阳光电影-www.ygdy8.com]天天向上2080729.mkv', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7783, 4, '明日之子', '', '', '#FF0000', '', '', '<p>《明日之子》第二季是腾讯视频独播的一档原创高品质音乐类节目。 第二季节目以“带领 冲撞 正流行”为核心，选出最受年轻人喜爱的音乐新人。选手通过盛世美颜、盛世独秀、盛世魔音三大赛道进入比拼称为“九大厂牌”，最终选出能够带领正流行的“最强厂牌”。由李宇春、吴青峰、华晨宇任赛道星推官，何炅出任“现场总导演”，杨幂担任“厂牌星推官”。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1ftbq946jodj207i0b9gmy.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]明日之子第二季20180630.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]明日之子第二季20180702.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]明日之子第二季20180707.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]明日之子第二季20180714.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6376/[阳光电影-www.ygdy8.com]明日之子第二季20180722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6378/[阳光电影-www.ygdy8.com]明日之子第二季20180728.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]明日之子第二季20180630.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]明日之子第二季20180702.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]明日之子第二季20180707.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]明日之子第二季20180714.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6376/[阳光电影-www.ygdy8.com]明日之子第二季20180722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6378/[阳光电影-www.ygdy8.com]明日之子第二季20180728.mp4', 'admin', '', 'M', 10.0, 1, 0);
