INSERT INTO `gx_video` VALUES (7793, 4, '高能少年团第二季', '', '', '#FF0000', '', '', '<p>《高能少年团第二季》是浙江卫视推出的偶像对抗挑战真人秀，由浙江卫视战略发展中心核心主创人员与厚海文化、北文传媒等联合制作，战略发展中心监制，由王俊凯、董子健、杨紫、张一山、王大陆担任MC。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fe9b95q6euj208c0ciadk.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6358/[阳光电影-www.ygdy8.com]高能少年团第二季20180707.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6364/[阳光电影-www.ygdy8.com]高能少年团第二季20180714.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6358/[阳光电影-www.ygdy8.com]高能少年团第二季20180707.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6364/[阳光电影-www.ygdy8.com]高能少年团第二季20180714.mkv', 'admin', '', 'G', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7794, 4, '无限歌谣季', '', '', '#FF0000', '', '', '<p>《无限歌谣季》是江苏卫视推出的一档音乐唱作类真人秀节目，由张绍刚、岳云鹏、杨迪、伊一、周峻纬担任歌谣研修生，由薛之谦、李荣浩、毛不易、于文文、符龙飞担任无限唱作人。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1frybfswpa8j20rs0d70wd.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6358/[阳光电影-www.ygdy8.com]无限歌谣季20180707.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6358/[阳光电影-www.ygdy8.com]无限歌谣季20180707.mkv', 'admin', '', 'W', 10.0, 1, 0);
