INSERT INTO `gx_video` VALUES (7807, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6352/[阳光电影-www.ygdy8.com]娱乐百分百20180702.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6353/[阳光电影-www.ygdy8.com]娱乐百分百20180703.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6354/[阳光电影-www.ygdy8.com]娱乐百分百20180704.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6355/[阳光电影-www.ygdy8.com]娱乐百分百20180705.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6357/[阳光电影-www.ygdy8.com]娱乐百分百20180706.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6358/[阳光电影-www.ygdy8.com]娱乐百分百20180707.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6359/[阳光电影-www.ygdy8.com]娱乐百分百20180709.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6360/[阳光电影-www.ygdy8.com]娱乐百分百20180710.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6362/[阳光电影-www.ygdy8.com]娱乐百分百20180711.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]娱乐百分百20180713.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6366/[阳光电影-www.ygdy8.com]娱乐百分百20180716.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6367/[阳光电影-www.ygdy8.com]娱乐百分百20180717.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6368/[阳光电影-www.ygdy8.com]娱乐百分百20180718.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6369/[阳光电影-www.ygdy8.com]娱乐百分百20180719.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6370/[阳光电影-www.ygdy8.com]娱乐百分百20180720.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]娱乐百分百20180721.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6373/[阳光电影-www.ygdy8.com]娱乐百分百20180723.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6374/[阳光电影-www.ygdy8.com]娱乐百分百20180724.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6375/[阳光电影-www.ygdy8.com]娱乐百分百20180725.mp4\nftp://