INSERT INTO `gx_video` VALUES (7813, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]综艺大集合20180701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6358/[阳光电影-www.ygdy8.com]综艺大集合20180708.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]综艺大集合20180715.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]综艺大集合20180722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]综艺大集合20180729.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]综艺大集合20180701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6358/[阳光电影-www.ygdy8.com]综艺大集合20180708.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]综艺大集合20180715.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]综艺大集合20180722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]综艺大集合20180729.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7814, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]两天一夜20180701.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6359/[阳光电影-www.ygdy8.com]两天一夜20180708.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6366/[阳光电影-www.ygdy8.com]两天一夜20180715.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]两天一夜20180722.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]两天一夜20180729.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]两天一夜20180701.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6359/[阳光电影-www.ygdy8.com]两天一夜20180708.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6366/[阳光电影-www.ygdy8.com]两天一夜20180715.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]两天一夜20180722.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]两天一夜20180729.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7815, 4, '人气歌谣', '', '', '#FF0000', '', '', '<p>《人气歌谣》每周日播出，主要是一个歌手的新歌和新专集得以COME BACK回归的第一平台，因此参加演出的歌手以最近一段时间的人气歌曲为主。基本形式是每周选出TAKE7进行打榜，最终选出一名周冠军，其中也穿插很多明星的COME BACK舞台。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfgw1eacv7d4jhcj20cq09a74t.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]人气歌谣20180701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6359/[阳光电影-www.ygdy8.com]人气歌谣20180708.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]人气歌谣20180715.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6373/[阳光电影-www.ygdy8.com]人气歌谣20180722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]人气歌谣20180729.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]人气歌谣20180701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6359/[阳光电影-www.ygdy8.com]人气歌谣20180708.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]人气歌谣20180715.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6373/[阳光电影-www.ygdy8.com]人气歌谣20180722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]人气歌谣20180729.mp4', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7816, 4, '超人回来了', '', '', '#FF0000', '', '', '<p>《超人回来了》是KBS打造的一档亲子节目，节目讲述在没有爸爸或是妈妈陪同的情况下，大人与孩子在48小时内发生的有趣的事情。<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fdljlrbnvoj20cg0ioadf.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]超人回来了20180701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6359/[阳光电影-www.ygdy8.com]超人回来了20180708.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]超人回来了20180715.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]超人回来了20180722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]超人回来了20180729.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]超人回来了20180701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6359/[阳光电影-www.ygdy8.com]超人回来了20180708.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]超人回来了20180715.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]超人回来了20180722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]超人回来了20180729.mp4', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7817, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]RunningMan20180701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6358/[阳光电影-www.ygdy8.com]RunningMan20180708.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]RunningMan180715.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]RunningMan20180722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]RunningMan20180729.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]RunningMan20180701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6358/[阳光电影-www.ygdy8.com]RunningMan20180708.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6365/[阳光电影-www.ygdy8.com]RunningMan180715.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6372/[阳光电影-www.ygdy8.com]RunningMan20180722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6379/[阳光电影-www.ygdy8.com]RunningMan20180729.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7818, 4, '放开我北鼻', '', '', '#FF0000', '', '', '<p>《放开我北鼻》是一档由上海东方娱乐传媒集团有限公司和腾讯视频共同推出的纯网综艺，由李文妤担纲制作人。节目记录几位性格迥异、颜值极高的素人小孩与明星嘉宾相处的过程。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fsf8w88y8vj20le0u00v9.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]放开我北鼻第三季20180610.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]放开我北鼻第三季20180617.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6343/[阳光电影-www.ygdy8.com]放开我北鼻第三季20180624.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]放开我北鼻第三季20180610.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]放开我北鼻第三季20180617.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6343/[阳光电影-www.ygdy8.com]放开我北鼻第三季20180624.mp4', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7819, 4, '坦白吧！花花世界', '', '', '#FF0000', '', '', '<p>《坦白吧！花花世界》主持人徐熙娣、蔡康永分享乐趣，康熙再度合体，感动！小s跟蔡康永为马云定制的购物节目。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fscvnv54zhj20f00qo7g5.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6334/[阳光电影-www.ygdy8.com]真相吧花花万物20180615期先导片.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6334/[阳光电影-www.ygdy8.com]真相吧花花万物20180615期先导片.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7820, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2018年俄罗斯世界杯（俄语：Чемпиона́т ми́ра по футбо́лу 2018）是第21届世界杯足球赛。比赛将于2018年6月14日至7月15日在俄罗斯境内11座城市中的12座球场内举行。这是世界杯首次在俄罗斯境内举行，也是世界杯首次在东欧国家举行，同时是继2006年德国世界杯后世界杯再一次在欧洲举行。俄罗斯世界杯共有32支球队参加比赛；除去东道主俄罗斯自动获得参赛资格以外，其他31支球队将通过参加预选赛获得参赛资格。世界杯期间，将在俄罗斯境内举行64场比赛角逐出冠军，决赛将于7月15日在莫斯科卢日尼基球场举行。2017年11月16日，2018年俄罗斯世界杯32强全部产生，其中巴拿马、冰岛历史首次晋级世界杯决赛圈，亚足联旗下首次有五支球队入围世界杯决赛圈。\n<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1fsbpo4nuvmj20yq0inaws.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6333/[阳光电影-www.ygdy8.com]2018年世界杯-开幕式.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6333/[阳光电影-www.ygdy8.com]2018年世界杯-俄罗斯vs沙特.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6334/[阳光电影-www.ygdy8.com]2018年世界杯-埃及VS乌拉圭.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6334/[阳光电影-www.ygdy8.com]2018年世界杯-摩洛哥VS伊朗.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6334/[阳光电影-www.ygdy8.com]2018年世界杯-葡萄牙VS西班牙.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]2018年世界杯-法国vs澳大利亚.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]2018年世界杯-阿根廷vs冰岛.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]2018年世界杯-秘鲁vs丹麦.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]2018年世界杯-克罗地亚vs尼日利亚.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]2018年世界杯-哥斯达黎加vs塞尔维亚.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]2018年世界杯-德国vs墨西哥.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]2018年世界杯-巴西vs瑞士.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6336/[阳光电影-www.ygdy8.com]2018年世界杯-瑞典vs韩国.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6336/[阳光电影-www.ygdy8.com]2018年世界杯-比利时vs巴拿马.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6336/[阳光电影-www.ygdy8.com]2018年世界杯-突尼斯vs英格兰.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6337/[阳光电影-www.ygdy8.com]2018年世界杯-哥伦比亚vs日本.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6337/[阳光电影-www.ygdy8.com]2018年世界杯-波兰vs塞内加尔.mp4\nftp://ygdy8:ygdy8@yg76.dydytt