INSERT INTO `gx_video` VALUES (7821, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>凤凰中文台军情观察室节目坐阵曾有“情报收集中心”之称的香港紧贴每周的全球热点军事话题以丰富、有趣的电视动画以及快节奏播报大量信息的方式为您搜罗军事情报同时请来军事专家对热点话题进行深度地分析与解读。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e8bbkka8mkj20700a0weu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6332/[阳光电影-www.ygdy8.com]军情观察室20180613.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6339/[阳光电影-www.ygdy8.com]军情观察室20180620.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6332/[阳光电影-www.ygdy8.com]军情观察室20180613.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6339/[阳光电影-www.ygdy8.com]军情观察室20180620.mkv', 'admin', '', 'Z', 10.0, 1, 0);
