INSERT INTO `gx_video` VALUES (7825, 4, '妈妈是超人第3季', '', '', '#FF0000', '', '', '<p>《妈妈是超人第3季》是一档明星育儿生活全景观察记，3月22日起中午十二点将在爱奇艺正式上线。节目集结了贾静雯、霍思燕、黄圣依、邓莎明星妈妈，她们将在节目中展示最原汁原味的家庭生活和最真性情的育儿经历。 \u200b\u200b\u200b\u200b<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fpuoypsceij20r8078dg3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6326/[阳光电影-www.ygdy8.com]妈妈是超人第三季20180607.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6326/[阳光电影-www.ygdy8.com]妈妈是超人第三季20180607.mp4', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7826, 4, '一周的偶像', '', '', '#FF0000', '', '', '<p>《一周的偶像》是一档室内访谈节目，由韩国资深娱乐节目主持人郑亨敦与嘻哈歌手Defconn双人组合共同主持，针对最新韩流发烧娱乐话题，每集专访一组粉丝最爱的偶像团体。主持人与偶像成员的快问快答，充满爆笑与即时性的综艺效果。另外，节目亲临偶像出没场所，对粉丝公开偶像地图，且用监视摄影机，偷偷记录偶像们面对突发状况的行为反应，每周带来韩流偶像难得一见的模样。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fha33ejy23j205k08c757.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6323/[阳光电影-www.ygdy8.com]一周的偶像20180606.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6332/[阳光电影-www.ygdy8.com]一周的偶像20180613.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6338/[阳光电影-www.ygdy8.com]一周的偶像20180620.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6347/[阳光电影-www.ygdy8.com]一周的偶像20180627.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6323/[阳光电影-www.ygdy8.com]一周的偶像20180606.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6332/[阳光电影-www.ygdy8.com]一周的偶像20180613.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6338/[阳光电影-www.ygdy8.com]一周的偶像20180620.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6347/[阳光电影-www.ygdy8.com]一周的偶像20180627.mp4', 'admin', '', 'Y', 10.0, 1, 0);
