INSERT INTO `gx_video` VALUES (7835, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>全国范围内热到炸裂的天气，让人心中不免躁动。而燃到炸裂的拼多多特约《极限挑战》第三季的第二期将于7月16日晚10点正式开播，“极限男人帮”化躁动为行动，红火出击，南下佛山，闯荡风雨武林路。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f30waeec55j20ch0gon0y.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6320/[阳光电影-www.ygdy8.com]极限挑战第四季20180603.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6329/[阳光电影-www.ygdy8.com]极限挑战第四季20180610.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]极限挑战第四季20180617.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6343/[阳光电影-www.ygdy8.com]极限挑战第四季20180624.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6320/[阳光电影-www.ygdy8.com]极限挑战第四季20180603.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6329/[阳光电影-www.ygdy8.com]极限挑战第四季20180610.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]极限挑战第四季20180617.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6343/[阳光电影-www.ygdy8.com]极限挑战第四季20180624.mp4', 'admin', '', 'Z', 10.0, 1, 0);
