INSERT INTO `gx_video` VALUES (7844, 4, '我是大侦探', '', '', '#FF0000', '', '', '<p>《我是大侦探》是湖南卫视和芒果TV共同打造的大型情境类益智互动推理秀，由《明星大侦探》原版人马倾情打造，节目秉承电影级高品质的精良制作水准，以调动“全民动脑”为首要宗旨，再加入极致夸张逗趣的明星角色扮演等综艺元素。每期集结6位超强阵容高能玩家，解锁层层悬念，找出关键人物K，引发全民推理热潮。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fpp34qqqaaj20go0b3dh3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6319/[阳光电影-www.ygdy8.com]我是大侦探20180602.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6327/[阳光电影-www.ygdy8.com]我是大侦探20180609.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]我是大侦探20180616.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6319/[阳光电影-www.ygdy8.com]我是大侦探20180602.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6327/[阳光电影-www.ygdy8.com]我是大侦探20180609.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]我是大侦探20180616.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7845, 4, '无限歌谣季', '', '', '#FF0000', '', '', '<p>《无限歌谣季》是江苏卫视推出的一档音乐唱作类真人秀节目，由张绍刚、岳云鹏、杨迪、伊一、周峻纬担任歌谣研修生，由薛之谦、李荣浩、毛不易、于文文、符龙飞担任无限唱作人。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1frybfswpa8j20rs0d70wd.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6319/[阳光电影-www.ygdy8.com]无限歌谣季20180602.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6327/[阳光电影-www.ygdy8.com]无限歌谣季20180609.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]无限歌谣季20180616.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6341/[阳光电影-www.ygdy8.com]无限歌谣季20180623.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6319/[阳光电影-www.ygdy8.com]无限歌谣季20180602.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6327/[阳光电影-www.ygdy8.com]无限歌谣季20180609.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]无限歌谣季20180616.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6341/[阳光电影-www.ygdy8.com]无限歌谣季20180623.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7846, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6319/[阳光电影-www.ygdy8.com]快乐大本营20180602.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6327/[阳光电影-www.ygdy8.com]快乐大本营20180609.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]快乐大本营20180616.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6341/[阳光电影-www.ygdy8.com]快乐大本营20180623.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]快乐大本营20180630.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6319/[阳光电影-www.ygdy8.com]快乐大本营20180602.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6327/[阳光电影-www.ygdy8.com]快乐大本营20180609.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]快乐大本营20180616.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6341/[阳光电影-www.ygdy8.com]快乐大本营20180623.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]快乐大本营20180630.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7847, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6319/[阳光电影-www.ygdy8.com]非诚勿扰20180602.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6327/[阳光电影-www.ygdy8.com]非诚勿扰20180609.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]非诚勿扰20180616.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6341/[阳光电影-www.ygdy8.com]非诚勿扰20180623.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]非诚勿扰20180630.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6319/[阳光电影-www.ygdy8.com]非诚勿扰20180602.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6327/[阳光电影-www.ygdy8.com]非诚勿扰20180609.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]非诚勿扰20180616.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6341/[阳光电影-www.ygdy8.com]非诚勿扰20180623.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6351/[阳光电影-www.ygdy8.com]非诚勿扰20180630.mkv', 'admin', '', 'F', 10.0, 1, 0);
