INSERT INTO `gx_video` VALUES (7850, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6318/[阳光电影-www.ygdy8.com]娱乐百分百20180601.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6319/[阳光电影-www.ygdy8.com]娱乐百分百20180602.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6321/[阳光电影-www.ygdy8.com]娱乐百分百20180604.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6322/[阳光电影-www.ygdy8.com]娱乐百分百20180605.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6323/[阳光电影-www.ygdy8.com]娱乐百分百20180606.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6324/[阳光电影-www.ygdy8.com]娱乐百分百20180607.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6326/[阳光电影-www.ygdy8.com]娱乐百分百20180608.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6327/[阳光电影-www.ygdy8.com]娱乐百分百20180609.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6330/[阳光电影-www.ygdy8.com]娱乐百分百20180611.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6331/[阳光电影-www.ygdy8.com]娱乐百分百20180612.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6332/[阳光电影-www.ygdy8.com]娱乐百分百20180613.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6333/[阳光电影-www.ygdy8.com]娱乐百分百20180614.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6334/[阳光电影-www.ygdy8.com]娱乐百分百20180615.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6335/[阳光电影-www.ygdy8.com]娱乐百分百20180616.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6336/[阳光电影-www.ygdy8.com]娱乐百分百20180618.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6337/[阳光电影-www.ygdy8.com]娱乐百分百20180619.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6338/[阳光电影-www.ygdy8.com]娱乐百分百20180620.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6339/[阳光电影-www.ygdy8.com]娱乐百分百20180621.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6340/[阳光电影-www.ygdy8.com]娱乐百分百20180622.mp4\nftp://