INSERT INTO `gx_video` VALUES (7857, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>爱奇艺出品、新浪微博联合出品的《热血街舞团》，由爱奇艺高级副总裁陈伟担任总监制，爱奇艺副总裁车澈担任总导演，音乐制作人刘洲出任节目音乐总监，同时节目组还邀请到著名舞美设计师唐焱担任视觉总监。\n<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fpp355ubznj20f009x13a.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6313/[阳光电影-www.ygdy8.com]热血街舞团20180522.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6313/[阳光电影-www.ygdy8.com]热血街舞团20180522.mp4', 'admin', '', 'Z', 10.0, 1, 0);
