INSERT INTO `gx_video` VALUES (7864, 4, '孝利家民宿', '', '', '#FF0000', '', '', '<p>《孝利家民宿》主要记录了李孝利、李尚顺夫妇将自己家改造成民宿，与前来投宿的普通民众之间发生的点滴故事，于每周日晚9时播出。<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fq6rnjbmycj20hi0nimzc.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6292/[阳光电影-www.ygdy8.com]孝利家民宿2-20180506.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6300/[阳光电影-www.ygdy8.com]孝利家民宿2-20180513.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6307/[阳光电影-www.ygdy8.com]孝利家民宿2-20180520.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6292/[阳光电影-www.ygdy8.com]孝利家民宿2-20180506.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6300/[阳光电影-www.ygdy8.com]孝利家民宿2-20180513.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6307/[阳光电影-www.ygdy8.com]孝利家民宿2-20180520.mkv', 'admin', '', 'X', 10.0, 1, 0);
