INSERT INTO `gx_video` VALUES (7869, 4, '超级夜总会', '', '', '#FF0000', '', '', '<p>《超级夜总会》是三立电视台独立制作的一档综艺娱乐节目，以歌曲演唱、幽默情景剧、户外与观众近距离互动为主要元素，是台湾第一个电视台出动大型舞台车至各县市镇、乡、村的著名观光景点、夜市、庙宇录制的节目。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3hdcxn0doj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6292/[阳光电影-www.ygdy8.com]超级夜总会20180505.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]超级夜总会20180512.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6307/[阳光电影-www.ygdy8.com]超级夜总会20180519.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6314/[阳光电影-www.ygdy8.com]超级夜总会20180526.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6292/[阳光电影-www.ygdy8.com]超级夜总会20180505.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]超级夜总会20180512.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6307/[阳光电影-www.ygdy8.com]超级夜总会20180519.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6314/[阳光电影-www.ygdy8.com]超级夜总会20180526.mp4', 'admin', '', 'C', 10.0, 1, 0);
