INSERT INTO `gx_video` VALUES (7871, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6292/[阳光电影-www.ygdy8.com]天天向上2080506.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6314/[阳光电影-www.ygdy8.com]天天向上2080528.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6292/[阳光电影-www.ygdy8.com]天天向上2080506.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6314/[阳光电影-www.ygdy8.com]天天向上2080528.mkv', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7872, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>由优酷、天猫、微博、巨匠出品，联手灿星制作的 2018 年开年综艺《这！就是街舞》，将于优酷全网首播，是一档大型街舞真人秀节目。 \u3000\u3000节目选用“明星导师+专业舞者真人秀”的全新赛制颠覆所有传统舞蹈节目模式，通过“大海选”吸纳优秀街舞舞者，设置“舞者近身斗舞”、“世界顶级街舞大师及国内一线明星带队PK”、“国际顶级街舞大师为参赛者定制个人街舞秀”等环节，再辅以专业的舞台灯光布景设计，全方位打造极致舞美，借街舞的内核重新定义年轻人的文化。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fp1v6b9ec2j20fa0r6go6.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6292/[阳光电影-www.ygdy8.com]这就是街舞20180505.mp4\njavascript:void(0);/*1526275270978*/', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6292/[阳光电影-www.ygdy8.com]这就是街舞20180505.mp4\njavascript:void(0);/*1526275270978*/', 'admin', '', 'Z', 10.0, 1, 0);
