INSERT INTO `gx_video` VALUES (7875, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]综艺玩很大20180505.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]综艺玩很大20180512.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]综艺玩很大20180519.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6314/[阳光电影-www.ygdy8.com]综艺玩很大20180526.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]综艺玩很大20180505.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]综艺玩很大20180512.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]综艺玩很大20180519.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6314/[阳光电影-www.ygdy8.com]综艺玩很大20180526.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7876, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]天才冲冲冲20180505.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]天才冲冲冲20180512.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]天才冲冲冲20180519.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6314/[阳光电影-www.ygdy8.com]天才冲冲冲20180526.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]天才冲冲冲20180505.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]天才冲冲冲20180512.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]天才冲冲冲20180519.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6314/[阳光电影-www.ygdy8.com]天才冲冲冲20180526.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7877, 4, '高能少年团第二季', '', '', '#FF0000', '', '', '<p>《高能少年团第二季》是浙江卫视推出的偶像对抗挑战真人秀，由浙江卫视战略发展中心核心主创人员与厚海文化、北文传媒等联合制作，战略发展中心监制，由王俊凯、董子健、杨紫、张一山、王大陆担任MC。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fe9b95q6euj208c0ciadk.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]高能少年团第二季20180505.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]高能少年团第二季20180512.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]高能少年团第二季20180519.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6313/[阳光电影-www.ygdy8.com]高能少年团第二季20180526.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]高能少年团第二季20180505.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]高能少年团第二季20180512.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]高能少年团第二季20180519.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6313/[阳光电影-www.ygdy8.com]高能少年团第二季20180526.mkv', 'admin', '', 'G', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7878, 4, '我是大侦探', '', '', '#FF0000', '', '', '<p>《我是大侦探》是湖南卫视和芒果TV共同打造的大型情境类益智互动推理秀，由《明星大侦探》原版人马倾情打造，节目秉承电影级高品质的精良制作水准，以调动“全民动脑”为首要宗旨，再加入极致夸张逗趣的明星角色扮演等综艺元素。每期集结6位超强阵容高能玩家，解锁层层悬念，找出关键人物K，引发全民推理热潮。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fpp34qqqaaj20go0b3dh3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]我是大侦探20180505.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]我是大侦探20180519.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6313/[阳光电影-www.ygdy8.com]我是大侦探20180526.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]我是大侦探20180505.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]我是大侦探20180519.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6313/[阳光电影-www.ygdy8.com]我是大侦探20180526.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7879, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]快乐大本营20180505.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]快乐大本营20180512.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]快乐大本营20180519.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6313/[阳光电影-www.ygdy8.com]快乐大本营20180526.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]快乐大本营20180505.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]快乐大本营20180512.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]快乐大本营20180519.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6313/[阳光电影-www.ygdy8.com]快乐大本营20180526.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7880, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]非诚勿扰20180505.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]非诚勿扰20180512.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]非诚勿扰20180519.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6313/[阳光电影-www.ygdy8.com]非诚勿扰20180526.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]非诚勿扰20180505.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]非诚勿扰20180512.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]非诚勿扰20180519.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6313/[阳光电影-www.ygdy8.com]非诚勿扰20180526.mkv', 'admin', '', 'F', 10.0, 1, 0);
