INSERT INTO `gx_video` VALUES (7891, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6286/[阳光电影-www.ygdy8.com]娱乐百分百20180501.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6287/[阳光电影-www.ygdy8.com]娱乐百分百20180502.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6288/[阳光电影-www.ygdy8.com]娱乐百分百20180503.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6290/[阳光电影-www.ygdy8.com]娱乐百分百20180504.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6291/[阳光电影-www.ygdy8.com]娱乐百分百20180505.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6293/[阳光电影-www.ygdy8.com]娱乐百分百20180507.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6294/[阳光电影-www.ygdy8.com]娱乐百分百20180508.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6295/[阳光电影-www.ygdy8.com]娱乐百分百20180509.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6296/[阳光电影-www.ygdy8.com]娱乐百分百20180510.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]娱乐百分百20180511.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6298/[阳光电影-www.ygdy8.com]娱乐百分百20180512.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6300/[阳光电影-www.ygdy8.com]娱乐百分百20180514.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6302/[阳光电影-www.ygdy8.com]娱乐百分百20180515.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6302/[阳光电影-www.ygdy8.com]娱乐百分百20180516.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6305/[阳光电影-www.ygdy8.com]娱乐百分百20180517.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6305/[阳光电影-www.ygdy8.com]娱乐百分百20180518.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6306/[阳光电影-www.ygdy8.com]娱乐百分百20180519.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6308/[阳光电影-www.ygdy8.com]娱乐百分百20180521.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6309/[阳光电影-www.ygdy8.com]娱乐百分百20180522.mp4\nftp://