INSERT INTO `gx_video` VALUES (7895, 4, '嗨！唱起来', '', '', '#FF0000', '', '', '<p>《嗨！唱起来》采用星素合唱的形式，来一次“全民共唱”。100个素人歌手将通过现场的“K歌”获得机会成为三位幸运歌手，与每期现场的大咖歌手进行合唱挑战，从而一步步接近自己的梦想。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fqtt8qrt3ej20fd08ojs2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6283/[阳光电影-www.ygdy8.com]嗨唱起来20180427.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6283/[阳光电影-www.ygdy8.com]嗨唱起来20180427.mkv', 'admin', '', 'H', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7896, 4, '我想和你唱 第三季', '', '', '#FF0000', '', '', '<p>《我想和你唱 第三季》是湖南卫视推出的的大型互动音乐综艺节目，由汪涵、韩红担任主持人。节目每期都会邀请知名歌坛巨星来跟素人合唱，延续前两季“星素结合、最强互动、全民嗨唱、轻松好玩”的模式。2018年4月28日起，每周五20:20在湖南卫视播出。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1ff65y7mrcbj20dw07uwes.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6283/[阳光电影-www.ygdy8.com]我想和你唱第三季20180428.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6283/[阳光电影-www.ygdy8.com]我想和你唱第三季20180428.mkv', 'admin', '', 'W', 10.0, 1, 0);
