INSERT INTO `gx_video` VALUES (7904, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]综艺玩很大20180407.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6268/[阳光电影-www.ygdy8.com]综艺玩很大20180414.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]综艺玩很大20180421.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6282/[阳光电影-www.ygdy8.com]综艺玩很大20180428.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]综艺玩很大20180407.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6268/[阳光电影-www.ygdy8.com]综艺玩很大20180414.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]综艺玩很大20180421.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6282/[阳光电影-www.ygdy8.com]综艺玩很大20180428.mp4', 'admin', '', 'Z', 10.0, 1, 0);
