INSERT INTO `gx_video` VALUES (7907, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]天才冲冲冲20180407.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6268/[阳光电影-www.ygdy8.com]天才冲冲冲20180414.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]天才冲冲冲20180421.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6282/[阳光电影-www.ygdy8.com]天才冲冲冲20180428.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]天才冲冲冲20180407.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6268/[阳光电影-www.ygdy8.com]天才冲冲冲20180414.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]天才冲冲冲20180421.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6282/[阳光电影-www.ygdy8.com]天才冲冲冲20180428.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7908, 4, '认识的哥哥', '', '', '#FF0000', '', '', '<p>《认识的哥哥》节目是根据主题不同，以存在于人生中，虽不是很重大，却会让人好奇不已，不得到答案就浑身不自在的问题为主题，通过各种方式为其寻求解答的综艺节目。<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fdljka0l66j20rs09x14w.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]认识的哥哥20180407.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6267/[阳光电影-www.ygdy8.com]认识的哥哥20180414.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]认识的哥哥20180428.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]认识的哥哥20180407.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6267/[阳光电影-www.ygdy8.com]认识的哥哥20180414.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]认识的哥哥20180428.mkv', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7909, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]无限挑战20180407.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]无限挑战20180407.mkv ', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7910, 4, '我是大侦探', '', '', '#FF0000', '', '', '<p>《我是大侦探》是湖南卫视和芒果TV共同打造的大型情境类益智互动推理秀，由《明星大侦探》原版人马倾情打造，节目秉承电影级高品质的精良制作水准，以调动“全民动脑”为首要宗旨，再加入极致夸张逗趣的明星角色扮演等综艺元素。每期集结6位超强阵容高能玩家，解锁层层悬念，找出关键人物K，引发全民推理热潮。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fpp34qqqaaj20go0b3dh3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]我是大侦探20180407.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6267/[阳光电影-www.ygdy8.com]我是大侦探20180414.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]我是大侦探20180421.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]我是大侦探20180429.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]我是大侦探20180407.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6267/[阳光电影-www.ygdy8.com]我是大侦探20180414.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]我是大侦探20180421.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]我是大侦探20180429.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7911, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>中国新相亲，东方卫视将推出一档全新代际相亲交友节目。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fnpavl01daj20b50a7n1w.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]中国新相亲20180407.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6267/[阳光电影-www.ygdy8.com]中国新相亲20180414.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]中国新相亲20180407.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6267/[阳光电影-www.ygdy8.com]中国新相亲20180414.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7912, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]快乐大本营20180407.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6267/[阳光电影-www.ygdy8.com]快乐大本营20180414.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]快乐大本营20180421.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]快乐大本营20180429.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]快乐大本营20180407.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6267/[阳光电影-www.ygdy8.com]快乐大本营20180414.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]快乐大本营20180421.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]快乐大本营20180429.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7913, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]非诚勿扰20180407.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6267/[阳光电影-www.ygdy8.com]非诚勿扰20180414.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]非诚勿扰20180421.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6283/[阳光电影-www.ygdy8.com]非诚勿扰20180428.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]非诚勿扰20180407.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6267/[阳光电影-www.ygdy8.com]非诚勿扰20180414.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]非诚勿扰20180421.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6283/[阳光电影-www.ygdy8.com]非诚勿扰20180428.mkv', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7914, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>由优酷、天猫、微博、巨匠出品，联手灿星制作的 2018 年开年综艺《这！就是街舞》，将于优酷全网首播，是一档大型街舞真人秀节目。 \u3000\u3000节目选用“明星导师+专业舞者真人秀”的全新赛制颠覆所有传统舞蹈节目模式，通过“大海选”吸纳优秀街舞舞者，设置“舞者近身斗舞”、“世界顶级街舞大师及国内一线明星带队PK”、“国际顶级街舞大师为参赛者定制个人街舞秀”等环节，再辅以专业的舞台灯光布景设计，全方位打造极致舞美，借街舞的内核重新定义年轻人的文化。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fp1v6b9ec2j20fa0r6go6.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]这就是街舞20180407.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6276/[阳光电影-www.ygdy8.com]这就是街舞20180421.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6283/[阳光电影-www.ygdy8.com]这就是街舞20180428.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]这就是街舞20180407.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6276/[阳光电影-www.ygdy8.com]这就是街舞20180421.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6283/[阳光电影-www.ygdy8.com]这就是街舞20180428.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7915, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>爱奇艺出品、新浪微博联合出品的《热血街舞团》，由爱奇艺高级副总裁陈伟担任总监制，爱奇艺副总裁车澈担任总导演，音乐制作人刘洲出任节目音乐总监，同时节目组还邀请到著名舞美设计师唐焱担任视觉总监。\n<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fpp355ubznj20f009x13a.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]热血街舞团20180407.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6276/[阳光电影-www.ygdy8.com]热血街舞团20180421.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]热血街舞团20180428.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]热血街舞团20180407.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6276/[阳光电影-www.ygdy8.com]热血街舞团20180421.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]热血街舞团20180428.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7916, 4, '偶像练习生', '', '', '#FF0000', '', '', '<p>《偶像练习生》是爱奇艺重点打造的中国首档偶像男团竞演养成类真人秀，张艺兴将担任”全民制作人代表“。 《偶像练习生》节目将从国内外各大经纪公司、练习生公司推荐选拔100名练习生，在未来的4个多月中进行封闭式训练及录制，最终由全民票选出优胜9人，组成全新偶像男团出道。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1fnmwm633vvj206y09qdgd.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]偶像练习生20180406.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]偶像练习生20180406.mp4 ', 'admin', '', 'O', 10.0, 1, 0);
