INSERT INTO `gx_video` VALUES (7918, 4, '王牌对王牌', '', '', '#FF0000', '', '', '<p>《王牌对王牌》是浙江卫视推出的大型原创室内竞技真人秀节目，每期围绕一个主题，邀请两支王牌团队，由两队固定队长各带领多名热门IP嘉宾进行PK对战，通过才艺比拼、游戏竞技，决出王牌中的王牌。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fby47cjo99j203d03d748.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6259/[阳光电影-www.ygdy8.com]王牌对王牌第三季20180406.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6266/[阳光电影-www.ygdy8.com]王牌对王牌第三季20180413.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6259/[阳光电影-www.ygdy8.com]王牌对王牌第三季20180406.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6266/[阳光电影-www.ygdy8.com]王牌对王牌第三季20180413.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7919, 4, '二十四小时', '', '', '#FF0000', '', '', '<p>《二十四小时》第三季是浙江卫视携手盛唐时空出品制作的大型原创连续剧悬念式户外真人秀节目，节目共12期。第三季固定嘉宾：林志颖、余文乐、白敬亭、林允、魏大勋、胡一天、熊梓淇。 \u3000\u3000《二十四小时》第三季将续写郑和下西洋的传奇历程，第一视角再现“海上丝绸之路”的雄伟壮丽，在寓教于乐的比拼中弘扬中华传统文化。“时空水手”们将分为两组，开启24小时限时比拼模式，更有神秘飞行嘉宾助阵，24小时倒计时一触即发。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fobdrlvf9nj206y09qgmm.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6259/[阳光电影-www.ygdy8.com]二十四小时第三季20180406.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6269/[阳光电影-www.ygdy8.com]二十四小时第三季20180414.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6259/[阳光电影-www.ygdy8.com]二十四小时第三季20180406.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6269/[阳光电影-www.ygdy8.com]二十四小时第三季20180414.mp4', 'admin', '', 'E', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7920, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2014年1月3日，《最强大脑》作为国内首档科学真人秀节目在江苏卫视隆重开播。百度创始人李彦宏搭档音乐才子周杰伦亮相首期节目，并与陶晶莹、梁冬、李永波、魏坤琳四位跨界评审共同找寻中国“最强大脑”。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1ec81qo4zz5j20yg0jowii.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6259/[阳光电影-www.ygdy8.com]最强大脑第五季20180406.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6266/[阳光电影-www.ygdy8.com]最强大脑第五季20180413.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6259/[阳光电影-www.ygdy8.com]最强大脑第五季20180406.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6266/[阳光电影-www.ygdy8.com]最强大脑第五季20180413.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7921, 4, '歌手2018', '', '', '#FF0000', '', '', '<p>《歌手2018》是湖南卫视推出的音乐竞技节目，由湖南卫视节目中心制作。首发阵容为汪峰、Jessie J（婕西·J）、李圣杰、张韶涵、Gai、张天、李晓东（李丰溢）。 节目每期邀请专业歌手之间进行歌唱竞赛，并提供平等竞技舞台，巧妙地利用视听符号，用心营造视听盛宴。 该节目于2018年1月12日起每周五22:00在湖南卫视首播。由张韶涵担任该节目的首位女性音乐串讲人。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fc7xi9ya2yj20mp0ezatu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6259/[阳光电影-www.ygdy8.com]歌手第二季20180406.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6266/[阳光电影-www.ygdy8.com]歌手第二季20180413.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6274/[阳光电影-www.ygdy8.com]歌手第二季20180420.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6259/[阳光电影-www.ygdy8.com]歌手第二季20180406.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6266/[阳光电影-www.ygdy8.com]歌手第二季20180413.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6274/[阳光电影-www.ygdy8.com]歌手第二季20180420.mkv', 'admin', '', 'G', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7922, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6259/[阳光电影-www.ygdy8.com]天天向上2080406.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6266/[阳光电影-www.ygdy8.com]天天向上2080413.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6259/[阳光电影-www.ygdy8.com]天天向上2080406.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6266/[阳光电影-www.ygdy8.com]天天向上2080413.mkv', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7923, 4, '妈妈是超人第3季', '', '', '#FF0000', '', '', '<p>《妈妈是超人第3季》是一档明星育儿生活全景观察记，3月22日起中午十二点将在爱奇艺正式上线。节目集结了贾静雯、霍思燕、黄圣依、邓莎明星妈妈，她们将在节目中展示最原汁原味的家庭生活和最真性情的育儿经历。 \u200b\u200b\u200b\u200b<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fpuoypsceij20r8078dg3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6257/[阳光电影-www.ygdy8.com]妈妈是超人20180405.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6266/[阳光电影-www.ygdy8.com]妈妈是超人20180412.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]妈妈是超人20180419.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6257/[阳光电影-www.ygdy8.com]妈妈是超人20180405.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6266/[阳光电影-www.ygdy8.com]妈妈是超人20180412.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]妈妈是超人20180419.mp4', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7924, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>凤凰中文台军情观察室节目坐阵曾有“情报收集中心”之称的香港紧贴每周的全球热点军事话题以丰富、有趣的电视动画以及快节奏播报大量信息的方式为您搜罗军事情报同时请来军事专家对热点话题进行深度地分析与解读。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e8bbkka8mkj20700a0weu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6257/[阳光电影-www.ygdy8.com]军情观察室20180404.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6264/[阳光电影-www.ygdy8.com]军情观察室20180411.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6273/[阳光电影-www.ygdy8.com]军情观察室20180418.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6257/[阳光电影-www.ygdy8.com]军情观察室20180404.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6264/[阳光电影-www.ygdy8.com]军情观察室20180411.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6273/[阳光电影-www.ygdy8.com]军情观察室20180418.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7925, 4, '一周的偶像', '', '', '#FF0000', '', '', '<p>《一周的偶像》是一档室内访谈节目，由韩国资深娱乐节目主持人郑亨敦与嘻哈歌手Defconn双人组合共同主持，针对最新韩流发烧娱乐话题，每集专访一组粉丝最爱的偶像团体。主持人与偶像成员的快问快答，充满爆笑与即时性的综艺效果。另外，节目亲临偶像出没场所，对粉丝公开偶像地图，且用监视摄影机，偷偷记录偶像们面对突发状况的行为反应，每周带来韩流偶像难得一见的模样。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fha33ejy23j205k08c757.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6257/[阳光电影-www.ygdy8.com]一周的偶像20180404.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6264/[阳光电影-www.ygdy8.com]一周的偶像20180411.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6272/[阳光电影-www.ygdy8.com]一周的偶像20180418.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6280/[阳光电影-www.ygdy8.com]一周的偶像20180425.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6257/[阳光电影-www.ygdy8.com]一周的偶像20180404.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6264/[阳光电影-www.ygdy8.com]一周的偶像20180411.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6272/[阳光电影-www.ygdy8.com]一周的偶像20180418.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6280/[阳光电影-www.ygdy8.com]一周的偶像20180425.mkv', 'admin', '', 'Y', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7926, 4, '鲁豫有约', '', '', '#FF0000', '', '', '<p>《鲁豫有约》为香港凤凰卫视的电视谈话性节目，凤凰卫视于1998年开播，后进入中国大陆电视，在各个地方电视台播出，2008年湖南卫视购买中国大陆区独播版权并与4月14日开始播出。2010年1月4日，《鲁豫有约》登陆安徽卫视，每周一到周五的晚间21：27分播出。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e6c74wy6s8j20fd08lwf1.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6255/[阳光电影-www.ygdy8.com]鲁豫有约20180403.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6257/[阳光电影-www.ygdy8.com]鲁豫有约20180404.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6271/[阳光电影-www.ygdy8.com]鲁豫有约20180417.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6272/[阳光电影-www.ygdy8.com]鲁豫有约20180418.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6273/[阳光电影-www.ygdy8.com]鲁豫有约20180419.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6278/[阳光电影-www.ygdy8.com]鲁豫有约20180424.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6280/[阳光电影-www.ygdy8.com]鲁豫有约20180425.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6280/[阳光电影-www.ygdy8.com]鲁豫有约20180426.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6255/[阳光电影-www.ygdy8.com]鲁豫有约20180403.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6257/[阳光电影-www.ygdy8.com]鲁豫有约20180404.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6271/[阳光电影-www.ygdy8.com]鲁豫有约20180417.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6272/[阳光电影-www.ygdy8.com]鲁豫有约20180418.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6273/[阳光电影-www.ygdy8.com]鲁豫有约20180419.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6278/[阳光电影-www.ygdy8.com]鲁豫有约20180424.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6280/[阳光电影-www.ygdy8.com]鲁豫有约20180425.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6280/[阳光电影-www.ygdy8.com]鲁豫有约20180426.mp4', 'admin', '', 'L', 10.0, 1, 0);
