INSERT INTO `gx_video` VALUES (7928, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]娱乐百分百20180402.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6255/[阳光电影-www.ygdy8.com]娱乐百分百20180403.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6258/[阳光电影-www.ygdy8.com]娱乐百分百20180404.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6258/[阳光电影-www.ygdy8.com]娱乐百分百20180405.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]娱乐百分百20180406.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6260/[阳光电影-www.ygdy8.com]娱乐百分百20180407.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6262/[阳光电影-www.ygdy8.com]娱乐百分百20180409.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6263/[阳光电影-www.ygdy8.com]娱乐百分百20180410.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6264/[阳光电影-www.ygdy8.com]娱乐百分百20180411.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6265/[阳光电影-www.ygdy8.com]娱乐百分百20180412.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6266/[阳光电影-www.ygdy8.com]娱乐百分百20180413.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6268/[阳光电影-www.ygdy8.com]娱乐百分百20180414.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6269/[阳光电影-www.ygdy8.com]娱乐百分百20180416.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6272/[阳光电影-www.ygdy8.com]娱乐百分百20180417.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6272/[阳光电影-www.ygdy8.com]娱乐百分百20180418.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6273/[阳光电影-www.ygdy8.com]娱乐百分百20180419.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6274/[阳光电影-www.ygdy8.com]娱乐百分百20180420.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6275/[阳光电影-www.ygdy8.com]娱乐百分百20180421.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6277/[阳光电影-www.ygdy8.com]娱乐百分百20180423.mp4\nftp://