INSERT INTO `gx_video` VALUES (7933, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]两天一夜20180401.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6261/[阳光电影-www.ygdy8.com]两天一夜20180408.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6269/[阳光电影-www.ygdy8.com]两天一夜20180415.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6277/[阳光电影-www.ygdy8.com]两天一夜20180422.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]两天一夜20180429.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]两天一夜20180401.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6261/[阳光电影-www.ygdy8.com]两天一夜20180408.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6269/[阳光电影-www.ygdy8.com]两天一夜20180415.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6277/[阳光电影-www.ygdy8.com]两天一夜20180422.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]两天一夜20180429.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7934, 4, '人气歌谣', '', '', '#FF0000', '', '', '<p>《人气歌谣》每周日播出，主要是一个歌手的新歌和新专集得以COME BACK回归的第一平台，因此参加演出的歌手以最近一段时间的人气歌曲为主。基本形式是每周选出TAKE7进行打榜，最终选出一名周冠军，其中也穿插很多明星的COME BACK舞台。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfgw1eacv7d4jhcj20cq09a74t.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]人气歌谣20180401.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6261/[阳光电影-www.ygdy8.com]人气歌谣20180408.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6269/[阳光电影-www.ygdy8.com]人气歌谣20180415.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6277/[阳光电影-www.ygdy8.com]人气歌谣20180422.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]人气歌谣20180429.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]人气歌谣20180401.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6261/[阳光电影-www.ygdy8.com]人气歌谣20180408.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6269/[阳光电影-www.ygdy8.com]人气歌谣20180415.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6277/[阳光电影-www.ygdy8.com]人气歌谣20180422.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]人气歌谣20180429.mp4', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7935, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]RunningMan20180401.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6261/[阳光电影-www.ygdy8.com]RunningMan20180408.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6269/[阳光电影-www.ygdy8.com]RunningMan20180415.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6277/[阳光电影-www.ygdy8.com]RunningMan20180422.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]RunningMan20180429.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]RunningMan20180401.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6261/[阳光电影-www.ygdy8.com]RunningMan20180408.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6269/[阳光电影-www.ygdy8.com]RunningMan20180415.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6277/[阳光电影-www.ygdy8.com]RunningMan20180422.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]RunningMan20180429.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7936, 4, '欢乐喜剧人', '', '', '#FF0000', '', '', '<p>《欢乐喜剧人》是一档由东方卫视打造的全国首档明星喜剧竞赛真人秀节目。第四季赛制发生重大改变，将由“魔王挑战赛”和“踢馆淘汰赛”交替进行。宋小宝、岳云鹏、贾玲等众多喜剧大咖都将以“喜剧大魔王”的身份重返舞台，而后续的补位者们也非常让人期待，德云社的张云雷和杨九郎，辽宁民间艺术团的程野和丫蛋，大碗娱乐的许君聪、何欢、卜钰等都陆续来到，欢笑敬请期待！<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfgw1es598hn6szj20bh07ht9j.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]欢乐喜剧人第四季20180401.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]欢乐喜剧人第四季20180401.mkv', 'admin', '', 'H', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7937, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6253/[阳光电影-www.ygdy8.com]综艺大集合20180401.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6261/[阳光电影-www.ygdy8.com]综艺大集合20180408.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6268/[阳光电影-www.ygdy8.com]综艺大集合20180415.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6276/[阳光电影-www.ygdy8.com]综艺大集合20180422.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]综艺大集合20180429.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6253/[阳光电影-www.ygdy8.com]综艺大集合20180401.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6261/[阳光电影-www.ygdy8.com]综艺大集合20180408.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6268/[阳光电影-www.ygdy8.com]综艺大集合20180415.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6276/[阳光电影-www.ygdy8.com]综艺大集合20180422.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6284/[阳光电影-www.ygdy8.com]综艺大集合20180429.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7938, 4, '妈妈是超人第3季', '', '', '#FF0000', '', '', '<p>《妈妈是超人第3季》是一档明星育儿生活全景观察记，3月22日起中午十二点将在爱奇艺正式上线。节目集结了贾静雯、霍思燕、黄圣依、邓莎明星妈妈，她们将在节目中展示最原汁原味的家庭生活和最真性情的育儿经历。 \u200b\u200b\u200b\u200b<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fpuoypsceij20r8078dg3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6249/[阳光电影-www.ygdy8.com]妈妈是超人第三季20180322.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6249/[阳光电影-www.ygdy8.com]妈妈是超人第三季20180329.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6249/[阳光电影-www.ygdy8.com]妈妈是超人第三季20180322.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6249/[阳光电影-www.ygdy8.com]妈妈是超人第三季20180329.mp4', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7939, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>爱奇艺出品、新浪微博联合出品的《热血街舞团》，由爱奇艺高级副总裁陈伟担任总监制，爱奇艺副总裁车澈担任总导演，音乐制作人刘洲出任节目音乐总监，同时节目组还邀请到著名舞美设计师唐焱担任视觉总监。\n<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fpp355ubznj20f009x13a.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]热血街舞团20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]热血街舞团20180324.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]热血街舞团20180331.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]热血街舞团20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]热血街舞团20180324.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]热血街舞团20180331.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7940, 4, '我是大侦探', '', '', '#FF0000', '', '', '<p>《我是大侦探》是湖南卫视和芒果TV共同打造的大型情境类益智互动推理秀，由《明星大侦探》原版人马倾情打造，节目秉承电影级高品质的精良制作水准，以调动“全民动脑”为首要宗旨，再加入极致夸张逗趣的明星角色扮演等综艺元素。每期集结6位超强阵容高能玩家，解锁层层悬念，找出关键人物K，引发全民推理热潮。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fpp34qqqaaj20go0b3dh3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]我是大侦探20180324.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]我是大侦探20180331.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]我是大侦探20180324.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]我是大侦探20180331.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7941, 4, '歌手2018', '', '', '#FF0000', '', '', '<p>《歌手2018》是湖南卫视推出的音乐竞技节目，由湖南卫视节目中心制作。首发阵容为汪峰、Jessie J（婕西·J）、李圣杰、张韶涵、Gai、张天、李晓东（李丰溢）。 节目每期邀请专业歌手之间进行歌唱竞赛，并提供平等竞技舞台，巧妙地利用视听符号，用心营造视听盛宴。 该节目于2018年1月12日起每周五22:00在湖南卫视首播。由张韶涵担任该节目的首位女性音乐串讲人。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fc7xi9ya2yj20mp0ezatu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6226/[阳光电影-www.ygdy8.com]歌手第二季20180309.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6233/[阳光电影-www.ygdy8.com]歌手第二季20180316.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6242/[阳光电影-www.ygdy8.com]歌手第二季20180323.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6250/[阳光电影-www.ygdy8.com]歌手第二季20180330.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6226/[阳光电影-www.ygdy8.com]歌手第二季20180309.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6233/[阳光电影-www.ygdy8.com]歌手第二季20180316.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6242/[阳光电影-www.ygdy8.com]歌手第二季20180323.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6250/[阳光电影-www.ygdy8.com]歌手第二季20180330.mkv ', 'admin', '', 'G', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7942, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6226/[阳光电影-www.ygdy8.com]天天向上2080309.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6233/[阳光电影-www.ygdy8.com]天天向上2080316.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]天天向上20180323.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]天天向上20180330.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6226/[阳光电影-www.ygdy8.com]天天向上2080309.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6233/[阳光电影-www.ygdy8.com]天天向上2080316.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]天天向上20180323.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]天天向上20180330.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7943, 4, '一周的偶像', '', '', '#FF0000', '', '', '<p>《一周的偶像》是一档室内访谈节目，由韩国资深娱乐节目主持人郑亨敦与嘻哈歌手Defconn双人组合共同主持，针对最新韩流发烧娱乐话题，每集专访一组粉丝最爱的偶像团体。主持人与偶像成员的快问快答，充满爆笑与即时性的综艺效果。另外，节目亲临偶像出没场所，对粉丝公开偶像地图，且用监视摄影机，偷偷记录偶像们面对突发状况的行为反应，每周带来韩流偶像难得一见的模样。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fha33ejy23j205k08c757.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6224/[阳光电影-www.ygdy8.com]一周的偶像20180307.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6233/[阳光电影-www.ygdy8.com]一周的偶像20180314.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6239/[阳光电影-www.ygdy8.com]一周的偶像20180321.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6248/[阳光电影-www.ygdy8.com]一周的偶像20180328.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6224/[阳光电影-www.ygdy8.com]一周的偶像20180307.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6233/[阳光电影-www.ygdy8.com]一周的偶像20180314.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6239/[阳光电影-www.ygdy8.com]一周的偶像20180321.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6248/[阳光电影-www.ygdy8.com]一周的偶像20180328.mkv', 'admin', '', 'Y', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7944, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>凤凰中文台军情观察室节目坐阵曾有“情报收集中心”之称的香港紧贴每周的全球热点军事话题以丰富、有趣的电视动画以及快节奏播报大量信息的方式为您搜罗军事情报同时请来军事专家对热点话题进行深度地分析与解读。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e8bbkka8mkj20700a0weu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6224/[阳光电影-www.ygdy8.com]军情观察室20180307.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6239/[阳光电影-www.ygdy8.com]军情观察室20180321.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6224/[阳光电影-www.ygdy8.com]军情观察室20180307.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6239/[阳光电影-www.ygdy8.com]军情观察室20180321.mkv', 'admin', '', 'Z', 10.0, 1, 0);
