INSERT INTO `gx_video` VALUES (7947, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6222/[阳光电影-www.ygdy8.com]两天一夜20180304.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]两天一夜20180311.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6237/[阳光电影-www.ygdy8.com]两天一夜20180318.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6244/[阳光电影-www.ygdy8.com]两天一夜20180324.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6222/[阳光电影-www.ygdy8.com]两天一夜20180304.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]两天一夜20180311.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6237/[阳光电影-www.ygdy8.com]两天一夜20180318.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6244/[阳光电影-www.ygdy8.com]两天一夜20180324.mp4', 'admin', '', 'Z', 10.0, 1, 0);
