INSERT INTO `gx_video` VALUES (7949, 4, '欢乐喜剧人', '', '', '#FF0000', '', '', '<p>《欢乐喜剧人》是一档由东方卫视打造的全国首档明星喜剧竞赛真人秀节目。第四季赛制发生重大改变，将由“魔王挑战赛”和“踢馆淘汰赛”交替进行。宋小宝、岳云鹏、贾玲等众多喜剧大咖都将以“喜剧大魔王”的身份重返舞台，而后续的补位者们也非常让人期待，德云社的张云雷和杨九郎，辽宁民间艺术团的程野和丫蛋，大碗娱乐的许君聪、何欢、卜钰等都陆续来到，欢笑敬请期待！<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfgw1es598hn6szj20bh07ht9j.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6221/[阳光电影-www.ygdy8.com]欢乐喜剧人第四季20180304.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]欢乐喜剧人第四季20180311.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6221/[阳光电影-www.ygdy8.com]欢乐喜剧人第四季20180304.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]欢乐喜剧人第四季20180311.mp4', 'admin', '', 'H', 10.0, 1, 0);
