INSERT INTO `gx_video` VALUES (7955, 4, '三个院子', '', '', '#FF0000', '', '', '<p>《三个院子》是一档提倡“共享生活”概念的观察体验真人秀节目，将于2017年第四季度在江苏卫视播出。 节目中三对不同关系的明星，作为“Life Sharing”发起人，分别入住三个院子，接待一群性格各异的客人，林更新、陈赫、陈小春和大张伟和他们最亲昵的人，将与素人一同分享百态人生，在共享中品味生活意义，该剧于2017年12月17日在江苏卫视首播。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fmsy0zbf5cj208706hmxc.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6221/[阳光电影-www.ygdy8.com]三个院子20180304.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6221/[阳光电影-www.ygdy8.com]三个院子20180304.mkv', 'admin', '', 'S', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7956, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>由优酷、天猫、微博、巨匠出品，联手灿星制作的 2018 年开年综艺《这！就是街舞》，将于优酷全网首播，是一档大型街舞真人秀节目。 \u3000\u3000节目选用“明星导师+专业舞者真人秀”的全新赛制颠覆所有传统舞蹈节目模式，通过“大海选”吸纳优秀街舞舞者，设置“舞者近身斗舞”、“世界顶级街舞大师及国内一线明星带队PK”、“国际顶级街舞大师为参赛者定制个人街舞秀”等环节，再辅以专业的舞台灯光布景设计，全方位打造极致舞美，借街舞的内核重新定义年轻人的文化。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fp1v6b9ec2j20fa0r6go6.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6221/[阳光电影-www.ygdy8.com]这就是街舞20180303.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6235/[阳光电影-www.ygdy8.com]这就是街舞20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6239/[阳光电影-www.ygdy8.com]这就是街舞20180320.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]这就是街舞20180324.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]这就是街舞20180331.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6221/[阳光电影-www.ygdy8.com]这就是街舞20180303.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6235/[阳光电影-www.ygdy8.com]这就是街舞20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6239/[阳光电影-www.ygdy8.com]这就是街舞20180320.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]这就是街舞20180324.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]这就是街舞20180331.mp4', 'admin', '', 'Z', 10.0, 1, 0);
