INSERT INTO `gx_video` VALUES (7958, 4, '超级夜总会', '', '', '#FF0000', '', '', '<p>《超级夜总会》是三立电视台独立制作的一档综艺娱乐节目，以歌曲演唱、幽默情景剧、户外与观众近距离互动为主要元素，是台湾第一个电视台出动大型舞台车至各县市镇、乡、村的著名观光景点、夜市、庙宇录制的节目。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3hdcxn0doj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6221/[阳光电影-www.ygdy8.com]超夜20180303.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]超级夜总会20180310.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6237/[阳光电影-www.ygdy8.com]超级夜总会20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6244/[阳光电影-www.ygdy8.com]超级夜总会20180324.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]超夜-20180331.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6221/[阳光电影-www.ygdy8.com]超夜20180303.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]超级夜总会20180310.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6237/[阳光电影-www.ygdy8.com]超级夜总会20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6244/[阳光电影-www.ygdy8.com]超级夜总会20180324.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6254/[阳光电影-www.ygdy8.com]超夜-20180331.mp4', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7959, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]无限挑战20180303.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6227/[阳光电影-www.ygdy8.com]无限挑战20180310.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6235/[阳光电影-www.ygdy8.com]无限挑战20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]无限挑战20180324.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]无限挑战20180331.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]无限挑战20180303.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6227/[阳光电影-www.ygdy8.com]无限挑战20180310.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6235/[阳光电影-www.ygdy8.com]无限挑战20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]无限挑战20180324.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]无限挑战20180331.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7960, 4, '声临其境', '', '', '#FF0000', '', '', '<p>《声临其境》是中国首档原创声音魅力竞演秀。节目以台词和配音为切入点，每期邀请四组台词功底深厚或是声音动听的演员和配音演员同台竞声。 节目于2018年1月6日晚10点在湖南卫视播出。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1fn87dr9esdj208h09l0t0.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]声临其境20180303.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6228/[阳光电影-www.ygdy8.com]声临其境20180310.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6235/[阳光电影-www.ygdy8.com]声临其境20180317.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]声临其境20180303.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6228/[阳光电影-www.ygdy8.com]声临其境20180310.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6235/[阳光电影-www.ygdy8.com]声临其境20180317.mkv', 'admin', '', 'S', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7961, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6228/[阳光电影-www.ygdy8.com]快乐大本营20180310.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6234/[阳光电影-www.ygdy8.com]快乐大本营20180317.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]快乐大本营20180324.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]快乐大本营20180331.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6228/[阳光电影-www.ygdy8.com]快乐大本营20180310.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6234/[阳光电影-www.ygdy8.com]快乐大本营20180317.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]快乐大本营20180324.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]快乐大本营20180331.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7962, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]非诚勿扰20180303.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]非诚勿扰20180310.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6235/[阳光电影-www.ygdy8.com]非诚勿扰20180317.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]非诚勿扰20180324.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]非诚勿扰20180331.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]非诚勿扰20180303.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]非诚勿扰20180310.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6235/[阳光电影-www.ygdy8.com]非诚勿扰20180317.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]非诚勿扰20180324.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]非诚勿扰20180331.mkv', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7963, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]天才冲冲冲20180303.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]天才冲冲冲20180310.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6234/[阳光电影-www.ygdy8.com]天才冲冲冲20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6245/[阳光电影-www.ygdy8.com]天才冲冲冲-20180324.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]天才冲冲冲20180331.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]天才冲冲冲20180303.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]天才冲冲冲20180310.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6234/[阳光电影-www.ygdy8.com]天才冲冲冲20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6245/[阳光电影-www.ygdy8.com]天才冲冲冲-20180324.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]天才冲冲冲20180331.mp4', 'admin', '', 'T', 10.0, 1, 0);
