INSERT INTO `gx_video` VALUES (7965, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]综艺玩很大20180303.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]综艺玩很大20180310.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6234/[阳光电影-www.ygdy8.com]综艺玩很大20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]综艺玩很大20180324.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]综艺玩很大20180331.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]综艺玩很大20180303.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]综艺玩很大20180310.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6234/[阳光电影-www.ygdy8.com]综艺玩很大20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6243/[阳光电影-www.ygdy8.com]综艺玩很大20180324.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6252/[阳光电影-www.ygdy8.com]综艺玩很大20180331.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7966, 4, '二十四小时', '', '', '#FF0000', '', '', '<p>《二十四小时》第三季是浙江卫视携手盛唐时空出品制作的大型原创连续剧悬念式户外真人秀节目，节目共12期。第三季固定嘉宾：林志颖、余文乐、白敬亭、林允、魏大勋、胡一天、熊梓淇。 \u3000\u3000《二十四小时》第三季将续写郑和下西洋的传奇历程，第一视角再现“海上丝绸之路”的雄伟壮丽，在寓教于乐的比拼中弘扬中华传统文化。“时空水手”们将分为两组，开启24小时限时比拼模式，更有神秘飞行嘉宾助阵，24小时倒计时一触即发。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fobdrlvf9nj206y09qgmm.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]二十四小时第三季20180302.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6226/[阳光电影-www.ygdy8.com]二十四小时第三季20180309.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6233/[阳光电影-www.ygdy8.com]二十四小时第三季20180316.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6242/[阳光电影-www.ygdy8.com]二十四小时第三季20180323.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]二十四小时第三季20180302.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6226/[阳光电影-www.ygdy8.com]二十四小时第三季20180309.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6233/[阳光电影-www.ygdy8.com]二十四小时第三季20180316.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6242/[阳光电影-www.ygdy8.com]二十四小时第三季20180323.mkv', 'admin', '', 'E', 10.0, 1, 0);
