INSERT INTO `gx_video` VALUES (7969, 4, '偶像练习生', '', '', '#FF0000', '', '', '<p>《偶像练习生》是爱奇艺重点打造的中国首档偶像男团竞演养成类真人秀，张艺兴将担任”全民制作人代表“。 《偶像练习生》节目将从国内外各大经纪公司、练习生公司推荐选拔100名练习生，在未来的4个多月中进行封闭式训练及录制，最终由全民票选出优胜9人，组成全新偶像男团出道。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1fnmwm633vvj206y09qdgd.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6218/[阳光电影-www.ygdy8.com]偶像练习生20180302.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6226/[阳光电影-www.ygdy8.com]偶像练习生20180309.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6233/[阳光电影-www.ygdy8.com]偶像练习生20180316.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6250/[阳光电影-www.ygdy8.com]偶像练习生20180330.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6218/[阳光电影-www.ygdy8.com]偶像练习生20180302.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6226/[阳光电影-www.ygdy8.com]偶像练习生20180309.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6233/[阳光电影-www.ygdy8.com]偶像练习生20180316.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6250/[阳光电影-www.ygdy8.com]偶像练习生20180330.mp4', 'admin', '', 'O', 10.0, 1, 0);
