INSERT INTO `gx_video` VALUES (7972, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6217/[阳光电影-www.ygdy8.com]娱乐百分百20180301.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]娱乐百分百20180302.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6219/[阳光电影-www.ygdy8.com]娱乐百分百20180303.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6222/[阳光电影-www.ygdy8.com]娱乐百分百20180305.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6223/[阳光电影-www.ygdy8.com]娱乐百分百20180306.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6224/[阳光电影-www.ygdy8.com]娱乐百分百20180307.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6225/[阳光电影-www.ygdy8.com]娱乐百分百20180308.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6226/[阳光电影-www.ygdy8.com]娱乐百分百20180309.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]娱乐百分百20180310.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6229/[阳光电影-www.ygdy8.com]娱乐百分百20180312.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6230/[阳光电影-www.ygdy8.com]娱乐百分百20180313.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6231/[阳光电影-www.ygdy8.com]娱乐百分百20180314.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6232/[阳光电影-www.ygdy8.com]娱乐百分百20180315.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6233/[阳光电影-www.ygdy8.com]娱乐百分百20180316.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6234/[阳光电影-www.ygdy8.com]娱乐百分百20180317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6237/[阳光电影-www.ygdy8.com]娱乐百分百20180319.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6238/[阳光电影-www.ygdy8.com]娱乐百分百20180320.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6239/[阳光电影-www.ygdy8.com]娱乐百分百20180321.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6240/[阳光电影-www.ygdy8.com]娱乐百分百20180322.mp4\nftp://