INSERT INTO `gx_video` VALUES (7980, 4, '二十四小时', '', '', '#FF0000', '', '', '<p>《二十四小时》第三季是浙江卫视携手盛唐时空出品制作的大型原创连续剧悬念式户外真人秀节目，节目共12期。第三季固定嘉宾：林志颖、余文乐、白敬亭、林允、魏大勋、胡一天、熊梓淇。 \u3000\u3000《二十四小时》第三季将续写郑和下西洋的传奇历程，第一视角再现“海上丝绸之路”的雄伟壮丽，在寓教于乐的比拼中弘扬中华传统文化。“时空水手”们将分为两组，开启24小时限时比拼模式，更有神秘飞行嘉宾助阵，24小时倒计时一触即发。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fobdrlvf9nj206y09qgmm.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]二十四小时第三季20180202.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]二十四小时第三季20180209.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6205/[阳光电影-www.ygdy8.com]二十四小时第三季20180216.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]二十四小时第三季20180223.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]二十四小时第三季20180202.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]二十四小时第三季20180209.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6205/[阳光电影-www.ygdy8.com]二十四小时第三季20180216.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]二十四小时第三季20180223.mkv', 'admin', '', 'E', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7981, 4, '重返地球', '', '', '#FF0000', '', '', '<p>《重返地球》是芒果TV自制的国内首档超时空生存实验剧，以末世科幻为背景，融合了密室逃脱，悬疑推理等多元素。十一位地球之子与张亮饰演的第一期地球之子相遇，他们需要齐心协力在充满傀儡的基地里完成多重任务，与地球及太空总部取得联系，并摧毁傀儡生存系统逃离危险境地。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfly1fnvhnlp3l0j206z09kjwp.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]重返地球20180209.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]重返地球20180209.mp4', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7982, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>凤凰中文台军情观察室节目坐阵曾有“情报收集中心”之称的香港紧贴每周的全球热点军事话题以丰富、有趣的电视动画以及快节奏播报大量信息的方式为您搜罗军事情报同时请来军事专家对热点话题进行深度地分析与解读。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e8bbkka8mkj20700a0weu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6197/[阳光电影-www.ygdy8.com]军情观察室20180207.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6197/[阳光电影-www.ygdy8.com]军情观察室20180207.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7983, 4, '欢乐喜剧人', '', '', '#FF0000', '', '', '<p>《欢乐喜剧人》是一档由东方卫视打造的全国首档明星喜剧竞赛真人秀节目。第四季赛制发生重大改变，将由“魔王挑战赛”和“踢馆淘汰赛”交替进行。宋小宝、岳云鹏、贾玲等众多喜剧大咖都将以“喜剧大魔王”的身份重返舞台，而后续的补位者们也非常让人期待，德云社的张云雷和杨九郎，辽宁民间艺术团的程野和丫蛋，大碗娱乐的许君聪、何欢、卜钰等都陆续来到，欢笑敬请期待！<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfgw1es598hn6szj20bh07ht9j.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6197/[阳光电影-www.ygdy8.com]欢乐喜剧人20180207.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6202/[阳光电影-www.ygdy8.com]欢乐喜剧人20180213.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]欢乐喜剧人第四季20180218.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6215/[阳光电影-www.ygdy8.com]欢乐喜剧人第四季20180225.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6197/[阳光电影-www.ygdy8.com]欢乐喜剧人20180207.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6202/[阳光电影-www.ygdy8.com]欢乐喜剧人20180213.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]欢乐喜剧人第四季20180218.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6215/[阳光电影-www.ygdy8.com]欢乐喜剧人第四季20180225.mp4', 'admin', '', 'H', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7984, 4, '三个院子', '', '', '#FF0000', '', '', '<p>《三个院子》是一档提倡“共享生活”概念的观察体验真人秀节目，将于2017年第四季度在江苏卫视播出。 节目中三对不同关系的明星，作为“Life Sharing”发起人，分别入住三个院子，接待一群性格各异的客人，林更新、陈赫、陈小春和大张伟和他们最亲昵的人，将与素人一同分享百态人生，在共享中品味生活意义，该剧于2017年12月17日在江苏卫视首播。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fmsy0zbf5cj208706hmxc.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6196/[阳光电影-www.ygdy8.com]三个院子20180204.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]三个院子20180211.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]三个院子20180218.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6196/[阳光电影-www.ygdy8.com]三个院子20180204.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]三个院子20180211.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]三个院子20180218.mp4', 'admin', '', 'S', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7985, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6194/[阳光电影-www.ygdy8.com]两天一夜20180204.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]两天一夜20180211.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6194/[阳光电影-www.ygdy8.com]两天一夜20180204.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]两天一夜20180211.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7986, 4, '超人回来了', '', '', '#FF0000', '', '', '<p>《超人回来了》是KBS打造的一档亲子节目，节目讲述在没有爸爸或是妈妈陪同的情况下，大人与孩子在48小时内发生的有趣的事情。<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fdljlrbnvoj20cg0ioadf.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6194/[阳光电影-www.ygdy8.com]超人回来了20180204.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6194/[阳光电影-www.ygdy8.com]超人回来了20180204.mkv', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7987, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6194/[阳光电影-www.ygdy8.com]RunningMan20180204.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]RunningMan20180218.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6194/[阳光电影-www.ygdy8.com]RunningMan20180204.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]RunningMan20180218.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7988, 4, '人气歌谣', '', '', '#FF0000', '', '', '<p>《人气歌谣》每周日播出，主要是一个歌手的新歌和新专集得以COME BACK回归的第一平台，因此参加演出的歌手以最近一段时间的人气歌曲为主。基本形式是每周选出TAKE7进行打榜，最终选出一名周冠军，其中也穿插很多明星的COME BACK舞台。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfgw1eacv7d4jhcj20cq09a74t.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6194/[阳光电影-www.ygdy8.com]人气歌谣20180204.mkv  ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6194/[阳光电影-www.ygdy8.com]人气歌谣20180204.mkv  ', 'admin', '', 'R', 10.0, 1, 0);
