INSERT INTO `gx_video` VALUES (7990, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6193/[阳光电影-www.ygdy8.com]综艺大集合20180204.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]综艺大集合20180211.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6209/[阳光电影-www.ygdy8.com]综艺大集合20180218.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6213/[阳光电影-www.ygdy8.com]综艺大集合20180225.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6193/[阳光电影-www.ygdy8.com]综艺大集合20180204.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]综艺大集合20180211.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6209/[阳光电影-www.ygdy8.com]综艺大集合20180218.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6213/[阳光电影-www.ygdy8.com]综艺大集合20180225.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7991, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>中国新相亲，东方卫视将推出一档全新代际相亲交友节目。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fnpavl01daj20b50a7n1w.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]中国新相亲20180203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]中国新相亲20180224.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]中国新相亲20180203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]中国新相亲20180224.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7992, 4, '认识的哥哥', '', '', '#FF0000', '', '', '<p>《认识的哥哥》节目是根据主题不同，以存在于人生中，虽不是很重大，却会让人好奇不已，不得到答案就浑身不自在的问题<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fdljka0l66j20rs09x14w.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]认识的哥哥20180203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]认识的哥哥20180210.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]认识的哥哥20180217.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]认识的哥哥20180224.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]认识的哥哥20180203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]认识的哥哥20180210.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]认识的哥哥20180217.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]认识的哥哥20180224.mp4', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7993, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]无限挑战20180203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]无限挑战20180217.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]无限挑战20180218.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]无限挑战20180224.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]无限挑战20180203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]无限挑战20180217.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]无限挑战20180218.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]无限挑战20180224.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7994, 4, '综艺3国智', '', '', '#FF0000', '', '', '<p>《综艺3国智》，官方英文名3 Kingdoms，是台湾电视公司监制及首播的实境外景节目，主持人为李李仁、纳豆、王少伟、黄路梓茵、明杰、风田、Evan、Teddy、 张立东、玛丽，台视主频于2016年11月12日首播。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fh5wyh40i8j20p00eqtau.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]综艺3国智20180203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]综艺3国智20180210.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]综艺3国智20180217.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6207/[阳光电影-www.ygdy8.com]综艺3国智20180218.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]综艺3国智20180224.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]综艺3国智20180203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]综艺3国智20180210.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]综艺3国智20180217.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6207/[阳光电影-www.ygdy8.com]综艺3国智20180218.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]综艺3国智20180224.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7995, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]综艺玩很大20180203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]综艺玩很大20180210.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6204/[阳光电影-www.ygdy8.com]综艺玩很大20180216.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]综艺玩很大20180217.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]综艺玩很大20180224.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]综艺玩很大20180203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]综艺玩很大20180210.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6204/[阳光电影-www.ygdy8.com]综艺玩很大20180216.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]综艺玩很大20180217.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]综艺玩很大20180224.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7996, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]天才冲冲冲20180203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]天才冲冲冲20180210.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]天才冲冲冲20180217.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]天才冲冲冲20180224.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]天才冲冲冲20180203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]天才冲冲冲20180210.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]天才冲冲冲20180217.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]天才冲冲冲20180224.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7997, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]快乐大本营20180203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6199/[阳光电影-www.ygdy8.com]快乐大本营20180210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]快乐大本营20180217.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]快乐大本营20180224.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]快乐大本营20180203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6199/[阳光电影-www.ygdy8.com]快乐大本营20180210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]快乐大本营20180217.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]快乐大本营20180224.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7998, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]非诚勿扰20180203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6199/[阳光电影-www.ygdy8.com]非诚勿扰20180210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6205/[阳光电影-www.ygdy8.com]非诚勿扰20180216.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]非诚勿扰20180203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6199/[阳光电影-www.ygdy8.com]非诚勿扰20180210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6205/[阳光电影-www.ygdy8.com]非诚勿扰20180216.mkv', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (7999, 4, '声临其境', '', '', '#FF0000', '', '', '<p>《声临其境》是中国首档原创声音魅力竞演秀。节目以台词和配音为切入点，每期邀请四组台词功底深厚或是声音动听的演员和配音演员同台竞声。 节目于2018年1月6日晚10点在湖南卫视播出。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1fn87dr9esdj208h09l0t0.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]声临其境20180203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6199/[阳光电影-www.ygdy8.com]声临其境20180210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]声临其境20180217.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6215/[阳光电影-www.ygdy8.com]声临其境20180224.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]声临其境20180203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6199/[阳光电影-www.ygdy8.com]声临其境20180210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]声临其境20180217.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6215/[阳光电影-www.ygdy8.com]声临其境20180224.mp4', 'admin', '', 'S', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8000, 4, '偶像练习生', '', '', '#FF0000', '', '', '<p>《偶像练习生》是爱奇艺重点打造的中国首档偶像男团竞演养成类真人秀，张艺兴将担任”全民制作人代表“。 《偶像练习生》节目将从国内外各大经纪公司、练习生公司推荐选拔100名练习生，在未来的4个多月中进行封闭式训练及录制，最终由全民票选出优胜9人，组成全新偶像男团出道。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1fnmwm633vvj206y09qdgd.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]偶像练习生20180202.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]偶像练习生20180209.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]偶像练习生20180223.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]偶像练习生20180202.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]偶像练习生20180209.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]偶像练习生20180223.mp4', 'admin', '', 'O', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8001, 4, '歌手2018', '', '', '#FF0000', '', '', '<p>《歌手2018》是湖南卫视推出的音乐竞技节目，由湖南卫视节目中心制作。首发阵容为汪峰、Jessie J（婕西·J）、李圣杰、张韶涵、Gai、张天、李晓东（李丰溢）。 节目每期邀请专业歌手之间进行歌唱竞赛，并提供平等竞技舞台，巧妙地利用视听符号，用心营造视听盛宴。 该节目于2018年1月12日起每周五22:00在湖南卫视首播。由张韶涵担任该节目的首位女性音乐串讲人。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fc7xi9ya2yj20mp0ezatu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6191/[阳光电影-www.ygdy8.com]歌手第二季20180202.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6205/[阳光电影-www.ygdy8.com]歌手第二季20180216.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]歌手第二季20180223.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6191/[阳光电影-www.ygdy8.com]歌手第二季20180202.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6205/[阳光电影-www.ygdy8.com]歌手第二季20180216.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]歌手第二季20180223.mkv', 'admin', '', 'G', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8002, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2014年1月3日，《最强大脑》作为国内首档科学真人秀节目在江苏卫视隆重开播。百度创始人李彦宏搭档音乐才子周杰伦亮相首期节目，并与陶晶莹、梁冬、李永波、魏坤琳四位跨界评审共同找寻中国“最强大脑”。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1ec81qo4zz5j20yg0jowii.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6191/[阳光电影-www.ygdy8.com]最强大脑第五季20180202.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]最强大脑第五季20180209.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]最强大脑第五季20180223.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6191/[阳光电影-www.ygdy8.com]最强大脑第五季20180202.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]最强大脑第五季20180209.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]最强大脑第五季20180223.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8003, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>相比上一季的《今夜百乐门》，新二季节目在维持第一季节目现场不NG的串场模式之外，还会增加更多的新元素，比如增加第二现场，两个现场同时推进，还原更多的观众互动环节，增强节目的可看性。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fnn2bfs4ktj205j0640sq.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6191/[阳光电影-www.ygdy8.com]今夜现场秀20180202.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]今夜现场秀20180209.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]今夜现场秀20180223.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6191/[阳光电影-www.ygdy8.com]今夜现场秀20180202.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]今夜现场秀20180209.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]今夜现场秀20180223.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8004, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6191/[阳光电影-www.ygdy8.com]天天向上20180202.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]天天向上20180209.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]天天向上2080223.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6191/[阳光电影-www.ygdy8.com]天天向上20180202.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]天天向上20180209.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6212/[阳光电影-www.ygdy8.com]天天向上2080223.mkv', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8005, 4, '鲁豫有约', '', '', '#FF0000', '', '', '<p>《鲁豫有约》为香港凤凰卫视的电视谈话性节目，凤凰卫视于1998年开播，后进入中国大陆电视，在各个地方电视台播出，2008年湖南卫视购买中国大陆区独播版权并与4月14日开始播出。2010年1月4日，《鲁豫有约》登陆安徽卫视，每周一到周五的晚间21：27分播出。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e6c74wy6s8j20fd08lwf1.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6191/[阳光电影-www.ygdy8.com]鲁豫有约20180201.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6195/[阳光电影-www.ygdy8.com]鲁豫有约20180206.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6202/[阳光电影-www.ygdy8.com]鲁豫有约20180213.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6202/[阳光电影-www.ygdy8.com]鲁豫有约20180214.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6210/[阳光电影-www.ygdy8.com]鲁豫有约20180220.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6191/[阳光电影-www.ygdy8.com]鲁豫有约20180201.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6195/[阳光电影-www.ygdy8.com]鲁豫有约20180206.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6202/[阳光电影-www.ygdy8.com]鲁豫有约20180213.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6202/[阳光电影-www.ygdy8.com]鲁豫有约20180214.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6210/[阳光电影-www.ygdy8.com]鲁豫有约20180220.mp4', 'admin', '', 'L', 10.0, 1, 0);
