INSERT INTO `gx_video` VALUES (8010, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6190/[阳光电影-www.ygdy8.com]娱乐百分百20180201.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6191/[阳光电影-www.ygdy8.com]娱乐百分百20180202.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6192/[阳光电影-www.ygdy8.com]娱乐百分百20180203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6194/[阳光电影-www.ygdy8.com]娱乐百分百20180205.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6195/[阳光电影-www.ygdy8.com]娱乐百分百20180206.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6196/[阳光电影-www.ygdy8.com]娱乐百分百20180207.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6197/[阳光电影-www.ygdy8.com]娱乐百分百20180208.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6198/[阳光电影-www.ygdy8.com]娱乐百分百20180209.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6200/[阳光电影-www.ygdy8.com]娱乐百分百20180210.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6201/[阳光电影-www.ygdy8.com]娱乐百分百20180212.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6202/[阳光电影-www.ygdy8.com]娱乐百分百20180213.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6202/[阳光电影-www.ygdy8.com]娱乐百分百20180214.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6203/[阳光电影-www.ygdy8.com]娱乐百分百20180215.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6204/[阳光电影-www.ygdy8.com]娱乐百分百20180216.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6206/[阳光电影-www.ygdy8.com]娱乐百分百20180217.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6207/[阳光电影-www.ygdy8.com]娱乐百分百20180219.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6208/[阳光电影-www.ygdy8.com]娱乐百分百20180220.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6209/[阳光电影-www.ygdy8.com]娱乐百分百20180221.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6210/[阳光电影-www.ygdy8.com]娱乐百分百20180222.mp4\nftp://