INSERT INTO `gx_video` VALUES (8012, 4, '重返地球', '', '', '#FF0000', '', '', '<p>《重返地球》是芒果TV自制的国内首档超时空生存实验剧，以末世科幻为背景，融合了密室逃脱，悬疑推理等多元素。十一位地球之子与张亮饰演的第一期地球之子相遇，他们需要齐心协力在充满傀儡的基地里完成多重任务，与地球及太空总部取得联系，并摧毁傀儡生存系统逃离危险境地。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfly1fnvhnlp3l0j206z09kjwp.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6184/[阳光电影-www.ygdy8.com]重返地球20180126.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6184/[阳光电影-www.ygdy8.com]重返地球20180126.mp4 ', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8013, 4, '欢乐喜剧人', '', '', '#FF0000', '', '', '<p>《欢乐喜剧人》是一档由东方卫视打造的全国首档明星喜剧竞赛真人秀节目。第四季赛制发生重大改变，将由“魔王挑战赛”和“踢馆淘汰赛”交替进行。宋小宝、岳云鹏、贾玲等众多喜剧大咖都将以“喜剧大魔王”的身份重返舞台，而后续的补位者们也非常让人期待，德云社的张云雷和杨九郎，辽宁民间艺术团的程野和丫蛋，大碗娱乐的许君聪、何欢、卜钰等都陆续来到，欢笑敬请期待！<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfgw1es598hn6szj20bh07ht9j.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]欢乐喜剧人第四季20180121.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6182/[阳光电影-www.ygdy8.com]欢乐喜剧人20180124.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6189/[阳光电影-www.ygdy8.com]欢乐喜剧人20180131.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]欢乐喜剧人第四季20180121.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6182/[阳光电影-www.ygdy8.com]欢乐喜剧人20180124.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6189/[阳光电影-www.ygdy8.com]欢乐喜剧人20180131.mp4 ', 'admin', '', 'H', 10.0, 1, 0);
