INSERT INTO `gx_video` VALUES (8015, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>相比上一季的《今夜百乐门》，新二季节目在维持第一季节目现场不NG的串场模式之外，还会增加更多的新元素，比如增加第二现场，两个现场同时推进，还原更多的观众互动环节，增强节目的可看性。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fnn2bfs4ktj205j0640sq.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]今夜现场秀20180119.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]今夜现场秀20180126.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]今夜现场秀20180119.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]今夜现场秀20180126.mkv ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8016, 4, '偶像练习生', '', '', '#FF0000', '', '', '<p>《偶像练习生》是爱奇艺重点打造的中国首档偶像男团竞演养成类真人秀，张艺兴将担任”全民制作人代表“。 《偶像练习生》节目将从国内外各大经纪公司、练习生公司推荐选拔100名练习生，在未来的4个多月中进行封闭式训练及录制，最终由全民票选出优胜9人，组成全新偶像男团出道。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1fnmwm633vvj206y09qdgd.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]偶像练习生20180119.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]偶像练习生20180126.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]偶像练习生20180119.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]偶像练习生20180126.mp4', 'admin', '', 'O', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8017, 4, '超级夜总会', '', '', '#FF0000', '', '', '<p>《超级夜总会》是三立电视台独立制作的一档综艺娱乐节目，以歌曲演唱、幽默情景剧、户外与观众近距离互动为主要元素，是台湾第一个电视台出动大型舞台车至各县市镇、乡、村的著名观光景点、夜市、庙宇录制的节目。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3hdcxn0doj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6173/[阳光电影-www.ygdy8.com]超级夜总会20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6173/[阳光电影-www.ygdy8.com]超级夜总会20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]超级夜总会20180127.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6173/[阳光电影-www.ygdy8.com]超级夜总会20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6173/[阳光电影-www.ygdy8.com]超级夜总会20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]超级夜总会20180127.mp4', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8018, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]综艺玩很大20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]综艺玩很大20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6178/[阳光电影-www.ygdy8.com]综艺玩很大20180120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]综艺玩很大20180127.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]综艺玩很大20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]综艺玩很大20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6178/[阳光电影-www.ygdy8.com]综艺玩很大20180120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]综艺玩很大20180127.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8019, 4, '歌手2018', '', '', '#FF0000', '', '', '<p>《歌手2018》是湖南卫视推出的音乐竞技节目，由湖南卫视节目中心制作。首发阵容为汪峰、Jessie J（婕西·J）、李圣杰、张韶涵、Gai、张天、李晓东（李丰溢）。 节目每期邀请专业歌手之间进行歌唱竞赛，并提供平等竞技舞台，巧妙地利用视听符号，用心营造视听盛宴。 该节目于2018年1月12日起每周五22:00在湖南卫视首播。由张韶涵担任该节目的首位女性音乐串讲人。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fc7xi9ya2yj20mp0ezatu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6170/[阳光电影-www.ygdy8.com]歌手第二季20180112.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]歌手第二季20180119.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6184/[阳光电影-www.ygdy8.com]歌手第二季20180126.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6170/[阳光电影-www.ygdy8.com]歌手第二季20180112.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]歌手第二季20180119.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6184/[阳光电影-www.ygdy8.com]歌手第二季20180126.mkv ', 'admin', '', 'G', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8020, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>凤凰中文台军情观察室节目坐阵曾有“情报收集中心”之称的香港紧贴每周的全球热点军事话题以丰富、有趣的电视动画以及快节奏播报大量信息的方式为您搜罗军事情报同时请来军事专家对热点话题进行深度地分析与解读。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e8bbkka8mkj20700a0weu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6169/[阳光电影-www.ygdy8.com]军情观察室20180110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6176/[阳光电影-www.ygdy8.com]军情观察室20180117.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6182/[阳光电影-www.ygdy8.com]军情观察室20180124.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6190/[阳光电影-www.ygdy8.com]军情观察室20180131.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6169/[阳光电影-www.ygdy8.com]军情观察室20180110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6176/[阳光电影-www.ygdy8.com]军情观察室20180117.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6182/[阳光电影-www.ygdy8.com]军情观察室20180124.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6190/[阳光电影-www.ygdy8.com]军情观察室20180131.mkv', 'admin', '', 'Z', 10.0, 1, 0);
