INSERT INTO `gx_video` VALUES (8022, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6166/[阳光电影-www.ygdy8.com]两天一夜20180107.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]两天一夜20180121.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]两天一夜20180128.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6166/[阳光电影-www.ygdy8.com]两天一夜20180107.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]两天一夜20180121.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]两天一夜20180128.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8023, 4, '人气歌谣', '', '', '#FF0000', '', '', '<p>《人气歌谣》每周日播出，主要是一个歌手的新歌和新专集得以COME BACK回归的第一平台，因此参加演出的歌手以最近一段时间的人气歌曲为主。基本形式是每周选出TAKE7进行打榜，最终选出一名周冠军，其中也穿插很多明星的COME BACK舞台。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfgw1eacv7d4jhcj20cq09a74t.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6166/[阳光电影-www.ygdy8.com]人气歌谣20180107.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6173/[阳光电影-www.ygdy8.com]人气歌谣20180114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]人气歌谣20180121.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6187/[阳光电影-www.ygdy8.com]人气歌谣20180128.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6166/[阳光电影-www.ygdy8.com]人气歌谣20180107.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6173/[阳光电影-www.ygdy8.com]人气歌谣20180114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]人气歌谣20180121.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6187/[阳光电影-www.ygdy8.com]人气歌谣20180128.mkv ', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8024, 4, '三个院子', '', '', '#FF0000', '', '', '<p>《三个院子》是一档提倡“共享生活”概念的观察体验真人秀节目，将于2017年第四季度在江苏卫视播出。 节目中三对不同关系的明星，作为“Life Sharing”发起人，分别入住三个院子，接待一群性格各异的客人，林更新、陈赫、陈小春和大张伟和他们最亲昵的人，将与素人一同分享百态人生，在共享中品味生活意义，该剧于2017年12月17日在江苏卫视首播。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fmsy0zbf5cj208706hmxc.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6166/[阳光电影-www.ygdy8.com]三个院子20180107.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6173/[阳光电影-www.ygdy8.com]两天一夜20180114.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]三个院子20180121.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6187/[阳光电影-www.ygdy8.com]三个院子20180128.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6166/[阳光电影-www.ygdy8.com]三个院子20180107.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6173/[阳光电影-www.ygdy8.com]两天一夜20180114.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]三个院子20180121.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6187/[阳光电影-www.ygdy8.com]三个院子20180128.mkv', 'admin', '', 'S', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8025, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6165/[阳光电影-www.ygdy8.com]综艺大集合20180107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6172/[阳光电影-www.ygdy8.com]综艺大集合20180114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]综艺大集合20180121.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]综艺大集合20180128.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6165/[阳光电影-www.ygdy8.com]综艺大集合20180107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6172/[阳光电影-www.ygdy8.com]综艺大集合20180114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]综艺大集合20180121.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]综艺大集合20180128.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8026, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6165/[阳光电影-www.ygdy8.com]无限挑战20180106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]无限挑战20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]无限挑战20180120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]无限挑战20180127.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6165/[阳光电影-www.ygdy8.com]无限挑战20180106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]无限挑战20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]无限挑战20180120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]无限挑战20180127.mp4 ', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8027, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6165/[阳光电影-www.ygdy8.com]RunningMan20180107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6173/[阳光电影-www.ygdy8.com]RunningMan20180114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]RunningMan20180121.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]RunningMan20180128.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6165/[阳光电影-www.ygdy8.com]RunningMan20180107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6173/[阳光电影-www.ygdy8.com]RunningMan20180114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]RunningMan20180121.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]RunningMan20180128.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8028, 4, '认识的哥哥', '', '', '#FF0000', '', '', '<p>《认识的哥哥》节目是根据主题不同，以存在于人生中，虽不是很重大，却会让人好奇不已，不得到答案就浑身不自在的问题<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fdljka0l66j20rs09x14w.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6165/[阳光电影-www.ygdy8.com]认识的哥哥20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]认识的哥哥20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]认识的哥哥20180120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]认识的哥哥20180127.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6165/[阳光电影-www.ygdy8.com]认识的哥哥20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]认识的哥哥20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]认识的哥哥20180120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]认识的哥哥20180127.mp4', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8029, 4, '让世界听见', '', '', '#FF0000', '', '', '<p>《让世界听见》是湖南卫视推出的原创音乐公益真人秀。 节目由两位明星支教老师走进大山，带领音乐教学帮手陪伴孩子们生活、学习，用组建合唱团的形式，帮助孩子们接触正规的音乐教学，实现孩子们将歌声唱出大山、让世界听见的终极梦想。 节目于2017年10月29日起每周日晚20:30在湖南卫视播出。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fl1dqwennsj20990afq2z.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6164/[阳光电影-www.ygdy8.com]让世界听见20180107.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6164/[阳光电影-www.ygdy8.com]让世界听见20180107.mkv', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8030, 4, '漂亮的房子', '', '', '#FF0000', '', '', '<p>《漂亮的房子》是由浙江卫视联合北京凤仪传媒、聚思传媒出品的一档集合了建筑美学和生活方式的大型明星户外建筑创意挑战真人秀。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fkq771fdwrj20hc0aiqbm.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6164/[阳光电影-www.ygdy8.com]漂亮的房子20180107.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6164/[阳光电影-www.ygdy8.com]漂亮的房子20180107.mkv ', 'admin', '', 'P', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8031, 4, '青春旅社', '', '', '#FF0000', '', '', '<p>《青春旅社》由王源、景甜、李小璐、何穗、李静、戴军、赵英俊、程晓h、郭劲岐、狄倩伊、王自如，分两组分别经营两家青春旅社，接待来自五湖四海的游客，在创业生活中畅聊青春、倾听故事。 \u3000\u3000两组共十一个青年，这其中有演员、歌手、运动员、创业者、城市白领、幕后工作者，来到美丽乡村，分两组经营两个青年旅社感受创业的艰辛，并且用年轻人擅长的方式，为青年旅社注入更多活力，分享自己的人生经历，共同分享中学习和进步。通过这两个青年旅社的经营，让更多人认识美丽乡村的巨变 ，感受这里的美好和热情。 \u3000\u3000数据显示，中国目前有超8000万人独居，其中20岁到39岁的独居青年数量已经达到5200万。 \u3000\u3000当我们来到一个陌生的城市学习和工作，并且留下来，没有同学和家人，我们缓解孤独的方式，是否是长时间在手机和电脑之间无缝切换，沉浸在看似热闹的社交网络中。 \u3000\u3000车友会、网友聚会、视频社交，我们有多久没有在身边增加新的有血有肉的朋友。 \u3000\u3000什么是真实的生活？ \u3000\u3000什么是真诚的社交？ \u3000\u3000什么是真切的快乐？ \u3000\u3000什么是真正的青春？ \u3000\u3000和志同道合的伙伴，用心经营一件真正喜欢的事情，会成为青春最宝贵的回忆。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fkbwmh0zzzj208c0citam.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6164/[阳光电影-www.ygdy8.com]青春旅社20180107.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6164/[阳光电影-www.ygdy8.com]青春旅社20180107.mkv ', 'admin', '', 'Q', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8032, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2017年，中央电视台音乐频道联合多方权威机构，倾力推出全新音乐歌唱节目《渴望现场》。以情怀为平凡的渴望助力，以责任呵护梦想的成长，以科技为音乐的未来护航。汇聚超强专业制作团队，联合最权威科研机构，人工智能和人类双重评分颠覆歌唱评价体系，探索科技与音乐的深度结合。 \u200b\u200b\u200b\u200b<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fms7vv93hzj20b40jsjvd.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6164/[阳光电影-www.ygdy8.com]渴望现场20180106.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]渴望现场20180127.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6164/[阳光电影-www.ygdy8.com]渴望现场20180106.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]渴望现场20180127.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8033, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>天籁之战》是由东方卫视自主原创的大型棚内音乐挑战节目，由费玉清担任主持 ，莫文蔚、华晨宇、杨坤、张杰担任固定明星导师，节目共12期。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fl1e00fpxxj206408k3z7.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6164/[阳光电影-www.ygdy8.com]天籁之战20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]天籁之战20180113.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6164/[阳光电影-www.ygdy8.com]天籁之战20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]天籁之战20180113.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8034, 4, '综艺3国智', '', '', '#FF0000', '', '', '<p>《综艺3国智》，官方英文名3 Kingdoms，是台湾电视公司监制及首播的实境外景节目，主持人为李李仁、纳豆、王少伟、黄路梓茵、明杰、风田、Evan、Teddy、 张立东、玛丽，台视主频于2016年11月12日首播。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fh5wyh40i8j20p00eqtau.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]综艺3国智20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]综艺3国智20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]综艺3国智20180127.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]综艺3国智20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]综艺3国智20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]综艺3国智20180127.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8035, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]天才冲冲冲20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]天才冲冲冲20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6178/[阳光电影-www.ygdy8.com]天才冲冲冲20180120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]天才冲冲冲20180127.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]天才冲冲冲20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]天才冲冲冲20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6178/[阳光电影-www.ygdy8.com]天才冲冲冲20180120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]天才冲冲冲20180127.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8036, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]综艺玩很大20180106.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]综艺玩很大20180106.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8037, 4, '声临其境', '', '', '#FF0000', '', '', '<p>《声临其境》是中国首档原创声音魅力竞演秀。节目以台词和配音为切入点，每期邀请四组台词功底深厚或是声音动听的演员和配音演员同台竞声。 节目于2018年1月6日晚10点在湖南卫视播出。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1fn87dr9esdj208h09l0t0.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]声临其境20180106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]声临其境20180113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]声临其境20180120.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]声临其境20180127.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]声临其境20180106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]声临其境20180113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]声临其境20180120.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]声临其境20180127.mkv', 'admin', '', 'S', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8038, 4, '演员的诞生', '', '', '#FF0000', '', '', '<p>《演员的诞生》是一档由湖南卫视与北京文化合作，在节目《演员的诞生》中24位影帝、影后带领24位潜力新秀，现场组合飙戏，24小时内以同一主题完成电影级作品，乌尔善、江志强、陈国富决定谁去谁留。三位一线影星带领三十位追梦人进入大型电影摄制现场，他们在其中接受培训和挑战。 \u200b\u200b<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fl1e5b0x7aj204605k3yq.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]演员的诞生20180106.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]演员的诞生20180120.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]演员的诞生20180106.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]演员的诞生20180120.mkv', 'admin', '', 'Y', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8039, 4, '喜剧总动员', '', '', '#FF0000', '', '', '<p>《喜剧总动员》是一档原创季播喜剧竞演综艺节目，将于9月起每周六晚在浙江卫视播出。节目共计12期，初赛9期，入围突击赛2期，总决赛1期。每期节目由影视演员和喜剧人组成的欢乐CP进行喜剧竞演，每两组欢乐CP组成一个战队，共两个战队，由吴秀波与郭德纲担任队长，每期节目不少于4组欢乐CP进行喜剧竞演。每期节目通过两个战队PK的形式决出获胜战队，总决赛选出喜剧总动员冠军。<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fl9n19u3r9j207i07imxb.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]喜剧总动员第2季20180106.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]喜剧总动员第2季20180113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]喜剧总动员第2季20180120.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]喜剧总动员第2季20180106.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]喜剧总动员第2季20180113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]喜剧总动员第2季20180120.mkv ', 'admin', '', 'X', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8040, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]快乐大本营20180106.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]快乐大本营20180113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]快乐大本营20180120.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]快乐大本营20180127.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]快乐大本营20180106.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]快乐大本营20180113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]快乐大本营20180120.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]快乐大本营20180127.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8041, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]非诚勿扰20180106.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]非诚勿扰20180113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]非诚勿扰20180120.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]非诚勿扰20180127.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]非诚勿扰20180106.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]非诚勿扰20180113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6179/[阳光电影-www.ygdy8.com]非诚勿扰20180120.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6186/[阳光电影-www.ygdy8.com]非诚勿扰20180127.mp4', 'admin', '', 'F', 10.0, 1, 0);
