INSERT INTO `gx_video` VALUES (8043, 4, '梦想的声音第二季', '', '', '#FF0000', '', '', '<p>《梦想的声音第二季》是浙江卫视推出的一档大型励志音乐竞技真人秀，由华少主持，采用4+X导师阵容，由林俊杰、林忆莲、羽泉、张靓颖担任四大常驻导师。 节目除了四大常驻导师，每期还会邀请一位神秘的导师助阵，4+X的模式不仅让音乐盛宴升级，也给素人歌手有更多的选择。 节目于2017年10月27日起每周五晚21:10在浙江卫视播出。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fl1eganwhij20j60i9q4s.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]梦想的声音20180105.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6170/[阳光电影-www.ygdy8.com]梦想的声音20180112.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]梦想的声音20180119.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6163/[阳光电影-www.ygdy8.com]梦想的声音20180105.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6170/[阳光电影-www.ygdy8.com]梦想的声音20180112.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]梦想的声音20180119.mkv ', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8044, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2014年1月3日，《最强大脑》作为国内首档科学真人秀节目在江苏卫视隆重开播。百度创始人李彦宏搭档音乐才子周杰伦亮相首期节目，并与陶晶莹、梁冬、李永波、魏坤琳四位跨界评审共同找寻中国“最强大脑”。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1ec81qo4zz5j20yg0jowii.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6162/[阳光电影-www.ygdy8.com]最强大脑第五季20180105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6170/[阳光电影-www.ygdy8.com]最强大脑第五季20180112.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]最强大脑第五季20180119.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]最强大脑第五季20180126.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6162/[阳光电影-www.ygdy8.com]最强大脑第五季20180105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6170/[阳光电影-www.ygdy8.com]最强大脑第五季20180112.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]最强大脑第五季20180119.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]最强大脑第五季20180126.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8045, 4, '王者荣耀', '', '', '#FF0000', '', '', '<p>《王者荣耀》实景真人对抗赛《王者出击》节目于2017年12月15日起每周五晚八点在腾讯视频全网独播。<img alt="" src="http://img.diannao1.com/d/file/html/zongyi2013/daluzongyi/2017-12-17/a4bb4cb31e156a93bf43ac6df6b6682c.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6162/[阳光电影-www.ygdy8.com]王者出击20180105.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6170/[阳光电影-www.ygdy8.com]王者出击20180112.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]王者出击20180119.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]王者出击20180126.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6162/[阳光电影-www.ygdy8.com]王者出击20180105.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6170/[阳光电影-www.ygdy8.com]王者出击20180112.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]王者出击20180119.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]王者出击20180126.mp4 ', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8046, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6162/[阳光电影-www.ygdy8.com]天天向上20180105.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6178/[阳光电影-www.ygdy8.com]天天向上20180119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]天天向上2080126.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6162/[阳光电影-www.ygdy8.com]天天向上20180105.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6178/[阳光电影-www.ygdy8.com]天天向上20180119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6185/[阳光电影-www.ygdy8.com]天天向上2080126.mkv', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8047, 4, '一周的偶像', '', '', '#FF0000', '', '', '<p>《一周的偶像》是一档室内访谈节目，由韩国资深娱乐节目主持人郑亨敦与嘻哈歌手Defconn双人组合共同主持，针对最新韩流发烧娱乐话题，每集专访一组粉丝最爱的偶像团体。主持人与偶像成员的快问快答，充满爆笑与即时性的综艺效果。另外，节目亲临偶像出没场所，对粉丝公开偶像地图，且用监视摄影机，偷偷记录偶像们面对突发状况的行为反应，每周带来韩流偶像难得一见的模样。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fha33ejy23j205k08c757.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6160/[阳光电影-www.ygdy8.com]一周的偶像20180103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6169/[阳光电影-www.ygdy8.com]一周的偶像20180110.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6176/[阳光电影-www.ygdy8.com]一周的偶像20180117.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6182/[阳光电影-www.ygdy8.com]一周的偶像20180124.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6190/[阳光电影-www.ygdy8.com]一周的偶像20180131.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6160/[阳光电影-www.ygdy8.com]一周的偶像20180103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6169/[阳光电影-www.ygdy8.com]一周的偶像20180110.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6176/[阳光电影-www.ygdy8.com]一周的偶像20180117.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6182/[阳光电影-www.ygdy8.com]一周的偶像20180124.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6190/[阳光电影-www.ygdy8.com]一周的偶像20180131.mp4', 'admin', '', 'Y', 10.0, 1, 0);
