INSERT INTO `gx_video` VALUES (8049, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>今年“东方”唱将中最受关注的，非陈奕迅、王菲莫属。做今年“Another Eason\'s LIFE”世巡时，陈奕迅曾发话此轮演唱会结束后会休养两三年专心创作找灵感，暂不做Con。对于做好长时间内听不到Eason唱歌的歌迷来说，忽闻其加盟东方跨年算是个意外惊喜，亦弥足珍贵。 而随着今年到来的嘻哈热潮，王力宏将携手欧阳靖再续传奇经典，两人将共同演绎歌曲《龙的传人》《盖世英雄》。而张杰则有可能搭档杨幂来一曲天籁之音。今年张杰的加盟可让申城的粉丝们高兴坏了，有不少粉丝当即表示要去现场观看，要知道东方卫视也算是张杰的“老家”了，时隔十三年，重回“老家”东方卫视跨年的他让人期待不已。<img alt="" src="https://wx4.sinaimg.cn/mw690/444476dfgy1fn2gl651iij20f50k678q.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6158/[阳光电影-www.ygdy8.com]2018梦圆东方跨年盛典.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6158/[阳光电影-www.ygdy8.com]2018梦圆东方跨年盛典.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8050, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2018江苏卫视跨年演唱会，让幸福照亮你！赵丽颖、吴亦凡、李宇春、潘玮柏、X玖少年团等明星强势加盟，劲歌热舞陪你一起迎接2018。<img alt="" src="https://wx1.sinaimg.cn/mw690/444476dfgy1fn2g79lnykj206m09gwep.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6158/[阳光电影-www.ygdy8.com]2018江苏卫视跨年演唱会.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6158/[阳光电影-www.ygdy8.com]2018江苏卫视跨年演唱会.mp4 ', 'admin', '', 'Z', 10.0, 1, 0);
