INSERT INTO `gx_video` VALUES (8054, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6158/[阳光电影-www.ygdy8.com]娱乐百分百20180101.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6159/[阳光电影-www.ygdy8.com]娱乐百分百20180102.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6160/[阳光电影-www.ygdy8.com]娱乐百分百20180103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6161/[阳光电影-www.ygdy8.com]娱乐百分百20180104.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6162/[阳光电影-www.ygdy8.com]娱乐百分百20180105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6164/[阳光电影-www.ygdy8.com]娱乐百分百20180106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6166/[阳光电影-www.ygdy8.com]娱乐百分百20180108.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6167/[阳光电影-www.ygdy8.com]娱乐百分百20180109.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6168/[阳光电影-www.ygdy8.com]娱乐百分百20180110.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6169/[阳光电影-www.ygdy8.com]娱乐百分百20180111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6170/[阳光电影-www.ygdy8.com]娱乐百分百20180112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6171/[阳光电影-www.ygdy8.com]娱乐百分百20180113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6174/[阳光电影-www.ygdy8.com]娱乐百分百20180115.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6174/[阳光电影-www.ygdy8.com]娱乐百分百20180116.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6175/[阳光电影-www.ygdy8.com]娱乐百分百20180117.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6176/[阳光电影-www.ygdy8.com]娱乐百分百20180118.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6177/[阳光电影-www.ygdy8.com]娱乐百分百20180119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6178/[阳光电影-www.ygdy8.com]娱乐百分百20180120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6180/[阳光电影-www.ygdy8.com]娱乐百分百20180122.mp4\nftp://