INSERT INTO `gx_video` VALUES (8064, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>浙江卫视领跑2018演唱会定档12月30日，先于其他卫视一天开启直播。这也是继2017年之后，浙江卫视第二年打出“领跑”概念，提前一天举办“跨年演唱会”。[1] 领跑2018演唱会于2017年12月30日19点30分在浙江卫视及境外频道同步直播。[2] 浙江卫视中国蓝创新性提出了“领跑二重奏，跨年双响炮”的理念：12月30日“浙江卫视领跑2018演唱会”领先开唱，12月31日首次推出“浙江卫视2018思想跨年盛典”，呈现“狂欢领跑、思想领跑”的王炸组合。<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fn1011odiqj206y09q3zm.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6157/[阳光电影-www.ygdy8.com]浙江卫视领跑2018演唱会.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6157/[阳光电影-www.ygdy8.com]浙江卫视领跑2018演唱会.mp4 ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8065, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6157/[阳光电影-www.ygdy8.com]快乐大本营2018跨年狂欢A.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6157/[阳光电影-www.ygdy8.com]快乐大本营2018跨年狂欢B.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6157/[阳光电影-www.ygdy8.com]快乐大本营2018跨年狂欢A.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6157/[阳光电影-www.ygdy8.com]快乐大本营2018跨年狂欢B.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8066, 4, '三个院子', '', '', '#FF0000', '', '', '<p>《三个院子》是一档提倡“共享生活”概念的观察体验真人秀节目，将于2017年第四季度在江苏卫视播出。 节目中三对不同关系的明星，作为“Life Sharing”发起人，分别入住三个院子，接待一群性格各异的客人，林更新、陈赫、陈小春和大张伟和他们最亲昵的人，将与素人一同分享百态人生，在共享中品味生活意义，该剧于2017年12月17日在江苏卫视首播。<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fmsy0zbf5cj208706hmxc.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6151/[阳光电影-www.ygdy8.com]三个院子20171224.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6151/[阳光电影-www.ygdy8.com]三个院子20171224.mkv ', 'admin', '', 'S', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8067, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2017年，中央电视台音乐频道联合多方权威机构，倾力推出全新音乐歌唱节目《渴望现场》。以情怀为平凡的渴望助力，以责任呵护梦想的成长，以科技为音乐的未来护航。汇聚超强专业制作团队，联合最权威科研机构，人工智能和人类双重评分颠覆歌唱评价体系，探索科技与音乐的深度结合。 \u200b\u200b\u200b\u200b<img alt="" src="https://wx2.sinaimg.cn/mw690/444476dfgy1fms7vv93hzj20b40jsjvd.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6150/[阳光电影-www.ygdy8.com]渴望现场20171216修复.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6150/[阳光电影-www.ygdy8.com]渴望现场20171223.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6157/[阳光电影-www.ygdy8.com]渴望现场20171230.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6150/[阳光电影-www.ygdy8.com]渴望现场20171216修复.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6150/[阳光电影-www.ygdy8.com]渴望现场20171223.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6157/[阳光电影-www.ygdy8.com]渴望现场20171230.mp4 ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8068, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>浙江卫视《十二道锋味》目前更名为《锋味》转战优酷，预计四季度播出，节目每期谢霆锋携一位明星好友+2位红人帮厨挑战各地厨神，12场美食冒险旅行，12场厨神之战。体验异国文化、探寻各国美食、展现人文风情 。霆锋接到来自某地的美食挑战，挑选帮厨。组建适合团队备战，探索饮食文化。寻找当地食材，每集不同的主题料理比拼大赛，特殊群体品尝菜肴，一分高下，淘汰表现差的帮厨，去芜存菁。<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fms7vnwwxzj207i060myf.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6150/[阳光电影-www.ygdy8.com]锋味20171216.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6150/[阳光电影-www.ygdy8.com]锋味20171223.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6157/[阳光电影-www.ygdy8.com]锋味20171230.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6150/[阳光电影-www.ygdy8.com]锋味20171216.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6150/[阳光电影-www.ygdy8.com]锋味20171223.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6157/[阳光电影-www.ygdy8.com]锋味20171230.mp4 ', 'admin', '', 'Z', 10.0, 1, 0);
