INSERT INTO `gx_video` VALUES (8072, 4, '一周的偶像', '', '', '#FF0000', '', '', '<p>《一周的偶像》是一档室内访谈节目，由韩国资深娱乐节目主持人郑亨敦与嘻哈歌手Defconn双人组合共同主持，针对最新韩流发烧娱乐话题，每集专访一组粉丝最爱的偶像团体。主持人与偶像成员的快问快答，充满爆笑与即时性的综艺效果。另外，节目亲临偶像出没场所，对粉丝公开偶像地图，且用监视摄影机，偷偷记录偶像们面对突发状况的行为反应，每周带来韩流偶像难得一见的模样。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fha33ejy23j205k08c757.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6133/[阳光电影-www.ygdy8.com]一周的偶像20171206.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6139/[阳光电影-www.ygdy8.com]一周的偶像20171213.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6149/[阳光电影-www.ygdy8.com]一周的偶像20171220.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6154/[阳光电影-www.ygdy8.com]一周的偶像20171227.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6133/[阳光电影-www.ygdy8.com]一周的偶像20171206.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6139/[阳光电影-www.ygdy8.com]一周的偶像20171213.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6149/[阳光电影-www.ygdy8.com]一周的偶像20171220.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6154/[阳光电影-www.ygdy8.com]一周的偶像20171227.mp4', 'admin', '', 'Y', 10.0, 1, 0);
