INSERT INTO `gx_video` VALUES (8097, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6125/[阳光电影-www.ygdy8.com]娱乐百分百2071201.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6126/[阳光电影-www.ygdy8.com]娱乐百分百20171202.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6129/[阳光电影-www.ygdy8.com]娱乐百分百20171204.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6131/[阳光电影-www.ygdy8.com]娱乐百分百20171205.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6132/[阳光电影-www.ygdy8.com]娱乐百分百20171206.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6133/[阳光电影-www.ygdy8.com]娱乐百分百20171207.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6134/[阳光电影-www.ygdy8.com]娱乐百分百20171208.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6136/[阳光电影-www.ygdy8.com]娱乐百分百20171209.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6137/[阳光电影-www.ygdy8.com]娱乐百分百20171211.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6139/[阳光电影-www.ygdy8.com]娱乐百分百20171212.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6139/[阳光电影-www.ygdy8.com]娱乐百分百20171213.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6141/[阳光电影-www.ygdy8.com]娱乐百分百20171214.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6142/[阳光电影-www.ygdy8.com]娱乐百分百20171215.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6144/[阳光电影-www.ygdy8.com]娱乐百分百20171216.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6145/[阳光电影-www.ygdy8.com]娱乐百分百20171218.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6146/[阳光电影-www.ygdy8.com]娱乐百分百20171219.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6148/[阳光电影-www.ygdy8.com]娱乐百分百20171220.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6149/[阳光电影-www.ygdy8.com]娱乐百分百20171221.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6150/[阳光电影-www.ygdy8.com]娱乐百分百20171222.mp4\nftp://y