INSERT INTO `gx_video` VALUES (8101, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]无限挑战20171125.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]无限挑战20171125.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8102, 4, '梦想的声音第二季', '', '', '#FF0000', '', '', '<p>《梦想的声音第二季》是浙江卫视推出的一档大型励志音乐竞技真人秀，由华少主持，采用4+X导师阵容，由林俊杰、林忆莲、羽泉、张靓颖担任四大常驻导师。 节目除了四大常驻导师，每期还会邀请一位神秘的导师助阵，4+X的模式不仅让音乐盛宴升级，也给素人歌手有更多的选择。 节目于2017年10月27日起每周五晚21:10在浙江卫视播出。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fl1eganwhij20j60i9q4s.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]梦想的声音20171103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]梦想的声音20171117.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]梦想的声音20171124.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]梦想的声音20171103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]梦想的声音20171117.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]梦想的声音20171124.mp4', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8103, 4, '爸爸去哪儿', '', '', '#FF0000', '', '', '<p>《爸爸去哪儿》第五季已经在筹备当中，预计今年暑假就会强势归来，作为一档大型亲子类节目，从第一部到第四季，可谓带红了不少的奶爸萌娃，奶爸萌娃的精彩表现成为了观众津津乐道的话题。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fjd063brvcj208c0ci75t.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6116/[阳光电影-www.ygdy8.com]爸爸去哪儿20171123.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6124/[阳光电影-www.ygdy8.com]爸爸去哪儿20171130.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6116/[阳光电影-www.ygdy8.com]爸爸去哪儿20171123.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6124/[阳光电影-www.ygdy8.com]爸爸去哪儿20171130.mp4 ', 'admin', '', 'B', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8104, 4, '让世界听见', '', '', '#FF0000', '', '', '<p>《让世界听见》是湖南卫视推出的原创音乐公益真人秀。 节目由两位明星支教老师走进大山，带领音乐教学帮手陪伴孩子们生活、学习，用组建合唱团的形式，帮助孩子们接触正规的音乐教学，实现孩子们将歌声唱出大山、让世界听见的终极梦想。 节目于2017年10月29日起每周日晚20:30在湖南卫视播出。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fl1dqwennsj20990afq2z.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6104/[阳光电影-www.ygdy8.com]让世界听见20171112.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]让世界听见20171119.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]让世界听见20171126.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6104/[阳光电影-www.ygdy8.com]让世界听见20171112.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]让世界听见20171119.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]让世界听见20171126.mkv ', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8105, 4, '喜剧总动员', '', '', '#FF0000', '', '', '<p>《喜剧总动员》是一档原创季播喜剧竞演综艺节目，将于9月起每周六晚在浙江卫视播出。节目共计12期，初赛9期，入围突击赛2期，总决赛1期。每期节目由影视演员和喜剧人组成的欢乐CP进行喜剧竞演，每两组欢乐CP组成一个战队，共两个战队，由吴秀波与郭德纲担任队长，每期节目不少于4组欢乐CP进行喜剧竞演。每期节目通过两个战队PK的形式决出获胜战队，总决赛选出喜剧总动员冠军。<img alt="" src="https://wx3.sinaimg.cn/mw690/444476dfgy1fl9n19u3r9j207i07imxb.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6098/[阳光电影-www.ygdy8.com]喜剧总动员第二季20171028.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6098/[阳光电影-www.ygdy8.com]喜剧总动员第二季20171104.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]喜剧总动员第2季20171111.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]喜剧总动员第2季20171118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]喜剧总动员第2季20171125.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6098/[阳光电影-www.ygdy8.com]喜剧总动员第二季20171028.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6098/[阳光电影-www.ygdy8.com]喜剧总动员第二季20171104.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]喜剧总动员第2季20171111.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]喜剧总动员第2季20171118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]喜剧总动员第2季20171125.mkv', 'admin', '', 'X', 10.0, 1, 0);
