INSERT INTO `gx_video` VALUES (8108, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]综艺大集合20171105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6104/[阳光电影-www.ygdy8.com]综艺大集合20171112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6112/[阳光电影-www.ygdy8.com]综艺大集合20171119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]综艺大集合20171126.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]综艺大集合20171105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6104/[阳光电影-www.ygdy8.com]综艺大集合20171112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6112/[阳光电影-www.ygdy8.com]综艺大集合20171119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]综艺大集合20171126.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8109, 4, '超级夜总会', '', '', '#FF0000', '', '', '<p>《超级夜总会》是三立电视台独立制作的一档综艺娱乐节目，以歌曲演唱、幽默情景剧、户外与观众近距离互动为主要元素，是台湾第一个电视台出动大型舞台车至各县市镇、乡、村的著名观光景点、夜市、庙宇录制的节目。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3hdcxn0doj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]超级夜总会20171104.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]超级夜总会20171111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]超级夜总会20171118.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]超级夜总会20171125.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]超级夜总会20171104.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]超级夜总会20171111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]超级夜总会20171118.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]超级夜总会20171125.mp4', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8110, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]RunningMan20171105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6104/[阳光电影-www.ygdy8.com]RunningMan20171112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]RunningMan20171119.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]RunningMan20171126.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]RunningMan20171105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6104/[阳光电影-www.ygdy8.com]RunningMan20171112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]RunningMan20171119.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]RunningMan20171126.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8111, 4, '人气歌谣', '', '', '#FF0000', '', '', '<p>《人气歌谣》每周日播出，主要是一个歌手的新歌和新专集得以COME BACK回归的第一平台，因此参加演出的歌手以最近一段时间的人气歌曲为主。基本形式是每周选出TAKE7进行打榜，最终选出一名周冠军，其中也穿插很多明星的COME BACK舞台。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfgw1eacv7d4jhcj20cq09a74t.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]人气歌谣20171105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6104/[阳光电影-www.ygdy8.com]人气歌谣20171112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]人气歌谣20171119.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]人气歌谣20171126.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]人气歌谣20171105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6104/[阳光电影-www.ygdy8.com]人气歌谣20171112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]人气歌谣20171119.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]人气歌谣20171126.mp4 ', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8112, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]两天一夜20171105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6104/[阳光电影-www.ygdy8.com]两天一夜20171112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]两天一夜20171119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]两天一夜20171126.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]两天一夜20171105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6104/[阳光电影-www.ygdy8.com]两天一夜20171112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]两天一夜20171119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]两天一夜20171126.mkv', 'admin', '', 'Z', 10.0, 1, 0);
