INSERT INTO `gx_video` VALUES (8115, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]综艺玩很大20171104.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]综艺玩很大20171111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]综艺玩很大20171118.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]综艺玩很大20171125.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]综艺玩很大20171104.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]综艺玩很大20171111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]综艺玩很大20171118.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]综艺玩很大20171125.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8116, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]天才冲冲冲20171104.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]天才冲冲冲20171111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]天才冲冲冲20171118.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]天才冲冲冲20171125.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]天才冲冲冲20171104.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]天才冲冲冲20171111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]天才冲冲冲20171118.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]天才冲冲冲20171125.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8117, 4, '演员的诞生', '', '', '#FF0000', '', '', '<p>《演员的诞生》是一档由湖南卫视与北京文化合作，在节目《演员的诞生》中24位影帝、影后带领24位潜力新秀，现场组合飙戏，24小时内以同一主题完成电影级作品，乌尔善、江志强、陈国富决定谁去谁留。三位一线影星带领三十位追梦人进入大型电影摄制现场，他们在其中接受培训和挑战。 \u200b\u200b<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fl1e5b0x7aj204605k3yq.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]演员的诞生20171104.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]演员的诞生20171118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]演员的诞生20171125.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]演员的诞生20171104.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]演员的诞生20171118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]演员的诞生20171125.mkv ', 'admin', '', 'Y', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8118, 4, '亲爱的客栈', '', '', '#FF0000', '', '', '<p>《亲爱的客栈》是由湖南卫视推出的生活纪实类综艺节目，陈歆宇团队主持。阚清子与纪凌尘、刘涛与老公王珂加盟《亲爱的客栈》。 \u200b\u200b\u200b\u200b<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fkbwphja6gj20u00gvmye.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]亲爱的客栈20171104.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]亲爱的客栈20171111.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]亲爱的客栈20171118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]亲爱的客栈20171125.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]亲爱的客栈20171104.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]亲爱的客栈20171111.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]亲爱的客栈20171118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]亲爱的客栈20171125.mkv ', 'admin', '', 'Q', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8119, 4, '青春旅社', '', '', '#FF0000', '', '', '<p>《青春旅社》由王源、景甜、李小璐、何穗、李静、戴军、赵英俊、程晓h、郭劲岐、狄倩伊、王自如，分两组分别经营两家青春旅社，接待来自五湖四海的游客，在创业生活中畅聊青春、倾听故事。 \u3000\u3000两组共十一个青年，这其中有演员、歌手、运动员、创业者、城市白领、幕后工作者，来到美丽乡村，分两组经营两个青年旅社感受创业的艰辛，并且用年轻人擅长的方式，为青年旅社注入更多活力，分享自己的人生经历，共同分享中学习和进步。通过这两个青年旅社的经营，让更多人认识美丽乡村的巨变 ，感受这里的美好和热情。 \u3000\u3000数据显示，中国目前有超8000万人独居，其中20岁到39岁的独居青年数量已经达到5200万。 \u3000\u3000当我们来到一个陌生的城市学习和工作，并且留下来，没有同学和家人，我们缓解孤独的方式，是否是长时间在手机和电脑之间无缝切换，沉浸在看似热闹的社交网络中。 \u3000\u3000车友会、网友聚会、视频社交，我们有多久没有在身边增加新的有血有肉的朋友。 \u3000\u3000什么是真实的生活？ \u3000\u3000什么是真诚的社交？ \u3000\u3000什么是真切的快乐？ \u3000\u3000什么是真正的青春？ \u3000\u3000和志同道合的伙伴，用心经营一件真正喜欢的事情，会成为青春最宝贵的回忆。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fkbwmh0zzzj208c0citam.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]青春旅社20171104.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6104/[阳光电影-www.ygdy8.com]青春旅社20171112.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]青春旅社20171119.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]青春旅社20171104.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6104/[阳光电影-www.ygdy8.com]青春旅社20171112.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6119/[阳光电影-www.ygdy8.com]青春旅社20171119.mkv ', 'admin', '', 'Q', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8120, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]快乐大本营20171104.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]快乐大本营20171111.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]快乐大本营20171118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]快乐大本营20171125.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]快乐大本营20171104.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]快乐大本营20171111.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]快乐大本营20171118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]快乐大本营20171125.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8121, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]非诚勿扰20171104.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]非诚勿扰20171111.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]非诚勿扰20171118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]非诚勿扰20171125.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]非诚勿扰20171104.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]非诚勿扰20171111.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]非诚勿扰20171118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]非诚勿扰20171125.mkv', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8122, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>全国范围内热到炸裂的天气，让人心中不免躁动。而燃到炸裂的拼多多特约《极限挑战》第三季的第二期将于7月16日晚10点正式开播，“极限男人帮”化躁动为行动，红火出击，南下佛山，闯荡风雨武林路。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f30waeec55j20ch0gon0y.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6095/[阳光电影-www.ygdy8.com]极限挑战第三季20171103.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]极限挑战第三季20171110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]极限挑战第三季20171117.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]极限挑战20171124.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6095/[阳光电影-www.ygdy8.com]极限挑战第三季20171103.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]极限挑战第三季20171110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]极限挑战第三季20171117.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6118/[阳光电影-www.ygdy8.com]极限挑战20171124.mp4 ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8123, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6095/[阳光电影-www.ygdy8.com]天天向上2071103.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]天天向上2071110.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6109/[阳光电影-www.ygdy8.com]天天向上2071117.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6117/[阳光电影-www.ygdy8.com]天天向上2071124.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6095/[阳光电影-www.ygdy8.com]天天向上2071103.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]天天向上2071110.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6109/[阳光电影-www.ygdy8.com]天天向上2071117.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6117/[阳光电影-www.ygdy8.com]天天向上2071124.mkv ', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8124, 4, '一周的偶像', '', '', '#FF0000', '', '', '<p>《一周的偶像》是一档室内访谈节目，由韩国资深娱乐节目主持人郑亨敦与嘻哈歌手Defconn双人组合共同主持，针对最新韩流发烧娱乐话题，每集专访一组粉丝最爱的偶像团体。主持人与偶像成员的快问快答，充满爆笑与即时性的综艺效果。另外，节目亲临偶像出没场所，对粉丝公开偶像地图，且用监视摄影机，偷偷记录偶像们面对突发状况的行为反应，每周带来韩流偶像难得一见的模样。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fha33ejy23j205k08c757.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6094/[阳光电影-www.ygdy8.com]一周的偶像20171101.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6101/[阳光电影-www.ygdy8.com]一周的偶像20171108.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6107/[阳光电影-www.ygdy8.com]一周的偶像20171115.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6115/[阳光电影-www.ygdy8.com]一周的偶像20171122.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6094/[阳光电影-www.ygdy8.com]一周的偶像20171101.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6101/[阳光电影-www.ygdy8.com]一周的偶像20171108.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6107/[阳光电影-www.ygdy8.com]一周的偶像20171115.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6115/[阳光电影-www.ygdy8.com]一周的偶像20171122.mkv', 'admin', '', 'Y', 10.0, 1, 0);
