INSERT INTO `gx_video` VALUES (8127, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6093/[阳光电影-www.ygdy8.com]娱乐百分百20171101.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6094/[阳光电影-www.ygdy8.com]娱乐百分百20171102.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6095/[阳光电影-www.ygdy8.com]娱乐百分百20171103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6096/[阳光电影-www.ygdy8.com]娱乐百分百20171104.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6098/[阳光电影-www.ygdy8.com]娱乐百分百20171106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6099/[阳光电影-www.ygdy8.com]娱乐百分百20171107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6100/[阳光电影-www.ygdy8.com]娱乐百分百20171108.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6101/[阳光电影-www.ygdy8.com]娱乐百分百20171109.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6102/[阳光电影-www.ygdy8.com]娱乐百分百20171110.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6103/[阳光电影-www.ygdy8.com]娱乐百分百20171111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6105/[阳光电影-www.ygdy8.com]娱乐百分百20171113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6106/[阳光电影-www.ygdy8.com]娱乐百分百20171114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6107/[阳光电影-www.ygdy8.com]娱乐百分百20171115.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6108/[阳光电影-www.ygdy8.com]娱乐百分百20171116.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6110/[阳光电影-www.ygdy8.com]娱乐百分百20171117.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6111/[阳光电影-www.ygdy8.com]娱乐百分百20171118.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6113/[阳光电影-www.ygdy8.com]娱乐百分百20171120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6114/[阳光电影-www.ygdy8.com]娱乐百分百20171121.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6115/[阳光电影-www.ygdy8.com]娱乐百分百20171122.mp4\nftp://