INSERT INTO `gx_video` VALUES (8133, 4, '梦想的声音第二季', '', '', '#FF0000', '', '', '<p>《梦想的声音第二季》是浙江卫视推出的一档大型励志音乐竞技真人秀，由华少主持，采用4+X导师阵容，由林俊杰、林忆莲、羽泉、张靓颖担任四大常驻导师。 节目除了四大常驻导师，每期还会邀请一位神秘的导师助阵，4+X的模式不仅让音乐盛宴升级，也给素人歌手有更多的选择。 节目于2017年10月27日起每周五晚21:10在浙江卫视播出。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fl1eganwhij20j60i9q4s.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6090/[阳光电影-www.ygdy8.com]梦想的声音第二季20171027.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6090/[阳光电影-www.ygdy8.com]梦想的声音第二季20171027.mp4', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8134, 4, '演员的诞生', '', '', '#FF0000', '', '', '<p>《演员的诞生》是一档由湖南卫视与北京文化合作，在节目《演员的诞生》中24位影帝、影后带领24位潜力新秀，现场组合飙戏，24小时内以同一主题完成电影级作品，乌尔善、江志强、陈国富决定谁去谁留。三位一线影星带领三十位追梦人进入大型电影摄制现场，他们在其中接受培训和挑战。 \u200b\u200b<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fl1e5b0x7aj204605k3yq.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6090/[阳光电影-www.ygdy8.com]演员的诞生20171028.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6090/[阳光电影-www.ygdy8.com]演员的诞生20171028.mp4 ', 'admin', '', 'Y', 10.0, 1, 0);
