INSERT INTO `gx_video` VALUES (8136, 4, '让世界听见', '', '', '#FF0000', '', '', '<p>《让世界听见》是湖南卫视推出的原创音乐公益真人秀。 节目由两位明星支教老师走进大山，带领音乐教学帮手陪伴孩子们生活、学习，用组建合唱团的形式，帮助孩子们接触正规的音乐教学，实现孩子们将歌声唱出大山、让世界听见的终极梦想。 节目于2017年10月29日起每周日晚20:30在湖南卫视播出。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fl1dqwennsj20990afq2z.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6090/[阳光电影-www.ygdy8.com]让世界听见20171029.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6090/[阳光电影-www.ygdy8.com]让世界听见20171029.mkv ', 'admin', '', 'R', 10.0, 1, 0);
