INSERT INTO `gx_video` VALUES (8138, 4, '中国新歌声', '', '', '#FF0000', '', '', '<p>《中国新歌声》是由浙江卫视联合星空传媒旗下灿星制作打造的大型原创专业音乐节目。自2016年起，系列节目不再引进国外版权，而是采用原创模式。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fhkyjhvuooj20fa08mweo.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6061/[阳光电影-www.ygdy8.com]中国新歌声第二季20171008.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6061/[阳光电影-www.ygdy8.com]中国新歌声第二季20171008.mkv ', 'admin', '', 'Z', 10.0, 1, 0);
