INSERT INTO `gx_video` VALUES (8141, 4, '亲爱的客栈', '', '', '#FF0000', '', '', '<p>《亲爱的客栈》是由湖南卫视推出的生活纪实类综艺节目，陈歆宇团队主持。阚清子与纪凌尘、刘涛与老公王珂加盟《亲爱的客栈》。 \u200b\u200b\u200b\u200b<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fkbwphja6gj20u00gvmye.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]亲爱的客栈20171007.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6072/[阳光电影-www.ygdy8.com]亲爱的客栈20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6079/[阳光电影-www.ygdy8.com]亲爱的客栈20171021.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]亲爱的客栈20171028.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]亲爱的客栈20171007.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6072/[阳光电影-www.ygdy8.com]亲爱的客栈20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6079/[阳光电影-www.ygdy8.com]亲爱的客栈20171021.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]亲爱的客栈20171028.mp4', 'admin', '', 'Q', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8142, 4, '青春旅社', '', '', '#FF0000', '', '', '<p>《青春旅社》由王源、景甜、李小璐、何穗、李静、戴军、赵英俊、程晓h、郭劲岐、狄倩伊、王自如，分两组分别经营两家青春旅社，接待来自五湖四海的游客，在创业生活中畅聊青春、倾听故事。 \u3000\u3000两组共十一个青年，这其中有演员、歌手、运动员、创业者、城市白领、幕后工作者，来到美丽乡村，分两组经营两个青年旅社感受创业的艰辛，并且用年轻人擅长的方式，为青年旅社注入更多活力，分享自己的人生经历，共同分享中学习和进步。通过这两个青年旅社的经营，让更多人认识美丽乡村的巨变 ，感受这里的美好和热情。 \u3000\u3000数据显示，中国目前有超8000万人独居，其中20岁到39岁的独居青年数量已经达到5200万。 \u3000\u3000当我们来到一个陌生的城市学习和工作，并且留下来，没有同学和家人，我们缓解孤独的方式，是否是长时间在手机和电脑之间无缝切换，沉浸在看似热闹的社交网络中。 \u3000\u3000车友会、网友聚会、视频社交，我们有多久没有在身边增加新的有血有肉的朋友。 \u3000\u3000什么是真实的生活？ \u3000\u3000什么是真诚的社交？ \u3000\u3000什么是真切的快乐？ \u3000\u3000什么是真正的青春？ \u3000\u3000和志同道合的伙伴，用心经营一件真正喜欢的事情，会成为青春最宝贵的回忆。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fkbwmh0zzzj208c0citam.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]青春旅社20170923.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]青春旅社20171007.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6071/[阳光电影-www.ygdy8.com]青春旅社20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]青春旅社20171028.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]青春旅社20170923.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]青春旅社20171007.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6071/[阳光电影-www.ygdy8.com]青春旅社20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]青春旅社20171028.mp4', 'admin', '', 'Q', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8143, 4, '综艺3国智', '', '', '#FF0000', '', '', '<p>《综艺3国智》，官方英文名3 Kingdoms，是台湾电视公司监制及首播的实境外景节目，主持人为李李仁、纳豆、王少伟、黄路梓茵、明杰、风田、Evan、Teddy、 张立东、玛丽，台视主频于2016年11月12日首播。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fh5wyh40i8j20p00eqtau.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]综艺3国智20171007.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6070/[阳光电影-www.ygdy8.com]综艺3国智20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6079/[阳光电影-www.ygdy8.com]综艺3国智20171021.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]综艺3国智20171028.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]综艺3国智20171007.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6070/[阳光电影-www.ygdy8.com]综艺3国智20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6079/[阳光电影-www.ygdy8.com]综艺3国智20171021.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]综艺3国智20171028.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8144, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]综艺玩很大20171007.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6070/[阳光电影-www.ygdy8.com]综艺玩很大20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6079/[阳光电影-www.ygdy8.com]综艺玩很大20171021.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]综艺玩很大20171028.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]综艺玩很大20171007.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6070/[阳光电影-www.ygdy8.com]综艺玩很大20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6079/[阳光电影-www.ygdy8.com]综艺玩很大20171021.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]综艺玩很大20171028.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8145, 4, '极速前进', '', '', '#FF0000', '', '', '<p>《极速前进》源于美国经典真人秀电视节目《The Amazing Race》（中文译名同样为极速前进），该节目自2001年开播至今已25季，共10次斩获“电视界奥斯卡”艾美奖中真人秀最高荣誉——“黄金档最佳竞技类真人秀”。在重重筛选之后，《The Amazing Race》选择与深圳卫视合作，由深圳卫视和英菲尼迪双方联合制作中国版《极速前进》，将环球竞速真人秀模式引入中国。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfgw1elvrqfw0ijj20a307j3zd.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]极速前进20171006.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]极速前进20171006.mp4', 'admin', '', 'J', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8146, 4, '跨界喜剧王', '', '', '#FF0000', '', '', '<p>《跨界喜剧王》作为北京卫视第三季度的重榜节目，以“跨界， 我为快乐而来”为核心，将继续引领“跨界”风潮，极致打造“跨界”品牌。小沈阳继在《跨界歌王》荣膺季军后，继续跨界成为《跨界喜剧王》舞台上的“喜剧召集人”<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f7k5wpv42yj20od0c6n1f.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20171007.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20171007.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8147, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]快乐大本营20171007.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6071/[阳光电影-www.ygdy8.com]快乐大本营20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6079/[阳光电影-www.ygdy8.com]快乐大本营20171021.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]快乐大本营20171028.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]快乐大本营20171007.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6071/[阳光电影-www.ygdy8.com]快乐大本营20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6079/[阳光电影-www.ygdy8.com]快乐大本营20171021.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]快乐大本营20171028.mp4', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8148, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]非诚勿扰20171007.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6071/[阳光电影-www.ygdy8.com]非诚勿扰20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6079/[阳光电影-www.ygdy8.com]非诚勿扰20171021.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]非诚勿扰20171028.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6059/[阳光电影-www.ygdy8.com]非诚勿扰20171007.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6071/[阳光电影-www.ygdy8.com]非诚勿扰20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6079/[阳光电影-www.ygdy8.com]非诚勿扰20171021.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]非诚勿扰20171028.mp4', 'admin', '', 'F', 10.0, 1, 0);
