INSERT INTO `gx_video` VALUES (8150, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6058/[阳光电影-www.ygdy8.com]天才冲冲冲20171007.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6070/[阳光电影-www.ygdy8.com]天才冲冲冲20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6079/[阳光电影-www.ygdy8.com]天才冲冲冲20171021.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]天才冲冲冲20171028.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6058/[阳光电影-www.ygdy8.com]天才冲冲冲20171007.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6070/[阳光电影-www.ygdy8.com]天才冲冲冲20171014.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6079/[阳光电影-www.ygdy8.com]天才冲冲冲20171021.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]天才冲冲冲20171028.mp4', 'admin', '', 'T', 10.0, 1, 0);
