INSERT INTO `gx_video` VALUES (8153, 4, '我们来了', '', '', '#FF0000', '', '', '<p>《我们来了》第二季（英文：Up Idol 3），又名《偶像来了》第三季，是中国大陆湖南卫视于2017年第三季度推出的一档周五黄金档女神生活体验类真人秀节目，也是2017湖南卫视节目巡礼重点推介的一档节目。 \u3000\u3000第二季的嘉宾构成较第一季有所升级。在保留原有的两名主持人兼队长的前提之下，本季在女嘉宾的选择上较第一季更为多元化。除了会邀请演艺界知名人士参加节目之外，亦会邀请一部分来自其他职业的中国90后女性精英，年龄在18－27岁之间。本季参加节目的女嘉宾共有10位，其中包括6位偶像队员及4位素人队员，以分组对抗的模式进行。两组各有一名队长、三名偶像队员及两名素人队员，新加入的素人队员将与偶像队员共同进行两天一夜的对抗任务。并在对抗过程中体验各种中华传统文化，更多元地向观众展现东方女性之美。<img alt="" src="http://ww2.sinaimg.cn/mw690/444476dfgw1f63vld9wcpj20j60y2tei.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6057/[阳光电影-www.ygdy8.com]我们来了第三季20171006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6070/[阳光电影-www.ygdy8.com]我们来了第三季20171013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6078/[阳光电影-www.ygdy8.com]我们来了第三季20171020.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6057/[阳光电影-www.ygdy8.com]我们来了第三季20171006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6070/[阳光电影-www.ygdy8.com]我们来了第三季20171013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6078/[阳光电影-www.ygdy8.com]我们来了第三季20171020.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8154, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6057/[阳光电影-www.ygdy8.com]天天向上2071006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6070/[阳光电影-www.ygdy8.com]天天向上20171013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6078/[阳光电影-www.ygdy8.com]天天向上2071020.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]天天向上20171027.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6057/[阳光电影-www.ygdy8.com]天天向上2071006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6070/[阳光电影-www.ygdy8.com]天天向上20171013.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6078/[阳光电影-www.ygdy8.com]天天向上2071020.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6088/[阳光电影-www.ygdy8.com]天天向上20171027.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8155, 4, '一周的偶像', '', '', '#FF0000', '', '', '<p>《一周的偶像》是一档室内访谈节目，由韩国资深娱乐节目主持人郑亨敦与嘻哈歌手Defconn双人组合共同主持，针对最新韩流发烧娱乐话题，每集专访一组粉丝最爱的偶像团体。主持人与偶像成员的快问快答，充满爆笑与即时性的综艺效果。另外，节目亲临偶像出没场所，对粉丝公开偶像地图，且用监视摄影机，偷偷记录偶像们面对突发状况的行为反应，每周带来韩流偶像难得一见的模样。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fha33ejy23j205k08c757.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6057/[阳光电影-www.ygdy8.com]一周的偶像20171004.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6068/[阳光电影-www.ygdy8.com]一周的偶像20171011.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6078/[阳光电影-www.ygdy8.com]一周的偶像20171018.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6085/[阳光电影-www.ygdy8.com]一周的偶像20171025.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6057/[阳光电影-www.ygdy8.com]一周的偶像20171004.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6068/[阳光电影-www.ygdy8.com]一周的偶像20171011.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6078/[阳光电影-www.ygdy8.com]一周的偶像20171018.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6085/[阳光电影-www.ygdy8.com]一周的偶像20171025.rmvb', 'admin', '', 'Y', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8156, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>凤凰中文台军情观察室节目坐阵曾有“情报收集中心”之称的香港紧贴每周的全球热点军事话题以丰富、有趣的电视动画以及快节奏播报大量信息的方式为您搜罗军事情报同时请来军事专家对热点话题进行深度地分析与解读。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e8bbkka8mkj20700a0weu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6056/[阳光电影-www.ygdy8.com]军情观察室20171004.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6065/[阳光电影-www.ygdy8.com]军情观察室20171011.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6078/[阳光电影-www.ygdy8.com]军情观察室20171018.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6085/[阳光电影-www.ygdy8.com]军情观察室20171025.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6056/[阳光电影-www.ygdy8.com]军情观察室20171004.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6065/[阳光电影-www.ygdy8.com]军情观察室20171011.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6078/[阳光电影-www.ygdy8.com]军情观察室20171018.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6085/[阳光电影-www.ygdy8.com]军情观察室20171025.mkv', 'admin', '', 'Z', 10.0, 1, 0);
