INSERT INTO `gx_video` VALUES (8167, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6054/[阳光电影-www.ygdy8.com]综艺大集合20171001.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6060/[阳光电影-www.ygdy8.com]综艺大集合20171008.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6074/[阳光电影-www.ygdy8.com]综艺大集合20171015.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6080/[阳光电影-www.ygdy8.com]综艺大集合20171022.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6054/[阳光电影-www.ygdy8.com]综艺大集合20171001.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6060/[阳光电影-www.ygdy8.com]综艺大集合20171008.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6074/[阳光电影-www.ygdy8.com]综艺大集合20171015.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6080/[阳光电影-www.ygdy8.com]综艺大集合20171022.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8168, 4, '一周的偶像', '', '', '#FF0000', '', '', '<p>《一周的偶像》是一档室内访谈节目，由韩国资深娱乐节目主持人郑亨敦与嘻哈歌手Defconn双人组合共同主持，针对最新韩流发烧娱乐话题，每集专访一组粉丝最爱的偶像团体。主持人与偶像成员的快问快答，充满爆笑与即时性的综艺效果。另外，节目亲临偶像出没场所，对粉丝公开偶像地图，且用监视摄影机，偷偷记录偶像们面对突发状况的行为反应，每周带来韩流偶像难得一见的模样。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fha33ejy23j205k08c757.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6026/[阳光电影-www.ygdy8.com]一周的偶像20170907.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6034/[阳光电影-www.ygdy8.com]一周的偶像20170913.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6043/[阳光电影-www.ygdy8.com]一周的偶像20170920.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6049/[阳光电影-www.ygdy8.com]一周的偶像20170927.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6026/[阳光电影-www.ygdy8.com]一周的偶像20170907.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6034/[阳光电影-www.ygdy8.com]一周的偶像20170913.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6043/[阳光电影-www.ygdy8.com]一周的偶像20170920.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6049/[阳光电影-www.ygdy8.com]一周的偶像20170927.rmvb', 'admin', '', 'Y', 10.0, 1, 0);
