INSERT INTO `gx_video` VALUES (8175, 4, '蒙面歌王', '', '', '#FF0000', '', '', '<p>《蒙面歌王》是MBC倾心打造的一档音乐节目。参赛者带上特殊的假面以隐藏身份，不管年龄、性别、职业、资历，只凭歌声一决胜负的节目形式引人关注！在听歌的同时猜测歌手到底是谁也成为节目的一大特色和亮点。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fh7rjjfb6kj20hs06oq39.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6022/[阳光电影-www.ygdy8.com]蒙面歌王20170903.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6022/[阳光电影-www.ygdy8.com]蒙面歌王20170903.mp4', 'admin', '', 'M', 10.0, 1, 0);
