INSERT INTO `gx_video` VALUES (8177, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6022/[阳光电影-www.ygdy8.com]两天一夜20170903.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6029/[阳光电影-www.ygdy8.com]两天一夜20170910.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6039/[阳光电影-www.ygdy8.com]两天一夜20170917.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6045/[阳光电影-www.ygdy8.com]两天一夜20170924.mkv  ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6022/[阳光电影-www.ygdy8.com]两天一夜20170903.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6029/[阳光电影-www.ygdy8.com]两天一夜20170910.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6039/[阳光电影-www.ygdy8.com]两天一夜20170917.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6045/[阳光电影-www.ygdy8.com]两天一夜20170924.mkv  ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8178, 4, '我们相爱吧第三季', '', '', '#FF0000', '', '', '<p>《我们相爱吧第三季》是由江苏卫视与韩国MBC电视台联合制作的恋爱实境真人秀电视节目，该节目由斯柯达昕动冠名，节目《我们相爱吧第三季》通过明星们组成假想情侣，进行假想情侣生活，该节目将于2017年在江苏卫视播出。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fgbd182inlj207f08c3yl.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6022/[阳光电影-www.ygdy8.com]我们相爱吧第三季20170903.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6031/[阳光电影-www.ygdy8.com]我们相爱吧第三季20170910.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6022/[阳光电影-www.ygdy8.com]我们相爱吧第三季20170903.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6031/[阳光电影-www.ygdy8.com]我们相爱吧第三季20170910.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8179, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>全国范围内热到炸裂的天气，让人心中不免躁动。而燃到炸裂的拼多多特约《极限挑战》第三季的第二期将于7月16日晚10点正式开播，“极限男人帮”化躁动为行动，红火出击，南下佛山，闯荡风雨武林路。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f30waeec55j20ch0gon0y.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6022/[阳光电影-www.ygdy8.com]极限挑战第三季20170903.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6022/[阳光电影-www.ygdy8.com]极限挑战第三季20170903.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8180, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6054/[阳光电影-www.ygdy8.com]综艺大集合20171001.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6060/[阳光电影-www.ygdy8.com]综艺大集合20171008.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6074/[阳光电影-www.ygdy8.com]综艺大集合20171015.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6080/[阳光电影-www.ygdy8.com]综艺大集合20171022.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6089/[阳光电影-www.ygdy8.com]综艺大集合20171029.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6054/[阳光电影-www.ygdy8.com]综艺大集合20171001.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6060/[阳光电影-www.ygdy8.com]综艺大集合20171008.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6074/[阳光电影-www.ygdy8.com]综艺大集合20171015.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6080/[阳光电影-www.ygdy8.com]综艺大集合20171022.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6089/[阳光电影-www.ygdy8.com]综艺大集合20171029.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8181, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]RunningMan20170903.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]RunningMan20170910.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6038/[阳光电影-www.ygdy8.com]RunningMan20170917.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6045/[阳光电影-www.ygdy8.com]RunningMan20170924.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]RunningMan20170903.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]RunningMan20170910.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6038/[阳光电影-www.ygdy8.com]RunningMan20170917.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6045/[阳光电影-www.ygdy8.com]RunningMan20170924.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8182, 4, '认识的哥哥', '', '', '#FF0000', '', '', '<p>《认识的哥哥》节目是根据主题不同，以存在于人生中，虽不是很重大，却会让人好奇不已，不得到答案就浑身不自在的问题<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fdljka0l66j20rs09x14w.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]认识的哥哥20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6029/[阳光电影-www.ygdy8.com]认识的哥哥20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6038/[阳光电影-www.ygdy8.com]认识的哥哥20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]认识的哥哥20170923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6053/[阳光电影-www.ygdy8.com]认识的哥哥20170930.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]认识的哥哥20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6029/[阳光电影-www.ygdy8.com]认识的哥哥20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6038/[阳光电影-www.ygdy8.com]认识的哥哥20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]认识的哥哥20170923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6053/[阳光电影-www.ygdy8.com]认识的哥哥20170930.mp4', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8183, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]无限挑战20170902.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]无限挑战20170902.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8184, 4, '跨界喜剧王', '', '', '#FF0000', '', '', '<p>《跨界喜剧王》作为北京卫视第三季度的重榜节目，以“跨界， 我为快乐而来”为核心，将继续引领“跨界”风潮，极致打造“跨界”品牌。小沈阳继在《跨界歌王》荣膺季军后，继续跨界成为《跨界喜剧王》舞台上的“喜剧召集人”<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f7k5wpv42yj20od0c6n1f.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170902.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170909.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170916.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170923.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170930.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170902.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170909.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170916.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170923.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170930.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8185, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>由浙江卫视联合北文传媒、大碗娱乐、北京文化共同出品、三全儿童水饺独家冠名的实景明星即兴喜剧节目《开心剧乐部》，以打造全新的喜剧类综艺为制作理念，让嘉宾身处不同的喜剧场景中，接受并完成即兴的喜剧表演创作。 \u200b\u200b\u200b\u200b<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fhmsr3uqlyj207g07g74k.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]开心剧乐部20170902.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]开心剧乐部20170909.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]开心剧乐部20170916.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6045/[阳光电影-www.ygdy8.com]开心剧乐部20170923.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]开心剧乐部20170902.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]开心剧乐部20170909.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]开心剧乐部20170916.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6045/[阳光电影-www.ygdy8.com]开心剧乐部20170923.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8186, 4, '旅途的花样', '', '', '#FF0000', '', '', '<p>《旅途的花样》作为东方卫视2017年力推的一档明星旅行体验类真人秀，目前官方公布的旅行地有摩洛哥、俄罗斯、挪威和丹麦等国家。 \u200b\u200b\u200b\u200b<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fga7zukek0j20dw0opabs.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]旅途的花样20170902.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]旅途的花样20170902.mp4', 'admin', '', 'L', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8187, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>浙江卫视《挑战者联盟第三季》，将于今年7月正式回归周六黄金档。新一季的《挑战者联盟》继续由范冰冰带队挑战，“两朝元老”陈学冬持续加盟，更有马苏、欧弟、曾舜、彭小苒、张钧甯、严屹宽、谭松韵等新人挑战者加入，展开一场别开生面的城际挑战，带领观众深入感受每个城市特色<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fh5x59czdaj207g04hjrj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]挑战者联盟20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170909.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6038/[阳光电影-www.ygdy8.com]挑战者联盟20170916.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]挑战者联盟20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170909.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6038/[阳光电影-www.ygdy8.com]挑战者联盟20170916.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8188, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]快乐大本营20170902.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]快乐大本营20170909.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]快乐大本营20170916.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6045/[阳光电影-www.ygdy8.com]快乐大本营20170923.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6053/[阳光电影-www.ygdy8.com]快乐大本营20170930.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]快乐大本营20170902.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]快乐大本营20170909.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]快乐大本营20170916.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6045/[阳光电影-www.ygdy8.com]快乐大本营20170923.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6053/[阳光电影-www.ygdy8.com]快乐大本营20170930.mp4', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8189, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]非诚勿扰20170902.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]非诚勿扰20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]非诚勿扰20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]非诚勿扰20170923.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6053/[阳光电影-www.ygdy8.com]非诚勿扰20170930.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]非诚勿扰20170902.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]非诚勿扰20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]非诚勿扰20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]非诚勿扰20170923.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6053/[阳光电影-www.ygdy8.com]非诚勿扰20170930.mp4', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8190, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>《中餐厅》是湖南卫视推出的青春合伙人经营体验节目。节目由赵薇、黄晓明、周冬雨、张亮、靳梦佳5位经营合伙人通过在泰国经营一家中餐厅，每期邀请嘉宾作为帮工出现，做出令人骄傲的中国味道。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fhtok1bi38j20fo0h9q4h.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]中餐厅20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]中餐厅20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]中餐厅20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]中餐厅20170923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6053/[阳光电影-www.ygdy8.com]中餐厅20170930.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]中餐厅20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]中餐厅20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]中餐厅20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]中餐厅20170923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6053/[阳光电影-www.ygdy8.com]中餐厅20170930.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8191, 4, '锵锵三人行', '', '', '#FF0000', '', '', '<p>《锵锵三人行》是凤凰卫视出品的谈话类节目，由主持人窦文涛与两岸三地传媒界之精英名嘴，一起针对每日热门新闻事件进行研究，并各抒己见，但却又不属于追求问题答案的正论，而是俗人闲话，一派多少天下事，尽付笑谈中的豪情，达至融汇信息传播，制造乐趣与辩析事理三大元素于一身的目的。看似“平衡一下”的“滑头话”，其实是窦文涛引导嘉宾发表具个人色彩的大胆言论，营造日常聊天的形态、谈笑风生的气氛，力求轻松、惹笑。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e894w9dvj5j205306w3yj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]锵锵三人行20170901.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6023/[阳光电影-www.ygdy8.com]锵锵三人行20170904.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6024/[阳光电影-www.ygdy8.com]锵锵三人行20170905.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6026/[阳光电影-www.ygdy8.com]锵锵三人行20170906.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6026/[阳光电影-www.ygdy8.com]锵锵三人行20170907.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]锵锵三人行20170908.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]锵锵三人行20170901.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6023/[阳光电影-www.ygdy8.com]锵锵三人行20170904.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6024/[阳光电影-www.ygdy8.com]锵锵三人行20170905.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6026/[阳光电影-www.ygdy8.com]锵锵三人行20170906.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6026/[阳光电影-www.ygdy8.com]锵锵三人行20170907.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]锵锵三人行20170908.mkv', 'admin', '', 'Q', 10.0, 1, 0);
