INSERT INTO `gx_video` VALUES (8193, 4, '综艺3国智', '', '', '#FF0000', '', '', '<p>《综艺3国智》，官方英文名3 Kingdoms，是台湾电视公司监制及首播的实境外景节目，主持人为李李仁、纳豆、王少伟、黄路梓茵、明杰、风田、Evan、Teddy、 张立东、玛丽，台视主频于2016年11月12日首播。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fh5wyh40i8j20p00eqtau.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]综艺3国智20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]综艺3国智20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]综艺3国智20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]综艺3国智20170923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]综艺3国智20170930.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]综艺3国智20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]综艺3国智20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]综艺3国智20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]综艺3国智20170923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]综艺3国智20170930.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8194, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]综艺玩很大20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]综艺玩很大20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]综艺玩很大20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]综艺玩很大20170923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]综艺玩很大20170930.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]综艺玩很大20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]综艺玩很大20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]综艺玩很大20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]综艺玩很大20170923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]综艺玩很大20170930.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8195, 4, '超级夜总会', '', '', '#FF0000', '', '', '<p>《超级夜总会》是三立电视台独立制作的一档综艺娱乐节目，以歌曲演唱、幽默情景剧、户外与观众近距离互动为主要元素，是台湾第一个电视台出动大型舞台车至各县市镇、乡、村的著名观光景点、夜市、庙宇录制的节目。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3hdcxn0doj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]超级夜总会20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6038/[阳光电影-www.ygdy8.com]超级夜总会20170916.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]超级夜总会20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6038/[阳光电影-www.ygdy8.com]超级夜总会20170916.mp4', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8196, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]天才冲冲冲20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]天才冲冲冲20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]天才冲冲冲20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]天才冲冲冲20170923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]天才冲冲冲20170930.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]天才冲冲冲20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]天才冲冲冲20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]天才冲冲冲20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]天才冲冲冲20170923.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]天才冲冲冲20170930.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8197, 4, '极速前进', '', '', '#FF0000', '', '', '<p>《极速前进》源于美国经典真人秀电视节目《The Amazing Race》（中文译名同样为极速前进），该节目自2001年开播至今已25季，共10次斩获“电视界奥斯卡”艾美奖中真人秀最高荣誉——“黄金档最佳竞技类真人秀”。在重重筛选之后，《The Amazing Race》选择与深圳卫视合作，由深圳卫视和英菲尼迪双方联合制作中国版《极速前进》，将环球竞速真人秀模式引入中国。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfgw1elvrqfw0ijj20a307j3zd.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]极速前进20170901.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]极速前进20170908.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6035/[阳光电影-www.ygdy8.com]极速前进20170915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]极速前进20170922.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]极速前进20170929.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]极速前进20170901.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6028/[阳光电影-www.ygdy8.com]极速前进20170908.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6035/[阳光电影-www.ygdy8.com]极速前进20170915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]极速前进20170922.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]极速前进20170929.mp4', 'admin', '', 'J', 10.0, 1, 0);
