INSERT INTO `gx_video` VALUES (8201, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6020/[阳光电影-www.ygdy8.com]娱乐百分百20170901.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6021/[阳光电影-www.ygdy8.com]娱乐百分百20170902.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6022/[阳光电影-www.ygdy8.com]娱乐百分百20170904.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6023/[阳光电影-www.ygdy8.com]娱乐百分百20170905.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6024/[阳光电影-www.ygdy8.com]娱乐百分百20170906.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6025/[阳光电影-www.ygdy8.com]娱乐百分百20170907.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6027/[阳光电影-www.ygdy8.com]娱乐百分百20170908.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6029/[阳光电影-www.ygdy8.com]娱乐百分百20170909.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6030/[阳光电影-www.ygdy8.com]娱乐百分百20170911.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6032/[阳光电影-www.ygdy8.com]娱乐百分百20170912.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6033/[阳光电影-www.ygdy8.com]娱乐百分百20170913.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6034/[阳光电影-www.ygdy8.com]娱乐百分百20170914.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6035/[阳光电影-www.ygdy8.com]娱乐百分百20170915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6038/[阳光电影-www.ygdy8.com]娱乐百分百20170916.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6039/[阳光电影-www.ygdy8.com]娱乐百分百20170918.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6040/[阳光电影-www.ygdy8.com]娱乐百分百20170919.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6041/[阳光电影-www.ygdy8.com]娱乐百分百20170920.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6042/[阳光电影-www.ygdy8.com]娱乐百分百20170921.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6044/[阳光电影-www.ygdy8.com]娱乐百分百20170922.mp4\nftp:/