INSERT INTO `gx_video` VALUES (8204, 4, '中国新歌声', '', '', '#FF0000', '', '', '<p>《中国新歌声》是由浙江卫视联合星空传媒旗下灿星制作打造的大型原创专业音乐节目。自2016年起，系列节目不再引进国外版权，而是采用原创模式。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fhkyjhvuooj20fa08mweo.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6020/[阳光电影-www.ygdy8.com]中国新歌声第二季20170901.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6026/[阳光电影-www.ygdy8.com]中国新歌声第二季20170908.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6035/[阳光电影-www.ygdy8.com]中国新歌声第二季20170915.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6043/[阳光电影-www.ygdy8.com]中国新歌声第二季20170922.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]中国新歌声20170929.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6020/[阳光电影-www.ygdy8.com]中国新歌声第二季20170901.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6026/[阳光电影-www.ygdy8.com]中国新歌声第二季20170908.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6035/[阳光电影-www.ygdy8.com]中国新歌声第二季20170915.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6043/[阳光电影-www.ygdy8.com]中国新歌声第二季20170922.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]中国新歌声20170929.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8205, 4, '我们来了', '', '', '#FF0000', '', '', '<p>《我们来了》第二季（英文：Up Idol 3），又名《偶像来了》第三季，是中国大陆湖南卫视于2017年第三季度推出的一档周五黄金档女神生活体验类真人秀节目，也是2017湖南卫视节目巡礼重点推介的一档节目。 \u3000\u3000第二季的嘉宾构成较第一季有所升级。在保留原有的两名主持人兼队长的前提之下，本季在女嘉宾的选择上较第一季更为多元化。除了会邀请演艺界知名人士参加节目之外，亦会邀请一部分来自其他职业的中国90后女性精英，年龄在18－27岁之间。本季参加节目的女嘉宾共有10位，其中包括6位偶像队员及4位素人队员，以分组对抗的模式进行。两组各有一名队长、三名偶像队员及两名素人队员，新加入的素人队员将与偶像队员共同进行两天一夜的对抗任务。并在对抗过程中体验各种中华传统文化，更多元地向观众展现东方女性之美。<img alt="" src="http://ww2.sinaimg.cn/mw690/444476dfgw1f63vld9wcpj20j60y2tei.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6020/[阳光电影-www.ygdy8.com]我们来了第三季20170901.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6026/[阳光电影-www.ygdy8.com]我们来了第三季20170908.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6035/[阳光电影-www.ygdy8.com]我们来了第三季20170915.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6043/[阳光电影-www.ygdy8.com]我们来了第三季20170922.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]我们来了第三季20170929.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6020/[阳光电影-www.ygdy8.com]我们来了第三季20170901.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6026/[阳光电影-www.ygdy8.com]我们来了第三季20170908.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6035/[阳光电影-www.ygdy8.com]我们来了第三季20170915.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6043/[阳光电影-www.ygdy8.com]我们来了第三季20170922.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]我们来了第三季20170929.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8206, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6020/[阳光电影-www.ygdy8.com]天天向上2070901.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6026/[阳光电影-www.ygdy8.com]天天向上2070908.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]天天向上20170915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6043/[阳光电影-www.ygdy8.com]天天向上2070922.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]天天向上20170929.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:6020/[阳光电影-www.ygdy8.com]天天向上2070901.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6026/[阳光电影-www.ygdy8.com]天天向上2070908.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6036/[阳光电影-www.ygdy8.com]天天向上20170915.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6043/[阳光电影-www.ygdy8.com]天天向上2070922.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6052/[阳光电影-www.ygdy8.com]天天向上20170929.mp4', 'admin', '', 'T', 10.0, 1, 0);
