INSERT INTO `gx_video` VALUES (8208, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>想深入了解明星的生活点滴？想全程掌握巨星的蛛丝马迹吗？瞬息万变的影剧视界，「完全娱乐」分秒必争，报导最精彩，天天现场直播大放送，最High Speed的各类星闻及明星艺人专访，让你的八卦神经完全启动，绝不秀逗台港大陆三地劲爆红星，惊人内幕、大胆呈现，明星八卦，漏网星闻，世界性娱乐新闻、国际化独家采访，台前幕後，国内国外，别人没有的我们有，别人有的我们绝对第一手，最新最HITO的娱乐新闻，完全娱乐 精彩传送。有《我跟你拼了》、《交换梦想》等多个单元，包你看到笑，又丰富了娱乐知识。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bip1w31lj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]完全娱乐20170812.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]完全娱乐20170813.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]完全娱乐20170812.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]完全娱乐20170813.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
