INSERT INTO `gx_video` VALUES (8210, 4, '我们相爱吧第三季', '', '', '#FF0000', '', '', '<p>《我们相爱吧第三季》是由江苏卫视与韩国MBC电视台联合制作的恋爱实境真人秀电视节目，该节目由斯柯达昕动冠名，节目《我们相爱吧第三季》通过明星们组成假想情侣，进行假想情侣生活，该节目将于2017年在江苏卫视播出。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fgbd182inlj207f08c3yl.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4284/[阳光电影-www.ygdy8.com]我们相爱吧第三季20170806.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6001/[阳光电影-www.ygdy8.com]我们相爱吧第三季20170813.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6010/[阳光电影-www.ygdy8.com]我们相爱吧第三季20170820.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6015/[阳光电影-www.ygdy8.com]我们相爱吧第三季20170827.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4284/[阳光电影-www.ygdy8.com]我们相爱吧第三季20170806.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6001/[阳光电影-www.ygdy8.com]我们相爱吧第三季20170813.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6010/[阳光电影-www.ygdy8.com]我们相爱吧第三季20170820.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6015/[阳光电影-www.ygdy8.com]我们相爱吧第三季20170827.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8211, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4284/[阳光电影-www.ygdy8.com]RunningMan20170806.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6001/[阳光电影-www.ygdy8.com]RunningMan20170813.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]RunningMan20170820.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]RunningMan20170827.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4284/[阳光电影-www.ygdy8.com]RunningMan20170806.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6001/[阳光电影-www.ygdy8.com]RunningMan20170813.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]RunningMan20170820.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]RunningMan20170827.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
