INSERT INTO `gx_video` VALUES (8215, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>全国范围内热到炸裂的天气，让人心中不免躁动。而燃到炸裂的拼多多特约《极限挑战》第三季的第二期将于7月16日晚10点正式开播，“极限男人帮”化躁动为行动，红火出击，南下佛山，闯荡风雨武林路。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f30waeec55j20ch0gon0y.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4284/[阳光电影-www.ygdy8.com]极限挑战第三季20170806.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6001/[阳光电影-www.ygdy8.com]极限挑战第三季20170813.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6010/[阳光电影-www.ygdy8.com]极限挑战第三季20170820.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6015/[阳光电影-www.ygdy8.com]极限挑战第三季20170827.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4284/[阳光电影-www.ygdy8.com]极限挑战第三季20170806.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6001/[阳光电影-www.ygdy8.com]极限挑战第三季20170813.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6010/[阳光电影-www.ygdy8.com]极限挑战第三季20170820.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6015/[阳光电影-www.ygdy8.com]极限挑战第三季20170827.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8216, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4284/[阳光电影-www.ygdy8.com]综艺大集合20170806.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]综艺大集合20170813.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6015/[阳光电影-www.ygdy8.com]C大集合20170827.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4284/[阳光电影-www.ygdy8.com]综艺大集合20170806.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]综艺大集合20170813.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6015/[阳光电影-www.ygdy8.com]C大集合20170827.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8217, 4, '人气歌谣', '', '', '#FF0000', '', '', '<p>《人气歌谣》每周日播出，主要是一个歌手的新歌和新专集得以COME BACK回归的第一平台，因此参加演出的歌手以最近一段时间的人气歌曲为主。基本形式是每周选出TAKE7进行打榜，最终选出一名周冠军，其中也穿插很多明星的COME BACK舞台。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfgw1eacv7d4jhcj20cq09a74t.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]人气歌谣20170806.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]人气歌谣20170813.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]人气歌谣20170820.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6015/[阳光电影-www.ygdy8.com]人气歌谣20170827.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]人气歌谣20170806.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]人气歌谣20170813.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]人气歌谣20170820.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6015/[阳光电影-www.ygdy8.com]人气歌谣20170827.mp4', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8218, 4, '认识的哥哥', '', '', '#FF0000', '', '', '<p>《认识的哥哥》节目是根据主题不同，以存在于人生中，虽不是很重大，却会让人好奇不已，不得到答案就浑身不自在的问题<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fdljka0l66j20rs09x14w.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]认识的哥哥20170805.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]认识的哥哥20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]认识的哥哥20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]认识的哥哥20170826.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]认识的哥哥20170805.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]认识的哥哥20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]认识的哥哥20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]认识的哥哥20170826.mp4', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8219, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]无限挑战20170805.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]无限挑战20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]无限挑战20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]无限挑战20170826.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]无限挑战20170805.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]无限挑战20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]无限挑战20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]无限挑战20170826.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8220, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>浙江卫视《挑战者联盟第三季》，将于今年7月正式回归周六黄金档。新一季的《挑战者联盟》继续由范冰冰带队挑战，“两朝元老”陈学冬持续加盟，更有马苏、欧弟、曾舜、彭小苒、张钧甯、严屹宽、谭松韵等新人挑战者加入，展开一场别开生面的城际挑战，带领观众深入感受每个城市特色<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fh5x59czdaj207g04hjrj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170805.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170819.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170826.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170805.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170819.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170826.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8221, 4, '跨界喜剧王', '', '', '#FF0000', '', '', '<p>《跨界喜剧王》作为北京卫视第三季度的重榜节目，以“跨界， 我为快乐而来”为核心，将继续引领“跨界”风潮，极致打造“跨界”品牌。小沈阳继在《跨界歌王》荣膺季军后，继续跨界成为《跨界喜剧王》舞台上的“喜剧召集人”<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f7k5wpv42yj20od0c6n1f.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170805.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170812.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170819.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6018/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170826.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170805.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170812.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170819.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6018/[阳光电影-www.ygdy8.com]跨界喜剧王第二季20170826.mkv', 'admin', '', 'K', 10.0, 1, 0);
