INSERT INTO `gx_video` VALUES (8223, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>由浙江卫视联合北文传媒、大碗娱乐、北京文化共同出品、三全儿童水饺独家冠名的实景明星即兴喜剧节目《开心剧乐部》，以打造全新的喜剧类综艺为制作理念，让嘉宾身处不同的喜剧场景中，接受并完成即兴的喜剧表演创作。 \u200b\u200b\u200b\u200b<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fhmsr3uqlyj207g07g74k.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]开心剧乐部20170805.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]开心剧乐部20170812.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]开心剧乐部20170819.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6015/[阳光电影-www.ygdy8.com]开心剧乐部20170826.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]开心剧乐部20170805.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]开心剧乐部20170812.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]开心剧乐部20170819.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6015/[阳光电影-www.ygdy8.com]开心剧乐部20170826.mkv ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8224, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]快乐大本营20170805.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]快乐大本营20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]快乐大本营20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]快乐大本营20170826.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]快乐大本营20170805.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]快乐大本营20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]快乐大本营20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]快乐大本营20170826.mp4', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8225, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]非诚勿扰20170805.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]非诚勿扰20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]非诚勿扰20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]非诚勿扰20170826.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]非诚勿扰20170805.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]非诚勿扰20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]非诚勿扰20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]非诚勿扰20170826.mp4', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8226, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>《中餐厅》是湖南卫视推出的青春合伙人经营体验节目。节目由赵薇、黄晓明、周冬雨、张亮、靳梦佳5位经营合伙人通过在泰国经营一家中餐厅，每期邀请嘉宾作为帮工出现，做出令人骄傲的中国味道。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fhtok1bi38j20fo0h9q4h.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]中餐厅20170805.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]中餐厅20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]中餐厅20170819.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]中餐厅20170826.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]中餐厅20170805.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]中餐厅20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]中餐厅20170819.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6014/[阳光电影-www.ygdy8.com]中餐厅20170826.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8227, 4, '综艺玩很大', '', '', '#FF0000', '', '', '<p>《综艺玩很大》是三立电视制作，并先后与台湾电视公司、中国电视公司联合监制及首播的外景节目，2014年7月19日起于台视主频首播，2014年7月20日起于三立都会台首播，主持人为吴宗宪及林柏升 (KID)。2014年12月13日起，台视主频播出时间改为22：00。2015年2月7日起，无线台版权由台视主频改至中视播出，周六22：00播出。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fh6mnr1gbej21hc0sewi2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]综艺玩很大20170805.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4291/[阳光电影-www.ygdy8.com]综艺玩很大20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]综艺玩很大20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]综艺玩很大20170826.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]综艺玩很大20170805.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4291/[阳光电影-www.ygdy8.com]综艺玩很大20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]综艺玩很大20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]综艺玩很大20170826.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8228, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]天才nnn20170805.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]天才冲冲冲20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]天才冲冲冲20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]天才冲冲冲20170826.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4283/[阳光电影-www.ygdy8.com]天才nnn20170805.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]天才冲冲冲20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]天才冲冲冲20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]天才冲冲冲20170826.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8229, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目首录主持加来宾阵容庞大，小宇（左起）、朱俐静、巫启贤、张小燕、李圣杰、阿Ken，齐聚第二现场KTV包厢。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fh6moml5ugj20i80dodhi.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4282/[阳光电影-www.ygdy8.com]K歌大明星20170805.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]K歌大明星20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]K歌大明星20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]K歌大明星20170826.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4282/[阳光电影-www.ygdy8.com]K歌大明星20170805.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]K歌大明星20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]K歌大明星20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]K歌大明星20170826.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8230, 4, '综艺3国智', '', '', '#FF0000', '', '', '<p>《综艺3国智》，官方英文名3 Kingdoms，是台湾电视公司监制及首播的实境外景节目，主持人为李李仁、纳豆、王少伟、黄路梓茵、明杰、风田、Evan、Teddy、 张立东、玛丽，台视主频于2016年11月12日首播。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fh5wyh40i8j20p00eqtau.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4282/[阳光电影-www.ygdy8.com]综艺3国智20170805.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4291/[阳光电影-www.ygdy8.com]综艺3国智20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]综艺3国智20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]综艺3国智20170826.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4282/[阳光电影-www.ygdy8.com]综艺3国智20170805.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4291/[阳光电影-www.ygdy8.com]综艺3国智20170812.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]综艺3国智20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]综艺3国智20170826.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8231, 4, '中国新歌声', '', '', '#FF0000', '', '', '<p>《中国新歌声》是由浙江卫视联合星空传媒旗下灿星制作打造的大型原创专业音乐节目。自2016年起，系列节目不再引进国外版权，而是采用原创模式。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fhkyjhvuooj20fa08mweo.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4281/[阳光电影-www.ygdy8.com]中国新歌声第二季20170804.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6001/[阳光电影-www.ygdy8.com]中国新歌声第二季20170811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6007/[阳光电影-www.ygdy8.com]中国新歌声第二季20170818.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]中国新歌声第二季20170825.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4281/[阳光电影-www.ygdy8.com]中国新歌声第二季20170804.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6001/[阳光电影-www.ygdy8.com]中国新歌声第二季20170811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6007/[阳光电影-www.ygdy8.com]中国新歌声第二季20170818.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]中国新歌声第二季20170825.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8232, 4, '我们来了', '', '', '#FF0000', '', '', '<p>《我们来了》第二季（英文：Up Idol 3），又名《偶像来了》第三季，是中国大陆湖南卫视于2017年第三季度推出的一档周五黄金档女神生活体验类真人秀节目，也是2017湖南卫视节目巡礼重点推介的一档节目。 \u3000\u3000第二季的嘉宾构成较第一季有所升级。在保留原有的两名主持人兼队长的前提之下，本季在女嘉宾的选择上较第一季更为多元化。除了会邀请演艺界知名人士参加节目之外，亦会邀请一部分来自其他职业的中国90后女性精英，年龄在18－27岁之间。本季参加节目的女嘉宾共有10位，其中包括6位偶像队员及4位素人队员，以分组对抗的模式进行。两组各有一名队长、三名偶像队员及两名素人队员，新加入的素人队员将与偶像队员共同进行两天一夜的对抗任务。并在对抗过程中体验各种中华传统文化，更多元地向观众展现东方女性之美。<img alt="" src="http://ww2.sinaimg.cn/mw690/444476dfgw1f63vld9wcpj20j60y2tei.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4281/[阳光电影-www.ygdy8.com]我们来了第三季20170804.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]我们来了第三季20170811.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6007/[阳光电影-www.ygdy8.com]我们来了第三季20170818.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]我们来了第三季2070825.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4281/[阳光电影-www.ygdy8.com]我们来了第三季20170804.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]我们来了第三季20170811.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:6007/[阳光电影-www.ygdy8.com]我们来了第三季20170818.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]我们来了第三季2070825.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8233, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4281/[阳光电影-www.ygdy8.com]天天向上20170804.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4291/[阳光电影-www.ygdy8.com]天天向上20170811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6007/[阳光电影-www.ygdy8.com]天天向上2070818.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]天天向上2070825.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4281/[阳光电影-www.ygdy8.com]天天向上20170804.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4291/[阳光电影-www.ygdy8.com]天天向上20170811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6007/[阳光电影-www.ygdy8.com]天天向上2070818.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]天天向上2070825.mp4', 'admin', '', 'T', 10.0, 1, 0);
