INSERT INTO `gx_video` VALUES (8235, 4, '一周的偶像', '', '', '#FF0000', '', '', '<p>《一周的偶像》是一档室内访谈节目，由韩国资深娱乐节目主持人郑亨敦与嘻哈歌手Defconn双人组合共同主持，针对最新韩流发烧娱乐话题，每集专访一组粉丝最爱的偶像团体。主持人与偶像成员的快问快答，充满爆笑与即时性的综艺效果。另外，节目亲临偶像出没场所，对粉丝公开偶像地图，且用监视摄影机，偷偷记录偶像们面对突发状况的行为反应，每周带来韩流偶像难得一见的模样。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fha33ejy23j205k08c757.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4280/[阳光电影-www.ygdy8.com]一周的偶像20170802.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4288/[阳光电影-www.ygdy8.com]一周的偶像20170809.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6005/[阳光电影-www.ygdy8.com]一周的偶像20170816.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6012/[阳光电影-www.ygdy8.com]一周的偶像20170823.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6018/[阳光电影-www.ygdy8.com]一周的偶像20170830.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4280/[阳光电影-www.ygdy8.com]一周的偶像20170802.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4288/[阳光电影-www.ygdy8.com]一周的偶像20170809.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6005/[阳光电影-www.ygdy8.com]一周的偶像20170816.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6012/[阳光电影-www.ygdy8.com]一周的偶像20170823.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6018/[阳光电影-www.ygdy8.com]一周的偶像20170830.rmvb', 'admin', '', 'Y', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8236, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>凤凰中文台军情观察室节目坐阵曾有“情报收集中心”之称的香港紧贴每周的全球热点军事话题以丰富、有趣的电视动画以及快节奏播报大量信息的方式为您搜罗军事情报同时请来军事专家对热点话题进行深度地分析与解读。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e8bbkka8mkj20700a0weu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4280/[阳光电影-www.ygdy8.com]军情观察室20170802.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4288/[阳光电影-www.ygdy8.com]军情观察室20170809.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6005/[阳光电影-www.ygdy8.com]军情观察室20170816.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6012/[阳光电影-www.ygdy8.com]军情观察室20170823.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6018/[阳光电影-www.ygdy8.com]军情观察室20170830.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4280/[阳光电影-www.ygdy8.com]军情观察室20170802.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4288/[阳光电影-www.ygdy8.com]军情观察室20170809.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6005/[阳光电影-www.ygdy8.com]军情观察室20170816.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6012/[阳光电影-www.ygdy8.com]军情观察室20170823.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6018/[阳光电影-www.ygdy8.com]军情观察室20170830.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8237, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4279/[阳光电影-www.ygdy8.com]娱乐百分百20170801.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4279/[阳光电影-www.ygdy8.com]娱乐百分百20170802.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4280/[阳光电影-www.ygdy8.com]娱乐百分百20170803.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4282/[阳光电影-www.ygdy8.com]娱乐百分百20170804.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4282/[阳光电影-www.ygdy8.com]娱乐百分百20170805.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4285/[阳光电影-www.ygdy8.com]娱乐百分百20170807.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4287/[阳光电影-www.ygdy8.com]娱乐百分百20170808.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4289/[阳光电影-www.ygdy8.com]娱乐百分百20170809.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4289/[阳光电影-www.ygdy8.com]娱乐百分百20170810.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4291/[阳光电影-www.ygdy8.com]娱乐百分百20170811.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4292/[阳光电影-www.ygdy8.com]娱乐百分百20170812.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:6002/[阳光电影-www.ygdy8.com]娱乐百分百20170814.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6004/[阳光电影-www.ygdy8.com]娱乐百分百20170815.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6005/[阳光电影-www.ygdy8.com]娱乐百分百20170816.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6006/[阳光电影-www.ygdy8.com]娱乐百分百20170817.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6008/[阳光电影-www.ygdy8.com]娱乐百分百20170818.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6009/[阳光电影-www.ygdy8.com]娱乐百分百20170819.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6010/[阳光电影-www.ygdy8.com]娱乐百分百20170821.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:6012/[阳光电影-www.ygdy8.com]娱乐百分百20170822.mp4