INSERT INTO `gx_video` VALUES (8241, 4, '锵锵三人行', '', '', '#FF0000', '', '', '<p>《锵锵三人行》是凤凰卫视出品的谈话类节目，由主持人窦文涛与两岸三地传媒界之精英名嘴，一起针对每日热门新闻事件进行研究，并各抒己见，但却又不属于追求问题答案的正论，而是俗人闲话，一派多少天下事，尽付笑谈中的豪情，达至融汇信息传播，制造乐趣与辩析事理三大元素于一身的目的。看似“平衡一下”的“滑头话”，其实是窦文涛引导嘉宾发表具个人色彩的大胆言论，营造日常聊天的形态、谈笑风生的气氛，力求轻松、惹笑。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e894w9dvj5j205306w3yj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4279/[阳光电影-www.ygdy8.com]锵锵三人行20170801.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4280/[阳光电影-www.ygdy8.com]锵锵三人行20170802.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4281/[阳光电影-www.ygdy8.com]锵锵三人行20170803.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4281/[阳光电影-www.ygdy8.com]锵锵三人行20170804.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4286/[阳光电影-www.ygdy8.com]锵锵三人行20170807.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4286/[阳光电影-www.ygdy8.com]锵锵三人行20170808.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4288/[阳光电影-www.ygdy8.com]锵锵三人行20170809.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4288/[阳光电影-www.ygdy8.com]锵锵三人行20170810.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4291/[阳光电影-www.ygdy8.com]锵锵三人行20170811.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6001/[阳光电影-www.ygdy8.com]锵锵三人行20170814.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6003/[阳光电影-www.ygdy8.com]锵锵三人行20170815.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6005/[阳光电影-www.ygdy8.com]锵锵三人行20170816.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6007/[阳光电影-www.ygdy8.com]锵锵三人行20170817.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6007/[阳光电影-www.ygdy8.com]锵锵三人行20170818.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6010/[阳光电影-www.ygdy8.com]锵锵三人行20170821.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6012/[阳光电影-www.ygdy8.com]锵锵三人行20170822.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6012/[阳光电影-www.ygdy8.com]锵锵三人行20170823.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6012/[阳光电影-www.ygdy8.com]锵锵三人行20170824.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6013/[阳光电影-www.ygdy8.com]锵锵三人行20170825.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:6017/[阳光电影-www.ygdy8.com]锵锵三人行20170828