INSERT INTO `gx_video` VALUES (8244, 4, '跨界喜剧王', '', '', '#FF0000', '', '', '<p>《跨界喜剧王》作为北京卫视第三季度的重榜节目，以“跨界， 我为快乐而来”为核心，将继续引领“跨界”风潮，极致打造“跨界”品牌。小沈阳继在《跨界歌王》荣膺季军后，继续跨界成为《跨界喜剧王》舞台上的“喜剧召集人”<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f7k5wpv42yj20od0c6n1f.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'f\nt\np\n:\n/\n/\ny\ng\nd\ny\n8\n:\ny\ng\nd\ny\n8\n@\ny\ng\n7\n6\n.\nd\ny\nd\ny\nt\nt\n.\nn\ne\nt\n:\n4\n2\n7\n3\n/\n[\n阳\n光\n电\n影\n-\nw\nw\nw\n.\ny\ng\nd\ny\n8\n.\nc\no\nm\n]\n跨\n界\n喜\n剧\n王\n第\n二\n季\n2\n0\n1\n7\n0\n7\n2\n9\n.\nm\nk\nv', 'f\nt\np\n:\n/\n/\ny\ng\nd\ny\n8\n:\ny\ng\nd\ny\n8\n@\ny\ng\n7\n6\n.\nd\ny\nd\ny\nt\nt\n.\nn\ne\nt\n:\n4\n2\n7\n3\n/\n[\n阳\n光\n电\n影\n-\nw\nw\nw\n.\ny\ng\nd\ny\n8\n.\nc\no\nm\n]\n跨\n界\n喜\n剧\n王\n第\n二\n季\n2\n0\n1\n7\n0\n7\n2\n9\n.\nm\nk\nv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8245, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>《中餐厅》是湖南卫视推出的青春合伙人经营体验节目。节目由赵薇、黄晓明、周冬雨、张亮、靳梦佳5位经营合伙人通过在泰国经营一家中餐厅，每期邀请嘉宾作为帮工出现，做出令人骄傲的中国味道。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fhtok1bi38j20fo0h9q4h.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4261/[阳光电影-www.ygdy8.com]中餐厅20170722.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4273/[阳光电影-www.ygdy8.com]中餐厅20170729.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4261/[阳光电影-www.ygdy8.com]中餐厅20170722.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4273/[阳光电影-www.ygdy8.com]中餐厅20170729.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8246, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>全国范围内热到炸裂的天气，让人心中不免躁动。而燃到炸裂的拼多多特约《极限挑战》第三季的第二期将于7月16日晚10点正式开播，“极限男人帮”化躁动为行动，红火出击，南下佛山，闯荡风雨武林路。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f30waeec55j20ch0gon0y.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4252/[阳光电影-www.ygdy8.com]极限挑战第三季20170709.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4252/[阳光电影-www.ygdy8.com]极限挑战第三季20170716.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4262/[阳光电影-www.ygdy8.com]极限挑战第三季20170723.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4275/[阳光电影-www.ygdy8.com]极限挑战第三季20170730.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4252/[阳光电影-www.ygdy8.com]极限挑战第三季20170709.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4252/[阳光电影-www.ygdy8.com]极限挑战第三季20170716.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4262/[阳光电影-www.ygdy8.com]极限挑战第三季20170723.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4275/[阳光电影-www.ygdy8.com]极限挑战第三季20170730.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8247, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>由浙江卫视联合北文传媒、大碗娱乐、北京文化共同出品、三全儿童水饺独家冠名的实景明星即兴喜剧节目《开心剧乐部》，以打造全新的喜剧类综艺为制作理念，让嘉宾身处不同的喜剧场景中，接受并完成即兴的喜剧表演创作。 \u200b\u200b\u200b\u200b<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fhmsr3uqlyj207g07g74k.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]开心剧乐部20170708.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]开心剧乐部20170715.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4261/[阳光电影-www.ygdy8.com]开心剧乐部20170722.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4273/[阳光电影-www.ygdy8.com]开心剧乐部20170729.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]开心剧乐部20170708.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]开心剧乐部20170715.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4261/[阳光电影-www.ygdy8.com]开心剧乐部20170722.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4273/[阳光电影-www.ygdy8.com]开心剧乐部20170729.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8248, 4, '中国新歌声', '', '', '#FF0000', '', '', '<p>《中国新歌声》是由浙江卫视联合星空传媒旗下灿星制作打造的大型原创专业音乐节目。自2016年起，系列节目不再引进国外版权，而是采用原创模式。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fhkyjhvuooj20fa08mweo.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4248/[阳光电影-www.ygdy8.com]中国新歌声20170714.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4258/[阳光电影-www.ygdy8.com]中国新歌声第二季20170721.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4270/[阳光电影-www.ygdy8.com]中国新歌声第二季20170728.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4248/[阳光电影-www.ygdy8.com]中国新歌声20170714.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4258/[阳光电影-www.ygdy8.com]中国新歌声第二季20170721.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4270/[阳光电影-www.ygdy8.com]中国新歌声第二季20170728.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8249, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>想深入了解明星的生活点滴？想全程掌握巨星的蛛丝马迹吗？瞬息万变的影剧视界，「完全娱乐」分秒必争，报导最精彩，天天现场直播大放送，最High Speed的各类星闻及明星艺人专访，让你的八卦神经完全启动，绝不秀逗台港大陆三地劲爆红星，惊人内幕、大胆呈现，明星八卦，漏网星闻，世界性娱乐新闻、国际化独家采访，台前幕後，国内国外，别人没有的我们有，别人有的我们绝对第一手，最新最HITO的娱乐新闻，完全娱乐 精彩传送。有《我跟你拼了》、《交换梦想》等多个单元，包你看到笑，又丰富了娱乐知识。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bip1w31lj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4244/[阳光电影-www.ygdy8.com]完全娱乐20170708.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4244/[阳光电影-www.ygdy8.com]完全娱乐20170709.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4275/[阳光电影-www.ygdy8.com]完全娱乐20170729.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4275/[阳光电影-www.ygdy8.com]完全娱乐20170730.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4244/[阳光电影-www.ygdy8.com]完全娱乐20170708.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4244/[阳光电影-www.ygdy8.com]完全娱乐20170709.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4275/[阳光电影-www.ygdy8.com]完全娱乐20170729.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4275/[阳光电影-www.ygdy8.com]完全娱乐20170730.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
