INSERT INTO `gx_video` VALUES (8251, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>简介：全国首档全能艺人们为争夺“全能综艺王”称号展开任务+演绎双比拼的全艺能实时竞技真人秀节目。特设全能综艺掌门人由演艺界前辈大咖出任，参与实时竞演的成员阵容囊括国内知名艺人和跨界明星。通过首创“1+1”剧情模式，1集“情景式户外真人秀”+1集“创意式室内表演秀”为全能综艺王一组播出结构，艺人们通过任务式真人秀，获得三个毫无关联的菜单选项，组合成为演绎题，为现场观众表演一场创意秀，并实时接收场外观众和场内观众的考评，根据综合实时数据排名进行末位淘汰。6名首发艺人，5名补位艺人角逐。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fgp909eh5vj20cx0iinb4.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]挑战的法则20170707.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]挑战的法则20170707.mkv ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8252, 4, '七十二层奇楼', '', '', '#FF0000', '', '', '<p>《七十二层奇楼》是一档原创文化探秘节目，由湖南卫视携手盛唐时空制作、南派三叔担任总设计。六位参与嘉宾将接受南派三叔的邀请寻找古籍《天宫秘术》，展开一段新奇的冒险之旅。每期他们将在奇景中通过合作，竞争和博弈寻找失落的宝物和离开的线索，成功者将瓜分“铜币”。节目采用实景+虚景打造视效奇观。目前嘉宾有吴亦凡、任达华、吴磊、大张伟、王小利、刘畅、娃尔。首期特约嘉宾为陈伟霆。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1ffbe4p30bnj20go0bvtb1.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]七十二层奇楼20170707.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4249/[阳光电影-www.ygdy8.com]七十二层奇楼20170714.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4258/[阳光电影-www.ygdy8.com]七十二层奇楼20170721.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4270/[阳光电影-www.ygdy8.com]七十二层奇楼20170728.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]七十二层奇楼20170707.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4249/[阳光电影-www.ygdy8.com]七十二层奇楼20170714.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4258/[阳光电影-www.ygdy8.com]七十二层奇楼20170721.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4270/[阳光电影-www.ygdy8.com]七十二层奇楼20170728.mkv', 'admin', '', 'Q', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8253, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]天天向上2070707.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4249/[阳光电影-www.ygdy8.com]天天向上20170714.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4258/[阳光电影-www.ygdy8.com]天天向上2070721.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4270/[阳光电影-www.ygdy8.com]天天向上2070728.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]天天向上2070707.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4249/[阳光电影-www.ygdy8.com]天天向上20170714.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4258/[阳光电影-www.ygdy8.com]天天向上2070721.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4270/[阳光电影-www.ygdy8.com]天天向上2070728.mkv', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8254, 4, '奔跑吧', '', '', '#FF0000', '', '', '<p>《奔跑吧》是浙江卫视推出的大型户外竞技真人秀节目，由浙江卫视节目中心制作。节目八位固定主持是邓超、Angelababy（杨颖）、李晨、陈赫、郑恺、王祖蓝、鹿晗、迪丽热巴。《奔跑吧兄弟》固定主持Angelababy（杨颖）由于照顾小海绵暂时缺席。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fenln3sntjj21kw0i3n6r.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]奔跑吧20170707.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]奔跑吧20170707.mkv', 'admin', '', 'B', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8255, 4, '今晚80后脱口秀', '', '', '#FF0000', '', '', '<p>《今晚80后脱口秀》是东方卫视全新打造的高端文化脱口秀，也是中国唯一一档欧美风格脱口秀节目，于2012年5月13日开播，80后新锐相声演员王自健倾情加盟，每期通过脱口秀的形式，展现年轻人对社会热点、文化事件、时尚潮流的态度和思想，幽默风趣却又不失智慧与锐度。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e4etydqfwkj20r2099tcl.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4237/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170706.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4237/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170706.mkv ', 'admin', '', 'J', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8256, 4, '一周的偶像', '', '', '#FF0000', '', '', '<p>《一周的偶像》是一档室内访谈节目，由韩国资深娱乐节目主持人郑亨敦与嘻哈歌手Defconn双人组合共同主持，针对最新韩流发烧娱乐话题，每集专访一组粉丝最爱的偶像团体。主持人与偶像成员的快问快答，充满爆笑与即时性的综艺效果。另外，节目亲临偶像出没场所，对粉丝公开偶像地图，且用监视摄影机，偷偷记录偶像们面对突发状况的行为反应，每周带来韩流偶像难得一见的模样。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fha33ejy23j205k08c757.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4235/[阳光电影-www.ygdy8.com]一周的偶像20170705.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4246/[阳光电影-www.ygdy8.com]一周的偶像20170712.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4259/[阳光电影-www.ygdy8.com]一周的偶像20170719.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4267/[阳光电影-www.ygdy8.com]一周的偶像20170726.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4235/[阳光电影-www.ygdy8.com]一周的偶像20170705.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4246/[阳光电影-www.ygdy8.com]一周的偶像20170712.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4259/[阳光电影-www.ygdy8.com]一周的偶像20170719.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4267/[阳光电影-www.ygdy8.com]一周的偶像20170726.rmvb', 'admin', '', 'Y', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8257, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>凤凰中文台军情观察室节目坐阵曾有“情报收集中心”之称的香港紧贴每周的全球热点军事话题以丰富、有趣的电视动画以及快节奏播报大量信息的方式为您搜罗军事情报同时请来军事专家对热点话题进行深度地分析与解读。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e8bbkka8mkj20700a0weu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4235/[阳光电影-www.ygdy8.com]军情观察室20170705.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4246/[阳光电影-www.ygdy8.com]军情观察室20170712.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4258/[阳光电影-www.ygdy8.com]军情观察室20170719.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4267/[阳光电影-www.ygdy8.com]军情观察室20170726.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4235/[阳光电影-www.ygdy8.com]军情观察室20170705.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4246/[阳光电影-www.ygdy8.com]军情观察室20170712.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4258/[阳光电影-www.ygdy8.com]军情观察室20170719.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4267/[阳光电影-www.ygdy8.com]军情观察室20170726.mkv', 'admin', '', 'Z', 10.0, 1, 0);
