INSERT INTO `gx_video` VALUES (8259, 4, '锵锵三人行', '', '', '#FF0000', '', '', '<p>《锵锵三人行》是凤凰卫视出品的谈话类节目，由主持人窦文涛与两岸三地传媒界之精英名嘴，一起针对每日热门新闻事件进行研究，并各抒己见，但却又不属于追求问题答案的正论，而是俗人闲话，一派多少天下事，尽付笑谈中的豪情，达至融汇信息传播，制造乐趣与辩析事理三大元素于一身的目的。看似“平衡一下”的“滑头话”，其实是窦文涛引导嘉宾发表具个人色彩的大胆言论，营造日常聊天的形态、谈笑风生的气氛，力求轻松、惹笑。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e894w9dvj5j205306w3yj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4232/[阳光电影-www.ygdy8.com]锵锵三人行20170703.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4233/[阳光电影-www.ygdy8.com]锵锵三人行20170704.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4235/[阳光电影-www.ygdy8.com]锵锵三人行20170705.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4237/[阳光电影-www.ygdy8.com]锵锵三人行20170706.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4245/[阳光电影-www.ygdy8.com]锵锵三人行20170710.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4245/[阳光电影-www.ygdy8.com]锵锵三人行20170711.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4246/[阳光电影-www.ygdy8.com]锵锵三人行20170712.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4248/[阳光电影-www.ygdy8.com]锵锵三人行20170713.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4248/[阳光电影-www.ygdy8.com]锵锵三人行20170714.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4252/[阳光电影-www.ygdy8.com]锵锵三人行20170717.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4253/[阳光电影-www.ygdy8.com]锵锵三人行20170718.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4258/[阳光电影-www.ygdy8.com]锵锵三人行20170719.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4258/[阳光电影-www.ygdy8.com]锵锵三人行20170720.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4258/[阳光电影-www.ygdy8.com]锵锵三人行20170721.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4264/[阳光电影-www.ygdy8.com]锵锵三人行20170724.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4266/[阳光电影-www.ygdy8.com]锵锵三人行20170725.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4267/[阳光电影-www.ygdy8.com]锵锵三人行20170726.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4269/[阳光电影-www.ygdy8.com]锵锵三人行20170727.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4272/[阳光电影-www.ygdy8.com]锵锵三人行20170728.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4278/[阳光电影-www.ygdy8.com]锵锵三人行20170731.