INSERT INTO `gx_video` VALUES (8263, 4, '食尚玩家', '', '', '#FF0000', '', '', '<p>《食尚玩家》节目每周在TVBS欢乐台首播四期，由莎莎、2moro、浩角翔起等新生代主持人担当主持。所谓“食尚玩家”，就是在游玩中享受美食，在美食中尽情游玩，所以每一期的《食尚玩家》节目都会选择一个台湾的城市或其他国家的城市，同时设置一个主题，比如省钱游、浪漫游、相亲游、温暖游等，根据这个主题来进行节目的编排，选择当地有代表性或颇受网友好评的餐厅、旅游景点、人文景观、自然风景等，通过主持人在该地区的游历和对该地区的介绍，让观众了解该地区独特的美食、美丽的自然风景和当地的人文习俗等，也会向观众推荐一些颇受当地人好评或颇受网友好评的餐厅、酒店、民宿、夜市、旅游景点、礼品店等，为观众的出行提供了很好的建议，同时，《食尚玩家》节目通过对各个地区的美食和游玩的介绍，向观众传达享受生活、热爱生活的积极向上的观念。<img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e3bj58gsatj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962619, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4232/[阳光电影-www.ygdy8.com]食尚玩家20170703.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4234/[阳光电影-www.ygdy8.com]食尚玩家20170704.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4236/[阳光电影-www.ygdy8.com]食尚玩家20170705.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4238/[阳光电影-www.ygdy8.com]食尚玩家20170706.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4244/[阳光电影-www.ygdy8.com]食尚玩家20170710.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4245/[阳光电影-www.ygdy8.com]食尚玩家20170711.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4246/[阳光电影-www.ygdy8.com]食尚玩家20170712.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4253/[阳光电影-www.ygdy8.com]食尚玩家20170717.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4254/[阳光电影-www.ygdy8.com]食尚玩家20170718.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4255/[阳光电影-www.ygdy8.com]食尚玩家20170719.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4257/[阳光电影-www.ygdy8.com]食尚玩家20170720.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4265/[阳光电影-www.ygdy8.com]食尚玩家20170724.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4266/[阳光电影-www.ygdy8.com]食尚玩家20170725.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4268/[阳光电影-www.ygdy8.com]食尚玩家20170726.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4269/[阳光电影-www.ygdy8.com]食尚玩家20170727.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4277/[阳光电影-www.ygdy8.com]食尚玩家20170731.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4232/[阳光电影-www.ygdy8.com]食尚玩家20170703.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4234/[阳光电影-www.ygdy8.com]食尚玩家20170704.rmvb\nftp: