INSERT INTO `gx_video` VALUES (8278, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>浙江卫视《挑战者联盟第三季》，将于今年7月正式回归周六黄金档。新一季的《挑战者联盟》继续由范冰冰带队挑战，“两朝元老”陈学冬持续加盟，更有马苏、欧弟、曾舜、彭小苒、张钧甯、严屹宽、谭松韵等新人挑战者加入，展开一场别开生面的城际挑战，带领观众深入感受每个城市特色<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fh5x59czdaj207g04hjrj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170701.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170708.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170715.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4261/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170722.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4273/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170729.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170701.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170708.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170715.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4261/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170722.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4273/[阳光电影-www.ygdy8.com]挑战者联盟第三季20170729.mkv ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8279, 4, '综艺3国智', '', '', '#FF0000', '', '', '<p>《综艺3国智》，官方英文名3 Kingdoms，是台湾电视公司监制及首播的实境外景节目，主持人为李李仁、纳豆、王少伟、黄路梓茵、明杰、风田、Evan、Teddy、 张立东、玛丽，台视主频于2016年11月12日首播。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fh5wyh40i8j20p00eqtau.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]综艺3国智20170701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]综艺3国智20170708.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]综艺3国智20170715.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4262/[阳光电影-www.ygdy8.com]综艺3国智20170722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4274/[阳光电影-www.ygdy8.com]综艺3国智20170729.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]综艺3国智20170701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]综艺3国智20170708.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]综艺3国智20170715.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4262/[阳光电影-www.ygdy8.com]综艺3国智20170722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4274/[阳光电影-www.ygdy8.com]综艺3国智20170729.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8280, 4, '超级夜总会', '', '', '#FF0000', '', '', '<p>《超级夜总会》是三立电视台独立制作的一档综艺娱乐节目，以歌曲演唱、幽默情景剧、户外与观众近距离互动为主要元素，是台湾第一个电视台出动大型舞台车至各县市镇、乡、村的著名观光景点、夜市、庙宇录制的节目。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3hdcxn0doj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]超级夜总会20170701.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4252/[阳光电影-www.ygdy8.com]超级夜总会20170715.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]超级夜总会20170701.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4252/[阳光电影-www.ygdy8.com]超级夜总会20170715.rmvb', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8281, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]天才冲冲冲20170701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]天才冲冲冲20170708.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]天才冲冲冲20170715.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4262/[阳光电影-www.ygdy8.com]天才冲冲冲20170722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4274/[阳光电影-www.ygdy8.com]天才冲冲冲20170729.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]天才冲冲冲20170701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]天才冲冲冲20170708.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]天才冲冲冲20170715.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4262/[阳光电影-www.ygdy8.com]天才冲冲冲20170722.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4274/[阳光电影-www.ygdy8.com]天才冲冲冲20170729.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8282, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]娱乐百分百20170701.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4232/[阳光电影-www.ygdy8.com]娱乐百分百20170703.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4234/[阳光电影-www.ygdy8.com]娱乐百分百20170704.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4236/[阳光电影-www.ygdy8.com]娱乐百分百20170705.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4238/[阳光电影-www.ygdy8.com]娱乐百分百20170706.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4244/[阳光电影-www.ygdy8.com]娱乐百分百20170708.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4244/[阳光电影-www.ygdy8.com]娱乐百分百20170710.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4245/[阳光电影-www.ygdy8.com]娱乐百分百20170711.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4246/[阳光电影-www.ygdy8.com]娱乐百分百20170712.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4247/[阳光电影-www.ygdy8.com]娱乐百分百20170713.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4248/[阳光电影-www.ygdy8.com]娱乐百分百20170714.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4252/[阳光电影-www.ygdy8.com]娱乐百分百20170715.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4254/[阳光电影-www.ygdy8.com]娱乐百分百20170717.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4254/[阳光电影-www.ygdy8.com]娱乐百分百20170718.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4255/[阳光电影-www.ygdy8.com]娱乐百分百20170719.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4257/[阳光电影-www.ygdy8.com]娱乐百分百20170720.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4259/[阳光电影-www.ygdy8.com]娱乐百分百20170721.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4262/[阳光电影-www.ygdy8.com]娱乐百分百20170722.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4265/[阳光电影-www.ygdy8.com]娱乐百分百20