INSERT INTO `gx_video` VALUES (8284, 4, '跨界歌王第二季', '', '', '#FF0000', '', '', '<p>《跨界歌王第二季》是北京卫视大型明星跨界音乐真人秀节目，2017年3月21日启动。发布会上，姚晨、陈建斌、江珊、苗圃、任嘉伦、梁译木组成的首发歌手阵容，以及戴玉强、王佩瑜、黄子佼组成的评论团携手亮相。相比第一季的刘涛、王凯、秦海璐、小沈阳、王祖蓝等荧屏的中坚力量，第二季的阵容明显是“新老结合”。总导演宫鹏在发布会上透露，本季将有18位艺人在2017《跨界歌王》的舞台上开唱。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f4lblnu54dj20fa0a0wf3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]跨界歌王第二季20170701.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]跨界歌王第二季20170708.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]跨界歌王第二季20170701.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]跨界歌王第二季20170708.mkv ', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8285, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]快乐大本营20170701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]快乐大本营20170708.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]快乐大本营20170715.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4261/[阳光电影-www.ygdy8.com]快乐大本营20170722.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4273/[阳光电影-www.ygdy8.com]快乐大本营20170729.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]快乐大本营20170701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]快乐大本营20170708.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]快乐大本营20170715.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4261/[阳光电影-www.ygdy8.com]快乐大本营20170722.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4273/[阳光电影-www.ygdy8.com]快乐大本营20170729.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8286, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]非诚勿扰20170701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]非诚勿扰20170708.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]非诚勿扰20170715.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4261/[阳光电影-www.ygdy8.com]非诚勿扰20170722.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4273/[阳光电影-www.ygdy8.com]非诚勿扰20170729.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4229/[阳光电影-www.ygdy8.com]非诚勿扰20170701.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]非诚勿扰20170708.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]非诚勿扰20170715.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4261/[阳光电影-www.ygdy8.com]非诚勿扰20170722.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4273/[阳光电影-www.ygdy8.com]非诚勿扰20170729.mkv', 'admin', '', 'F', 10.0, 1, 0);
