INSERT INTO `gx_video` VALUES (8288, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4228/[阳光电影-www.ygdy8.com]无限挑战20170701.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]无限挑战20170708.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]无限挑战20170715.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4262/[阳光电影-www.ygdy8.com]无限挑战20170721.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4274/[阳光电影-www.ygdy8.com]无限挑战20170729.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4228/[阳光电影-www.ygdy8.com]无限挑战20170701.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4242/[阳光电影-www.ygdy8.com]无限挑战20170708.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4250/[阳光电影-www.ygdy8.com]无限挑战20170715.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4262/[阳光电影-www.ygdy8.com]无限挑战20170721.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4274/[阳光电影-www.ygdy8.com]无限挑战20170729.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8289, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>简介：全国首档全能艺人们为争夺“全能综艺王”称号展开任务+演绎双比拼的全艺能实时竞技真人秀节目。特设全能综艺掌门人由演艺界前辈大咖出任，参与实时竞演的成员阵容囊括国内知名艺人和跨界明星。通过首创“1+1”剧情模式，1集“情景式户外真人秀”+1集“创意式室内表演秀”为全能综艺王一组播出结构，艺人们通过任务式真人秀，获得三个毫无关联的菜单选项，组合成为演绎题，为现场观众表演一场创意秀，并实时接收场外观众和场内观众的考评，根据综合实时数据排名进行末位淘汰。6名首发艺人，5名补位艺人角逐。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fgp909eh5vj20cx0iinb4.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4210/[阳光电影-www.ygdy8.com]挑战的法则20170616.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4218/[阳光电影-www.ygdy8.com]挑战的法则20170623.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4227/[阳光电影-www.ygdy8.com]挑战的法则20170630.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4210/[阳光电影-www.ygdy8.com]挑战的法则20170616.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4218/[阳光电影-www.ygdy8.com]挑战的法则20170623.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4227/[阳光电影-www.ygdy8.com]挑战的法则20170630.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8290, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>明日之子是腾讯视频独播的一档全新偶像养成类娱乐真人秀节目。《明日之子》以音乐为载体，为全球年轻人开辟三条独具创新的赛道：盛世美颜、盛世魔音、盛世独秀。杨幂、薛之谦、华晨宇将分别担任美颜赛道、独秀赛道及魔音赛道的星推官。节目倡导偶像多元价值观，立志打造未来十年的偶像。2017年6月10日晚八点《明日之子》在腾讯视频独家播出。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1fgnydqylbjj204605k0t3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4209/[阳光电影-www.ygdy8.com]明日之子20170610.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4209/[阳光电影-www.ygdy8.com]明日之子20170610.mp4 ', 'admin', '', 'Z', 10.0, 1, 0);
