INSERT INTO `gx_video` VALUES (8295, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>这是一档形式新颖，趣味十足，在挑战中发掘个性，又充满悬念的全新益智攻擂节目，每期参加节目的有11人，分为10位守擂者和一位挑战者，他们年龄，身份，文化层次各异，守擂者手中都有不同价值的奖品，而挑战者将通过20秒的限时答题与守擂者一一PK，挑战者获胜将赢得守擂者的奖品，而守擂者获胜将成为新的挑战者，并赢取挑战者手中的所有奖品，任何一方失败都将掉下擂台淘汰出局。连续战胜五名对手的挑战者有权选择带着赢得的奖品离开，或是冒着被对手PK掉的风险继续战斗，赢得更多奖品。而一站到底成为最后一位的挑战者，也将视战胜的对手人数赢得相应的奖品。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e77lhpbbkrj20m80dcgoa.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4194/[阳光电影-www.ygdy8.com]一站到底20170605.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4194/[阳光电影-www.ygdy8.com]一站到底20170605.mkv', 'admin', '', 'Z', 10.0, 1, 0);
