INSERT INTO `gx_video` VALUES (8307, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]无限挑战20170603.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]无限挑战20170610.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4212/[阳光电影-www.ygdy8.com]无限挑战20170617.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]无限挑战20170624.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]无限挑战20170603.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]无限挑战20170610.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4212/[阳光电影-www.ygdy8.com]无限挑战20170617.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]无限挑战20170624.mp4', 'admin', '', 'W', 10.0, 1, 0);
