INSERT INTO `gx_video` VALUES (8309, 4, '跨界歌王第二季', '', '', '#FF0000', '', '', '<p>《跨界歌王第二季》是北京卫视大型明星跨界音乐真人秀节目，2017年3月21日启动。发布会上，姚晨、陈建斌、江珊、苗圃、任嘉伦、梁译木组成的首发歌手阵容，以及戴玉强、王佩瑜、黄子佼组成的评论团携手亮相。相比第一季的刘涛、王凯、秦海璐、小沈阳、王祖蓝等荧屏的中坚力量，第二季的阵容明显是“新老结合”。总导演宫鹏在发布会上透露，本季将有18位艺人在2017《跨界歌王》的舞台上开唱。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f4lblnu54dj20fa0a0wf3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]跨界歌王第二季20170603.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]跨界歌王第二季20170610.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]跨界歌王第二季20170624.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]跨界歌王第二季20170603.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]跨界歌王第二季20170610.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]跨界歌王第二季20170624.mkv ', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8310, 4, '旅途的花样', '', '', '#FF0000', '', '', '<p>《旅途的花样》作为东方卫视2017年力推的一档明星旅行体验类真人秀，目前官方公布的旅行地有摩洛哥、俄罗斯、挪威和丹麦等国家。 \u200b\u200b\u200b\u200b<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fga7zukek0j20dw0opabs.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]旅途的花样20170603.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]旅途的花样20170610.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4211/[阳光电影-www.ygdy8.com]旅途的花样20170617.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]旅途的花样20170624.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]旅途的花样20170603.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]旅途的花样20170610.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4211/[阳光电影-www.ygdy8.com]旅途的花样20170617.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]旅途的花样20170624.mkv ', 'admin', '', 'L', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8311, 4, '高能少年团', '', '', '#FF0000', '', '', '<p>《高能少年团》是浙江卫视推出的一档室内+户外多场景式的偶像对抗挑战类真人秀，由王俊凯、刘昊然、董子健、张一山、王大陆5位90后少年偶像担任节目嘉宾 。 \u3000\u3000节目将以真人秀的形式记录每个少年的高能挑战。意想不到的对手、青春奇幻的互动、绝不能输的挑战……每一期节目，5位少年都会 以“VS”的概念对战不同对象，既可以是人、时间、体能、胆量，也可以是内部对战，还可以是对战邀请的外来嘉宾或素人。少年和嘉宾们会将自己积极向上的拼搏劲儿全情投入在有趣的游戏中，并且在完成游戏的开发训练后最终完成当期挑战。“燃”、“向上”和“好玩”永远是节目设计时考虑的第一目标，节目也力争营造出少年们勇于尝试、敢爱敢恨、鲜活真实的形象。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fe9b95q6euj208c0ciadk.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]高能少年团20170603.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4211/[阳光电影-www.ygdy8.com]高能少年团20170617.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]高能少年团20170624.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]高能少年团20170603.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4211/[阳光电影-www.ygdy8.com]高能少年团20170617.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]高能少年团20170624.mkv', 'admin', '', 'G', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8312, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]快乐大本营20170603.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]快乐大本营20170610.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4211/[阳光电影-www.ygdy8.com]快乐大本营20170617.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]快乐大本营20170624.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]快乐大本营20170603.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]快乐大本营20170610.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4211/[阳光电影-www.ygdy8.com]快乐大本营20170617.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]快乐大本营20170624.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8313, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]非诚勿扰20170603.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]非诚勿扰20170610.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4211/[阳光电影-www.ygdy8.com]非诚勿扰20170617.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]非诚勿扰20170624.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]非诚勿扰20170603.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]非诚勿扰20170610.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4211/[阳光电影-www.ygdy8.com]非诚勿扰20170617.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]非诚勿扰20170624.mkv ', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8314, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]天才冲冲冲20170603.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]天才冲冲冲20170610.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4212/[阳光电影-www.ygdy8.com]天才冲冲冲20170617.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]天才冲冲冲20170624.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]天才冲冲冲20170603.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]天才冲冲冲20170610.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4212/[阳光电影-www.ygdy8.com]天才冲冲冲20170617.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4219/[阳光电影-www.ygdy8.com]天才冲冲冲20170624.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8315, 4, '锵锵三人行', '', '', '#FF0000', '', '', '<p>《锵锵三人行》是凤凰卫视出品的谈话类节目，由主持人窦文涛与两岸三地传媒界之精英名嘴，一起针对每日热门新闻事件进行研究，并各抒己见，但却又不属于追求问题答案的正论，而是俗人闲话，一派多少天下事，尽付笑谈中的豪情，达至融汇信息传播，制造乐趣与辩析事理三大元素于一身的目的。看似“平衡一下”的“滑头话”，其实是窦文涛引导嘉宾发表具个人色彩的大胆言论，营造日常聊天的形态、谈笑风生的气氛，力求轻松、惹笑。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e894w9dvj5j205306w3yj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]锵锵三人行20170601.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4192/[阳光电影-www.ygdy8.com]锵锵三人行20170602.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4195/[阳光电影-www.ygdy8.com]锵锵三人行20170605.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4195/[阳光电影-www.ygdy8.com]锵锵三人行20170606.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4197/[阳光电影-www.ygdy8.com]锵锵三人行20170607.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4198/[阳光电影-www.ygdy8.com]锵锵三人行20170608.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4200/[阳光电影-www.ygdy8.com]锵锵三人行20170609.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4205/[阳光电影-www.ygdy8.com]锵锵三人行20170612.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4208/[阳光电影-www.ygdy8.com]锵锵三人行20170613.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4208/[阳光电影-www.ygdy8.com]锵锵三人行20170614.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4209/[阳光电影-www.ygdy8.com]锵锵三人行20170615.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4210/[阳光电影-www.ygdy8.com]锵锵三人行20170616.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4213/[阳光电影-www.ygdy8.com]锵锵三人行20170619.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4213/[阳光电影-www.ygdy8.com]锵锵三人行20170620.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4215/[阳光电影-www.ygdy8.com]锵锵三人行20170621.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4216/[阳光电影-www.ygdy8.com]锵锵三人行20170622.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4218/[阳光电影-www.ygdy8.com]锵锵三人行20170623.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4222/[阳光电影-www.ygdy8.com]锵锵三人行20170626.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4224/[阳光电影-www.ygdy8.com]锵锵三人行20170627.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4224/[阳光电影-www.ygdy8.com]锵锵三人行20170628