INSERT INTO `gx_video` VALUES (8316, 4, '七十二层奇楼', '', '', '#FF0000', '', '', '<p>《七十二层奇楼》是一档原创文化探秘节目，由湖南卫视携手盛唐时空制作、南派三叔担任总设计。六位参与嘉宾将接受南派三叔的邀请寻找古籍《天宫秘术》，展开一段新奇的冒险之旅。每期他们将在奇景中通过合作，竞争和博弈寻找失落的宝物和离开的线索，成功者将瓜分“铜币”。节目采用实景+虚景打造视效奇观。目前嘉宾有吴亦凡、任达华、吴磊、大张伟、王小利、刘畅、娃尔。首期特约嘉宾为陈伟霆。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1ffbe4p30bnj20go0bvtb1.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4190/[阳光电影-www.ygdy8.com]七十二层奇楼20170602.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4200/[阳光电影-www.ygdy8.com]七十二层奇楼20170609.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4212/[阳光电影-www.ygdy8.com]七十二层奇楼20170616.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4218/[阳光电影-www.ygdy8.com]七十二层奇楼20170623.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4227/[阳光电影-www.ygdy8.com]七十二层奇楼20170630.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4190/[阳光电影-www.ygdy8.com]七十二层奇楼20170602.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4200/[阳光电影-www.ygdy8.com]七十二层奇楼20170609.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4212/[阳光电影-www.ygdy8.com]七十二层奇楼20170616.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4218/[阳光电影-www.ygdy8.com]七十二层奇楼20170623.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4227/[阳光电影-www.ygdy8.com]七十二层奇楼20170630.mp4', 'admin', '', 'Q', 10.0, 1, 0);
