INSERT INTO `gx_video` VALUES (8318, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4190/[阳光电影-www.ygdy8.com]天天向上20170602.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4200/[阳光电影-www.ygdy8.com]天天向上2070609.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4210/[阳光电影-www.ygdy8.com]天天向上2070616.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4218/[阳光电影-www.ygdy8.com]天天向上2070623.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4227/[阳光电影-www.ygdy8.com]天天向上2070630.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4190/[阳光电影-www.ygdy8.com]天天向上20170602.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4200/[阳光电影-www.ygdy8.com]天天向上2070609.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4210/[阳光电影-www.ygdy8.com]天天向上2070616.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4218/[阳光电影-www.ygdy8.com]天天向上2070623.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4227/[阳光电影-www.ygdy8.com]天天向上2070630.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8319, 4, '今晚80后脱口秀', '', '', '#FF0000', '', '', '<p>《今晚80后脱口秀》是东方卫视全新打造的高端文化脱口秀，也是中国唯一一档欧美风格脱口秀节目，于2012年5月13日开播，80后新锐相声演员王自健倾情加盟，每期通过脱口秀的形式，展现年轻人对社会热点、文化事件、时尚潮流的态度和思想，幽默风趣却又不失智慧与锐度。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e4etydqfwkj20r2099tcl.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4190/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170601.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4198/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170608.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4216/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170621.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4226/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170628.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4190/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170601.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4198/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170608.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4216/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170621.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4226/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170628.mkv ', 'admin', '', 'J', 10.0, 1, 0);
