INSERT INTO `gx_video` VALUES (8322, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4189/[阳光电影-www.ygdy8.com]娱乐百分百20170601.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4190/[阳光电影-www.ygdy8.com]娱乐百分百20170602.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4195/[阳光电影-www.ygdy8.com]娱乐百分百20170603.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4195/[阳光电影-www.ygdy8.com]娱乐百分百20170605.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4196/[阳光电影-www.ygdy8.com]娱乐百分百20170606.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4197/[阳光电影-www.ygdy8.com]娱乐百分百20170607.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4199/[阳光电影-www.ygdy8.com]娱乐百分百20170608.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4201/[阳光电影-www.ygdy8.com]娱乐百分百20170609.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4202/[阳光电影-www.ygdy8.com]娱乐百分百20170610.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4204/[阳光电影-www.ygdy8.com]娱乐百分百20170612.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4206/[阳光电影-www.ygdy8.com]娱乐百分百20170613.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4209/[阳光电影-www.ygdy8.com]娱乐百分百20170615.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4210/[阳光电影-www.ygdy8.com]娱乐百分百20170616.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4212/[阳光电影-www.ygdy8.com]娱乐百分百20170617.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4213/[阳光电影-www.ygdy8.com]娱乐百分百20170619.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4214/[阳光电影-www.ygdy8.com]娱乐百分百20170620.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4215/[阳光电影-www.ygdy8.com]娱乐百分百20170621.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4217/[阳光电影-www.ygdy8.com]娱乐百分百20170622.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4218/[阳光电影-www.ygdy8.com]娱乐百分百20