INSERT INTO `gx_video` VALUES (8328, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>前《花儿与少年》总导演廖珂担任总导演的新节目《#综艺•花样青春# 》近日在湖南卫视2017招商会上亮相。该节目重新定义明星旅行真人秀，打破传统旅行节目叙事模式，大胆启用“#星素结合# ”人物设定，让明星和普通人一样去旅行。三位男明星，两位普通女孩，“星素+男女”迅速升温 ，开启旅行故事中无限的情感幻想。这是一次充满年轻、冒险、狂热、不安分基因的旅行，全新旅行场景、全时段、全开放旅程。每天固定时段明星手机直播，网友脑洞大开在线派发旅行任务，各种匪夷所思的旅行故事也随之接踵而来。<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fezx85tnvgj208c0ciwgk.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4163/[阳光电影-www.ygdy8.com]花儿与少年第三季20170507.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4163/[阳光电影-www.ygdy8.com]花儿与少年第三季20170514.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4176/[阳光电影-www.ygdy8.com]花儿与少年第三季20170521.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4183/[阳光电影-www.ygdy8.com]花儿与少年第三季20170528.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4163/[阳光电影-www.ygdy8.com]花儿与少年第三季20170507.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4163/[阳光电影-www.ygdy8.com]花儿与少年第三季20170514.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4176/[阳光电影-www.ygdy8.com]花儿与少年第三季20170521.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4183/[阳光电影-www.ygdy8.com]花儿与少年第三季20170528.mp4', 'admin', '', 'Z', 10.0, 1, 0);
