INSERT INTO `gx_video` VALUES (8335, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]RunningMan20170507.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4163/[阳光电影-www.ygdy8.com]RunningMan20170514.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4176/[阳光电影-www.ygdy8.com]Runningman20170521.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4183/[阳光电影-www.ygdy8.com]RunningMan20170528.rmvb ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]RunningMan20170507.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4163/[阳光电影-www.ygdy8.com]RunningMan20170514.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4176/[阳光电影-www.ygdy8.com]Runningman20170521.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4183/[阳光电影-www.ygdy8.com]RunningMan20170528.rmvb ', 'admin', '', 'Z', 10.0, 1, 0);
