INSERT INTO `gx_video` VALUES (8338, 4, '超级夜总会', '', '', '#FF0000', '', '', '<p>《超级夜总会》是三立电视台独立制作的一档综艺娱乐节目，以歌曲演唱、幽默情景剧、户外与观众近距离互动为主要元素，是台湾第一个电视台出动大型舞台车至各县市镇、乡、村的著名观光景点、夜市、庙宇录制的节目。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3hdcxn0doj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]超级夜总会20170506.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4163/[阳光电影-www.ygdy8.com]超夜20170513.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4176/[阳光电影-www.ygdy8.com]超夜20170520.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4181/[阳光电影-www.ygdy8.com]超级夜总会20170527.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]超级夜总会20170506.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4163/[阳光电影-www.ygdy8.com]超夜20170513.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4176/[阳光电影-www.ygdy8.com]超夜20170520.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4181/[阳光电影-www.ygdy8.com]超级夜总会20170527.rmvb', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8339, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]天才冲冲冲20170506.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4163/[阳光电影-www.ygdy8.com]天才___20170513.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4174/[阳光电影-www.ygdy8.com]天才___20170520.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4181/[阳光电影-www.ygdy8.com]天才冲冲冲20170527.rmvb ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]天才冲冲冲20170506.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4163/[阳光电影-www.ygdy8.com]天才___20170513.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4174/[阳光电影-www.ygdy8.com]天才___20170520.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4181/[阳光电影-www.ygdy8.com]天才冲冲冲20170527.rmvb ', 'admin', '', 'T', 10.0, 1, 0);
