INSERT INTO `gx_video` VALUES (8343, 4, '跨界歌王第二季', '', '', '#FF0000', '', '', '<p>《跨界歌王第二季》是北京卫视大型明星跨界音乐真人秀节目，2017年3月21日启动。发布会上，姚晨、陈建斌、江珊、苗圃、任嘉伦、梁译木组成的首发歌手阵容，以及戴玉强、王佩瑜、黄子佼组成的评论团携手亮相。相比第一季的刘涛、王凯、秦海璐、小沈阳、王祖蓝等荧屏的中坚力量，第二季的阵容明显是“新老结合”。总导演宫鹏在发布会上透露，本季将有18位艺人在2017《跨界歌王》的舞台上开唱。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f4lblnu54dj20fa0a0wf3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]跨界歌王第二季20170506.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4162/[阳光电影-www.ygdy8.com]跨界歌王第二季20170513.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4175/[阳光电影-www.ygdy8.com]跨界歌王第二季20170520.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]跨界歌王第二季20170506.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4162/[阳光电影-www.ygdy8.com]跨界歌王第二季20170513.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4175/[阳光电影-www.ygdy8.com]跨界歌王第二季20170520.mp4 ', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8344, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]快乐大本营20170506.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4162/[阳光电影-www.ygdy8.com]快乐大本营20170513.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4175/[阳光电影-www.ygdy8.com]快乐大本营20170520.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]快乐大本营20170506.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4162/[阳光电影-www.ygdy8.com]快乐大本营20170513.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4175/[阳光电影-www.ygdy8.com]快乐大本营20170520.mp4', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8345, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]非诚勿扰20170506.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4162/[阳光电影-www.ygdy8.com]非诚勿扰20170513.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]非诚勿扰20170506.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4162/[阳光电影-www.ygdy8.com]非诚勿扰20170513.mkv ', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8346, 4, '高能少年团', '', '', '#FF0000', '', '', '<p>《高能少年团》是浙江卫视推出的一档室内+户外多场景式的偶像对抗挑战类真人秀，由王俊凯、刘昊然、董子健、张一山、王大陆5位90后少年偶像担任节目嘉宾 。 \u3000\u3000节目将以真人秀的形式记录每个少年的高能挑战。意想不到的对手、青春奇幻的互动、绝不能输的挑战……每一期节目，5位少年都会 以“VS”的概念对战不同对象，既可以是人、时间、体能、胆量，也可以是内部对战，还可以是对战邀请的外来嘉宾或素人。少年和嘉宾们会将自己积极向上的拼搏劲儿全情投入在有趣的游戏中，并且在完成游戏的开发训练后最终完成当期挑战。“燃”、“向上”和“好玩”永远是节目设计时考虑的第一目标，节目也力争营造出少年们勇于尝试、敢爱敢恨、鲜活真实的形象。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fe9b95q6euj208c0ciadk.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]高能少年团20170506.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4162/[阳光电影-www.ygdy8.com]高能少年团20170513.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4175/[阳光电影-www.ygdy8.com]高能少年团20170520.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4155/[阳光电影-www.ygdy8.com]高能少年团20170506.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4162/[阳光电影-www.ygdy8.com]高能少年团20170513.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4175/[阳光电影-www.ygdy8.com]高能少年团20170520.mp4', 'admin', '', 'G', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8347, 4, '我们结婚了', '', '', '#FF0000', '', '', '<p>《我们结婚了》是韩国今年最受欢迎的综艺节目之一，这是一档明星假想结婚节目。几对明星假扮成新婚夫妇，真的将自己的行礼搬过来装扮起自己的“新婚房“。由前期春节节目衍生来的。第一季节目嘉宾：Andy和Solbi，Alex和申爱，郑型敦和Saori，Crown J和徐仁英，李辉才和赵茹珍，金贤重和皇甫。<img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e3enc83xg7j.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4154/[阳光电影-www.ygdy8.com]我们结婚了20170506.rmvb  \nftp://ygdy8:ygdy8@yg76.dydytt.net:4162/[阳光电影-www.ygdy8.com]我们结婚了20170513.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4154/[阳光电影-www.ygdy8.com]我们结婚了20170506.rmvb  \nftp://ygdy8:ygdy8@yg76.dydytt.net:4162/[阳光电影-www.ygdy8.com]我们结婚了20170513.rmvb', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8348, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4154/[阳光电影-www.ygdy8.com]无限挑战20170506.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4162/[阳光电影-www.ygdy8.com]无限挑战20170513.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4176/[阳光电影-www.ygdy8.com]无限挑战20170520.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4181/[阳光电影-www.ygdy8.com]无限挑战20170527.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4154/[阳光电影-www.ygdy8.com]无限挑战20170506.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4162/[阳光电影-www.ygdy8.com]无限挑战20170513.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4176/[阳光电影-www.ygdy8.com]无限挑战20170520.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4181/[阳光电影-www.ygdy8.com]无限挑战20170527.rmvb', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8349, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4154/[阳光电影-www.ygdy8.com]天天向上2070505.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4160/[阳光电影-www.ygdy8.com]天天向上2070512.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4173/[阳光电影-www.ygdy8.com]天天向上2070519.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4154/[阳光电影-www.ygdy8.com]天天向上2070505.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4160/[阳光电影-www.ygdy8.com]天天向上2070512.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4173/[阳光电影-www.ygdy8.com]天天向上2070519.mkv', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8350, 4, '奔跑吧', '', '', '#FF0000', '', '', '<p>《奔跑吧》是浙江卫视推出的大型户外竞技真人秀节目，由浙江卫视节目中心制作。节目八位固定主持是邓超、Angelababy（杨颖）、李晨、陈赫、郑恺、王祖蓝、鹿晗、迪丽热巴。《奔跑吧兄弟》固定主持Angelababy（杨颖）由于照顾小海绵暂时缺席。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fenln3sntjj21kw0i3n6r.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4153/[阳光电影-www.ygdy8.com]奔跑吧20170505.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4160/[阳光电影-www.ygdy8.com]奔跑吧20170512.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4173/[阳光电影-www.ygdy8.com]奔跑吧20170519.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4180/[阳光电影-www.ygdy8.com]奔跑吧20170526.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4153/[阳光电影-www.ygdy8.com]奔跑吧20170505.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4160/[阳光电影-www.ygdy8.com]奔跑吧20170512.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4173/[阳光电影-www.ygdy8.com]奔跑吧20170519.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4180/[阳光电影-www.ygdy8.com]奔跑吧20170526.mp4', 'admin', '', 'B', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8351, 4, '七十二层奇楼', '', '', '#FF0000', '', '', '<p>《七十二层奇楼》是一档原创文化探秘节目，由湖南卫视携手盛唐时空制作、南派三叔担任总设计。六位参与嘉宾将接受南派三叔的邀请寻找古籍《天宫秘术》，展开一段新奇的冒险之旅。每期他们将在奇景中通过合作，竞争和博弈寻找失落的宝物和离开的线索，成功者将瓜分“铜币”。节目采用实景+虚景打造视效奇观。目前嘉宾有吴亦凡、任达华、吴磊、大张伟、王小利、刘畅、娃尔。首期特约嘉宾为陈伟霆。<img alt="" src="http://wx2.sinaimg.cn/mw690/444476dfgy1ffbe4p30bnj20go0bvtb1.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4153/[阳光电影-www.ygdy8.com]七十二层奇楼20170505.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4173/[阳光电影-www.ygdy8.com]七十二层奇楼20170519.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4180/[阳光电影-www.ygdy8.com]七十二层奇楼20170526.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4153/[阳光电影-www.ygdy8.com]七十二层奇楼20170505.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4173/[阳光电影-www.ygdy8.com]七十二层奇楼20170519.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4180/[阳光电影-www.ygdy8.com]七十二层奇楼20170526.mkv ', 'admin', '', 'Q', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8352, 4, '今晚80后脱口秀', '', '', '#FF0000', '', '', '<p>《今晚80后脱口秀》是东方卫视全新打造的高端文化脱口秀，也是中国唯一一档欧美风格脱口秀节目，于2012年5月13日开播，80后新锐相声演员王自健倾情加盟，每期通过脱口秀的形式，展现年轻人对社会热点、文化事件、时尚潮流的态度和思想，幽默风趣却又不失智慧与锐度。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e4etydqfwkj20r2099tcl.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4151/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170504.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4159/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170511.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4171/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170518.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4180/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170525.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4151/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170504.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4159/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170511.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4171/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170518.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4180/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170525.mkv', 'admin', '', 'J', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8353, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>凤凰中文台军情观察室节目坐阵曾有“情报收集中心”之称的香港紧贴每周的全球热点军事话题以丰富、有趣的电视动画以及快节奏播报大量信息的方式为您搜罗军事情报同时请来军事专家对热点话题进行深度地分析与解读。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e8bbkka8mkj20700a0weu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4151/[阳光电影-www.ygdy8.com]军情观察室20170503.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4158/[阳光电影-www.ygdy8.com]军情观察室20170510.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4170/[阳光电影-www.ygdy8.com]军情观察室20170517.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4180/[阳光电影-www.ygdy8.com]军情观察室20170524.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4187/[阳光电影-www.ygdy8.com]军情观察室20170531.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4151/[阳光电影-www.ygdy8.com]军情观察室20170503.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4158/[阳光电影-www.ygdy8.com]军情观察室20170510.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4170/[阳光电影-www.ygdy8.com]军情观察室20170517.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4180/[阳光电影-www.ygdy8.com]军情观察室20170524.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4187/[阳光电影-www.ygdy8.com]军情观察室20170531.mkv', 'admin', '', 'Z', 10.0, 1, 0);
