INSERT INTO `gx_video` VALUES (8355, 4, '锵锵三人行', '', '', '#FF0000', '', '', '<p>《锵锵三人行》是凤凰卫视出品的谈话类节目，由主持人窦文涛与两岸三地传媒界之精英名嘴，一起针对每日热门新闻事件进行研究，并各抒己见，但却又不属于追求问题答案的正论，而是俗人闲话，一派多少天下事，尽付笑谈中的豪情，达至融汇信息传播，制造乐趣与辩析事理三大元素于一身的目的。看似“平衡一下”的“滑头话”，其实是窦文涛引导嘉宾发表具个人色彩的大胆言论，营造日常聊天的形态、谈笑风生的气氛，力求轻松、惹笑。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e894w9dvj5j205306w3yj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4147/[阳光电影-www.ygdy8.com]锵锵三人行20170501.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4147/[阳光电影-www.ygdy8.com]锵锵三人行20170502.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4151/[阳光电影-www.ygdy8.com]锵锵三人行20170503.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4153/[阳光电影-www.ygdy8.com]锵锵三人行20170504.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4153/[阳光电影-www.ygdy8.com]锵锵三人行20170505.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4157/[阳光电影-www.ygdy8.com]锵锵三人行20170508.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4158/[阳光电影-www.ygdy8.com]锵锵三人行20170509.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4158/[阳光电影-www.ygdy8.com]锵锵三人行20170510.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4159/[阳光电影-www.ygdy8.com]锵锵三人行20170511.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4160/[阳光电影-www.ygdy8.com]锵锵三人行20170512.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4165/[阳光电影-www.ygdy8.com]锵锵三人行20170515.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4167/[阳光电影-www.ygdy8.com]锵锵三人行20170516.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4171/[阳光电影-www.ygdy8.com]锵锵三人行20170517.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4172/[阳光电影-www.ygdy8.com]锵锵三人行20170518.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4174/[阳光电影-www.ygdy8.com]锵锵三人行20170519.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4176/[阳光电影-www.ygdy8.com]锵锵三人行20170522.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4180/[阳光电影-www.ygdy8.com]锵锵三人行20170523.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4180/[阳光电影-www.ygdy8.com]锵锵三人行20170524.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4180/[阳光电影-www.ygdy8.com]锵锵三人行20170525.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4180/[阳光电影-www.ygdy8.com]锵锵三人行2017052