INSERT INTO `gx_video` VALUES (8360, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4146/[阳光电影-www.ygdy8.com]娱乐百分百20170501.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4147/[阳光电影-www.ygdy8.com]娱乐百分百20170502.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4150/[阳光电影-www.ygdy8.com]娱乐百分百20170503.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4153/[阳光电影-www.ygdy8.com]娱乐百分百20170504.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4154/[阳光电影-www.ygdy8.com]娱乐百分百20170505.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4157/[阳光电影-www.ygdy8.com]娱乐百分百20170506.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4157/[阳光电影-www.ygdy8.com]娱乐百分百20170508.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4158/[阳光电影-www.ygdy8.com]娱乐百分百20170509.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4158/[阳光电影-www.ygdy8.com]娱乐百分百20170510.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4159/[阳光电影-www.ygdy8.com]娱乐百分百20170511.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4161/[阳光电影-www.ygdy8.com]娱乐百分百20170512.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4163/[阳光电影-www.ygdy8.com]钒俜职20170513.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4166/[阳光电影-www.ygdy8.com]娱乐百分百20170515.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4167/[阳光电影-www.ygdy8.com]娱乐百分百20170516.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4170/[阳光电影-www.ygdy8.com]娱乐百分百20170517.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4171/[阳光电影-www.ygdy8.com]娱乐百分百20170518.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4174/[阳光电影-www.ygdy8.com]娱乐百分百20170519.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4176/[阳光电影-www.ygdy8.com]娱乐百分百20170522.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4177/[阳光电影-www.ygdy8.com]娱乐百分百201