INSERT INTO `gx_video` VALUES (8363, 4, '我想和你唱第二季', '', '', '#FF0000', '', '', '<p>《我想和你唱第二季》是湖南卫视推出的的大型互动音乐综艺节目，节目共12期。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1ff65y7mrcbj20dw07uwes.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]我想和你唱第二季20170429.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]我想和你唱第二季20170429.mkv ', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8364, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>前《花儿与少年》总导演廖珂担任总导演的新节目《#综艺•花样青春# 》近日在湖南卫视2017招商会上亮相。该节目重新定义明星旅行真人秀，打破传统旅行节目叙事模式，大胆启用“#星素结合# ”人物设定，让明星和普通人一样去旅行。三位男明星，两位普通女孩，“星素+男女”迅速升温 ，开启旅行故事中无限的情感幻想。这是一次充满年轻、冒险、狂热、不安分基因的旅行，全新旅行场景、全时段、全开放旅程。每天固定时段明星手机直播，网友脑洞大开在线派发旅行任务，各种匪夷所思的旅行故事也随之接踵而来。<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fezx85tnvgj208c0ciwgk.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4141/[阳光电影-www.ygdy8.com]花儿与少年第三季20170423.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4141/[阳光电影-www.ygdy8.com]花儿与少年第三季20170423.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8365, 4, '笑声传奇', '', '', '#FF0000', '', '', '<p>《笑声传奇》是东方卫视与东方娱乐联合推出的一档星素喜剧挑战竞技秀节目。 \u3000\u3000节目打破传统喜剧竞赛模式，邀请喜剧传奇笑匠、新锐笑匠同台竞技，现场观众作为大众评审，投票打分决定新锐笑匠谁去谁留。<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1feyp49m6lvj208c0ci76d.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4139/[阳光电影-www.ygdy8.com]笑声传奇20170423.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4139/[阳光电影-www.ygdy8.com]笑声传奇20170423.mkv ', 'admin', '', 'X', 10.0, 1, 0);
