INSERT INTO `gx_video` VALUES (8368, 4, '跨界歌王第二季', '', '', '#FF0000', '', '', '<p>《跨界歌王第二季》是北京卫视大型明星跨界音乐真人秀节目，2017年3月21日启动。发布会上，姚晨、陈建斌、江珊、苗圃、任嘉伦、梁译木组成的首发歌手阵容，以及戴玉强、王佩瑜、黄子佼组成的评论团携手亮相。相比第一季的刘涛、王凯、秦海璐、小沈阳、王祖蓝等荧屏的中坚力量，第二季的阵容明显是“新老结合”。总导演宫鹏在发布会上透露，本季将有18位艺人在2017《跨界歌王》的舞台上开唱。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f4lblnu54dj20fa0a0wf3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]跨界歌王第二季20170415.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]跨界歌王第二季20170422.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]跨界歌王第二季20170429.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]跨界歌王第二季20170415.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]跨界歌王第二季20170422.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]跨界歌王第二季20170429.mkv ', 'admin', '', 'K', 10.0, 1, 0);
