INSERT INTO `gx_video` VALUES (8370, 4, '明星大侦探第二季', '', '', '#FF0000', '', '', '<p>《明星大侦探第二季》是综艺节目《明星大侦探》的续集，《明星大侦探》节目组表示第二季正在马不停蹄地筹备中，新增侦探的信息。 据悉，《明星大侦探》已确定制作第二季，意犹未尽的粉丝只要耐心等待，未来就会看到更加难解的案件。其中“侦探X”的描述为“学霸，弟控”，“侦探W”的描述为“虎牙少年”，”有观众猜测可能是爆红的小鲜肉组合tfboys里的易烊千玺、王俊凯。<img alt="" src="http://ww1.sinaimg.cn/mw690/444476dfgw1fbpxayvqeej208c0ciq4r.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4118/[阳光电影-www.ygdy8.com]明星大侦探20170407.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4127/[阳光电影-www.ygdy8.com]明星大侦探-上20170414.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4127/[阳光电影-www.ygdy8.com]明星大侦探-下20170414.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4118/[阳光电影-www.ygdy8.com]明星大侦探20170407.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4127/[阳光电影-www.ygdy8.com]明星大侦探-上20170414.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4127/[阳光电影-www.ygdy8.com]明星大侦探-下20170414.mp4', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8371, 4, '王牌对王牌第二季', '', '', '#FF0000', '', '', '<p>《王牌对王牌第二季》是浙江卫视推出的大型原创室内竞技真人秀节目，由浙江卫视节目中心制作。节目共12期。节目主持人为沈涛，宋茜担任固定王牌特工，王祖蓝、王源分任两队王牌队长。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fby47cjo99j203d03d748.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4117/[阳光电影-www.ygdy8.com]王牌对王牌第二季20170407.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4117/[阳光电影-www.ygdy8.com]王牌对王牌第二季20170407.mkv ', 'admin', '', 'W', 10.0, 1, 0);
