INSERT INTO `gx_video` VALUES (8373, 4, '厉害了！我的歌', '', '', '#FF0000', '', '', '<p>《厉害了！我的歌》号称中国首档音乐喜剧综艺秀，该节目将于1月13日起每周五晚21：08在北京卫视爆笑唱响。 \u3000\u3000据悉，节目首创喜剧人携手音乐人共同演绎音乐喜剧的全新模式，网罗中国最优秀音乐人和喜剧人，打造最具创意的CP组合。在曝光嘉宾中，著名音乐唱作人金志文担任音乐总监，李玉刚、霍尊、胡海泉等知名歌手与艾伦、杨树林等喜剧明星跨界搭档、颠覆形象，值得期待！<img alt="" src="http://ww2.sinaimg.cn/mw690/444476dfgw1fbpx2cigvbj209d0gon0i.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4117/[阳光电影-www.ygdy8.com]历害了我的歌20170407.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4127/[阳光电影-www.ygdy8.com]厉害了我的歌20170414.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4117/[阳光电影-www.ygdy8.com]历害了我的歌20170407.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4127/[阳光电影-www.ygdy8.com]厉害了我的歌20170414.mkv ', 'admin', '', 'L', 10.0, 1, 0);
