INSERT INTO `gx_video` VALUES (8383, 4, '型男大主厨', '', '', '#FF0000', '', '', '<p>《型男大主厨》自2006年7月10日首播推出以来，收视率节节高升，长期占据台湾美食教学类节目收视第一名的位置，也成为艺人宣传作品必上的一个节目。2007年5月14日起由原来的每集30分钟改为每集60分钟并于年底加入女主持人夏于乔。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e3bjiuoyhwj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4112/[阳光电影-www.ygdy8.com]型男大主厨20170403.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4113/[阳光电影-www.ygdy8.com]型男大主厨20170404.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4115/[阳光电影-www.ygdy8.com]型男大主厨20170405.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4116/[阳光电影-www.ygdy8.com]型男大主厨20170406.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4121/[阳光电影-www.ygdy8.com]型男大主厨20170410.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4122/[阳光电影-www.ygdy8.com]型男大主厨20170411.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4124/[阳光电影-www.ygdy8.com]型男大主厨20170412.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4126/[阳光电影-www.ygdy8.com]型男大主厨20170413.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4127/[阳光电影-www.ygdy8.com]型男大主厨20170414.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4131/[阳光电影-www.ygdy8.com]型男大主厨20170417.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4132/[阳光电影-www.ygdy8.com]型男大主厨20170418.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4134/[阳光电影-www.ygdy8.com]型男大主厨20170419.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4135/[阳光电影-www.ygdy8.com]型男大主厨20170420.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]型男大主厨20170421.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4140/[阳光电影-www.ygdy8.com]型男大主厨20170424.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4141/[阳光电影-www.ygdy8.com]型男大主厨20170425.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4144/[阳光电影-www.ygdy8.com]型男大主厨20170427.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4144/[阳光电影-www.ygdy8.com]型男大主厨20170428.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4112/[阳光电影-www.ygdy8.com]型男大主厨20170403.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4113/[阳光电影-www.ygdy8.com]型男大主厨20170404.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4115/[阳光电影-www.ygdy8.com]型男大主厨2