INSERT INTO `gx_video` VALUES (8387, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4111/[阳光电影-www.ygdy8.com]两天一夜20170402.rmvb  \nftp://ygdy8:ygdy8@yg76.dydytt.net:4120/[阳光电影-www.ygdy8.com]两天一夜20170409.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4130/[阳光电影-www.ygdy8.com]两天一夜20170416.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]两天一夜20170423.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]两天一夜20170430.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4111/[阳光电影-www.ygdy8.com]两天一夜20170402.rmvb  \nftp://ygdy8:ygdy8@yg76.dydytt.net:4120/[阳光电影-www.ygdy8.com]两天一夜20170409.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4130/[阳光电影-www.ygdy8.com]两天一夜20170416.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]两天一夜20170423.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]两天一夜20170430.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8388, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4111/[阳光电影-www.ygdy8.com]RunningMan20170402.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4119/[阳光电影-www.ygdy8.com]RunningMan20170409.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4130/[阳光电影-www.ygdy8.com]Runningman20170416.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]RunningMan20170423.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]RunningMan20170430.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4111/[阳光电影-www.ygdy8.com]RunningMan20170402.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4119/[阳光电影-www.ygdy8.com]RunningMan20170409.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4130/[阳光电影-www.ygdy8.com]Runningman20170416.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]RunningMan20170423.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]RunningMan20170430.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8389, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>这是一档形式新颖，趣味十足，在挑战中发掘个性，又充满悬念的全新益智攻擂节目，每期参加节目的有11人，分为10位守擂者和一位挑战者，他们年龄，身份，文化层次各异，守擂者手中都有不同价值的奖品，而挑战者将通过20秒的限时答题与守擂者一一PK，挑战者获胜将赢得守擂者的奖品，而守擂者获胜将成为新的挑战者，并赢取挑战者手中的所有奖品，任何一方失败都将掉下擂台淘汰出局。连续战胜五名对手的挑战者有权选择带着赢得的奖品离开，或是冒着被对手PK掉的风险继续战斗，赢得更多奖品。而一站到底成为最后一位的挑战者，也将视战胜的对手人数赢得相应的奖品。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e77lhpbbkrj20m80dcgoa.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4111/[阳光电影-www.ygdy8.com]一站到底20170403.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4120/[阳光电影-www.ygdy8.com]一站到底20170410.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4130/[阳光电影-www.ygdy8.com]一站到底20170417.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4111/[阳光电影-www.ygdy8.com]一站到底20170403.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4120/[阳光电影-www.ygdy8.com]一站到底20170410.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4130/[阳光电影-www.ygdy8.com]一站到底20170417.mkv ', 'admin', '', 'Z', 10.0, 1, 0);
