INSERT INTO `gx_video` VALUES (8393, 4, '锵锵三人行', '', '', '#FF0000', '', '', '<p>《锵锵三人行》是凤凰卫视出品的谈话类节目，由主持人窦文涛与两岸三地传媒界之精英名嘴，一起针对每日热门新闻事件进行研究，并各抒己见，但却又不属于追求问题答案的正论，而是俗人闲话，一派多少天下事，尽付笑谈中的豪情，达至融汇信息传播，制造乐趣与辩析事理三大元素于一身的目的。看似“平衡一下”的“滑头话”，其实是窦文涛引导嘉宾发表具个人色彩的大胆言论，营造日常聊天的形态、谈笑风生的气氛，力求轻松、惹笑。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e894w9dvj5j205306w3yj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4111/[阳光电影-www.ygdy8.com]锵锵三人行20170403.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4112/[阳光电影-www.ygdy8.com]锵锵三人行20170404.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4116/[阳光电影-www.ygdy8.com]锵锵三人行20170405.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4116/[阳光电影-www.ygdy8.com]锵锵三人行20170406.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4117/[阳光电影-www.ygdy8.com]锵锵三人行20170407.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4120/[阳光电影-www.ygdy8.com]锵锵三人行20170410.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4123/[阳光电影-www.ygdy8.com]锵锵三人行20170411.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4125/[阳光电影-www.ygdy8.com]锵锵三人行20170412.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4127/[阳光电影-www.ygdy8.com]锵锵三人行20170413.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4127/[阳光电影-www.ygdy8.com]锵锵三人行20170414.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4130/[阳光电影-www.ygdy8.com]锵锵三人行20170417.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4131/[阳光电影-www.ygdy8.com]锵锵三人行20170418.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4133/[阳光电影-www.ygdy8.com]锵锵三人行20170419.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4135/[阳光电影-www.ygdy8.com]锵锵三人行20170420.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4136/[阳光电影-www.ygdy8.com]锵锵三人行20170421.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4139/[阳光电影-www.ygdy8.com]锵锵三人行20170424.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4142/[阳光电影-www.ygdy8.com]锵锵三人行20170425.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4142/[阳光电影-www.ygdy8.com]锵锵三人行20170426.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4144/[阳光电影-www.ygdy8.com]锵锵三人行20170427.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4144/[阳光电影-www.ygdy8.com]锵锵三人行2017042