INSERT INTO `gx_video` VALUES (8394, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4111/[阳光电影-www.ygdy8.com]综艺大集合20170402.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4120/[阳光电影-www.ygdy8.com]综艺大集合20170409.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4130/[阳光电影-www.ygdy8.com]C大集合20170416.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]综艺大集合20170423.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]综艺大集合20170430.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4111/[阳光电影-www.ygdy8.com]综艺大集合20170402.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4120/[阳光电影-www.ygdy8.com]综艺大集合20170409.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4130/[阳光电影-www.ygdy8.com]C大集合20170416.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]综艺大集合20170423.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]综艺大集合20170430.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8395, 4, '高能少年团', '', '', '#FF0000', '', '', '<p>《高能少年团》是浙江卫视推出的一档室内+户外多场景式的偶像对抗挑战类真人秀，由王俊凯、刘昊然、董子健、张一山、王大陆5位90后少年偶像担任节目嘉宾 。 \u3000\u3000节目将以真人秀的形式记录每个少年的高能挑战。意想不到的对手、青春奇幻的互动、绝不能输的挑战……每一期节目，5位少年都会 以“VS”的概念对战不同对象，既可以是人、时间、体能、胆量，也可以是内部对战，还可以是对战邀请的外来嘉宾或素人。少年和嘉宾们会将自己积极向上的拼搏劲儿全情投入在有趣的游戏中，并且在完成游戏的开发训练后最终完成当期挑战。“燃”、“向上”和“好玩”永远是节目设计时考虑的第一目标，节目也力争营造出少年们勇于尝试、敢爱敢恨、鲜活真实的形象。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fe9b95q6euj208c0ciadk.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]高能少年团20170401.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4119/[阳光电影-www.ygdy8.com]高能少年团20170408.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]高能少年团20170415.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]高能少年团20170422.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]高能少年团20170429.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]高能少年团20170401.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4119/[阳光电影-www.ygdy8.com]高能少年团20170408.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]高能少年团20170415.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]高能少年团20170422.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]高能少年团20170429.mkv ', 'admin', '', 'G', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8396, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]天才冲冲冲20170401.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4119/[阳光电影-www.ygdy8.com]天才冲冲冲20170408.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4129/[阳光电影-www.ygdy8.com]天才___20170415.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]天才冲冲冲20170422.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]天才冲冲冲20170429.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]天才冲冲冲20170401.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4119/[阳光电影-www.ygdy8.com]天才冲冲冲20170408.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4129/[阳光电影-www.ygdy8.com]天才___20170415.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]天才冲冲冲20170422.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]天才冲冲冲20170429.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8397, 4, '我们结婚了', '', '', '#FF0000', '', '', '<p>《我们结婚了》是韩国今年最受欢迎的综艺节目之一，这是一档明星假想结婚节目。几对明星假扮成新婚夫妇，真的将自己的行礼搬过来装扮起自己的“新婚房“。由前期春节节目衍生来的。第一季节目嘉宾：Andy和Solbi，Alex和申爱，郑型敦和Saori，Crown J和徐仁英，李辉才和赵茹珍，金贤重和皇甫。<img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e3enc83xg7j.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]我们结婚了20170401.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4118/[阳光电影-www.ygdy8.com]我们结婚了20170408.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]我们结婚了20170415.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]我们结婚了20170422.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]我们结婚了20170429.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]我们结婚了20170401.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4118/[阳光电影-www.ygdy8.com]我们结婚了20170408.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]我们结婚了20170415.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]我们结婚了20170422.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]我们结婚了20170429.rmvb', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8398, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]无限挑战20170401.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4119/[阳光电影-www.ygdy8.com]无限挑战20170408.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]无限挑战20170415.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]无限挑战20170422.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]无限挑战20170429.rmvb ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]无限挑战20170401.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4119/[阳光电影-www.ygdy8.com]无限挑战20170408.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]无限挑战20170415.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]无限挑战20170422.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]无限挑战20170429.rmvb ', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8399, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]非诚勿扰20170401.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4118/[阳光电影-www.ygdy8.com]非诚勿扰20170408.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]非诚勿扰20170415.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]非诚勿扰20170422.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]非诚勿扰20170429.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]非诚勿扰20170401.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4118/[阳光电影-www.ygdy8.com]非诚勿扰20170408.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]非诚勿扰20170415.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]非诚勿扰20170422.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]非诚勿扰20170429.mkv ', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8400, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]快乐大本营20170401.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4118/[阳光电影-www.ygdy8.com]快乐大本营20170408.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]快乐大本营20170415.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]快乐大本营20170422.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]快乐大本营20170429.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]快乐大本营20170401.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4118/[阳光电影-www.ygdy8.com]快乐大本营20170408.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]快乐大本营20170415.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]快乐大本营20170422.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]快乐大本营20170429.mkv ', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8401, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2017年全新音乐节目《歌手》是湖南卫视推出的大型音乐竞技节目，由湖南卫视节目中心制作，节目共14期。首发歌手为林忆莲、谭晶、狮子合唱团、袁娅维、光良、迪玛希、杜丽莎等。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fc7xi9ya2yj20mp0ezatu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]歌手20170401.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4119/[阳光电影-www.ygdy8.com]歌手20170408.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]歌手20170415.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]歌手20170422.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]歌手20170401.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4119/[阳光电影-www.ygdy8.com]歌手20170408.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4128/[阳光电影-www.ygdy8.com]歌手20170415.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]歌手20170422.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8402, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>想深入了解明星的生活点滴？想全程掌握巨星的蛛丝马迹吗？瞬息万变的影剧视界，「完全娱乐」分秒必争，报导最精彩，天天现场直播大放送，最High Speed的各类星闻及明星艺人专访，让你的八卦神经完全启动，绝不秀逗台港大陆三地劲爆红星，惊人内幕、大胆呈现，明星八卦，漏网星闻，世界性娱乐新闻、国际化独家采访，台前幕後，国内国外，别人没有的我们有，别人有的我们绝对第一手，最新最HITO的娱乐新闻，完全娱乐 精彩传送。有《我跟你拼了》、《交换梦想》等多个单元，包你看到笑，又丰富了娱乐知识。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bip1w31lj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]完全娱乐20170401.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4112/[阳光电影-www.ygdy8.com]完全娱乐20170402.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4129/[阳光电影-www.ygdy8.com]完全娱乐20170415.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4130/[阳光电影-www.ygdy8.com]完全娱乐20170416.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]完全娱乐20170422.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]完全娱乐20170429.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]完全娱乐20170430.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]完全娱乐20170401.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4112/[阳光电影-www.ygdy8.com]完全娱乐20170402.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4129/[阳光电影-www.ygdy8.com]完全娱乐20170415.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4130/[阳光电影-www.ygdy8.com]完全娱乐20170416.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]完全娱乐20170422.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]完全娱乐20170429.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4145/[阳光电影-www.ygdy8.com]完全娱乐20170430.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
