INSERT INTO `gx_video` VALUES (8404, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4109/[阳光电影-www.ygdy8.com]娱乐百分百20170401.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4112/[阳光电影-www.ygdy8.com]娱乐百分百20170403.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4113/[阳光电影-www.ygdy8.com]娱乐百分百20170404.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4115/[阳光电影-www.ygdy8.com]娱乐百分百20170405.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4116/[阳光电影-www.ygdy8.com]娱乐百分百20170406.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4118/[阳光电影-www.ygdy8.com]娱乐百分百20170407.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4119/[阳光电影-www.ygdy8.com]娱乐百分百20170408.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4121/[阳光电影-www.ygdy8.com]娱乐百分百20170410.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4122/[阳光电影-www.ygdy8.com]娱乐百分百20170411.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4124/[阳光电影-www.ygdy8.com]娱乐百分百20170412.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4126/[阳光电影-www.ygdy8.com]娱乐百分百20170413.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4127/[阳光电影-www.ygdy8.com]娱乐百分百20170414.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4129/[阳光电影-www.ygdy8.com]娱乐百分百20170415.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4131/[阳光电影-www.ygdy8.com]娱乐百分百20170417.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4132/[阳光电影-www.ygdy8.com]娱乐百分百20170418.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4134/[阳光电影-www.ygdy8.com]娱乐百分百20170419.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4135/[阳光电影-www.ygdy8.com]娱乐百分百20170420.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4137/[阳光电影-www.ygdy8.com]娱乐百分百20170421.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4138/[阳光电影-www.ygdy8.com]娱乐百分百20