INSERT INTO `gx_video` VALUES (8411, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4076/[阳光电影-www.ygdy8.com]RunningMan20170305.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4102/[阳光电影-www.ygdy8.com]RunningMan20170326.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4076/[阳光电影-www.ygdy8.com]RunningMan20170305.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4102/[阳光电影-www.ygdy8.com]RunningMan20170326.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8412, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4076/[阳光电影-www.ygdy8.com]两天一夜20170305.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4086/[阳光电影-www.ygdy8.com]两天一夜20170312.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4102/[阳光电影-www.ygdy8.com]两天一夜20170326.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4076/[阳光电影-www.ygdy8.com]两天一夜20170305.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4086/[阳光电影-www.ygdy8.com]两天一夜20170312.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4102/[阳光电影-www.ygdy8.com]两天一夜20170326.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8413, 4, '人气歌谣', '', '', '#FF0000', '', '', '<p>《人气歌谣》每周日播出，主要是一个歌手的新歌和新专集得以COME BACK回归的第一平台，因此参加演出的歌手以最近一段时间的人气歌曲为主。基本形式是每周选出TAKE7进行打榜，最终选出一名周冠军，其中也穿插很多明星的COME BACK舞台。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfgw1eacv7d4jhcj20cq09a74t.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4076/[阳光电影-www.ygdy8.com]人气歌谣20170305.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4086/[阳光电影-www.ygdy8.com]人气歌谣20170312.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4102/[阳光电影-www.ygdy8.com]人气歌谣20170326.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4076/[阳光电影-www.ygdy8.com]人气歌谣20170305.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4086/[阳光电影-www.ygdy8.com]人气歌谣20170312.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4102/[阳光电影-www.ygdy8.com]人气歌谣20170326.mp4', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8414, 4, '了不起的挑战', '', '', '#FF0000', '', '', '<p>《了不起的挑战》第二季更名为《我们的挑战》，并将转移到江苏卫视播出。第一期今日在上海浦东开录，嘉宾阵容：黄晓明、刘烨、阮经天、岳云鹏、沙溢、薛之谦。节目暂定于12月4日20:30播出。 \u3000\u3000每期节目有不同的主题，该节目深入到国内多个行业，覆盖上百个工作岗位，到普通劳动者的工作和生活场景中，一起完成一系列艰难的任务挑战。<img alt="" src="http://ww4.sinaimg.cn/mw690/444476dfjw1faxa1i5c3qj208c0ciabr.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4076/[阳光电影-www.ygdy8.com]我们的挑战20170305.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4076/[阳光电影-www.ygdy8.com]我们的挑战20170305.mp4', 'admin', '', 'L', 10.0, 1, 0);
