INSERT INTO `gx_video` VALUES (8418, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4075/[阳光电影-www.ygdy8.com]天才冲冲冲20170304.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4085/[阳光电影-www.ygdy8.com]天才冲冲冲20170311.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4093/[阳光电影-www.ygdy8.com]天才冲冲冲20170318.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4101/[阳光电影-www.ygdy8.com]天才冲冲冲20170325.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4075/[阳光电影-www.ygdy8.com]天才冲冲冲20170304.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4085/[阳光电影-www.ygdy8.com]天才冲冲冲20170311.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4093/[阳光电影-www.ygdy8.com]天才冲冲冲20170318.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4101/[阳光电影-www.ygdy8.com]天才冲冲冲20170325.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8419, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4093/[阳光电影-www.ygdy8.com]无限挑战20170318.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4102/[阳光电影-www.ygdy8.com]无限挑战20170325.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4093/[阳光电影-www.ygdy8.com]无限挑战20170318.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4102/[阳光电影-www.ygdy8.com]无限挑战20170325.rmvb', 'admin', '', 'W', 10.0, 1, 0);
