INSERT INTO `gx_video` VALUES (8431, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2014年1月3日，《最强大脑》作为国内首档科学真人秀节目在江苏卫视隆重开播。百度创始人李彦宏搭档音乐才子周杰伦亮相首期节目，并与陶晶莹、梁冬、李永波、魏坤琳四位跨界评审共同找寻中国“最强大脑”。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1ec81qo4zz5j20yg0jowii.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4074/[阳光电影-www.ygdy8.com]最强大脑20170303.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4084/[阳光电影-www.ygdy8.com]最强大脑20170310.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4092/[阳光电影-www.ygdy8.com]最强大脑20170317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4099/[阳光电影-www.ygdy8.com]最强大脑20170324.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4108/[阳光电影-www.ygdy8.com]最强大脑20170331.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4074/[阳光电影-www.ygdy8.com]最强大脑20170303.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4084/[阳光电影-www.ygdy8.com]最强大脑20170310.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4092/[阳光电影-www.ygdy8.com]最强大脑20170317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4099/[阳光电影-www.ygdy8.com]最强大脑20170324.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4108/[阳光电影-www.ygdy8.com]最强大脑20170331.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8432, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4074/[阳光电影-www.ygdy8.com]天天向上2070303.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4084/[阳光电影-www.ygdy8.com]天天向上2070310.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4092/[阳光电影-www.ygdy8.com]天天向上2070317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4099/[阳光电影-www.ygdy8.com]天天向上2070324.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]天天向上2070331.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4074/[阳光电影-www.ygdy8.com]天天向上2070303.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4084/[阳光电影-www.ygdy8.com]天天向上2070310.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4092/[阳光电影-www.ygdy8.com]天天向上2070317.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4099/[阳光电影-www.ygdy8.com]天天向上2070324.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4110/[阳光电影-www.ygdy8.com]天天向上2070331.mkv ', 'admin', '', 'T', 10.0, 1, 0);
