INSERT INTO `gx_video` VALUES (8436, 4, '今晚80后脱口秀', '', '', '#FF0000', '', '', '<p>《今晚80后脱口秀》是东方卫视全新打造的高端文化脱口秀，也是中国唯一一档欧美风格脱口秀节目，于2012年5月13日开播，80后新锐相声演员王自健倾情加盟，每期通过脱口秀的形式，展现年轻人对社会热点、文化事件、时尚潮流的态度和思想，幽默风趣却又不失智慧与锐度。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e4etydqfwkj20r2099tcl.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4073/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170302.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4082/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170309.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4090/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170316.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4099/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170323.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4073/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170302.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4082/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170309.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4090/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170316.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4099/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170323.mkv', 'admin', '', 'J', 10.0, 1, 0);
