INSERT INTO `gx_video` VALUES (8438, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4072/[阳光电影-www.ygdy8.com]娱乐百分百20170301.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4073/[阳光电影-www.ygdy8.com]娱乐百分百20170302.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4074/[阳光电影-www.ygdy8.com]娱乐百分百20170303.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4075/[阳光电影-www.ygdy8.com]娱乐百分百20170304.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4077/[阳光电影-www.ygdy8.com]娱乐百分百20170306.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4078/[阳光电影-www.ygdy8.com]娱乐百分百20170307.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4079/[阳光电影-www.ygdy8.com]娱乐百分百20170308.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4081/[阳光电影-www.ygdy8.com]娱乐百分百20170309.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4086/[阳光电影-www.ygdy8.com]娱乐百分百20170310.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4086/[阳光电影-www.ygdy8.com]娱乐百分百20170311.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4087/[阳光电影-www.ygdy8.com]娱乐百分百20170313.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4088/[阳光电影-www.ygdy8.com]娱乐百分百20170314.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4089/[阳光电影-www.ygdy8.com]娱乐百分百20170315.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4090/[阳光电影-www.ygdy8.com]娱乐百分百20170316.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4092/[阳光电影-www.ygdy8.com]娱乐百分百20170317.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4095/[阳光电影-www.ygdy8.com]娱乐百分百20170318.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4095/[阳光电影-www.ygdy8.com]娱乐百分百20170320.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4096/[阳光电影-www.ygdy8.com]娱乐百分百20170321.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4097/[阳光电影-www.ygdy8.com]娱乐百分百201