INSERT INTO `gx_video` VALUES (8441, 4, '锵锵三人行', '', '', '#FF0000', '', '', '<p>《锵锵三人行》是凤凰卫视出品的谈话类节目，由主持人窦文涛与两岸三地传媒界之精英名嘴，一起针对每日热门新闻事件进行研究，并各抒己见，但却又不属于追求问题答案的正论，而是俗人闲话，一派多少天下事，尽付笑谈中的豪情，达至融汇信息传播，制造乐趣与辩析事理三大元素于一身的目的。看似“平衡一下”的“滑头话”，其实是窦文涛引导嘉宾发表具个人色彩的大胆言论，营造日常聊天的形态、谈笑风生的气氛，力求轻松、惹笑。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e894w9dvj5j205306w3yj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4072/[阳光电影-www.ygdy8.com]锵锵三人行20170301.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4073/[阳光电影-www.ygdy8.com]锵锵三人行20170302.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4074/[阳光电影-www.ygdy8.com]锵锵三人行20170303.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4077/[阳光电影-www.ygdy8.com]锵锵三人行20170306.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4079/[阳光电影-www.ygdy8.com]锵锵三人行20170307.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4080/[阳光电影-www.ygdy8.com]锵锵三人行20170308.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4084/[阳光电影-www.ygdy8.com]锵锵三人行20170310.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4088/[阳光电影-www.ygdy8.com]锵锵三人行20170313.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4089/[阳光电影-www.ygdy8.com]锵锵三人行20170314.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4091/[阳光电影-www.ygdy8.com]锵锵三人行20170315.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4091/[阳光电影-www.ygdy8.com]锵锵三人行20170316.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4092/[阳光电影-www.ygdy8.com]锵锵三人行20170317.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4095/[阳光电影-www.ygdy8.com]锵锵三人行20170320.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4096/[阳光电影-www.ygdy8.com]锵锵三人行20170321.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4098/[阳光电影-www.ygdy8.com]锵锵三人行20170322.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4100/[阳光电影-www.ygdy8.com]锵锵三人行20170323.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4100/[阳光电影-www.ygdy8.com]锵锵三人行20170324.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4102/[阳光电影-www.ygdy8.com]锵锵三人行20170327.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4103/[阳光电影-www.ygdy8.com]锵锵三人行20170328.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4106/[阳光电影-www.ygdy8.com]锵锵三人行20170329