INSERT INTO `gx_video` VALUES (8444, 4, '鲁豫有约', '', '', '#FF0000', '', '', '<p>《鲁豫有约》为香港凤凰卫视的电视谈话性节目，凤凰卫视于1998年开播，后进入中国大陆电视，在各个地方电视台播出，2008年湖南卫视购买中国大陆区独播版权并与4月14日开始播出。2010年1月4日，《鲁豫有约》登陆安徽卫视，每周一到周五的晚间21：27分播出。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e6c74wy6s8j20fd08lwf1.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4072/[阳光电影-www.ygdy8.com]鲁豫有约20170301.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4073/[阳光电影-www.ygdy8.com]鲁豫有约20170302.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4077/[阳光电影-www.ygdy8.com]鲁豫有约20170307.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4079/[阳光电影-www.ygdy8.com]鲁豫有约20170308.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4080/[阳光电影-www.ygdy8.com]鲁豫有约20170309.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4088/[阳光电影-www.ygdy8.com]鲁豫有约20170314.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4089/[阳光电影-www.ygdy8.com]鲁豫有约20170315.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4089/[阳光电影-www.ygdy8.com]鲁豫有约20170316.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4096/[阳光电影-www.ygdy8.com]鲁豫有约20170321.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4096/[阳光电影-www.ygdy8.com]鲁豫有约20170322.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4099/[阳光电影-www.ygdy8.com]鲁豫有约20170323.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4103/[阳光电影-www.ygdy8.com]鲁豫有约20170328.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4104/[阳光电影-www.ygdy8.com]鲁豫有约20170329.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4105/[阳光电影-www.ygdy8.com]鲁豫有约20170330.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4072/[阳光电影-www.ygdy8.com]鲁豫有约20170301.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4073/[阳光电影-www.ygdy8.com]鲁豫有约20170302.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4077/[阳光电影-www.ygdy8.com]鲁豫有约20170307.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4079/[阳光电影-www.ygdy8.com]鲁豫有约20170308.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4080/[阳光电影-www.ygdy8.com]鲁豫有约20170309.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4088/[阳光电影-www.ygdy8.com]鲁豫有约20170314.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4089/[阳光电影-www.ygdy8.com]鲁豫有约20170315.mp4 \nft