INSERT INTO `gx_video` VALUES (8445, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4060/[阳光电影-www.ygdy8.com]无限挑战20170218.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]无限挑战20170225.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4060/[阳光电影-www.ygdy8.com]无限挑战20170218.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]无限挑战20170225.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8446, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2017年江苏卫视元宵节晚会！实力笑星曹云金、何云伟爆笑演绎喜剧小品；李玉刚致敬经典实力反串；更有大张伟、 好妹妹乐队、SNH48等带来初春里的好声音和你一起欢乐闹元宵！ \u200b<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fcosi3k5hsj206b08cq38.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4051/[阳光电影-www.ygdy8.com]2017江苏元宵晚会.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4051/[阳光电影-www.ygdy8.com]2017江苏元宵晚会.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8447, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>每年农历的正月十五，湖南卫视为观众献上一份快乐大餐，最火热力的明星，最搞笑的演出，最时尚的话题，更多精彩，尽在《湖南卫视元宵喜乐会》<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fcosfhwxj6j205y08c3ys.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4051/[阳光电影-www.ygdy8.com]2017湖南元宵喜乐会.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4051/[阳光电影-www.ygdy8.com]2017湖南元宵喜乐会.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8448, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>小品女王蔡明跨界献声，张继科、董力将分别献唱《同桌的你》《我相信》，沙溢也将搭档朱迅反串表演小品《过河》。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fcosao94stj206i08c74m.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4051/[阳光电影-www.ygdy8.com]2017央视元宵晚会.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4051/[阳光电影-www.ygdy8.com]2017央视元宵晚会.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8449, 4, '我们十七岁', '', '', '#FF0000', '', '', '<p>《我们十七岁》是由浙江卫视、宇佑传媒和华策天映联合出品的国内首档大型明星逆时光旅行类真人秀，节目共12期。节目六位固定主持是范明、郭富城、林志颖、华少、孙杨、韩东君。 在两天一夜的欢乐旅程中，节目不仅会呈现六位嘉宾一路同行的酸甜苦辣，还将展现大江南北的风土人情和传统文化，观众在欢笑之余，也收获感动和成长。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1famwyohgc5j204x06o74g.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4050/[阳光电影-www.ygdy8.com]我们十七岁20170211.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]我们十七岁20170218.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]我们十七岁20170225.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4050/[阳光电影-www.ygdy8.com]我们十七岁20170211.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]我们十七岁20170218.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]我们十七岁20170225.mp4', 'admin', '', 'W', 10.0, 1, 0);
