INSERT INTO `gx_video` VALUES (8458, 4, '我们结婚了', '', '', '#FF0000', '', '', '<p>《我们结婚了》是韩国今年最受欢迎的综艺节目之一，这是一档明星假想结婚节目。几对明星假扮成新婚夫妇，真的将自己的行礼搬过来装扮起自己的“新婚房“。由前期春节节目衍生来的。第一季节目嘉宾：Andy和Solbi，Alex和申爱，郑型敦和Saori，Crown J和徐仁英，李辉才和赵茹珍，金贤重和皇甫。<img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e3enc83xg7j.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4042/[阳光电影-www.ygdy8.com]我们结婚了20170204.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4050/[阳光电影-www.ygdy8.com]我们结婚了20170211.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4060/[阳光电影-www.ygdy8.com]我们结婚了20170218.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]我们结婚了20170225.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4042/[阳光电影-www.ygdy8.com]我们结婚了20170204.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4050/[阳光电影-www.ygdy8.com]我们结婚了20170211.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4060/[阳光电影-www.ygdy8.com]我们结婚了20170218.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]我们结婚了20170225.mp4 ', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8459, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4042/[阳光电影-www.ygdy8.com]RunningMan20170205.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4052/[阳光电影-www.ygdy8.com]RunningMan20170212.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4060/[阳光电影-www.ygdy8.com]RunningMan20170219.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]RunningMan20170226.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4042/[阳光电影-www.ygdy8.com]RunningMan20170205.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4052/[阳光电影-www.ygdy8.com]RunningMan20170212.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4060/[阳光电影-www.ygdy8.com]RunningMan20170219.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]RunningMan20170226.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8460, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4042/[阳光电影-www.ygdy8.com]两天一夜20170205.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4052/[阳光电影-www.ygdy8.com]两天一夜20170212.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4060/[阳光电影-www.ygdy8.com]两天一夜20170219.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4071/[阳光电影-www.ygdy8.com]两天一夜20170226.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4042/[阳光电影-www.ygdy8.com]两天一夜20170205.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4052/[阳光电影-www.ygdy8.com]两天一夜20170212.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4060/[阳光电影-www.ygdy8.com]两天一夜20170219.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4071/[阳光电影-www.ygdy8.com]两天一夜20170226.mp4', 'admin', '', 'Z', 10.0, 1, 0);
