INSERT INTO `gx_video` VALUES (8464, 4, '了不起的挑战', '', '', '#FF0000', '', '', '<p>《了不起的挑战》第二季更名为《我们的挑战》，并将转移到江苏卫视播出。第一期今日在上海浦东开录，嘉宾阵容：黄晓明、刘烨、阮经天、岳云鹏、沙溢、薛之谦。节目暂定于12月4日20:30播出。 \u3000\u3000每期节目有不同的主题，该节目深入到国内多个行业，覆盖上百个工作岗位，到普通劳动者的工作和生活场景中，一起完成一系列艰难的任务挑战。<img alt="" src="http://ww4.sinaimg.cn/mw690/444476dfjw1faxa1i5c3qj208c0ciabr.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4042/[阳光电影-www.ygdy8.com]我们的挑战20170205.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4061/[阳光电影-www.ygdy8.com]我们的挑战20170219.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4070/[阳光电影-www.ygdy8.com]我们的挑战20170226.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4042/[阳光电影-www.ygdy8.com]我们的挑战20170205.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4061/[阳光电影-www.ygdy8.com]我们的挑战20170219.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4070/[阳光电影-www.ygdy8.com]我们的挑战20170226.mkv', 'admin', '', 'L', 10.0, 1, 0);
