INSERT INTO `gx_video` VALUES (8466, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4042/[阳光电影-www.ygdy8.com]天才冲冲冲20170204.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4049/[阳光电影-www.ygdy8.com]天才冲冲冲20170211.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4061/[阳光电影-www.ygdy8.com]天才冲冲冲20170218.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]天才冲冲冲20170225.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4042/[阳光电影-www.ygdy8.com]天才冲冲冲20170204.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4049/[阳光电影-www.ygdy8.com]天才冲冲冲20170211.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4061/[阳光电影-www.ygdy8.com]天才冲冲冲20170218.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]天才冲冲冲20170225.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8467, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>东方卫视原创话题喜剧综艺《笑星闯地球》，节目曝光首款海报，海报以红蓝为主色调，呈现激烈的对抗氛围。大张伟、王自健分别化身笑星队、地球队队长首次加盟原创话题喜剧综艺，节目现场领队“吵架”，嘴炮横飞，你招架得住吗？<img alt="" src="http://ww1.sinaimg.cn/mw690/444476dfgw1fa6m9vsz4yj21120o3agu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]笑星撞地球20170204.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4050/[阳光电影-www.ygdy8.com]笑星撞地球20170211.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4060/[阳光电影-www.ygdy8.com]笑星闯地球20170218.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4070/[阳光电影-www.ygdy8.com]笑星撞地球20170225.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]笑星撞地球20170204.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4050/[阳光电影-www.ygdy8.com]笑星撞地球20170211.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4060/[阳光电影-www.ygdy8.com]笑星闯地球20170218.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4070/[阳光电影-www.ygdy8.com]笑星撞地球20170225.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8468, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>深度剖析中国婚恋，从情感、家庭、文化、道德多维度出发，打造全新的相亲节目。<img alt="" src="http://ww4.sinaimg.cn/mw690/444476dfgw1fb2tmi0p8wj206408k74q.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]中国式相亲20170204.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4050/[阳光电影-www.ygdy8.com]中国式相亲20170211.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]中国式相亲20170218.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4070/[阳光电影-www.ygdy8.com]中国式相亲20170225.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]中国式相亲20170204.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4050/[阳光电影-www.ygdy8.com]中国式相亲20170211.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]中国式相亲20170218.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4070/[阳光电影-www.ygdy8.com]中国式相亲20170225.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8469, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]快乐大本营20170204.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]快乐大本营20170218.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4070/[阳光电影-www.ygdy8.com]快乐大本营20170225.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]快乐大本营20170204.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]快乐大本营20170218.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4070/[阳光电影-www.ygdy8.com]快乐大本营20170225.mkv', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8470, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]非诚勿扰20170204.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]非诚勿扰20170218.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4070/[阳光电影-www.ygdy8.com]非诚勿扰20170225.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]非诚勿扰20170204.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]非诚勿扰20170218.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4070/[阳光电影-www.ygdy8.com]非诚勿扰20170225.mkv', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8471, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2017年全新音乐节目《歌手》是湖南卫视推出的大型音乐竞技节目，由湖南卫视节目中心制作，节目共14期。首发歌手为林忆莲、谭晶、狮子合唱团、袁娅维、光良、迪玛希、杜丽莎等。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fc7xi9ya2yj20mp0ezatu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]歌手20170204.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4050/[阳光电影-www.ygdy8.com]歌手20170211.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]歌手20170218.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]歌手20170225.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]歌手20170204.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4050/[阳光电影-www.ygdy8.com]歌手20170211.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]歌手20170218.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]歌手20170225.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8472, 4, '二十四小时', '', '', '#FF0000', '', '', '<p>《二十四小时》首创连续剧集式的综艺新形式，在单期节目完整性的基础上，核心线索于全季12期故事中一以贯之，并融入喜剧性的翻转环节，跌宕起伏、悬念重重。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfgw1f09dqqecznj20fa06gq5m.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]二十四小时第二季20170203.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4048/[阳光电影-www.ygdy8.com]二十四小时第二季20170210.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4058/[阳光电影-www.ygdy8.com]二十四小时第二季20170217.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4067/[阳光电影-www.ygdy8.com]二十四小时20170224.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]二十四小时第二季20170203.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4048/[阳光电影-www.ygdy8.com]二十四小时第二季20170210.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4058/[阳光电影-www.ygdy8.com]二十四小时第二季20170217.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4067/[阳光电影-www.ygdy8.com]二十四小时20170224.mp4', 'admin', '', 'E', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8473, 4, '明星大侦探第二季', '', '', '#FF0000', '', '', '<p>《明星大侦探第二季》是综艺节目《明星大侦探》的续集，《明星大侦探》节目组表示第二季正在马不停蹄地筹备中，新增侦探的信息。 据悉，《明星大侦探》已确定制作第二季，意犹未尽的粉丝只要耐心等待，未来就会看到更加难解的案件。其中“侦探X”的描述为“学霸，弟控”，“侦探W”的描述为“虎牙少年”，”有观众猜测可能是爆红的小鲜肉组合tfboys里的易烊千玺、王俊凯。<img alt="" src="http://ww1.sinaimg.cn/mw690/444476dfgw1fbpxayvqeej208c0ciq4r.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]明星大侦探20170203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4049/[阳光电影-www.ygdy8.com]明星大侦探20170210.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4061/[阳光电影-www.ygdy8.com]明星大侦探20170217.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]明星大侦探20170224.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]明星大侦探20170203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4049/[阳光电影-www.ygdy8.com]明星大侦探20170210.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4061/[阳光电影-www.ygdy8.com]明星大侦探20170217.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]明星大侦探20170224.mp4', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8474, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]天天向上20170203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4048/[阳光电影-www.ygdy8.com]天天向上20170210.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]天天向上20170217.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4067/[阳光电影-www.ygdy8.com]天天向上2070224.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]天天向上20170203.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4048/[阳光电影-www.ygdy8.com]天天向上20170210.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]天天向上20170217.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4067/[阳光电影-www.ygdy8.com]天天向上2070224.mkv', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8475, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2014年1月3日，《最强大脑》作为国内首档科学真人秀节目在江苏卫视隆重开播。百度创始人李彦宏搭档音乐才子周杰伦亮相首期节目，并与陶晶莹、梁冬、李永波、魏坤琳四位跨界评审共同找寻中国“最强大脑”。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1ec81qo4zz5j20yg0jowii.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]最强大脑20170203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4049/[阳光电影-www.ygdy8.com]最强大脑20170210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]最强大脑20170217.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4067/[阳光电影-www.ygdy8.com]最强大脑20170224.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]最强大脑20170203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4049/[阳光电影-www.ygdy8.com]最强大脑20170210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]最强大脑20170217.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4067/[阳光电影-www.ygdy8.com]最强大脑20170224.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8476, 4, '厉害了！我的歌', '', '', '#FF0000', '', '', '<p>《厉害了！我的歌》号称中国首档音乐喜剧综艺秀，该节目将于1月13日起每周五晚21：08在北京卫视爆笑唱响。 \u3000\u3000据悉，节目首创喜剧人携手音乐人共同演绎音乐喜剧的全新模式，网罗中国最优秀音乐人和喜剧人，打造最具创意的CP组合。在曝光嘉宾中，著名音乐唱作人金志文担任音乐总监，李玉刚、霍尊、胡海泉等知名歌手与艾伦、杨树林等喜剧明星跨界搭档、颠覆形象，值得期待！<img alt="" src="http://ww2.sinaimg.cn/mw690/444476dfgw1fbpx2cigvbj209d0gon0i.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4039/[阳光电影-www.ygdy8.com]厉害了我的歌20170203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4049/[阳光电影-www.ygdy8.com]厉害了我的歌20170210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]厉害了我的歌20170217.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]厉害了我的歌20170224.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4039/[阳光电影-www.ygdy8.com]厉害了我的歌20170203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4049/[阳光电影-www.ygdy8.com]厉害了我的歌20170210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4059/[阳光电影-www.ygdy8.com]厉害了我的歌20170217.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]厉害了我的歌20170224.mp4', 'admin', '', 'L', 10.0, 1, 0);
