INSERT INTO `gx_video` VALUES (8485, 4, '锵锵三人行', '', '', '#FF0000', '', '', '<p>《锵锵三人行》是凤凰卫视出品的谈话类节目，由主持人窦文涛与两岸三地传媒界之精英名嘴，一起针对每日热门新闻事件进行研究，并各抒己见，但却又不属于追求问题答案的正论，而是俗人闲话，一派多少天下事，尽付笑谈中的豪情，达至融汇信息传播，制造乐趣与辩析事理三大元素于一身的目的。看似“平衡一下”的“滑头话”，其实是窦文涛引导嘉宾发表具个人色彩的大胆言论，营造日常聊天的形态、谈笑风生的气氛，力求轻松、惹笑。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e894w9dvj5j205306w3yj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4036/[阳光电影-www.ygdy8.com]锵锵三人行20170201.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4038/[阳光电影-www.ygdy8.com]锵锵三人行20170202.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4041/[阳光电影-www.ygdy8.com]锵锵三人行20170203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4045/[阳光电影-www.ygdy8.com]锵锵三人行20170207.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4045/[阳光电影-www.ygdy8.com]锵锵三人行20170208.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4047/[阳光电影-www.ygdy8.com]锵锵三人行20170209.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4048/[阳光电影-www.ygdy8.com]锵锵三人行20170210.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4053/[阳光电影-www.ygdy8.com]锵锵三人行20170213.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4054/[阳光电影-www.ygdy8.com]锵锵三人行20170214.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4055/[阳光电影-www.ygdy8.com]锵锵三人行20170215.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4058/[阳光电影-www.ygdy8.com]锵锵三人行20170216.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4058/[阳光电影-www.ygdy8.com]锵锵三人行20170217.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4063/[阳光电影-www.ygdy8.com]锵锵三人行20170220.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4065/[阳光电影-www.ygdy8.com]锵锵三人行20170221.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4066/[阳光电影-www.ygdy8.com]锵锵三人行20170222.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4067/[阳光电影-www.ygdy8.com]锵锵三人行20170223.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4067/[阳光电影-www.ygdy8.com]锵锵三人行20170224.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4069/[阳光电影-www.ygdy8.com]锵锵三人行20170226.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4071/[阳光电影-www.ygdy8.com]锵锵三人行20170228.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4036/[阳光电影-www.ygdy8.com]锵锵三人行201