INSERT INTO `gx_video` VALUES (8487, 4, '洪洋洞', '', '', '#FF0000', '', '', '<p>《洪洋洞》郭德纲 于谦 10 《学电台》高峰 栾云平 09 《扒马褂》郭德纲 于谦 烧饼 岳云鹏 郭麒麟 08 《歪唱太平歌词》张云雷 杨九郎 07 《铁甲将军》岳云鹏 孙越 06 《逗捧论》郭麒麟 阎鹤祥 05 《爱情往事》郭德纲 于谦 04 《下象棋》孔云龙 李云杰 03 《找搭档》侯震 闫云达 陶阳 02 《开场小唱 门柳儿》德云社全员 01 《德云社丙申年封箱庆典》是德云社的相声演员为观众呈现的精彩相声庆典。庆典呈现了多种形式的相声作品，带领观众体验相声的魅力。<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fcasvu6u8ij207p0adgmm.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4035/[阳光电影-www.ygdy8.com]2017德云社丙申年封箱整场.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4035/[阳光电影-www.ygdy8.com]2017德云社丙申年封箱整场.mkv', 'admin', '', 'H', 10.0, 1, 0);
