INSERT INTO `gx_video` VALUES (8489, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2017年全新音乐节目《歌手》是湖南卫视推出的大型音乐竞技节目，由湖南卫视节目中心制作，节目共14期。首发歌手为林忆莲、谭晶、狮子合唱团、袁娅维、光良、迪玛希、杜丽莎等。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fc7xi9ya2yj20mp0ezatu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]歌手20170121.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]歌手20170128.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]歌手20170121.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]歌手20170128.mkv ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8490, 4, '北京卫视春节联欢晚会', '', '', '#FF0000', '', '', '<p>《北京卫视春节联欢晚会》于1月28日19:35在北京卫视播出。2017年北京台春晚围绕“欢动万家夜，爱暖中国心”的主题，立足北京特有的城市属性。<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fc7xi14mtuj21hc0u047i.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]2017北京卫视春节联欢晚会A.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]2017北京卫视春节联欢晚会B.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]2017北京卫视春节联欢晚会A.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]2017北京卫视春节联欢晚会B.mkv ', 'admin', '', 'B', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8491, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>安徽卫视春节联欢晚会，通常简称“安徽卫视春晚”或“徽晚”，是安徽电视台在每年农历除夕晚上为庆祝农历新年举办的地方性文艺晚会，也是安徽卫视为安徽人民、家乡倾力打造的综艺性春节联欢晚会。安徽卫视春晚在演出规模、演员阵容、播出时长和海内外观众收视率上，在全国地方卫视中占有一席之地，成为地方电视台中的一朵奇葩。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fc7xhu161uj20ev08ln6a.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]2017安徽卫视春节联欢晚会.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]2017安徽卫视春节联欢晚会.mp4 ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8492, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>本次春晚的主题是“幸福一起来”，总导演张炀剖析幸福主题：“去年是按照了人、家、国的几个层次解读的，今年我们觉得幸福是分很多种类，平安，喜乐，开心，各种各样的体验，幸福这个词汇里面包括的各种体验非常丰富。我们希望各种各样丰富的体验都能伴随着2017年一起扑向我们。”<img alt="" src="http://wx4.sinaimg.cn/mw690/444476dfgy1fc7xho06hdj20od0cyq5v.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]2017江苏卫视春节联欢晚会.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]2017江苏卫视春节联欢晚会.mkv', 'admin', '', 'Z', 10.0, 1, 0);
