INSERT INTO `gx_video` VALUES (8496, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>山东卫视2017鸡年青春启航春晚节目单曝光，这也是省台首家春晚，张靓颖、费玉清、林志颖等大咖加盟， 黄龄跟着林海，搭配阿速、张美琪担任山东春晚主持<img alt="" src="http://wx1.sinaimg.cn/mw690/444476dfgy1fc6pd5ddr3j20fa07xjt3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4030/[阳光电影-www.ygdy8.com]2017年山东卫视春节联欢晚会.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4030/[阳光电影-www.ygdy8.com]2017年山东卫视春节联欢晚会.mp4', 'admin', '', 'Z', 10.0, 1, 0);
