INSERT INTO `gx_video` VALUES (8498, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>辽视春晚的一大看点就是语言类节目的“质优量足”，东北人天然的幽默感加上适度夸张的表现力总能恰到好处地戳中观众笑点，从潘长江巩汉林蔡明郭冬临、到宋小宝刘小光周云鹏、再到乔杉修睿王宁高晓攀，辽宁卫视集齐了喜剧届的半壁江山，卯足劲儿为观众奉上一道欢乐盛宴。 \u3000\u3000今年的辽视春晚，也是明星家庭组团亮相最多一年，不仅有火风霍尊、巩汉林巩天阔、潘长江潘阳、冯晓泉曾格格这种“传统”的家庭组合，还有辽视两档王牌节目《中国好家庭》和《欢乐饭米粒》的“全家总动员”，更有郭阳郭亮、宋小宝和哈德森这样的“双胞胎”组合、辽篮“大侄子”郭艾伦和演员宋佳伦的“双伦”组合、贾乃亮王迅和脸脸于洋的“破马张飞”组合……可谓“你方笑罢我登场”。<img alt="" src="http://wx1.sinaimg.cn/mw690/6a9a5967ly1fc404eyj3rj20m80m8wgm.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4029/[阳光电影-www.ygdy8.com]2017辽宁春节联欢晚会A.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4029/[阳光电影-www.ygdy8.com]2017辽宁春节联欢晚会B.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4029/[阳光电影-www.ygdy8.com]2017辽宁春节联欢晚会C.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4029/[阳光电影-www.ygdy8.com]2017辽宁春节联欢晚会A.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4029/[阳光电影-www.ygdy8.com]2017辽宁春节联欢晚会B.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4029/[阳光电影-www.ygdy8.com]2017辽宁春节联欢晚会C.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8499, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>2017湖南卫视小年夜春晚将于今晚（1月20日）19：30与大家准时相见。这台“有料、有味、有热点”的晚会众星云集，大张伟、宋小宝、沙溢、邹市明、田亮、凤凰传奇、好妹妹乐队、郎朗、李玟、谢娜、陈乔恩、江一燕、奚梦瑶、莫文蔚、唐嫣、罗晋、王宝强、柳岩等与观众一起过新年。更有湖南卫视当红主持人何炅、汪涵、谢娜、沈梦辰、梁田携手主持。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fby4gjgc2wj20dw082wf2.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4017/[阳光电影-www.ygdy8.com]2017湖南卫视小年夜春晚20170120.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4017/[阳光电影-www.ygdy8.com]2017湖南卫视小年夜春晚20170120.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8500, 4, '王牌对王牌第二季', '', '', '#FF0000', '', '', '<p>《王牌对王牌第二季》是浙江卫视推出的大型原创室内竞技真人秀节目，由浙江卫视节目中心制作。节目共12期。节目主持人为沈涛，宋茜担任固定王牌特工，王祖蓝、王源分任两队王牌队长。<img alt="" src="http://wx3.sinaimg.cn/mw690/444476dfgy1fby47cjo99j203d03d748.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4017/[阳光电影-www.ygdy8.com]王牌对王牌第二季20170120.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4033/[阳光电影-www.ygdy8.com]王牌对王牌第二季20170129.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4034/[阳光电影-www.ygdy8.com]王牌对王牌第二季20170130.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4017/[阳光电影-www.ygdy8.com]王牌对王牌第二季20170120.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4033/[阳光电影-www.ygdy8.com]王牌对王牌第二季20170129.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4034/[阳光电影-www.ygdy8.com]王牌对王牌第二季20170130.mkv', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8501, 4, '欢乐中国人', '', '', '#FF0000', '', '', '<p>《欢乐中国人》是一档央视综合频道首播的大型合家欢真人秀节目。节目用舞台幽默小品的形式再现了生活中的欢乐片段，诠释了家庭和睦、优良家风给百姓带来幸福感。<img alt="" src="http://ww2.sinaimg.cn/mw690/444476dfgw1fbsedkdarkj20hs0bvjsj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4011/[阳光电影-www.ygdy8.com]欢乐中国人20170115.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4011/[阳光电影-www.ygdy8.com]欢乐中国人20170115.mkv ', 'admin', '', 'H', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8502, 4, '明星大侦探第二季', '', '', '#FF0000', '', '', '<p>《明星大侦探第二季》是综艺节目《明星大侦探》的续集，《明星大侦探》节目组表示第二季正在马不停蹄地筹备中，新增侦探的信息。 据悉，《明星大侦探》已确定制作第二季，意犹未尽的粉丝只要耐心等待，未来就会看到更加难解的案件。其中“侦探X”的描述为“学霸，弟控”，“侦探W”的描述为“虎牙少年”，”有观众猜测可能是爆红的小鲜肉组合tfboys里的易烊千玺、王俊凯。<img alt="" src="http://ww1.sinaimg.cn/mw690/444476dfgw1fbpxayvqeej208c0ciq4r.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4009/[阳光电影-www.ygdy8.com]明星大侦探20170113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4018/[阳光电影-www.ygdy8.com]明星大侦探20170120.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4009/[阳光电影-www.ygdy8.com]明星大侦探20170113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4018/[阳光电影-www.ygdy8.com]明星大侦探20170120.mp4', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8503, 4, '厉害了！我的歌', '', '', '#FF0000', '', '', '<p>《厉害了！我的歌》号称中国首档音乐喜剧综艺秀，该节目将于1月13日起每周五晚21：08在北京卫视爆笑唱响。 \u3000\u3000据悉，节目首创喜剧人携手音乐人共同演绎音乐喜剧的全新模式，网罗中国最优秀音乐人和喜剧人，打造最具创意的CP组合。在曝光嘉宾中，著名音乐唱作人金志文担任音乐总监，李玉刚、霍尊、胡海泉等知名歌手与艾伦、杨树林等喜剧明星跨界搭档、颠覆形象，值得期待！<img alt="" src="http://ww2.sinaimg.cn/mw690/444476dfgw1fbpx2cigvbj209d0gon0i.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4009/[阳光电影-www.ygdy8.com]厉害了我的歌20170113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4017/[阳光电影-www.ygdy8.com]厉害了我的歌20170120.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4009/[阳光电影-www.ygdy8.com]厉害了我的歌20170113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4017/[阳光电影-www.ygdy8.com]厉害了我的歌20170120.mkv', 'admin', '', 'L', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8504, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4004/[阳光电影-www.ygdy8.com]天才冲冲冲20170107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]天才___20170114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4020/[阳光电影-www.ygdy8.com]天才冲冲冲20170121.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4033/[阳光电影-www.ygdy8.com]天才nnn20170128.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4004/[阳光电影-www.ygdy8.com]天才冲冲冲20170107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]天才___20170114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4020/[阳光电影-www.ygdy8.com]天才冲冲冲20170121.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4033/[阳光电影-www.ygdy8.com]天才nnn20170128.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8505, 4, '我们结婚了', '', '', '#FF0000', '', '', '<p>《我们结婚了》是韩国今年最受欢迎的综艺节目之一，这是一档明星假想结婚节目。几对明星假扮成新婚夫妇，真的将自己的行礼搬过来装扮起自己的“新婚房“。由前期春节节目衍生来的。第一季节目嘉宾：Andy和Solbi，Alex和申爱，郑型敦和Saori，Crown J和徐仁英，李辉才和赵茹珍，金贤重和皇甫。<img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e3enc83xg7j.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4003/[阳光电影-www.ygdy8.com]我们结婚了20170107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]我们结婚了20170114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4035/[阳光电影-www.ygdy8.com]我们结婚了20170121.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4033/[阳光电影-www.ygdy8.com]我们结婚了20170128.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4003/[阳光电影-www.ygdy8.com]我们结婚了20170107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]我们结婚了20170114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4035/[阳光电影-www.ygdy8.com]我们结婚了20170121.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4033/[阳光电影-www.ygdy8.com]我们结婚了20170128.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8506, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4003/[阳光电影-www.ygdy8.com]无限挑战20170107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4011/[阳光电影-www.ygdy8.com]无限挑战20170114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4021/[阳光电影-www.ygdy8.com]无限挑战20170121.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4003/[阳光电影-www.ygdy8.com]无限挑战20170107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4011/[阳光电影-www.ygdy8.com]无限挑战20170114.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4021/[阳光电影-www.ygdy8.com]无限挑战20170121.mp4', 'admin', '', 'W', 10.0, 1, 0);
