INSERT INTO `gx_video` VALUES (8513, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4002/[阳光电影-www.ygdy8.com]非诚勿扰20170107.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]非诚勿扰20170114.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4019/[阳光电影-www.ygdy8.com]非诚勿扰20170121.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4002/[阳光电影-www.ygdy8.com]非诚勿扰20170107.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]非诚勿扰20170114.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4019/[阳光电影-www.ygdy8.com]非诚勿扰20170121.mkv', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8514, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>全国首档美食喜剧真人秀，以美为线索，爆笑解读生活话题。徐峥与30个大牌明星共同演绎爆笑美食故事，拟邀嘉宾胡歌、岳云鹏、TFBoys。最调动味蕾的视觉盛宴，最逵猩竦谋笑情节，美食+喜剧，一场无法拒绝的感官盛宴。<img alt="" src="http://ww2.sinaimg.cn/mw690/444476dfgw1fazegoewyvj208c0bs0t3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4002/[阳光电影-www.ygdy8.com]食在逋20170107.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]食在逋20170114.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4019/[阳光电影-www.ygdy8.com]食在逋20170121.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4033/[阳光电影-www.ygdy8.com]食在逋20170128.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4002/[阳光电影-www.ygdy8.com]食在逋20170107.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]食在逋20170114.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4019/[阳光电影-www.ygdy8.com]食在逋20170121.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4033/[阳光电影-www.ygdy8.com]食在逋20170128.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8515, 4, '我们十七岁', '', '', '#FF0000', '', '', '<p>《我们十七岁》是由浙江卫视、宇佑传媒和华策天映联合出品的国内首档大型明星逆时光旅行类真人秀，节目共12期。节目六位固定主持是范明、郭富城、林志颖、华少、孙杨、韩东君。 在两天一夜的欢乐旅程中，节目不仅会呈现六位嘉宾一路同行的酸甜苦辣，还将展现大江南北的风土人情和传统文化，观众在欢笑之余，也收获感动和成长。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1famwyohgc5j204x06o74g.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4002/[阳光电影-www.ygdy8.com]我们十七岁20170107.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]我们十七岁20170114.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4019/[阳光电影-www.ygdy8.com]我们十七岁20170121.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]我们十七岁20170128.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4002/[阳光电影-www.ygdy8.com]我们十七岁20170107.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]我们十七岁20170114.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4019/[阳光电影-www.ygdy8.com]我们十七岁20170121.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4032/[阳光电影-www.ygdy8.com]我们十七岁20170128.mkv ', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8516, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4002/[阳光电影-www.ygdy8.com]快乐大本营20170107.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]快乐大本营20170114.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4019/[阳光电影-www.ygdy8.com]快乐大本营20170121.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4019/[阳光电影-www.ygdy8.com]快乐大本营2017跨年特辑A.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4019/[阳光电影-www.ygdy8.com]快乐大本营2017跨年特辑B.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4033/[阳光电影-www.ygdy8.com]快乐大本营20170128.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:4002/[阳光电影-www.ygdy8.com]快乐大本营20170107.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]快乐大本营20170114.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4019/[阳光电影-www.ygdy8.com]快乐大本营20170121.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4019/[阳光电影-www.ygdy8.com]快乐大本营2017跨年特辑A.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4019/[阳光电影-www.ygdy8.com]快乐大本营2017跨年特辑B.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4033/[阳光电影-www.ygdy8.com]快乐大本营20170128.mkv', 'admin', '', 'K', 10.0, 1, 0);
