INSERT INTO `gx_video` VALUES (8522, 4, '今晚80后脱口秀', '', '', '#FF0000', '', '', '<p>《今晚80后脱口秀》是东方卫视全新打造的高端文化脱口秀，也是中国唯一一档欧美风格脱口秀节目，于2012年5月13日开播，80后新锐相声演员王自健倾情加盟，每期通过脱口秀的形式，展现年轻人对社会热点、文化事件、时尚潮流的态度和思想，幽默风趣却又不失智慧与锐度。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e4etydqfwkj20r2099tcl.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2999/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4008/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170112.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4017/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4029/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170126.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2999/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4008/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170112.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4017/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4029/[阳光电影-www.ygdy8.com]今晚80后脱口秀20170126.mkv ', 'admin', '', 'J', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8523, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>凤凰中文台军情观察室节目坐阵曾有“情报收集中心”之称的香港紧贴每周的全球热点军事话题以丰富、有趣的电视动画以及快节奏播报大量信息的方式为您搜罗军事情报同时请来军事专家对热点话题进行深度地分析与解读。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e8bbkka8mkj20700a0weu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2997/[阳光电影-www.ygdy8.com]军情观察室20170104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4007/[阳光电影-www.ygdy8.com]军情观察室20170111.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4016/[阳光电影-www.ygdy8.com]军情观察室20170118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4027/[阳光电影-www.ygdy8.com]军情观察室20170125.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2997/[阳光电影-www.ygdy8.com]军情观察室20170104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4007/[阳光电影-www.ygdy8.com]军情观察室20170111.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4016/[阳光电影-www.ygdy8.com]军情观察室20170118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4027/[阳光电影-www.ygdy8.com]军情观察室20170125.mkv', 'admin', '', 'Z', 10.0, 1, 0);
