INSERT INTO `gx_video` VALUES (8528, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2996/[阳光电影-www.ygdy8.com]娱乐百分百20170102.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2998/[阳光电影-www.ygdy8.com]娱乐百分百20170103.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2999/[阳光电影-www.ygdy8.com]娱乐百分百20170104.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2999/[阳光电影-www.ygdy8.com]娱乐百分百20170105.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4003/[阳光电影-www.ygdy8.com]娱乐百分百20170107.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4006/[阳光电影-www.ygdy8.com]娱乐百分百20170109.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4006/[阳光电影-www.ygdy8.com]娱乐百分百20170110.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4007/[阳光电影-www.ygdy8.com]娱乐百分百20170111.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4009/[阳光电影-www.ygdy8.com]娱乐百分百20170112.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4009/[阳光电影-www.ygdy8.com]娱乐百分百20170113.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]钒俜职20170114.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:4013/[阳光电影-www.ygdy8.com]娱乐百分百20170116.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4013/[阳光电影-www.ygdy8.com]娱乐百分百20170117.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4015/[阳光电影-www.ygdy8.com]娱乐百分百20170118.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4017/[阳光电影-www.ygdy8.com]娱乐百分百20170119.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4018/[阳光电影-www.ygdy8.com]娱乐百分百20170120.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4021/[阳光电影-www.ygdy8.com]娱乐百分百-20170121.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4025/[阳光电影-www.ygdy8.com]娱乐百分百20170124.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4027/[阳光电影-www.ygdy8.com]娱乐百分百20