INSERT INTO `gx_video` VALUES (8533, 4, '锵锵三人行', '', '', '#FF0000', '', '', '<p>《锵锵三人行》是凤凰卫视出品的谈话类节目，由主持人窦文涛与两岸三地传媒界之精英名嘴，一起针对每日热门新闻事件进行研究，并各抒己见，但却又不属于追求问题答案的正论，而是俗人闲话，一派多少天下事，尽付笑谈中的豪情，达至融汇信息传播，制造乐趣与辩析事理三大元素于一身的目的。看似“平衡一下”的“滑头话”，其实是窦文涛引导嘉宾发表具个人色彩的大胆言论，营造日常聊天的形态、谈笑风生的气氛，力求轻松、惹笑。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e894w9dvj5j205306w3yj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2995/[阳光电影-www.ygdy8.com]锵锵三人行20170102.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2996/[阳光电影-www.ygdy8.com]锵锵三人行20170103.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2997/[阳光电影-www.ygdy8.com]锵锵三人行20170104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2999/[阳光电影-www.ygdy8.com]锵锵三人行20170105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4000/[阳光电影-www.ygdy8.com]锵锵三人行20170106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4006/[阳光电影-www.ygdy8.com]锵锵三人行20170109.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4006/[阳光电影-www.ygdy8.com]锵锵三人行20170110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4007/[阳光电影-www.ygdy8.com]锵锵三人行20170111.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4009/[阳光电影-www.ygdy8.com]锵锵三人行20170112.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4010/[阳光电影-www.ygdy8.com]锵锵三人行20170113.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4012/[阳光电影-www.ygdy8.com]锵锵三人行20170116.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4013/[阳光电影-www.ygdy8.com]锵锵三人行20170117.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4016/[阳光电影-www.ygdy8.com]锵锵三人行20170118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4017/[阳光电影-www.ygdy8.com]锵锵三人行20170119.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4018/[阳光电影-www.ygdy8.com]锵锵三人行20170120.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4026/[阳光电影-www.ygdy8.com]锵锵三人行20170124.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4028/[阳光电影-www.ygdy8.com]锵锵三人行20170125.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4028/[阳光电影-www.ygdy8.com]锵锵三人行20170126.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4030/[阳光电影-www.ygdy8.com]锵锵三人行20170127.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4035/[阳光电影-www.ygdy8.com]锵锵三人行20170