INSERT INTO `gx_video` VALUES (8536, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>东方卫视《天籁之战(我不是歌手) 》是档类似于《跨界歌王》的明星跨界歌唱真人秀。 \u3000\u3000邀请奥斯卡最佳原创音乐奖得主谭盾为“音乐推荐人”“音乐总监”，携手国家交响乐团为明星现场伴奏，音乐剧舞台呈现，参演明星将邀请他的圈内一众好友作为亲友团为其站台，舞台上呈现一位对音乐真诚执着的歌手，舞台下讲述一个明星与音乐的故事。通过排位淘汰赛、踢馆赛、半决赛、决赛选出歌王。主力明星8位，踢馆明星4位，拟邀影视娱乐大咖，打造非凡音乐盛宴!<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f93ei9rwkaj208c09qjs9.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]天籁之战20170101.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]天籁之战20170101.mp4 ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8537, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目立意寻找各行各业喜爱音乐但是从来没有参加过演唱会的人来现场表演，因此除了年轻新鲜的素人歌者，一些有音乐梦想的荧屏偶像也将在之后的节目中热情加入，究竟他们会带来怎样的惊喜？而在如此紧张刺激的状态下，五位音乐导师会迸发出怎样强大的音乐能量？更多精彩，敬请期待11月4日（ 周五）晚《梦想的声音》。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f9h1jwq5i9j208c0cidhg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]梦想的声音20170101.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4000/[阳光电影-www.ygdy8.com]梦想的声音20170106.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4009/[阳光电影-www.ygdy8.com]梦想的声音20170113.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]梦想的声音20170101.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4000/[阳光电影-www.ygdy8.com]梦想的声音20170106.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:4009/[阳光电影-www.ygdy8.com]梦想的声音20170113.mkv', 'admin', '', 'Z', 10.0, 1, 0);
