INSERT INTO `gx_video` VALUES (8549, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>12月30日，浙江卫视将在深圳湾体育中心春茧体育场举办加多宝冠名的“爱在一起”领跑2017演唱会。“我觉得现在再拼凑一堆明星在台上唱个歌跨个年，这种形式其实早就已经不能满足老百姓的要求了。”总导演蒋敏昊说起这台演唱会，言语中满是感触。各大卫视每年12月31日都要举办跨年演唱会，这些年几乎成了惯例。今年，浙江卫视率先出来搞事情!不但把时间提前到12月30日，还誓要把这场“演唱会”做出超综艺感。<img alt="" src="http://ww2.sinaimg.cn/mw690/444476dfgw1fbca8jvukkj209q0han09.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]爱在一起领跑2017演唱会浙江卫视跨年晚会A.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]爱在一起领跑2017演唱会浙江卫视跨年晚会B.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]爱在一起领跑2017演唱会浙江卫视跨年晚会C.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]爱在一起领跑2017演唱会浙江卫视跨年晚会A.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]爱在一起领跑2017演唱会浙江卫视跨年晚会B.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]爱在一起领跑2017演唱会浙江卫视跨年晚会C.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8550, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]综艺大集合20170101.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4004/[阳光电影-www.ygdy8.com]C大集合20170108.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4012/[阳光电影-www.ygdy8.com]综艺大集合-20170115.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4021/[阳光电影-www.ygdy8.com]综艺大集合20170122.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4033/[阳光电影-www.ygdy8.com]综艺大集合20170129.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]综艺大集合20170101.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4004/[阳光电影-www.ygdy8.com]C大集合20170108.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4012/[阳光电影-www.ygdy8.com]综艺大集合-20170115.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4021/[阳光电影-www.ygdy8.com]综艺大集合20170122.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:4033/[阳光电影-www.ygdy8.com]综艺大集合20170129.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8551, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]RunningMan20170101.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4003/[阳光电影-www.ygdy8.com]RunningMan20170108.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4011/[阳光电影-www.ygdy8.com]RunningMan20170115.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4022/[阳光电影-www.ygdy8.com]RunningMan20170122.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4034/[阳光电影-www.ygdy8.com]RunningMan20170129.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]RunningMan20170101.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4003/[阳光电影-www.ygdy8.com]RunningMan20170108.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4011/[阳光电影-www.ygdy8.com]RunningMan20170115.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4022/[阳光电影-www.ygdy8.com]RunningMan20170122.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4034/[阳光电影-www.ygdy8.com]RunningMan20170129.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8552, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]两天一夜20170101.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4003/[阳光电影-www.ygdy8.com]两天一夜20170108.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4012/[阳光电影-www.ygdy8.com]两天一夜20170115.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4022/[阳光电影-www.ygdy8.com]两天一夜20170122.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4034/[阳光电影-www.ygdy8.com]两天一夜20170129.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]两天一夜20170101.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:4003/[阳光电影-www.ygdy8.com]两天一夜20170108.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4012/[阳光电影-www.ygdy8.com]两天一夜20170115.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4022/[阳光电影-www.ygdy8.com]两天一夜20170122.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:4034/[阳光电影-www.ygdy8.com]两天一夜20170129.mp4', 'admin', '', 'Z', 10.0, 1, 0);
