INSERT INTO `gx_video` VALUES (8573, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2964/[阳光电影-www.ygdy8.com]快乐大本营20161203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2971/[阳光电影-www.ygdy8.com]快乐大本营20161210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2980/[阳光电影-www.ygdy8.com]快乐大本营20161217.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2988/[阳光电影-www.ygdy8.com]快乐大本营20161224.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]快乐大本营2017跨年特辑A.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]快乐大本营2017跨年特辑B.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2964/[阳光电影-www.ygdy8.com]快乐大本营20161203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2971/[阳光电影-www.ygdy8.com]快乐大本营20161210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2980/[阳光电影-www.ygdy8.com]快乐大本营20161217.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2988/[阳光电影-www.ygdy8.com]快乐大本营20161224.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]快乐大本营2017跨年特辑A.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]快乐大本营2017跨年特辑B.mkv ', 'admin', '', 'K', 10.0, 1, 0);
