INSERT INTO `gx_video` VALUES (8575, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2964/[阳光电影-www.ygdy8.com]非诚勿扰20161203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2971/[阳光电影-www.ygdy8.com]非诚勿扰20161210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2980/[阳光电影-www.ygdy8.com]非诚勿扰20161217.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2989/[阳光电影-www.ygdy8.com]非诚勿扰20161224.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2964/[阳光电影-www.ygdy8.com]非诚勿扰20161203.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2971/[阳光电影-www.ygdy8.com]非诚勿扰20161210.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2980/[阳光电影-www.ygdy8.com]非诚勿扰20161217.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2989/[阳光电影-www.ygdy8.com]非诚勿扰20161224.mp4', 'admin', '', 'F', 10.0, 1, 0);
