INSERT INTO `gx_video` VALUES (8582, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2962/[阳光电影-www.ygdy8.com]天天向上201601202.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2970/[阳光电影-www.ygdy8.com]天天向上20161209.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2980/[阳光电影-www.ygdy8.com]天天向上201601216.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2987/[阳光电影-www.ygdy8.com]天天向上201601223.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]天天向上201601230.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2962/[阳光电影-www.ygdy8.com]天天向上201601202.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2970/[阳光电影-www.ygdy8.com]天天向上20161209.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2980/[阳光电影-www.ygdy8.com]天天向上201601216.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2987/[阳光电影-www.ygdy8.com]天天向上201601223.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2994/[阳光电影-www.ygdy8.com]天天向上201601230.mkv', 'admin', '', 'T', 10.0, 1, 0);
