INSERT INTO `gx_video` VALUES (8584, 4, '锵锵三人行', '', '', '#FF0000', '', '', '<p>《锵锵三人行》是凤凰卫视出品的谈话类节目，由主持人窦文涛与两岸三地传媒界之精英名嘴，一起针对每日热门新闻事件进行研究，并各抒己见，但却又不属于追求问题答案的正论，而是俗人闲话，一派多少天下事，尽付笑谈中的豪情，达至融汇信息传播，制造乐趣与辩析事理三大元素于一身的目的。看似“平衡一下”的“滑头话”，其实是窦文涛引导嘉宾发表具个人色彩的大胆言论，营造日常聊天的形态、谈笑风生的气氛，力求轻松、惹笑。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e894w9dvj5j205306w3yj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2961/[阳光电影-www.ygdy8.com]锵锵三人行20161201.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2962/[阳光电影-www.ygdy8.com]锵锵三人行20161202.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2967/[阳光电影-www.ygdy8.com]锵锵三人行20161205.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2969/[阳光电影-www.ygdy8.com]锵锵三人行20161206.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2969/[阳光电影-www.ygdy8.com]锵锵三人行20161207.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2969/[阳光电影-www.ygdy8.com]锵锵三人行20161208.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2971/[阳光电影-www.ygdy8.com]锵锵三人行20161209.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2973/[阳光电影-www.ygdy8.com]锵锵三人行20161212.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2974/[阳光电影-www.ygdy8.com]锵锵三人行20161213.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:2976/[阳光电影-www.ygdy8.com]锵锵三人行20161214.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2978/[阳光电影-www.ygdy8.com]锵锵三人行20161215.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2979/[阳光电影-www.ygdy8.com]锵锵三人行20161216.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2982/[阳光电影-www.ygdy8.com]锵锵三人行20161219.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2983/[阳光电影-www.ygdy8.com]锵锵三人行20161220.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2985/[阳光电影-www.ygdy8.com]锵锵三人行20161221.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2987/[阳光电影-www.ygdy8.com]锵锵三人行20161222.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2987/[阳光电影-www.ygdy8.com]锵锵三人行20161223.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2990/[阳光电影-www.ygdy8.com]锵锵三人行20161226.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2992/[阳光电影-www.ygdy8.com]锵锵三人行20161227.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2993/[阳光电影-www.ygdy8.com]