INSERT INTO `gx_video` VALUES (8588, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2961/[阳光电影-www.ygdy8.com]娱乐百分百20161201.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2963/[阳光电影-www.ygdy8.com]娱乐百分百20161202.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2964/[阳光电影-www.ygdy8.com]娱乐百分百20161203.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2966/[阳光电影-www.ygdy8.com]娱乐百分百20161205.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2968/[阳光电影-www.ygdy8.com]娱乐百分百20161206.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2969/[阳光电影-www.ygdy8.com]娱乐百分百20161207.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2969/[阳光电影-www.ygdy8.com]娱乐百分百20161208.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2970/[阳光电影-www.ygdy8.com]娱乐百分百20161209.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2972/[阳光电影-www.ygdy8.com]娱乐百分百20161210.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2975/[阳光电影-www.ygdy8.com]娱乐百分百20161212.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2975/[阳光电影-www.ygdy8.com]娱乐百分百20161213.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2976/[阳光电影-www.ygdy8.com]娱乐百分百20161214.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2978/[阳光电影-www.ygdy8.com]娱乐百分百20161215.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2979/[阳光电影-www.ygdy8.com]娱乐百分百20161216.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2980/[阳光电影-www.ygdy8.com]娱乐百分百20161217.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2982/[阳光电影-www.ygdy8.com]娱乐百分百20161219.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2984/[阳光电影-www.ygdy8.com]娱乐百分百20161220.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2985/[阳光电影-www.ygdy8.com]娱乐百分百20161221.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2987/[阳光电影-www.ygdy8.com]娱乐百分百20