INSERT INTO `gx_video` VALUES (8595, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>第53届金马奖，陶子陶晶莹将担任金马奖主持人，这也是她时隔四年再次主持金马奖，令人期待。陶晶莹曾先后搭档周华健、冯德伦、吴奇隆等，主持风格诙谐幽默、妙语连珠。<img alt="" src="http://ww1.sinaimg.cn/mw690/444476dfgw1fa6mjqnap5j208c0ci0ti.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2954/[阳光电影-www.ygdy8.com]第53媒瘃RC_典Y.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2954/[阳光电影-www.ygdy8.com]第53媒瘃RC_典Y.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8596, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>东方卫视原创话题喜剧综艺《笑星闯地球》，节目曝光首款海报，海报以红蓝为主色调，呈现激烈的对抗氛围。大张伟、王自健分别化身笑星队、地球队队长首次加盟原创话题喜剧综艺，节目现场领队“吵架”，嘴炮横飞，你招架得住吗？<img alt="" src="http://ww1.sinaimg.cn/mw690/444476dfgw1fa6m9vsz4yj21120o3agu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2954/[阳光电影-www.ygdy8.com]笑星闯地球20161126.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2954/[阳光电影-www.ygdy8.com]笑星闯地球20161126.mkv ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8597, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>湖南卫视建构式喜剧综艺节目《头号惊喜》(原名：万万没想到)播出时间：11月20日晚十点。该节目主持人何炅，拟邀嘉宾：郎平、黄磊、张惠妹、郭德纲、盛一伦、贾乃亮、刘昊然等。预计10月16日录制。 \u3000\u3000为能够保障宣传的效果，特地邀请好莱坞模式大师节目总导演Jason GoldbergPUNK\'D的原版导演，节目类型不是单纯的喜剧综艺节目，将是建构式喜剧——电视情景喜剧的综艺化延伸。 \u3000\u3000第二大保障是兴格团队，就是曾经策划导演《中国达人秀》、《笑傲江湖》共同出谋划策，第三大保障就是整个 湖南卫视的团队，现在的湖南卫视可谓是坐拥卫视节目的榜首，其综艺节目在国内的收视率也是有目共睹的<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f9zqpbxo7ej208c0cijt3.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]头号惊喜20161120.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]头号惊喜20161127.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]头号惊喜20161120.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]头号惊喜20161127.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8598, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>TVB2016年巡礼剧，万千星辉贺台庆宣传片，TVB《2016无线节目巡礼》在将军澳电视城举行，总动员近190位TVB艺员出席。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f9zlgpjo1nj20xc0m8466.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]2016TVB万千星辉贺台庆.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]2016TVB万千星辉贺台庆.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8599, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>这是一档形式新颖，趣味十足，在挑战中发掘个性，又充满悬念的全新益智攻擂节目，每期参加节目的有11人，分为10位守擂者和一位挑战者，他们年龄，身份，文化层次各异，守擂者手中都有不同价值的奖品，而挑战者将通过20秒的限时答题与守擂者一一PK，挑战者获胜将赢得守擂者的奖品，而守擂者获胜将成为新的挑战者，并赢取挑战者手中的所有奖品，任何一方失败都将掉下擂台淘汰出局。连续战胜五名对手的挑战者有权选择带着赢得的奖品离开，或是冒着被对手PK掉的风险继续战斗，赢得更多奖品。而一站到底成为最后一位的挑战者，也将视战胜的对手人数赢得相应的奖品。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e77lhpbbkrj20m80dcgoa.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2932/[阳光电影-www.ygdy8.com]一站到底20161107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2940/[阳光电影-www.ygdy8.com]一站到底20161114.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]一站到底20161121.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2957/[阳光电影-www.ygdy8.com]一站到底20161128.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2932/[阳光电影-www.ygdy8.com]一站到底20161107.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2940/[阳光电影-www.ygdy8.com]一站到底20161114.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]一站到底20161121.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2957/[阳光电影-www.ygdy8.com]一站到底20161128.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8600, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>该节目是台湾综艺节目收视冠军。一个乡土类节目，录影地点是台湾乡镇的各个庙口。内容是介绍并体验台湾各个角落的人文、美食、特产等。主持群以及艺人来宾在节目里面跟群众玩游戏，送奖金，与民同乐。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1enjblzicz9j205f07eq3b.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2932/[阳光电影-www.ygdy8.com]C大集合20161106.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]综艺大集合20161113.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]综艺大集合20161120.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]综艺大集合20161127.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2932/[阳光电影-www.ygdy8.com]C大集合20161106.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]综艺大集合20161113.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]综艺大集合20161120.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]综艺大集合20161127.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8601, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>想深入了解明星的生活点滴？想全程掌握巨星的蛛丝马迹吗？瞬息万变的影剧视界，「完全娱乐」分秒必争，报导最精彩，天天现场直播大放送，最High Speed的各类星闻及明星艺人专访，让你的八卦神经完全启动，绝不秀逗台港大陆三地劲爆红星，惊人内幕、大胆呈现，明星八卦，漏网星闻，世界性娱乐新闻、国际化独家采访，台前幕後，国内国外，别人没有的我们有，别人有的我们绝对第一手，最新最HITO的娱乐新闻，完全娱乐 精彩传送。有《我跟你拼了》、《交换梦想》等多个单元，包你看到笑，又丰富了娱乐知识。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bip1w31lj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2932/[阳光电影-www.ygdy8.com]完全20161106.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]完全20161112.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]完全20161113.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2954/[阳光电影-www.ygdy8.com]完全娱乐20161126.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2932/[阳光电影-www.ygdy8.com]完全20161106.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]完全20161112.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]完全20161113.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2954/[阳光电影-www.ygdy8.com]完全娱乐20161126.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8602, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2932/[阳光电影-www.ygdy8.com]RunningMan20161106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]RunningMan20161113.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]RunningMan20161120.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2957/[阳光电影-www.ygdy8.com]RunningMan20161127.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2932/[阳光电影-www.ygdy8.com]RunningMan20161106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]RunningMan20161113.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]RunningMan20161120.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2957/[阳光电影-www.ygdy8.com]RunningMan20161127.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8603, 4, '蒙面唱将猜猜猜', '', '', '#FF0000', '', '', '<p>《蒙面唱将猜猜猜》是由江苏卫视和灿星制作携手打造的大型音乐悬疑竞猜类真人秀。2016年9月11日起，将在每周日晚20:30于江苏卫视播出。这档拥有全新赛制、阵容的原创音乐节目由李好主持，届时将有30余位艺人蒙面上台献唱，接受由资深艺人大张伟、陶晶莹、Ella等组成的猜评团和全场观众的猜测考验。<img alt="" src="http://ww4.sinaimg.cn/mw690/444476dfgw1f7z39kqnpej20hs0bvjtn.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]蒙面唱将猜猜猜20161106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]蒙面唱将猜猜猜20161113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]蒙面唱将猜猜猜20161120.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]蒙面唱将猜猜猜20161127.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]蒙面唱将猜猜猜20161106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]蒙面唱将猜猜猜20161113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]蒙面唱将猜猜猜20161120.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]蒙面唱将猜猜猜20161127.mkv', 'admin', '', 'M', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8604, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>大型励志挑战节目《挑战不可能》第二季将于10月起在央视一套每周日晚8点播出。首期节目中，来自全球的“读音者”“世界铁肺”“弹簧腿少年”“逆行英雄”“平衡大师”等5名挑战者将登陆《挑战不可能》第二季的舞台。此外，撒贝宁误用钢丝绳险遭毁容、“呆萌”王力宏竟把“无齿”当“五尺”、董卿含泪为“逆行英雄”点赞等精彩内容也将成为首期另一看点。作为“笑点担当”，撒贝宁使出浑身解数，堪称全能。<img alt="" src="http://ww1.sinaimg.cn/mw690/444476dfgw1f9jmfp2jzfj208c0cimyu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]挑战不可能第二季20161030.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]挑战不可能第二季20161106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2939/[阳光电影-www.ygdy8.com]挑战不可能第二季20161113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]挑战不可能第二季20161120.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]挑战不可能20161127.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]挑战不可能第二季20161030.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]挑战不可能第二季20161106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2939/[阳光电影-www.ygdy8.com]挑战不可能第二季20161113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]挑战不可能第二季20161120.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]挑战不可能20161127.mkv ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8605, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]两天一夜20161106.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]两天一夜20161106.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8606, 4, '人气歌谣', '', '', '#FF0000', '', '', '<p>《人气歌谣》每周日播出，主要是一个歌手的新歌和新专集得以COME BACK回归的第一平台，因此参加演出的歌手以最近一段时间的人气歌曲为主。基本形式是每周选出TAKE7进行打榜，最终选出一名周冠军，其中也穿插很多明星的COME BACK舞台。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfgw1eacv7d4jhcj20cq09a74t.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]人气歌谣20161106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]人气歌谣201601113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]人气歌谣20161120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]人气歌谣20161127.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]人气歌谣20161106.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]人气歌谣201601113.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]人气歌谣20161120.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]人气歌谣20161127.mp4', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8607, 4, '我们结婚了', '', '', '#FF0000', '', '', '<p>《我们结婚了》是韩国今年最受欢迎的综艺节目之一，这是一档明星假想结婚节目。几对明星假扮成新婚夫妇，真的将自己的行礼搬过来装扮起自己的“新婚房“。由前期春节节目衍生来的。第一季节目嘉宾：Andy和Solbi，Alex和申爱，郑型敦和Saori，Crown J和徐仁英，李辉才和赵茹珍，金贤重和皇甫。<img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e3enc83xg7j.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]我们结婚了20161105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]我们结婚了201601112.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]我们结婚了20161119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]我们结婚了20161126.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]我们结婚了20161105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]我们结婚了201601112.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]我们结婚了20161119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]我们结婚了20161126.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8608, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]无限挑战20161105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]无限挑战201601112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]无限挑战20161119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]无限挑战20161126.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]无限挑战20161105.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]无限挑战201601112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]无限挑战20161119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]无限挑战20161126.mp4', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8609, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>东方卫视《天籁之战(我不是歌手) 》是档类似于《跨界歌王》的明星跨界歌唱真人秀。 \u3000\u3000邀请奥斯卡最佳原创音乐奖得主谭盾为“音乐推荐人”“音乐总监”，携手国家交响乐团为明星现场伴奏，音乐剧舞台呈现，参演明星将邀请他的圈内一众好友作为亲友团为其站台，舞台上呈现一位对音乐真诚执着的歌手，舞台下讲述一个明星与音乐的故事。通过排位淘汰赛、踢馆赛、半决赛、决赛选出歌王。主力明星8位，踢馆明星4位，拟邀影视娱乐大咖，打造非凡音乐盛宴!<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f93ei9rwkaj208c09qjs9.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]天籁之战20161106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2939/[阳光电影-www.ygdy8.com]天籁之战20161113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]天籁之战20161120.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]天籁之战20161127.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2931/[阳光电影-www.ygdy8.com]天籁之战20161106.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2939/[阳光电影-www.ygdy8.com]天籁之战20161113.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2948/[阳光电影-www.ygdy8.com]天籁之战20161120.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]天籁之战20161127.mkv', 'admin', '', 'Z', 10.0, 1, 0);
