INSERT INTO `gx_video` VALUES (8614, 4, '跨界喜剧王', '', '', '#FF0000', '', '', '<p>《跨界喜剧王》是由北京电视台、北京鑫宝源影视投资有限公司、北京千秋岁文化传播有限公司及北京京视卫星文化传播有限公司联合制作的中国首档原创跨界喜剧竞技秀，节目将聚集商界、文化界、体育界、音乐界、演艺界等各领域的代表人物，在五位喜剧经纪人的协助下，展现属于不同领域的幽默风格表演，从而打造多元化的中式幽默。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f7k5wpv42yj20od0c6n1f.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2930/[阳光电影-www.ygdy8.com]跨界喜剧王20161105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]跨界喜剧王201601112.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2946/[阳光电影-www.ygdy8.com]跨界喜剧王20161119.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2930/[阳光电影-www.ygdy8.com]跨界喜剧王20161105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]跨界喜剧王201601112.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2946/[阳光电影-www.ygdy8.com]跨界喜剧王20161119.mp4', 'admin', '', 'K', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8615, 4, '非诚勿扰', '', '', '#FF0000', '', '', '<p>《非诚勿扰》是2010年1月15日中国大陆江苏卫视制作的一档婚恋交友真人秀节目，由江苏电视台新闻节目主持人孟非主持，另由乐嘉和黄菡两个人分析点评。节目首播时间为每周六和周日的21:10，后改为21:20，同日23:00左右重播，周六周日12:30左右第二次重播（后改为11:30，分别重播上周六、周日）。2011年7月推出澳洲专场；2011年10月推出美国专场；2012年1月推出英国专场；2012年6月推出法国专场；2012年8月推出加拿大专场；2012年11月推出韩国专场；2012年12月推出美国西部专场。 <img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3i0wk3qaxj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2930/[阳光电影-www.ygdy8.com]非诚勿扰20161105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]非诚勿扰201601112.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]非诚勿扰20161119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2954/[阳光电影-www.ygdy8.com]非诚勿扰20161126.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2930/[阳光电影-www.ygdy8.com]非诚勿扰20161105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]非诚勿扰201601112.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]非诚勿扰20161119.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2954/[阳光电影-www.ygdy8.com]非诚勿扰20161126.mkv ', 'admin', '', 'F', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8616, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>由东方卫视与华录百纳、蓝色火焰联合推出的明星跨界时尚真人秀节目《女神的新衣》一直备受关注。不久前，节目组宣布正式更名为《我的新衣》，将于9月3日登陆东方卫视。<img alt="" src="http://ww1.sinaimg.cn/mw690/444476dfgw1f7kv0zy6n2j20fd0afabd.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2930/[阳光电影-www.ygdy8.com]我的新衣20161105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]我的新衣201601112.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2946/[阳光电影-www.ygdy8.com]我的新衣20161119.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2930/[阳光电影-www.ygdy8.com]我的新衣20161105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]我的新衣201601112.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2946/[阳光电影-www.ygdy8.com]我的新衣20161119.mp4', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8617, 4, '超级夜总会', '', '', '#FF0000', '', '', '<p>《超级夜总会》是三立电视台独立制作的一档综艺娱乐节目，以歌曲演唱、幽默情景剧、户外与观众近距离互动为主要元素，是台湾第一个电视台出动大型舞台车至各县市镇、乡、村的著名观光景点、夜市、庙宇录制的节目。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e3hdcxn0doj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2930/[阳光电影-www.ygdy8.com]超级夜总会20161105.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]超级夜总会20161112.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]超级夜总会20161119.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2954/[阳光电影-www.ygdy8.com]超级夜总会20161126.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2930/[阳光电影-www.ygdy8.com]超级夜总会20161105.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]超级夜总会20161112.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]超级夜总会20161119.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2954/[阳光电影-www.ygdy8.com]超级夜总会20161126.rmvb', 'admin', '', 'C', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8618, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2930/[阳光电影-www.ygdy8.com]天才冲冲冲20161105.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]天才___20161112.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]天才冲冲冲20161119.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]天才冲冲冲20161126.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2930/[阳光电影-www.ygdy8.com]天才冲冲冲20161105.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]天才___20161112.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]天才冲冲冲20161119.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2955/[阳光电影-www.ygdy8.com]天才冲冲冲20161126.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8619, 4, '快乐大本营', '', '', '#FF0000', '', '', '<p>《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，是湖南卫视上星以来一直保持的品牌节目之一。节目开始采用全民娱乐的类型，经常邀请一些有特殊才能的人物，一些可爱的孩子来表演，后又转为选秀节目，来选举其主持人；现在多以嘉宾访谈游戏型的综艺节目，经常邀请一些中国大陆、香港、台湾的知名艺人来访谈，游戏等。是湖南卫视的品牌节目之一。观众最喜欢的综艺节目，该节目获得1998年度金鹰奖。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e4la8z3oggj20f00b9gma.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2929/[阳光电影-www.ygdy8.com]快乐大本营20161105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]快乐大本营201601112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2946/[阳光电影-www.ygdy8.com]快乐大本营20161119.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2954/[阳光电影-www.ygdy8.com]快乐大本营20161126.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2929/[阳光电影-www.ygdy8.com]快乐大本营20161105.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]快乐大本营201601112.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2946/[阳光电影-www.ygdy8.com]快乐大本营20161119.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2954/[阳光电影-www.ygdy8.com]快乐大本营20161126.mkv', 'admin', '', 'K', 10.0, 1, 0);
