INSERT INTO `gx_video` VALUES (8621, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2928/[阳光电影-www.ygdy8.com]天天向上201601104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]天天向上201601111.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2946/[阳光电影-www.ygdy8.com]天天向上201601118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2953/[阳光电影-www.ygdy8.com]天天向上201601125.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2928/[阳光电影-www.ygdy8.com]天天向上201601104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]天天向上201601111.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2946/[阳光电影-www.ygdy8.com]天天向上201601118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2953/[阳光电影-www.ygdy8.com]天天向上201601125.mp4', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8622, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目立意寻找各行各业喜爱音乐但是从来没有参加过演唱会的人来现场表演，因此除了年轻新鲜的素人歌者，一些有音乐梦想的荧屏偶像也将在之后的节目中热情加入，究竟他们会带来怎样的惊喜？而在如此紧张刺激的状态下，五位音乐导师会迸发出怎样强大的音乐能量？更多精彩，敬请期待11月4日（ 周五）晚《梦想的声音》。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f9h1jwq5i9j208c0cidhg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2927/[阳光电影-www.ygdy8.com]梦想的声音20161104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]梦想的声音201601111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2945/[阳光电影-www.ygdy8.com]梦想的声音20161118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2953/[阳光电影-www.ygdy8.com]梦想的声音20161125.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2927/[阳光电影-www.ygdy8.com]梦想的声音20161104.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2937/[阳光电影-www.ygdy8.com]梦想的声音201601111.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2945/[阳光电影-www.ygdy8.com]梦想的声音20161118.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2953/[阳光电影-www.ygdy8.com]梦想的声音20161125.mp4', 'admin', '', 'Z', 10.0, 1, 0);
