INSERT INTO `gx_video` VALUES (8624, 4, '四大名助', '', '', '#FF0000', '', '', '<p>《四大名助》是2016年东方卫视播出的社交服务类节目，节目2016年1月7日起每周四晚在东方卫视播出。 节目由孟非担任主持，并搭档三位一线名嘴嘉宾组成的“四大名助”阵容，在节目中通过嬉笑怒骂的讨论帮助普通人解决各种烦恼问题。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1f0879w2wl9j20cl08ct9y.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2926/[阳光电影-www.ygdy8.com]四大名助20161103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2935/[阳光电影-www.ygdy8.com]四大名助20161110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2944/[阳光电影-www.ygdy8.com]四大名助20161117.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2951/[阳光电影-www.ygdy8.com]四大名助20161124.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2926/[阳光电影-www.ygdy8.com]四大名助20161103.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2935/[阳光电影-www.ygdy8.com]四大名助20161110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2944/[阳光电影-www.ygdy8.com]四大名助20161117.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2951/[阳光电影-www.ygdy8.com]四大名助20161124.mkv', 'admin', '', 'S', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8625, 4, '今晚80后脱口秀', '', '', '#FF0000', '', '', '<p>《今晚80后脱口秀》是东方卫视全新打造的高端文化脱口秀，也是中国唯一一档欧美风格脱口秀节目，于2012年5月13日开播，80后新锐相声演员王自健倾情加盟，每期通过脱口秀的形式，展现年轻人对社会热点、文化事件、时尚潮流的态度和思想，幽默风趣却又不失智慧与锐度。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e4etydqfwkj20r2099tcl.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2924/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161103.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2935/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2944/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161117.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2951/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161124.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2924/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161103.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2935/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161110.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2944/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161117.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2951/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161124.mkv', 'admin', '', 'J', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8626, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>凤凰中文台军情观察室节目坐阵曾有“情报收集中心”之称的香港紧贴每周的全球热点军事话题以丰富、有趣的电视动画以及快节奏播报大量信息的方式为您搜罗军事情报同时请来军事专家对热点话题进行深度地分析与解读。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e8bbkka8mkj20700a0weu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2923/[阳光电影-www.ygdy8.com]军情观察室20161102.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:2934/[阳光电影-www.ygdy8.com]军情观察室20161109.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2942/[阳光电影-www.ygdy8.com]军情观察室20161116.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2950/[阳光电影-www.ygdy8.com]军情观察室20161123.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2960/[阳光电影-www.ygdy8.com]军情观察室20161130.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2923/[阳光电影-www.ygdy8.com]军情观察室20161102.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:2934/[阳光电影-www.ygdy8.com]军情观察室20161109.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2942/[阳光电影-www.ygdy8.com]军情观察室20161116.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2950/[阳光电影-www.ygdy8.com]军情观察室20161123.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2960/[阳光电影-www.ygdy8.com]军情观察室20161130.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
