INSERT INTO `gx_video` VALUES (8629, 4, '锵锵三人行', '', '', '#FF0000', '', '', '<p>《锵锵三人行》是凤凰卫视出品的谈话类节目，由主持人窦文涛与两岸三地传媒界之精英名嘴，一起针对每日热门新闻事件进行研究，并各抒己见，但却又不属于追求问题答案的正论，而是俗人闲话，一派多少天下事，尽付笑谈中的豪情，达至融汇信息传播，制造乐趣与辩析事理三大元素于一身的目的。看似“平衡一下”的“滑头话”，其实是窦文涛引导嘉宾发表具个人色彩的大胆言论，营造日常聊天的形态、谈笑风生的气氛，力求轻松、惹笑。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e894w9dvj5j205306w3yj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2922/[阳光电影-www.ygdy8.com]锵锵三人行20161101.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2923/[阳光电影-www.ygdy8.com]锵锵三人行20161102.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2924/[阳光电影-www.ygdy8.com]锵锵三人行20161103.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2927/[阳光电影-www.ygdy8.com]锵锵三人行20161104.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2932/[阳光电影-www.ygdy8.com]锵锵三人行20161107.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2933/[阳光电影-www.ygdy8.com]锵锵三人行20161108.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2934/[阳光电影-www.ygdy8.com]锵锵三人行20161109.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2935/[阳光电影-www.ygdy8.com]锵锵三人行20161110.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2936/[阳光电影-www.ygdy8.com]锵锵三人行20161111.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2940/[阳光电影-www.ygdy8.com]锵锵三人行20161114.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2941/[阳光电影-www.ygdy8.com]锵锵三人行20161115.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2945/[阳光电影-www.ygdy8.com]锵锵三人行20161118.rmvb \nftp://ygdy8:ygdy8@yg76.dydytt.net:2958/[阳光电影-www.ygdy8.com]锵锵三人行20161128.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2958/[阳光电影-www.ygdy8.com]锵锵三人行20161129.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2960/[阳光电影-www.ygdy8.com]锵锵三人行20161130.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2922/[阳光电影-www.ygdy8.com]锵锵三人行20161101.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2923/[阳光电影-www.ygdy8.com]锵锵三人行20161102.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2924/[阳光电影-www.ygdy8.com]锵锵三人行20161103.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2927/[阳光电影-www.ygdy8.com]锵锵三人行20161104.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2932/[阳光电影-www.yg