INSERT INTO `gx_video` VALUES (8633, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2922/[阳光电影-www.ygdy8.com]娱乐百分百20161101.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2926/[阳光电影-www.ygdy8.com]娱乐百分百20161102.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2926/[阳光电影-www.ygdy8.com]娱乐百分百20161103.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2929/[阳光电影-www.ygdy8.com]娱乐百分百20161104.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2930/[阳光电影-www.ygdy8.com]娱乐百分百20161105.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2932/[阳光电影-www.ygdy8.com]钒俜职20161107.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2933/[阳光电影-www.ygdy8.com]娱乐百分百20161108.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2934/[阳光电影-www.ygdy8.com]钒俜职20161109.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2935/[阳光电影-www.ygdy8.com]娱乐百分百20161110.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2936/[阳光电影-www.ygdy8.com]钒俜职-20161111.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2938/[阳光电影-www.ygdy8.com]钒俜职20161112.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2940/[阳光电影-www.ygdy8.com]娱乐百分百20161114.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2943/[阳光电影-www.ygdy8.com]娱乐百分百20161115.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2943/[阳光电影-www.ygdy8.com]娱乐百分百20161116.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2945/[阳光电影-www.ygdy8.com]娱乐百分百20161117.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2946/[阳光电影-www.ygdy8.com]娱乐百分百20161118.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2947/[阳光电影-www.ygdy8.com]娱乐百分百20161119.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2949/[阳光电影-www.ygdy8.com]娱乐百分百20161121.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2949/[阳光电影-www.ygdy8.com]娱乐百分百20161122.