INSERT INTO `gx_video` VALUES (8640, 4, '天才冲冲冲', '', '', '#FF0000', '', '', '<p>《天才冲冲冲》是中华电视公司、东森综合台主频道首播的台湾综艺节目，由徐乃麟、曾国城、艾莉丝、黄瑜娴 四人主持 。制作单位是金是传播，制作人是黄义雄。首播时间最早为每星期五22:00，2006年8月4日起改为每星期六22:00～24:00。每一集节目中，通常有三至五个单元。 <img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e3hade8d6oj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2901/[阳光电影-www.ygdy8.com]天才冲冲冲20161015.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2919/[阳光电影-www.ygdy8.com]天才冲冲冲20161029.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2901/[阳光电影-www.ygdy8.com]天才冲冲冲20161015.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2919/[阳光电影-www.ygdy8.com]天才冲冲冲20161029.rmvb', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8641, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>10月15日19点30分，第十一届金鹰节互联盛典就要华丽开启了！从彩排现场出现的明星阵容来看，几乎有半个娱乐圈的大腕大咖都将加盟互联盛典。汪峰、蔡依林、张翰与翰家族、大张伟、张若昀…….不管是当红的巨星，还是新生代的小生小花，都将带来精彩绝伦的表演。除此之外，晚会还将发布最新的支付手段以及百度人工智能秘书“小度”等前沿科技产品。这是一台体现跨界和网感的晚会，从节目设计、舞美效果、嘉宾组合等等方面，都充分展示出了晚会主题“您的生活已上线”。互联科技与娱乐大咖的结合，必将带来酷炫带感的视觉冲击。<img alt="" src="http://ww2.sinaimg.cn/large/444476dfjw1f8tyq9nn2aj20fa08mgm4.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2900/[阳光电影-www.ygdy8.com]第11届金鹰节互联盛典20161015.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2900/[阳光电影-www.ygdy8.com]第11届金鹰节互联盛典20161015.mkv ', 'admin', '', 'Z', 10.0, 1, 0);
