INSERT INTO `gx_video` VALUES (8644, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>由金牌制作人谢涤葵打造的《战斗吧男神》将于7/1起每周五22:00登陆江苏卫视，该节目源自荷兰《the phone》。目前基本确定的嘉宾阵容有：\xa0\xa0 常驻嘉宾：王凯、王嘉尔、张涵予、井柏然、吴世勋、白敬亭、葛优（神秘人） 飞行嘉宾：林志玲、孙红雷、言承旭、古天乐、吴奇隆、苏有朋、林心如、巨石强森。<img alt="" src="http://ww1.sinaimg.cn/mw690/444476dfgw1f5z2mndzw9j2066099757.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2890/[阳光电影-www.ygdy8.com]我们战斗吧20161007.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2890/[阳光电影-www.ygdy8.com]我们战斗吧20161007.mkv ', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8645, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>9月23日起,美食综艺脱口秀《疯狂的冰箱》亮相东方卫视。节目要求明星嘉宾带着自家的冰箱参与,他们最真实的生活状态将在最日常的冰箱"内存"中展露无遗。<img alt="" src="http://ww3.sinaimg.cn/mw690/444476dfgw1f8733hhy2jj20780a03yy.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2890/[阳光电影-www.ygdy8.com]疯狂的冰箱20161007.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2900/[阳光电影-www.ygdy8.com]疯狂的冰箱20161014.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2890/[阳光电影-www.ygdy8.com]疯狂的冰箱20161007.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2900/[阳光电影-www.ygdy8.com]疯狂的冰箱20161014.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8646, 4, '天天向上', '', '', '#FF0000', '', '', '<p>《天天向上》是由湖南卫视打造的大型礼仪公德脱口秀节目，2008年8月4日首播。节目的主持阵容由汪涵、欧弟、田源、钱枫、俞灏明、金恩圣（小五）七位天天兄弟组成。该节目采用全国第一支偶像男子团体的概念，用各种形式来传播中国千年礼仪之邦的礼仪文化。节目氛围欢快轻松幽默，获得高收视率的同时，也受到了广大观众的好评。 <img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e797pa7236j20b508djsg.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2890/[阳光电影-www.ygdy8.com]天天向上201601007.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2899/[阳光电影-www.ygdy8.com]天天向上201601014.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2908/[阳光电影-www.ygdy8.com]天天向上201601021.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2916/[阳光电影-www.ygdy8.com]天天向上201601028.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2890/[阳光电影-www.ygdy8.com]天天向上201601007.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2899/[阳光电影-www.ygdy8.com]天天向上201601014.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2908/[阳光电影-www.ygdy8.com]天天向上201601021.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2916/[阳光电影-www.ygdy8.com]天天向上201601028.mkv', 'admin', '', 'T', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8647, 4, '我们来了', '', '', '#FF0000', '', '', '<p>《我们来了》（原名《偶像来了第二季》）是湖南卫视推出的一档大型明星女神生活体验秀节目，由湖南卫视金牌制片人陈汝涵团队领衔操刀。 汪涵、袁弘担任队长\xa0 ，赵雅芝、刘嘉玲、莫文蔚、陈乔恩、江一燕、谢娜、徐娇、奚梦瑶等明星组成固定嘉宾。<img alt="" src="http://ww2.sinaimg.cn/mw690/444476dfgw1f63vld9wcpj20j60y2tei.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2890/[阳光电影-www.ygdy8.com]我们来了20161007.mkv ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2890/[阳光电影-www.ygdy8.com]我们来了20161007.mkv ', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8648, 4, '四大名助', '', '', '#FF0000', '', '', '<p>《四大名助》是2016年东方卫视播出的社交服务类节目，节目2016年1月7日起每周四晚在东方卫视播出。 节目由孟非担任主持，并搭档三位一线名嘴嘉宾组成的“四大名助”阵容，在节目中通过嬉笑怒骂的讨论帮助普通人解决各种烦恼问题。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfgw1f0879w2wl9j20cl08ct9y.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2889/[阳光电影-www.ygdy8.com]四大名助20161006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2897/[阳光电影-www.ygdy8.com]四大名助20161013.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2906/[阳光电影-www.ygdy8.com]四大名助20161020.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2916/[阳光电影-www.ygdy8.com]四大名助20161027.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2889/[阳光电影-www.ygdy8.com]四大名助20161006.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2897/[阳光电影-www.ygdy8.com]四大名助20161013.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2906/[阳光电影-www.ygdy8.com]四大名助20161020.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2916/[阳光电影-www.ygdy8.com]四大名助20161027.mkv', 'admin', '', 'S', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8649, 4, '今晚80后脱口秀', '', '', '#FF0000', '', '', '<p>《今晚80后脱口秀》是东方卫视全新打造的高端文化脱口秀，也是中国唯一一档欧美风格脱口秀节目，于2012年5月13日开播，80后新锐相声演员王自健倾情加盟，每期通过脱口秀的形式，展现年轻人对社会热点、文化事件、时尚潮流的态度和思想，幽默风趣却又不失智慧与锐度。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e4etydqfwkj20r2099tcl.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2888/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161006.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2897/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161013.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2906/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161020.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2916/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161027.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2888/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161006.mkv \nftp://ygdy8:ygdy8@yg76.dydytt.net:2897/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161013.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2906/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161020.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2916/[阳光电影-www.ygdy8.com]今晚80后脱口秀20161027.mkv', 'admin', '', 'J', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8650, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>凤凰中文台军情观察室节目坐阵曾有“情报收集中心”之称的香港紧贴每周的全球热点军事话题以丰富、有趣的电视动画以及快节奏播报大量信息的方式为您搜罗军事情报同时请来军事专家对热点话题进行深度地分析与解读。<img alt="" src="http://ww2.sinaimg.cn/bmiddle/444476dfjw1e8bbkka8mkj20700a0weu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2886/[阳光电影-www.ygdy8.com]军情观察室20161005.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2895/[阳光电影-www.ygdy8.com]军情观察室20161012.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2907/[阳光电影-www.ygdy8.com]军情观察室20161019.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2914/[阳光电影-www.ygdy8.com]军情观察室20161026.rmvb', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2886/[阳光电影-www.ygdy8.com]军情观察室20161005.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2895/[阳光电影-www.ygdy8.com]军情观察室20161012.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2907/[阳光电影-www.ygdy8.com]军情观察室20161019.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2914/[阳光电影-www.ygdy8.com]军情观察室20161026.rmvb', 'admin', '', 'Z', 10.0, 1, 0);
