INSERT INTO `gx_video` VALUES (8655, 4, '锵锵三人行', '', '', '#FF0000', '', '', '<p>《锵锵三人行》是凤凰卫视出品的谈话类节目，由主持人窦文涛与两岸三地传媒界之精英名嘴，一起针对每日热门新闻事件进行研究，并各抒己见，但却又不属于追求问题答案的正论，而是俗人闲话，一派多少天下事，尽付笑谈中的豪情，达至融汇信息传播，制造乐趣与辩析事理三大元素于一身的目的。看似“平衡一下”的“滑头话”，其实是窦文涛引导嘉宾发表具个人色彩的大胆言论，营造日常聊天的形态、谈笑风生的气氛，力求轻松、惹笑。<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e894w9dvj5j205306w3yj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2884/[阳光电影-www.ygdy8.com]锵锵三人行20161003.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2885/[阳光电影-www.ygdy8.com]锵锵三人行20161004.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2886/[阳光电影-www.ygdy8.com]锵锵三人行20161005.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2888/[阳光电影-www.ygdy8.com]锵锵三人行20161006.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2890/[阳光电影-www.ygdy8.com]锵锵三人行20161007.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2893/[阳光电影-www.ygdy8.com]锵锵三人行20161010.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2894/[阳光电影-www.ygdy8.com]锵锵三人行20161011.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2895/[阳光电影-www.ygdy8.com]锵锵三人行20161012.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2897/[阳光电影-www.ygdy8.com]锵锵三人行20161013.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2899/[阳光电影-www.ygdy8.com]锵锵三人行20161014.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2903/[阳光电影-www.ygdy8.com]锵锵三人行20161017.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2905/[阳光电影-www.ygdy8.com]锵锵三人行20161018.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2906/[阳光电影-www.ygdy8.com]锵锵三人行20161019.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2906/[阳光电影-www.ygdy8.com]锵锵三人行20161020.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2907/[阳光电影-www.ygdy8.com]锵锵三人行20161021.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2912/[阳光电影-www.ygdy8.com]锵锵三人行20161024.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2913/[阳光电影-www.ygdy8.com]锵锵三人行20161025.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2914/[阳光电影-www.ygdy8.com]锵锵三人行20161026.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2915/[阳光电影-www.ygdy8.com]锵锵三人行20161027.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2916/[阳光电影-www.ygdy8