INSERT INTO `gx_video` VALUES (8666, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>Running Man是韩国SBS电视台周末娱乐节目《星期天真好》新的版块，是韩国著名主持人刘在石自“家族诞生”第一季结束后时隔五个月接手的SBS新艺能节目，作为刘在石的SBS艺能节目回归之作，running man致力于打造一个不同于过去real variety的新型态娱乐节目。可以说是SBS赌上自尊心的新艺能节目。2010年7月11日起作为‘星期日真好-1部’播放。 节目通过组队游戏获取金币或running ball 最后决定胜者，输的一队将接受惩罚。节目由刘在石，池石镇，HAHA，金钟国，Gary姜熙健，宋智孝，李光洙等搞笑性、艺能性极高的艺人主持。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3i13mt31nj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2883/[阳光电影-www.ygdy8.com]RunningMan20161002.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2892/[阳光电影-www.ygdy8.com]RunningMan20161009.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2901/[阳光电影-www.ygdy8.com]RunningMan20161016.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2911/[阳光电影-www.ygdy8.com]RunningMan20161023.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2919/[阳光电影-www.ygdy8.com]RunningMan20161030.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2883/[阳光电影-www.ygdy8.com]RunningMan20161002.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2892/[阳光电影-www.ygdy8.com]RunningMan20161009.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2901/[阳光电影-www.ygdy8.com]RunningMan20161016.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2911/[阳光电影-www.ygdy8.com]RunningMan20161023.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2919/[阳光电影-www.ygdy8.com]RunningMan20161030.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8667, 4, '综艺节目', '', '', '#FF0000', '', '', '<p>节目由六名韩国艺人出演，殷志源初丁熊宝宝、卢洪哲、金钟民、李秀根、池尚烈，还有尚根一只狗出演。由节目组提出挑战，艺人和MC共同完成任务娱乐节目，由于池尚烈拍摄电视剧离开由金C进入顶替，卢洪哲离开李胜基黑洞顶替，金钟民服兵役MC梦进入顶替,2天1夜的收视率居高不下，甚至创下最高收视率!<img alt="" src="http://ww3.sinaimg.cn/bmiddle/444476dfjw1e6hgcqh6nij20700a0glu.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2883/[阳光电影-www.ygdy8.com]两天一夜20161002.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2892/[阳光电影-www.ygdy8.com]两天一夜20161009.mkv', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2883/[阳光电影-www.ygdy8.com]两天一夜20161002.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2892/[阳光电影-www.ygdy8.com]两天一夜20161009.mkv', 'admin', '', 'Z', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8668, 4, '人气歌谣', '', '', '#FF0000', '', '', '<p>《人气歌谣》每周日播出，主要是一个歌手的新歌和新专集得以COME BACK回归的第一平台，因此参加演出的歌手以最近一段时间的人气歌曲为主。基本形式是每周选出TAKE7进行打榜，最终选出一名周冠军，其中也穿插很多明星的COME BACK舞台。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfgw1eacv7d4jhcj20cq09a74t.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2883/[阳光电影-www.ygdy8.com]人气歌谣20161002.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2892/[阳光电影-www.ygdy8.com]人气歌谣20161009.MP4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2902/[阳光电影-www.ygdy8.com]人气歌谣20161016.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2909/[阳光电影-www.ygdy8.com]人气歌谣20161023.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2920/[阳光电影-www.ygdy8.com]人气歌谣20161030.mp4', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2883/[阳光电影-www.ygdy8.com]人气歌谣20161002.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2892/[阳光电影-www.ygdy8.com]人气歌谣20161009.MP4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2902/[阳光电影-www.ygdy8.com]人气歌谣20161016.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2909/[阳光电影-www.ygdy8.com]人气歌谣20161023.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2920/[阳光电影-www.ygdy8.com]人气歌谣20161030.mp4', 'admin', '', 'R', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8669, 4, '我们结婚了', '', '', '#FF0000', '', '', '<p>《我们结婚了》是韩国今年最受欢迎的综艺节目之一，这是一档明星假想结婚节目。几对明星假扮成新婚夫妇，真的将自己的行礼搬过来装扮起自己的“新婚房“。由前期春节节目衍生来的。第一季节目嘉宾：Andy和Solbi，Alex和申爱，郑型敦和Saori，Crown J和徐仁英，李辉才和赵茹珍，金贤重和皇甫。<img alt="" src="http://ww1.sinaimg.cn/bmiddle/444476dfjw1e3enc83xg7j.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2883/[阳光电影-www.ygdy8.com]我们结婚了20161001.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2892/[阳光电影-www.ygdy8.com]我们结婚了20161008.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2902/[阳光电影-www.ygdy8.com]我们结婚了20161015.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2909/[阳光电影-www.ygdy8.com]我们结婚了20161022.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2917/[阳光电影-www.ygdy8.com]我们结婚了20161029.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2883/[阳光电影-www.ygdy8.com]我们结婚了20161001.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2892/[阳光电影-www.ygdy8.com]我们结婚了20161008.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2902/[阳光电影-www.ygdy8.com]我们结婚了20161015.mp4 \nftp://ygdy8:ygdy8@yg76.dydytt.net:2909/[阳光电影-www.ygdy8.com]我们结婚了20161022.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2917/[阳光电影-www.ygdy8.com]我们结婚了20161029.mp4 ', 'admin', '', 'W', 10.0, 1, 0);
INSERT INTO `gx_video` VALUES (8670, 4, '无限挑战', '', '', '#FF0000', '', '', '<p>《无限挑战》（韩语：무한도전，英文：Infinite Challenge, Muhan Dojeon）于每周六晚上18:30—19:50于韩国MBC播放，是公认的韩国电视史上第一个“真实综艺节目”——没有固定的主架构，不依稿本进行，并遵循类似的格式基于挑战的电视真人秀节目。节目一直标榜为“3D综艺节目”，其中“3D”分别代表Dirty、Difficult和Dangerous。<img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e7c344ev8aj20od0ed0wx.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2883/[阳光电影-www.ygdy8.com]无限挑战20161001.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2892/[阳光电影-www.ygdy8.com]无限挑战20161008.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2902/[阳光电影-www.ygdy8.com]无限挑战20161015.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2909/[阳光电影-www.ygdy8.com]无限挑战20161022.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2917/[阳光电影-www.ygdy8.com]无限挑战20161029.mp4 ', 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2883/[阳光电影-www.ygdy8.com]无限挑战20161001.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2892/[阳光电影-www.ygdy8.com]无限挑战20161008.mkv\nftp://ygdy8:ygdy8@yg76.dydytt.net:2902/[阳光电影-www.ygdy8.com]无限挑战20161015.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2909/[阳光电影-www.ygdy8.com]无限挑战20161022.mp4\nftp://ygdy8:ygdy8@yg76.dydytt.net:2917/[阳光电影-www.ygdy8.com]无限挑战20161029.mp4 ', 'admin', '', 'W', 10.0, 1, 0);
