INSERT INTO `gx_video` VALUES (8674, 4, '娱乐百分百', '', '', '#FF0000', '', '', '<p>《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。 <img alt="" src="http://ww4.sinaimg.cn/bmiddle/444476dfjw1e3bjavn7xjj.jpg" /></p>', 'error', '中国', '普通话', 2013, '0', 1542962620, 0, 0, 0, 0, 0, 5, 1, 0, 0, 'ftp://ygdy8:ygdy8@yg76.dydytt.net:2883/[阳光电影-www.ygdy8.com]娱乐百分百20161001.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2884/[阳光电影-www.ygdy8.com]娱乐百分百20161003.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2885/[阳光电影-www.ygdy8.com]娱乐百分百20161004.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2887/[阳光电影-www.ygdy8.com]娱乐百分百20161005.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2889/[阳光电影-www.ygdy8.com]娱乐百分百20161006.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2891/[阳光电影-www.ygdy8.com]娱乐百分百20161007.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2892/[阳光电影-www.ygdy8.com]娱乐百分百20161008.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2894/[阳光电影-www.ygdy8.com]娱乐百分百20161010.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2895/[阳光电影-www.ygdy8.com]娱乐百分百20161011.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2896/[阳光电影-www.ygdy8.com]娱乐百分百20161012.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2897/[阳光电影-www.ygdy8.com]钒俜职20161013.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2899/[阳光电影-www.ygdy8.com]钒俜职20161014.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2901/[阳光电影-www.ygdy8.com]娱乐百分百20161015.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2902/[阳光电影-www.ygdy8.com]钒俜职20161017.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2905/[阳光电影-www.ygdy8.com]娱乐百分百20161018.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2906/[阳光电影-www.ygdy8.com]娱乐百分百20161019.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2907/[阳光电影-www.ygdy8.com]娱乐百分百20161020.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2908/[阳光电影-www.ygdy8.com]钒俜职20161021.rmvb\nftp://ygdy8:ygdy8@yg76.dydytt.net:2913/[阳光电影-www.ygdy8.com]钒俜职20161024.rmv